TS.raw_templates['group'] = "\t<li class='{{makeGroupDomId model_ob}} group {{makeGroupDomClass model_ob}} cursor_pointer'>\n\t\t<a href=\"{{makeChannelPath model_ob}}\" class=\"group_name primary_action\" data-group-id=\"{{model_ob.id}}\" aria-label=\"{{makeGroupLinkAriaLabelSafe model_ob}}\"{{#feature flag=\"feature_docs\"}} draggable=\"true\" data-drag-meta=\"{{makeChannelDragData model_ob}}\"{{\/feature}}>\n\t\t\t{{#if model_ob.is_archived}}\n\t\t\t\t{{#if_equal model_ob.is_moved compare=1}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_angle_arrow_up_left prefix\"}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_archived_channel prefix\"}}\n\t\t\t\t{{\/if_equal}}\n\t\t\t{{else}}\n\t\t\t\t{{#showDraftIcon model_ob}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_pencil prefix\"}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_lock prefix\"}}\n\t\t\t\t{{\/showDraftIcon}}\n\t\t\t{{\/if}}\n\t\t\t<span class=\"{{makeUnreadMsgsDomId model_ob}} unread_msgs {{#if_equal model_ob.unread_cnt compare=0}}hidden{{\/if_equal}}\">\n\t\t\t\t{{numberWithMax model_ob.unread_cnt 10}}\n\t\t\t<\/span>\n\t\t\t<span class=\"{{makeUnreadHighlightDomId model_ob}} unread_highlights\n\t\t\t             {{#if_equal model_ob.unread_highlight_cnt compare=0}}hidden{{\/if_equal}}\n\t\t\t             {{#if_equal model_ob.unread_highlight_cnt compare=undefined}}hidden{{\/if_equal}}\">\n\t\t\t\t{{numberWithMax model_ob.unread_highlight_cnt 10}}\n\t\t\t<\/span>\n\t\t\t<span class=\"display_flex\">\n\t\t\t\t<span class=\"overflow_ellipsis\">\n\t\t\t\t\t{{model_ob.name}}\n\t\t\t\t<\/span>\n\t\t\t\t{{#if model_ob.is_shared}}{{> shared_channel_icon}}{{\/if}}\n\t\t\t<\/span>\n\t\t<\/a>\n\t<\/li>\n";
TS.raw_templates['channel'] = "\t<li class=\"{{makeChannelDomId model_ob}} channel {{#if model_ob.is_private}}private {{\/if}}{{makeChannelDomClass model_ob}}\">\n\t\t<a href=\"{{makeChannelPath model_ob}}\" class=\"channel_name primary_action\" data-channel-id=\"{{model_ob.id}}\" aria-label=\"{{makeChannelLinkAriaLabelSafe model_ob}}\"{{#feature flag=\"feature_docs\"}} draggable=\"true\" data-drag-meta=\"{{makeChannelDragData model_ob}}\"{{\/feature}}>\n\t\t\t{{#if model_ob.is_archived}}\n\t\t\t\t{{#if_equal model_ob.is_moved compare=1}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_angle_arrow_up_left prefix\"}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_archived_channel prefix\"}}\n\t\t\t\t{{\/if_equal}}\n\t\t\t{{else}}\n\t\t\t\t{{#showDraftIcon model_ob}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_pencil prefix\"}}\n\t\t\t\t{{else if model_ob.is_mpim}}\n\t\t\t\t\t<ts-icon class=\"ts_icon ts_icon_multiparty_dm_{{mpimMemberCount model_ob}} prefix\"><\/ts-icon>\n\t\t\t\t{{else if model_ob.is_private}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_lock prefix\"}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_channel_pane_hash prefix\"}}\n\t\t\t\t{{\/showDraftIcon}}\n\t\t\t{{\/if}}\n\t\t\t<span class=\"{{makeUnreadMsgsDomId model_ob}} unread_msgs {{#if_equal model_ob.unread_cnt compare=0}}hidden{{\/if_equal}}\">\n\t\t\t\t{{numberWithMax model_ob.unread_cnt 10}}\n\t\t\t<\/span>\n\t\t\t<span class=\"{{makeUnreadHighlightDomId model_ob}} unread_highlights\n\t\t\t             {{#if_equal model_ob.unread_highlight_cnt compare=0}}hidden{{\/if_equal}}\n\t\t\t             {{#if_equal model_ob.unread_highlight_cnt compare=undefined}}hidden{{\/if_equal}}\">\n\t\t\t\t{{numberWithMax model_ob.unread_highlight_cnt 10}}\n\t\t\t<\/span>\n\t\t\t<span class=\"display_flex\">\n\t\t\t\t<span class=\"overflow_ellipsis\">\n\t\t\t\t\t{{#if model_ob.is_mpim}}\n\t\t\t\t\t\t{{mpimDisplayName model_ob}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{model_ob.name}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t<\/span>\n\t\t\t\t{{#if model_ob.is_org_shared}}{{> shared_channel_icon}}{{else if model_ob.is_shared}}{{> shared_channels_icon model_ob=model_ob tooltip=true shared_team_ids=model_ob.shared_team_ids}}{{\/if}}\n\t\t\t<\/span>\n\t\t<\/a>\n\t<\/li>\n";
TS.raw_templates['member'] = "{{i18n_ns \"channels\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n\t<li class='{{makeMemberDomId member}} member {{makeMemberDomClass member}} cursor_pointer'>\n\t\t{{! NOTE: we add user_colored and nuc classes to disallow\/allow the color to be applied via the css rule (with :not(.nuc)), and easily toggle that on and off}}\n\t\t<a href=\"{{makeChannelPath model_ob}}\" class=\"im_name primary_action{{#if color_names}} user_colored{{else}} nuc{{\/if}} {{getMemberColorClassByImId model_ob.id}}\" data-member-id=\"{{member.id}}\" aria-label=\"{{makeMemberLinkAriaLabelSafe this}}\"{{#feature flag=\"feature_docs\"}} draggable=\"true\" data-drag-meta=\"{{makeChannelDragData model_ob}}\"{{\/feature}}>\n\t\t\t<div class=\"im_name_background {{#if color_names}}user_colored{{else}}nuc{{\/if}} {{getMemberColorClassByImId model_ob.id}}\"><\/div>\n\t\t\t<span class=\"{{makeUnreadHighlightDomId member}} unread_highlights {{#if_equal model_ob.unread_cnt compare=0}}hidden{{\/if_equal}}{{#if_equal model_ob.unread_cnt compare=undefined}}hidden{{\/if_equal}}\">{{numberWithMax model_ob.unread_cnt 10}}<\/span>\n\t\t\t<span class=\"typing_indicator\"><\/span>\n\t\t\t<span class=\"overflow_ellipsis member_name\">\n\t\t\t\t{{#if_equal model_ob.name compare=\"slackbot\"}}\n\t\t\t\t\t{{#showDraftIcon model_ob}}\n\t\t\t\t\t\t{{> ts_icon class=\"ts_icon_pencil prefix\"}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<i class=\"ts_icon ts_icon_heart slackbot_icon\"><\/i>\n\t\t\t\t\t{{\/showDraftIcon}}\n\t\t\t\t\t{{model_ob.name}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#showDraftIcon model_ob}}\n\t\t\t\t\t\t{{> ts_icon class=\"ts_icon_pencil prefix\"}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#if member.deleted}}\n\t\t\t\t\t\t\t{{> ts_icon class=\"ts_icon_archived_channel prefix deleted_im\"}}\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t{{{makeMemberPresenceIcon member}}}\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t{{\/showDraftIcon}}\n\t\t\t\t\t{{getDisplayNameOfUserForIm model_ob}}\n\t\t\t\t\t{{#if member.is_self}} ({{#t note=\"Appears next to user name when user is self, e.g. 'Steve (you)' when I am Steve\"}}t\u00fa{{\/t}}){{\/if}}\n\t\t\t\t{{\/if_equal}}\n\t\t\t<\/span>\n\t\t\t{{#or member.profile.status_emoji member.profile.status_text}}\n\t\t\t\t{{> current_status classes=\"ts_tip_float\"}}\n\t\t\t{{\/or}}\n\t\t<\/a>\n\t\t{{#if show_close_link}}\n\t\t\t<button class=\"ts_icon ts_icon_times_circle im_close btn_unstyle\" aria-label=\"Close Direct Message with {{getDisplayNameOfUserForIm model_ob}}\" data-qa=\"im_close\" type=\"button\"><\/button>\n\t\t{{\/if}}\n\t<\/li>\n\n\n\n";
TS.raw_templates['channel_create_overlay'] = "{{i18n_ns 'channels'}}\n\n<div id=\"channel_created\" class=\"channel_overlay channel_overlay_redesign\">\n\t{{#if channel.is_shared}}\n\t\t<img class=\"channel_overlay_shared_icon float_left\" src=\"{{versioned_join_shared_channel '2x'}}\" srcset=\"{{versioned_join_shared_channel '1x'}} 1x, {{versioned_join_shared_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t\t\t<p class=\"channel_overlay_title_shared small_bottom_margin\">\n\t\t\t\t{{#if channel.is_global_shared}}\n\t\t\t\t\t{{#t}}Acabas de crear un canal compartido con <button class=\"btn_link\" data-channel-shared-teams>todos los espacios de trabajo<\/button>{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Acabas de crear un canal compartido con <button class=\"btn_link\" data-channel-shared-teams>{channel.shared_team_ids.length, plural, =1 {# espacio de trabajo} other {# espacios de trabajo}}<\/button>{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t{{else}}\n\t\t<img class=\"channel_overlay_team_icon float_left\" src=\"{{versioned_join_team_channel '2x'}}\" srcset=\"{{versioned_join_team_channel '1x'}} 1x, {{versioned_join_team_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t{{\/if}}\n\t\t<p class=\"channel_overlay_title\">\n\t\t\t{{#unless channel.is_shared}}\n\t\t\t\t<span class=\"channel_overlay_title_opener\">{{#t note=\"Appears above the name of the channel you created, so will read 'You just created {channel_name}'\"}}Acabas de crear este canal:{{\/t}}<\/span><br \/>\n\t\t\t{{\/unless}}\n\t\t\t<span class=\"channel_overlay_title_prefix\">#<\/span><strong>{{channel.name}}<\/strong>\n\t\t<\/p>\n\t<\/div>\n\t<ul>\n\t\t{{#pageNeedsEnterprise}}\n\t\t\t{{#if channel.is_shared}}\n\t\t\t\t{{#if channel.is_global_shared}}\n\t\t\t\t\t<li>{{#t}}Todos los espacios de trabajo podr\u00e1n ver los mensajes, archivos y miembros de este canal.{{\/t}}<\/li>\n\t\t\t\t{{else}}\n\t\t\t\t\t<li>{{#t}}Los mensajes, archivos y miembros de este canal estar\u00e1n visibles para {channel.shared_team_ids.length, plural, =1 {# espacio} other {# espacios}}.{{\/t}}<\/li>\n\t\t\t\t{{\/if}}\n\t\t\t\t<li>{{#t}}Las integraciones de Slack han sido desactivadas en este canal.{{\/t}}<\/li>\n\t\t\t{{\/if}}\n\t\t{{\/pageNeedsEnterprise}}\n\t\t<li>{{#t}}Otros miembros del espacio de trabajo pueden unirse desde la <strong>lista de canales<\/strong>{{\/t}}<\/li>\n\t\t<li>{{#t}}O, si prefieres, t\u00fa mismo puedes <a class=\"bold invite_link\">invitar a otros<\/a>.{{\/t}}<\/li>\n\t<\/ul>\n\t{{#if channel.purpose.value}}\n\t\t<p class=\"channel_overlay_purpose\">{{#t channel_purpose=(formatTopicOrPurpose channel.purpose.value)}}La finalidad de este canal es:<br \/>{channel_purpose}{{\/t}}<\/p>\n\t{{\/if}}\n\n\t<label class=\"checkbox overlay_pref block\">\n\t\t<input id=\"no_created_overlays_cb\" type=\"checkbox\" \/> {{#t}}No volver a mostrarme este mensaje al crear un canal{{\/t}}\n\t<\/label>\n\n\t<a class=\"btn padded\">{{#t}}Entendido{{\/t}}<\/a>\n\n\t<p class=\"hidden\" aria-hidden=\"false\">\n\t\t{{#t}}Pulsa Intro para cerrar este mensaje y ver el canal.{{\/t}}\n\t<\/p>\n\n<\/div>\n";
TS.raw_templates['channel_join_overlay'] = "{{i18n_ns 'channels'}}\n\n<div id=\"channel_joined\" class=\"channel_overlay channel_overlay_redesign\">\n\t{{#if channel.is_shared}}\n\t\t<img class=\"channel_overlay_shared_icon float_left\" src=\"{{versioned_join_shared_channel '2x'}}\" srcset=\"{{versioned_join_shared_channel '1x'}} 1x, {{versioned_join_shared_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t\t\t<p class=\"channel_overlay_title_shared small_bottom_margin\">\n\t\t\t\t{{#if channel.is_global_shared}}\n\t\t\t\t\t{{#t}}Acabas de unirte a un canal compartido con <button class=\"btn_link\" data-channel-shared-teams>todos los espacios de trabajo<\/button>{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#if channel.is_org_shared}}\n\t\t\t\t\t\t{{#t}}Acabas de unirte a un canal compartido con <button class=\"btn_link\" data-channel-shared-teams>{channel.shared_team_ids.length, plural, =1 {# espacio de trabajo} other {# espacios de trabajo}}<\/button>{{\/t}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t team_names=(makeTeamNameList channel.shared_team_ids)}}Acabas de unirte a un canal compartido con <strong>{team_names}<\/strong>{{\/t}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t{{else}}\n\t\t<img class=\"channel_overlay_team_icon float_left\" src=\"{{versioned_join_team_channel '2x'}}\" srcset=\"{{versioned_join_team_channel '1x'}} 1x, {{versioned_join_team_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t{{\/if}}\n\t\t<p class=\"channel_overlay_title\">\n\t\t\t{{#unless channel.is_shared}}\n\t\t\t\t<span class=\"channel_overlay_title_opener\">{{#t note=\"Appears above the name of the channel you joined, so will read 'You just joined {channel_name}'\"}}Acabas de unirte a{{\/t}}<\/span><br \/>\n\t\t\t{{\/unless}}\n\t\t\t<span class=\"channel_overlay_title_prefix\">#<\/span><strong>{{channel.name}}<\/strong>\n\t\t<\/p>\n\t<\/div>\n\t<ul>\n\t\t{{#pageNeedsEnterprise}}\n\t\t\t{{#if channel.is_shared}}\n\t\t\t\t{{#if channel.is_global_shared}}\n\t\t\t\t\t<li>{{#t}}Todos los espacios de trabajo podr\u00e1n ver los mensajes, archivos y miembros de este canal.{{\/t}}<\/li>\n\t\t\t\t{{else}}\n\t\t\t\t\t<li>{{#t}}Los mensajes, archivos y miembros de este canal estar\u00e1n visibles para {channel.shared_team_ids.length, plural, =1 {# espacio} other {# espacios}}.{{\/t}}<\/li>\n\t\t\t\t{{\/if}}\n\t\t\t\t<li>{{#t}}Las integraciones de Slack han sido desactivadas en este canal.{{\/t}}<\/li>\n\t\t\t{{\/if}}\n\t\t{{\/pageNeedsEnterprise}}\n\t\t{{#if channel.creator}}\n\t\t<li>{{#t date_created=(convertTimestampToMilliseconds channel.created) user_name=(makeMemberPreviewLinkById channel.creator)}}Creado el {date_created, date, long} por {user_name}{{\/t}}<\/li>\n\t\t{{else}}\n\t\t<li>{{#t date_created=(convertTimestampToMilliseconds channel.created)}}Creado el {date_created, date, long}{{\/t}}<\/li>\n\t\t{{\/if}}\n\t\t{{#if inviter}}\n\t\t\t<li>{{#t user_name=(makeMemberPreviewLinkById inviter)}}{user_name} te invit\u00f3 a este canal.{{\/t}}<\/li>\n\t\t{{\/if}}\n\t<\/ul>\n\t{{#if channel.purpose.value}}\n\t\t<p class=\"channel_overlay_purpose\">{{#t channel_purpose=(formatTopicOrPurpose channel.purpose.value)}}La finalidad de este canal es:<br \/>{channel_purpose}{{\/t}}<\/p>\n\t{{\/if}}\n\n\t<label class=\"checkbox overlay_pref block\">\n\t\t<input id=\"no_joined_overlays_cb\" type=\"checkbox\" \/> {{#t}}No mostrarme este mensaje al unirme a un canal{{\/t}}\n\t<\/label>\n\n\t<a class=\"btn padded\">{{#t note=\"Appears on a button to say the user understands the information and wishes to close the overlay\"}}Entendido{{\/t}}<\/a>\n\n\t<p class=\"hidden\" aria-hidden=\"false\">\n\t\t{{#t}}Pulsa Intro para cerrar este mensaje y ver el canal.{{\/t}}\n\t<\/p>\n\n<\/div>\n";
TS.raw_templates['channel_header'] = "{{i18n_ns \"channel_header\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n<div class=\"channel_title\">\n\t{{#if all_unreads.is_showing}}\n\t\t<div id=\"channel_name_container\" class=\"channel_name_container\">\n\t\t\t<h2 id=\"channel_name\" class=\"channel_name cursor_default\" data-qa=\"channel_name\">{{#t}}Mensajes sin leer{{\/t}}<\/h2>\n\t\t<\/div>\n\t\t<div id=\"channel_header_info\" class=\"channel_header_info\">\n\t\t\t{{> unread_header_info all_unreads}}\n\t\t<\/div>\n\t{{else if threads.is_showing}}\n\t\t<div id=\"channel_name_container\" class=\"channel_name_container\">\n\t\t\t<h2 id=\"channel_name\" class=\"channel_name cursor_default\" data-qa=\"channel_name\">\n\t\t\t\t{{#feature flag=\"feature_threads_copy_change\"}}\n\t\t\t\t\t{{#t}}Tus hilos{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Todos los hilos{{\/t}}\n\t\t\t\t{{\/feature}}\n\t\t\t<\/h2>\n\t\t<\/div>\n\t\t<div id=\"channel_header_info\" class=\"channel_header_info threads_channel_header_info\"><\/div>\n\t{{else if search.is_showing}}\n\t\t{{#feature flag=\"feature_primary_search\"}}\n            {{#experiment name=\"primary_search_dev\" group=\"primary_search_dev\"}}\n                <div id=\"channel_name_container\" class=\"channel_name_container\">\n                    <h2 id=\"channel_name\" class=\"channel_name cursor_default\" data-qa=\"channel_name\">{{#t}}Search{{\/t}}<\/h2>\n                <\/div>\n                <div id=\"channel_header_info\" class=\"channel_header_info threads_channel_header_info\">{{#t}}This is the Primary Search interface.{{\/t}}<\/div>\n            {{\/experiment}}\n\t\t{{\/feature}}\n\t{{else if is_app}}\n\t\t<div id=\"channel_name_container\" class=\"channel_name_container\">\n\t\t\t{{!-- For App Space, we put the star next to the Channel\/App name --}}\n\t\t\t<h2 class=\"channel_name cursor_default\" data-qa=\"channel_name\">\n\t\t\t\t<div id=\"star_container\" class=\"channel_header_info_item\"><\/div>\n\t\t\t\t<span>{{getPrefCompliantMemberName member}}<\/span>\n\t\t\t<\/h2>\n\t\t<\/div>\n\t\t<div id=\"channel_header_info\" class=\"channel_header__tabs__container\">\n\t\t\t{{> app_space_channel_header}}\n\t\t<\/div>\n\t{{else}}\n\t\t<div id=\"channel_name_container\" class=\"channel_name_container\">\n\t\t\t<span id=\"channel_name\" class=\"channel_name\" data-qa=\"channel_name\">\n\t\t\t{{#if mpim}}\n\t\t\t\t<button type=\"button\" id=\"dm_title\" class=\"btn_unstyle dm_title\">{{mpimDisplayName mpim true}}<\/button>\n\t\t\t{{else}}\n\t\t\t\t{{#if member}}\n\t\t\t\t\t{{#if member.is_unknown}}\n\t\t\t\t\t\t<button type=\"button\" id=\"im_title\" class=\"btn_unstyle\">{{> unknown_member id=member.id}}<\/button>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<button type=\"button\" id=\"im_title\" class=\"btn_unstyle\">{{getPrefCompliantMemberName member}} {{#if member.is_self}}<span class=\"normal subtle_silver\"> {{#t}}(t\u00fa){{\/t}}<\/span>{{\/if}}<\/button>\n\t\t\t\t\t\t{{#or member.profile.status_emoji member.profile.status_text}}\n\t\t\t\t\t\t\t<div class=\"channel_header_member_current_status overflow_ellipsis normal subtle_silver\">\n\t\t\t\t\t\t\t\t{{getMemberCurrentStatusForDisplayWithoutAnimations member}}\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t{{\/or}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{else}}\n\t\t\t\t\t<button type=\"button\" id=\"channel_title\" class=\"btn_unstyle\">{{name}}{{#if member.is_self}}<span class=\"normal subtle_silver\"> {{#t}}(t\u00fa){{\/t}}<\/span>{{\/if}}<\/button>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t\t<\/span>{{#unless is_dm_or_mpdm}}\n\t\t\t{{#if is_org_shared}}\n\t\t\t\t{{> shared_channel_icon model_ob=model_ob tooltip=true tooltip_position='bottom'}}\n\t\t\t{{else if is_shared}}\n\t\t\t\t{{> shared_channels_icon tooltip=true tooltip_position=\"bottom\"}}\n\t\t\t{{\/if}}{{\/unless}}{{!--\n\t\t\t--}}<div class=\"channel_actions_container\"><div id=\"mute_container\"><\/div><\/div>\n\t\t<\/div>\n\n\t\t{{!-- line of misc meta below channel name (star, members, pins, topic, member name, presence, etc) --}}\n\t\t<div id=\"channel_header_info\" class=\"channel_header_info\">\n\n\t\t\t{{#unless member.deleted}}\n\t\t\t\t<div id=\"star_container\" class=\"channel_header_info_item\"><\/div>\n\t\t\t{{\/unless}}\n\n\t\t\t{{~#if member~}}\n\n\t\t\t\t{{#or member.deleted member.is_unknown}}{{else}}\n\t\t\t\t\t<div class=\"channel_header_info_item channel_header_member_status\">\n\t\t\t\t\t\t{{{makeMemberPresenceIcon member}}}\n\t\t\t\t\t\t<span id=\"header_status_message\"><\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/or}}\n\n\t\t\t\t{{#memberHasSecondaryName member}}\n\t\t\t\t\t<div class=\"channel_header_info_item channel_header_member_alt_name\">\n\t\t\t\t\t\t{{getMemberSecondaryName member}}\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/memberHasSecondaryName}}\n\t\t\t\t{{#if member.is_external}}\n\t\t\t\t\t<div class=\"channel_header_info_item channel_header_team_name\">\n\t\t\t\t\t\t{{getTeamNameByMember member}}\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/if}}\n\n\t\t\t{{~else~}}\n\n\t\t\t\t<div class=\"channel_header_info_item\">\n\t\t\t\t\t<button type=\"button\" id=\"channel_members_toggle_count\" class=\"btn_unstyle hidden blue_on_hover ts_tip ts_tip_bottom ts_tip_multiline\">{{!--\n\t\t\t\t\t\t--}}<ts-icon class=\"ts_icon_user ts_icon_inherit channel_members_icon\"><\/ts-icon>\n\t\t\t\t\t\t<span id=\"channel_members_toggle_count_count\"><\/span>{{!--\n\t\t\t\t\t\t--}}<span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">\n\t\t\t\t\t\t\t{{#t}}Ver la lista de miembros{{\/t}}\n\t\t\t\t\t\t<\/span><\/span>{{!--\n\t\t\t\t\t--}}<\/button>\n\t\t\t\t<\/div>\n\n\t\t\t{{~\/if~}}\n\n\t\t\t<div class=\"channel_header_info_item pin\">\n\t\t\t\t<button type=\"button\" id=\"pinned_item_count\" class=\"btn_unstyle blue_on_hover ts_tip ts_tip_bottom ts_tip_multiline\">{{!--\n\t\t\t\t\t--}}<ts-icon class=\"ts_icon_thumb_tack ts_icon_inherit ts_icon_align_bottom pinned_count_icon\"><\/ts-icon>{{!--\n\t\t\t\t\t--}}<span id=\"pinned_item_count_count\"><\/span>{{!--\n\t\t\t\t\t--}}<span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">\n\t\t\t\t\t\t{{#t}}Ver las chinchetas{{\/t}}<br \/><span class=\"subtle_silver pin_count_new_pin_message\"><\/span>\n\t\t\t\t\t<\/span><\/span>{{!--\n\t\t\t\t--}}<\/button>\n\t\t\t<\/div>\n\n\t\t\t{{#unless is_org_shared}}\n\t\t\t\t{{~#and is_shared (makeTeamNameList shared_team_ids)}}\n\t\t\t\t\t<div class=\"channel_header_info_item overflow_ellipsis\">\n\t\t\t\t\t\t<button type=\"button\" id=\"channel_share_info\" class=\"btn_unstyle blue_on_hover ts_tip ts_tip_float ts_tip_bottom\">\n\t\t\t\t\t\t\t<span id=\"channel_header_info_share_info\">{{#t team_names=(makeTeamNameList shared_team_ids)}}Compartido con {team_names}{{\/t}}<\/span>\n\t\t\t\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t\t\t\t{{#t}}Ver informaci\u00f3n del canal{{\/t}}\n\t\t\t\t\t\t\t<\/span>\n\t\t\t\t\t\t<\/button>\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/and}}\n\t\t\t{{\/unless}}\n\n\t\t\t{{~#if show_topic~}}\n\t\t\t\t<div class=\"channel_header_info_item channel_topic_container\">\n\t\t\t\t\t<span id=\"edit_topic_container\" class=\"channel_topic\" tabindex=\"0\" role=\"button\">{{!--\n\t\t\t\t\t\t--}}<span id=\"edit_topic_inner\" {{#unless can_post_in_channel}}class=\"unable_to_post\"{{\/unless}} data-instructions-text=\"{{#t}}Intro para enviar, Esc para cancelar{{\/t}}\">{{!--\n\t\t\t\t\t\t\t--}}<span id=\"channel_topic_text\" class=\"no_jumbomoji\" data-placeholder=\"{{#currentUserIsRA}}{{else}}{{#t}}A\u00f1adir un tema{{\/t}}{{\/currentUserIsRA}}\"><\/span>{{!--\n\t\t\t\t\t\t--}}<\/span>{{!--\n\t\t\t\t\t--}}<\/span>\n\t\t\t\t\t{{~#if can_post_in_channel~}}\n\t\t\t\t\t\t<button type=\"button\" class=\"btn_link\" id=\"edit_topic_trigger\" tabindex=\"-1\">{{#t}}Editar{{\/t}}<\/button>\n\t\t\t\t\t{{~\/if~}}\n\t\t\t\t<\/div>\n\t\t\t{{~\/if~}}\n\n\t\t<\/div>{{!--\/channel_header_info--}}\n\t{{\/if}}\n<\/div>{{!--\/channel_title--}}\n\n{{!-- Drag region for SSB --}}\n<div class=\"channel_header_drag_region\" data-region=\"main\"><\/div>\n\n<div class=\"channel_title_info\">\n\t{{#if all_unreads.is_showing}}\n\t\t<button type=\"button\" id=\"channel_header_unread_refresh\" class=\"btn btn_outline channel_actions_toggle {{#unless unread_has_new_messages}}hidden{{\/unless}}\">\n\t\t\t{{> ts_icon class=\"ts_icon_sync\"}}\n\t\t\t<span class=\"text\"><\/span>\n\t\t<\/button>\n\n\t{{else if threads.is_showing}}\n\t\t{{! Nothing yet }}\n\t{{else if app_space.is_showing}}\n\t\t{{! Nothing yet }}\n\t{{else if search.is_showing}}\n\t\t{{! Nothing yet }}\n\t{{else}}\n\t\t<!-- calls button -->\n\t\t<div id=\"channel_calls_container\" class=\"hidden channel_calls_container\"><\/div>\n\n\t\t<!--channel details icon  -->\n\t\t<button type=\"button\" id=\"details_toggle\" data-qa=\"channel_details_toggle\" class=\"channel_header_icon btn_unstyle blue_on_hover channel_details_toggle ts_tip ts_tip_bottom {{#if details_showing}}active{{\/if}}\">\n\t\t\t{{#if details_showing}}\n\t\t\t\t{{#if member}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Ocultar detalles de la conversaci\u00f3n{{\/t}}<\/span>\n\t\t\t\t{{else if mpim}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Ocultar detalles de la conversaci\u00f3n{{\/t}}<\/span>\n\t\t\t\t{{else}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Ocultar informaci\u00f3n del canal{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t{{else}}\n\t\t\t\t{{#if member}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Mostrar detalles de la conversaci\u00f3n{{\/t}}<\/span>\n\t\t\t\t{{else if mpim}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Mostrar detalles de la conversaci\u00f3n{{\/t}}<\/span>\n\t\t\t\t{{else}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Mostrar informaci\u00f3n del canal{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t\t{{> ts_icon class=\"ts_icon_info_circle\"}}\n\t\t<\/button>\n\n\t\t<!-- channel actions menu toggle -->\n\t\t<button type=\"button\" id=\"channel_actions_toggle\" class=\"btn_unstyle blue_on_hover channel_actions_toggle channel_header_icon ts_tip ts_tip_bottom\" data-qa=\"channel_actions_button\">\n\t\t\t{{#if member}}\n\t\t\t<span class=\"ts_tip_tip\">{{#t}}Ajustes de la conversaci\u00f3n{{\/t}}<\/span>\n\t\t\t{{else if mpim}}\n\t\t\t<span class=\"ts_tip_tip\">{{#t}}Ajustes de la conversaci\u00f3n{{\/t}}<\/span>\n\t\t\t{{else}}\n\t\t\t<span class=\"ts_tip_tip\">{{#t}}Ajustes del canal{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t\t{{> ts_icon class=\"ts_icon_cog_o\"}}\n\t\t<\/button>\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['channel_created'] = "{{i18n_ns \"channel_created\"}}\n\n{{#if shared.ext_shared}}\n\t{{#if shared.is_pending}}\n\t\t{{#t\n\t\t\tpending_teams=(listify shared.pending_teams map=\"name\" strong=\"true\")\n\t\t}}Este es un canal compartido. Esperando a que lleguen {pending_teams}...{{\/t}}\n\t{{else}}\n\t\t{{#t\n\t\t\tshared_teams=(listify shared.shared_teams map=\"name\" strong=\"true\")\n\t\t}}Este es un canal compartido entre {shared_teams}.{{\/t}}\n\t{{\/if}}\n\n{{else}}{{#if creator.is_self}}\n\n\t{{#if shared}}\n\t\t{{#if shared.all_teams}}\n\t\t\t{{#t note=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'\"}}Creaste este canal {private, select, true {cerrado} other {}} en <button class=\"btn_link\" data-channel-shared-teams> todos los espacios de trabajo<\/button> de tu organizaci\u00f3n {date}.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t\n\t\t\t\tnote=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'\"\n\t\t\t}}Creaste este canal en <button class=\"btn_link\" data-channel-shared-teams>{shared.model_ob.shared_team_ids.length, plural, =1 {# espacio de trabajo} other {# espacios de trabajo}}<\/button> {date}.{{\/t}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#t note=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'\"}}Creaste este canal {private, select, true {cerrado} other {}} {date}.{{\/t}}\n\t{{\/if}}\n\n{{else}}{{#if creator.user}}\n\n\t{{#if shared}}\n\t\t{{#if shared.all_teams}}\n\t\t\t{{#t note=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'. Also, {creator.user} is always third person, e.g. 'UserA created this...'\"}}{creator.user} cre\u00f3 este canal {private, select, true {cerrado} other {}} en <button class=\"btn_link\" data-channel-shared-teams> todos los espacios de trabajo<\/button> de tu organizaci\u00f3n {date}.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t\n\t\t\t\tnote=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'. Also, {creator.user} is always third person, e.g. 'UserA created this...'\"\n\t\t\t}}{creator.user} cre\u00f3 este canal {private, select, true {cerrado} other {}} en <button class=\"btn_link\" data-channel-shared-teams>{shared.model_ob.shared_team_ids.length, plural, =1 {# espacio de trabajo} other {# espacios de trabajo}}<\/button> {date}.{{\/t}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#t note=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'. Also, {creator.user} is always third person, e.g. 'UserA created this...'\"}}{creator.user} cre\u00f3 este canal {private, select, true {cerrado} other {}} {date}.{{\/t}}\n\t{{\/if}}\n\n{{else}}\n\n\t{{#if shared}}\n\t\t{{#if shared.all_teams}}\n\t\t\t{{#t note=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'\"}}Alguien desconocido cre\u00f3 este canal {private, select, true {cerrado} other {}} <button class=\"btn_link\" data-channel-shared-teams>en todos los espacios de trabajo<\/button> de tu organizaci\u00f3n {date}.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t\n\t\t\t\tnote=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'\"\n\t\t\t}}Alguien desconocido cre\u00f3 este canal {private, select, true {cerrado} other {}} en <button class=\"btn_link\" data-channel-shared-teams>{shared.model_ob.shared_team_ids.length, plural, =1 {# espacio de trabajo} other {# espacios de trabajo}}<\/button> {date}.{{\/t}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#t note=\"{date} is either a date e.g. 'on July 14th', or 'yesterday' or 'today'\"}}Alguien desconocido cre\u00f3 este canal {private, select, true {cerrado} other {}} {date}.{{\/t}}\n\t{{\/if}}\n\n\n{{\/if}}{{\/if}}{{\/if}}\n";
TS.raw_templates['group_create_overlay'] = "{{i18n_ns 'group_overlay'}}\n\n<div id=\"group_created\" class=\"channel_overlay channel_overlay_redesign\">\n\t{{#if group.is_shared}}\n\t\t<img class=\"channel_overlay_shared_icon float_left\" src=\"{{versioned_join_shared_channel '2x'}}\" srcset=\"{{versioned_join_shared_channel 1x}} '1x', {{versioned_join_shared_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t\t\t<p class=\"channel_overlay_title_shared small_bottom_margin\">\n\t\t\t\t{{#t}}Acabas de crear un canal cerrado compartido{{\/t}}\n\t\t\t<\/p>\n\t{{else}}\n\t\t<img class=\"channel_overlay_team_icon float_left\" src=\"{{versioned_join_team_channel '2x'}}\" srcset=\"{{versioned_join_team_channel '1x'}} 1x, {{versioned_join_team_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t{{\/if}}\n\t\t<p class=\"channel_overlay_title\">\n\t\t\t{{#if group.is_shared}}\n\t\t\t\t<span class=\"channel_overlay_title_prefix\">{{groupPrefix}}<\/span><strong>{{group.name}}<\/strong>\n\t\t\t{{else}}\n\t\t\t\t{{#t group_prefix=(groupPrefix)}}<span class=\"channel_overlay_title_opener\">Acabas de crear<\/span><br \/> <span class=\"channel_overlay_title_prefix\">{group_prefix}<\/span><strong>{group.name}<\/strong>{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t<\/div>\n\t<ul>\n\t\t<li>{{#t}}Puedes invitar a m\u00e1s gente desde el men\u00fa de canales, que encontrar\u00e1s en la parte superior de la columna.{{\/t}}<\/li>\n\t<\/ul>\n\t{{#if group.purpose.value}}\n\t\t<p class=\"channel_overlay_purpose\">{{#t purpose=(formatTopicOrPurpose group.purpose.value)}}La finalidad de este canal es:<br \/>{purpose}{{\/t}}<\/p>\n\t{{\/if}}\n\n\t<label class=\"checkbox overlay_pref block\">\n\t\t<input id=\"no_created_overlays_cb\" type=\"checkbox\" \/> {{#t}}No volver a mostrarme este mensaje al crear un canal{{\/t}}\n\t<\/label>\n\n\t<a class=\"btn padded\">{{#t}}\u00a1Entendido!\r\n{{\/t}}<\/a>\n\n\t<p class=\"hidden\" aria-hidden=\"false\">\n\t\t{{#t}}Pulsa Intro para cerrar este mensaje y ver el canal.{{\/t}}\n\t<\/p>\n\n<\/div>\n";
TS.raw_templates['group_join_overlay'] = "{{i18n_ns 'group_overlay'}}\n\n<div id=\"group_joined\" class=\"channel_overlay channel_overlay_redesign\">\n\t{{#if group.is_shared}}\n\t<img class=\"channel_overlay_shared_icon float_left\" src=\"{{versioned_join_shared_channel '2x'}}\" srcset=\"{{versioned_join_shared_channel '1x'}} 1x, {{versioned_join_shared_channel '2x'}} 2x\" \/>\n\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t\t<p class=\"channel_overlay_title_shared small_bottom_margin\">\n\t\t\t{{#t}}Acabas de unirte a un canal cerrado compartido{{\/t}}\n\t\t<\/p>\n\t{{else}}\n\t\t<img class=\"channel_overlay_team_icon float_left\" src=\"{{versioned_join_team_channel '2x'}}\" srcset=\"{{versioned_join_team_channel '1x'}} 1x, {{versioned_join_team_channel '2x'}} 2x\" \/>\n\t\t<div class=\"channel_overlay_title_wrap bottom_margin\">\n\t{{\/if}}\n\t\t<p class=\"channel_overlay_title\">\n\t\t\t{{#unless group.is_shared}}\n\t\t\t\t<span class=\"channel_overlay_title_opener\">{{#t note='Followed by the group name'}}Acabas de unirte a{{\/t}}<\/span><br \/>\n\t\t\t{{\/unless}}\n\t\t\t<span class=\"channel_overlay_title_prefix\">{{groupPrefix}}<\/span><strong>{{group.name}}<\/strong>\n\t\t<\/p>\n\t<\/div>\n\t<ul>\n\t\t<li>\n\t\t{{#if group.creator}}\n\t\t\t{{#t create_date=(toCalendarDate group.created) creator_link=(makeMemberPreviewLinkById group.creator)}}Creado el {create_date} por {creator_link}.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t create_date=(toCalendarDate group.created)}}Creado el {create_date}{{\/t}}\n\t\t{{\/if}}\n\t\t<\/li>\n\t\t<li>{{#t}}Este es un canal cerrado.{{\/t}}<\/li>\n\t\t{{#if inviter_id}}\n\t\t\t<li>{{#t inviter=(makeMemberPreviewLinkById inviter_id)}}{inviter} te ha invitado a este canal.{{\/t}}<\/li>\n\t\t{{\/if}}\n\t\t<li>{{#t}}Solo los miembros pueden abrir el canal y son los \u00fanicos con acceso a los archivos.{{\/t}}<\/li>\n\t\t<li>{{#t}}Puedes invitar a m\u00e1s miembros desde el men\u00fa de canales.{{\/t}}<\/li>\n\t<\/ul>\n\t{{