utton\" data-action=\"copy_link\" data-permalink=\"{{abs_permalink}}\" class=\"btn_unstyle btn_msg_action ts_icon ts_icon_link ts_tip ts_tip_top ts_tip_float {{ts_tip_delay_class}}\" title=\"{{#t}}Copiar el enlace{{\/t}}\" aria-label=\"{{#t}}Copiar el enlace{{\/t}}\"><\/button>\n\t\t\t{{~\/if~}}\n\t\t{{~\/if~}}\n\t{{~\/if~}}\n{{~\/if~}}\n{{~#if star~}}\n\t<button type=\"button\" data-action=\"star\" class=\"btn_unstyle btn_msg_action ts_icon ts_tip ts_tip_top ts_tip_float {{ts_tip_delay_class}} {{star.classes}}\" title=\"{{star.text}}\" aria-label=\"{{star.text}}\" {{#each star.attributes}}{{@key}}=\"{{this}}\" {{\/each}}><\/button>\n{{~\/if~}}\n{{~#unless hide_actions_menu~}}\n\t<button type=\"button\" data-action=\"actions_menu\" class=\"btn_unstyle btn_msg_action ts_icon ts_icon_small_ellipsis ts_tip ts_tip_top ts_tip_float {{ts_tip_delay_class}}\" title=\"{{#t note=\"Show a menu with a full list of available actions to take on this message\"}}Mostrar acciones del mensaje{{\/t}}\" aria-label=\"{{#t}}Mostrar acciones del mensaje{{\/t}}\"><\/button>\n{{~\/unless~}}\n";
