TS.raw_templates['attachment_actions'] = "{{i18n_ns 'attachment_actions'}}\n{{#if attachment.actions}}\n\t<div class=\"attachment_actions_interactions{{#if attachment._pending}} attachment_pending{{\/if}}{{#if disable_actions}} ts_tip ts_tip_top ts_tip_multiline ts_tip_float{{\/if}}\">\n\t\t{{#if disable_actions}}\n\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t<span class=\"ts_tip_multiline_inner\">\n\t\t\t\t\t{{#if_equal disable_actions_reason compare='ARCHIVES'}}\n\t\t\t\t\t\t{{#t}}La interactividad est\u00e1 deshabilitada en los archivos de mensaje{{\/t}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t{{#if_equal disable_actions_reason compare='CHANNEL_PREVIEW'}}\n\t\t\t\t\t\t{{#t}}\u00danete al canal para interactuar con este mensaje{{\/t}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t{{#if_equal disable_actions_reason compare='OTHER'}}\n\t\t\t\t\t\t{{#t}}Las interacciones solamente funcionan en el canal en el que se public\u00f3 este mensaje por primera vez.{{\/t}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t<\/span>\n\t\t\t<\/span>\n\t\t{{\/if}}\n\t\t<span class=\"attachment_actions_interactions_inner_wrapper\">\n\t\t\t{{renderAttachmentActions attachment message_ts disable_actions}}\n\t\t<\/span>\n\t\t{{#if attachment._pending}}\n\t\t\t{{inlineSaver hide_text=true}}\n\t\t{{\/if}}\n\t<\/div>\n{{\/if}}\n{{#if attachment.legacy_actions}}\n\t<div class=\"attachment_actions\">\n\t\t{{#foreach attachment.legacy_actions}}\n\t\t\t{{formatActionLink this.value msg ..\/enable_slack_action_links}}\n\t\t\t{{#unless this.last}} \u2022 {{\/unless}}\n\t\t{{\/foreach}}\n\t<\/div>\n{{\/if}}\n";
TS.raw_templates['attachment_actions_button'] = "<button\n\tclass=\"btn btn_attachment{{#if _loading}} loading{{\/if}}{{#if btn_class}} {{btn_class}}{{\/if}}{{#if url}} btn_attachment_link{{\/if}}\"\n\t{{#if url}}data-url=\"{{url}}\"{{\/if}}\n\t{{#if _disabled}}disabled{{\/if}}\n\tdata-action-id=\"{{id}}\"\n\tdata-qa=\"{{data_qa_value}}\"\n\ttitle=\"{{current_text}}\"\n>\n\t<span class=\"btn_attachment_text overflow_ellipsis\">{{formatted_text}}<\/span>\n<\/button>\n";
TS.raw_templates['attachment_actions_select'] = "{{! Note the lazy_filter_select library will decorate these selects. See `TS.attachment_actions.select`. }}\n<select\n\tclass=\"select_attachment_placeholder\"\n\t{{#if disabled}}disabled{{\/if}}\n\tname=\"{{name}}\"\n\t{{#if text}}placeholder=\"{{text}}\"{{\/if}}\n\tdata-action-id=\"{{id}}\"\n>\n\t{{#if option_groups}}\n\t\t{{#each option_groups}}\n\t\t\t<optgroup label=\"{{text}}\">\n\t\t\t\t{{#each options}}\n\t\t\t\t\t{{renderAttachmentActionSelectOption this is_group_item=true}}\n\t\t\t\t{{\/each}}\n\t\t\t<\/optgroup>\n\t\t{{\/each}}\n\t{{else}}\n\t\t{{#each options}}\n\t\t\t{{renderAttachmentActionSelectOption this}}\n\t\t{{\/each}}\n\t{{\/if}}\n<\/select>\n";
