TS.raw_templates['pinned_message_info'] = "{{i18n_ns \"messages\"}}\n\n<ts-icon class=\"ts_icon_thumb_tack_filled ts_icon_inherit ts_icon_align_bottom {{#if complete_data}}ts_tip ts_tip_top ts_tip_float ts_tip_multiline{{\/if}}\">\n\t{{#if complete_data}}\n\t\t<span class=\"ts_tip_tip\">\n\t\t\t<span class=\"ts_tip_multiline_inner\">\n\t\t\t{{#if user.is_self}}\n\t\t\t\t{{#t note=\"metadata in tooltip above a pinned item in the message pane\"}}\n\t\t\t\t\tChincheta a\u00f1adida por ti\n\t\t\t\t{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t note=\"metadata in tooltip above a pinned item in the message pane\" member_display_name=(getPrefCompliantMemberName user)}}\n\t\t\t\t\tChincheta a\u00f1adida por {member_display_name}\n\t\t\t\t{{\/t}}\n\t\t\t{{\/if}}\n\t\t\t<br>\n\t\t\t\t<span class=\"subtle_silver\">\n\t\t\t\t\t{{#t\n\t\t\t\t\t\tnote=\"{date} is either a calendar date e.g. 'Dec 6th' or 'Today'\/'Yesterday' depending on when the comment was made. Time includes am\/pm ex. 12:07pm\"\n\t\t\t\t\t\tdate=(toCalendarDateOrNamedDayShort ts)\n\t\t\t\t\t\ttime=(toTime ts true)}}\n\t\t\t\t\t\t{date} a la(s) {time}\n\t\t\t\t\t{{\/t}}\n\t\t\t\t<\/span>\n\t\t\t<\/span>\n\t\t<\/span>\n\t{{\/if}}\n<\/ts-icon>\n{{#if complete_data}}\n\t{{#if user.is_self}}\n\t\t{{#t note=\"metadata above a pinned item in the message pane\"}}\n\t\t\tChincheta a\u00f1adida por ti\n\t\t{{\/t}}\n\t{{else}}\n\t\t{{#t note=\"metadata above a pinned item in the message pane\" member_display_name=(getPrefCompliantMemberName user)}}\n\t\t\tChincheta a\u00f1adida por {member_display_name}\n\t\t{{\/t}}\n\t{{\/if}}\n{{else}}\n\t{{#t}}Chinchetas{{\/t}}\n{{\/if}}";
TS.raw_templates['highlights_message_info'] = "{{i18n_ns \"messages\"}}\n\n<span class=\"highlights_feedback subtle_silver position_relative {{#if recap.isLeavingFeedback}}is_leaving_feedback{{\/if}}\">\n\t{{#if recap.isLeavingFeedback}}\n\t\t{{#t}}<strong>\u00bfPor qu\u00e9 no te pareci\u00f3 \u00fatil este destacado?<\/strong> D\u00ednoslo y lo arreglaremos. <button type=\"button\" class=\"btn_link\" data-js=\"highlights_feedback_dropdown\">Dejar comentario <ts-icon class=\"ts_icon_chevron_down highlights_feedback__dropdown_icon\"><\/ts-icon><\/button>{{\/t}}\n\t{{else}}\n\t\t<ts-icon class=\"ts_icon_sparkles_filled ts_icon_inherit ts_icon_align_bottom\"><\/ts-icon>\n\t\t<button type=\"button\" class=\"btn_link highlights_feedback_link bold\">{{#t}}Destacado{{\/t}}<\/button><span data-js=\"highlights_feedback\" class=\"highlights_feedback_text subtle_silver\">{{#if recap.justification}} \u2014 {{dangerouslyRenderHTML recap.justification}}{{\/if}}<\/span>\n\t\t<div class=\"sli_briefing__feedback_controls {{#if recap.data.feedback}}gave_{{recap.data.feedback}}_feedback{{\/if}}\">\n\t\t\t \u2014 {{#t}}\u00bfTe ha resultado \u00fatil?{{\/t}}\n\t\t\t<button type=\"button\" data-highlight-feedback=\"positive\" class=\"sli_briefing__feedback_control sli_briefing__feedback_positive btn_unstyle ts_icon ts_icon_thumbs_up ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}Me ha resultado \u00fatil{{\/t}}\"><\/button>\n\t\t\t<button type=\"button\" data-highlight-feedback=\"negative\" class=\"sli_briefing__feedback_control sli_briefing__feedback_negative btn_unstyle ts_icon ts_icon_thumbs_down ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}No me ha resultado muy \u00fatil{{\/t}}\"><\/button>\n\t\t<\/div>\n\t{{\/if}}\n<\/span>";
TS.raw_templates['message_member_image'] = "{{#if is_tombstone}}\n\t<div class=\"message_deleted_icon\"><i class=\"ts_icon ts_icon_trash member_image thumb_36\"><\/i><\/div>\n{{else}}\n\t{{#if member}}\n\t\t{{#if member.is_unknown}}\n\t\t\t<div class=\"member_image member_image_unknown thumb_36\"><\/div>\n\t\t{{else}}\n\t\t\t{{#if is_bot}}\n\t\t\t\t{{makeProfileImage member size=\"36\"}}\n\t\t\t{{else}}\n\t\t\t\t{{makeMemberPreviewLinkImage member.id 36 null null null null msg.slackbot_feels}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{makeUsernameImage msg 36}}\n\t{{\/if}}\n{{\/if}}\n";
