mberActionBar}}\n\n\t{{#unless member.is_stranger}}\n\t\t{{#if member.profile}}\n\t\t\t<hr class=\"member_details_divider small_bottom_margin\">\n\t\t\t<table class=\"member_data_table\">\n\t\t\t\t{{#if member.profile.display_name}}\n\t\t\t\t\t<tr>\n\t\t\t\t\t\t<td><span class=\"small_right_padding old_petunia_grey\" title=\"{{#t}}Nombre de Slack{{\/t}}\">{{#t}}Nombre de Slack{{\/t}}<\/span><\/td>\n\t\t\t\t\t\t{{#if member.deleted}}\n\t\t\t\t\t\t\t{{#memberHasIm member=member}}\n\t\t\t\t\t\t\t\t<td><a href=\"\/messages\/@{{member.id}}\" target=\"\/messages\/@{{member.id}}\" data-member-id=\"{{member.id}}\" class=\"internal_im_link\">{{getMemberProfileFieldDisplayName member}}<\/a><\/td>\n\t\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t\t<td><a href=\"\/team\/{{member.id}}\" target=\"{{newWindowName}}\">{{getMemberProfileFieldDisplayName member}}<\/a><\/td>\n\t\t\t\t\t\t\t{{\/memberHasIm}}\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t{{#if member.is_self}}\n\t\t\t\t\t\t\t\t<td><span title=\"{{getMemberProfileFieldDisplayName member}}\">{{getMemberProfileFieldDisplayName member}}<\/span><\/td>\n\t\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t\t{{#isClient}}\n\t\t\t\t\t\t\t\t\t<td><a href=\"\/messages\/@{{member.id}}\" target=\"\/messages\/@{{member.id}}\" data-member-id=\"{{member.id}}\" title=\"{{getMemberProfileFieldDisplayName member}}\" class=\"internal_im_link\">{{getMemberProfileFieldDisplayName member}}<\/a><\/td>\n\t\t\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t\t\t<td><a href=\"\/messages\/@{{member.id}}\" target=\"new\" title=\"{{getMemberProfileFieldDisplayName member}}\">{{getMemberProfileFieldDisplayName member}}<\/a><\/td>\n\t\t\t\t\t\t\t\t{{\/isClient}}\n\t\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t<\/tr>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#unless (isSlackbotOrTeambot member)}}\n\t\t\t\t\t{{#unless member.is_bot}}\n\t\t\t\t\t\t<tr>\n\t\t\t\t\t\t\t<td><span class=\"small_right_padding old_petunia_grey\" title=\"{{#t}}Zona horaria{{\/t}}\">{{#t}}Zona horaria{{\/t}}<\/span><\/td>\n\t\t\t\t\t\t\t<td class=\"member_preview_timezone\"><span class=\"timezone_label\" data-member-id=\"{{member.id}}\">{{memberLocalTime member}}<\/span>{{#if member.is_self}} {{#t new_win_name=(newWindowName)}}(<a href='\/account\/settings' target=\"{new_win_name}\" data-action=\"edit_member_profile_modal\">cambiar<\/a>){{\/t}}{{\/if}}<\/td>\n\t\t\t\t\t\t<\/tr>\n\t\t\t\t\t{{\/unless}}\n\t\t\t\t{{\/unless}}\n\t\t\t\t{{#if member.profile.phone}}\n\t\t\t\t\t<tr>\n\t\t\t\t\t\t<td><span class=\"small_right_padding old_petunia_grey\" title=\"{{#t}}N\u00famero de tel\u00e9fono{{\/t}}\">{{#t}}N\u00famero de tel\u00e9fono{{\/t}}<\/span><\/td>\n\t\t\t\t\t\t<td><a href=\"tel:{{member.profile.phone}}\">{{member.profile.phone}}<\/a><\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#and member.profile.email (shouldShowMemberEmail member)}}\n\t\t\t\t\t<tr>\n\t\t\t\t\t\t<td><span class=\"small_right_padding old_petunia_grey\" title=\"{{#t}}Correo{{\/t}}\">{{#t}}Correo{{\/t}}<\/span><\/td>\n\t\t\t\t\t\t<td><a href=\"mailto:{{member.profile.email}}\" title=\"{{#t}}Correo electr\u00f3nico de {member.name}{{\/t}}\">{{member.profile.email}}<\/a><\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t{{\/and}}\n\t\t\t\t{{#if show_admin_info}}\n\t\t\t\t\t<tr>\n\t\t\t\t\t\t<td><span class=\"small_right_padding old_petunia_grey\" title=\"{{#t}}Rol{{\/t}}\">{{#t}}Rol{{\/t}}<\/span><\/td>\n\t\t\t\t\t\t<td>\n\t\t\t\t\t\t\t{{#if member.is_owner}}\n\t\t\t\t\t\t\t\t{{#t}}Propietario de {team_name}{{\/t}}\n\t\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t\t{{#t}}Administrador de {team_name}{{\/t}}\n\t\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t{{\/if}}\n\t\t\t\t<tbody id=\"member_data_table_team_fields\">\n\t\t\t\t\t{{getVisibleTeamProfileFieldsForMember member lazy_load_profile_fields=lazy_load_profile_fields}}\n\t\t\t\t<\/tbody>\n\t\t\t<\/table>\n\t\t{{\/if}}\n\t{{\/unless}}\n\n\t{{#if member.is_restricted}}\n\t\t<hr class=\"member_details_divider\">\n\n\t\t<table id=\"member_data_table_guest_fields\" class=\"member_data_table{{#pageNeedsEnterprise}}{{#if teams}} no_bottom_margin{{\/if}}{{\/pageNeedsEnterprise}}\">\n\t\t\t{{> guest_profile_fields member=member lazy_load_profile_fields=lazy_load_profile_fields }}\n\t\t<\/table>\n\t{{\/if}}\n\n\t{{#pageNeedsEnterprise}}\n\t\t{{#pageNeedsEnterprise}}\n\t\t\t{{#if shared_teams}}\n\t\t\t\t<hr class=\"member_details_divider\">\n\n\t\t\t\t<table id=\"member_data_table_shared_teams\" class=\"member_data_table\">\n\t\t\t\t\t{{> member_shared_teams lazy_load_shared_teams=lazy_load_shared_teams shared_teams=shared_teams}}\n\t\t\t\t<\/table>\n\t\t\t{{\/if}}\n\t\t{{\/pageNeedsEnterprise}}\n\t{{\/pageNeedsEnterprise}}\n\n\t{{#if member.is_external}}\n\t\t<hr class=\"member_details_divider\">\n\n\t\t{{#if member.is_stranger}}\n\t\t\t<p class=\"member_data_shared_message align_center large_right_margin large_left_margin\">\n\t\t\t\t{{#t member_name=(getPrefCompliantMemberName member)}}\n\t\t\t\t\t<strong>No compartes ning\u00fan canal con {member_name}.<\/strong>\n\t\t\t\t\tPara\u00a0interactuar con una persona de otro espacio de trabajo, ten\u00e9is que coincidir al menos en un canal.\n\t\t\t\t{{\/t}}\n\t\t\t<\/p>\n\t\t{{else}}\n\t\t\t<table id=\"member_data_table_shared_channels\" class=\"member_data_table\">\n\t\t\t\t{{> shared_channels_profile_field}}\n\t\t\t<\/table>\n\t\t{{\/if}}\n\t{{\/if}}\n\n\t<div class=\"clear_both larger_bottom_margin\"><\/div>\n\n<\/div>\n\n{{#if member.is_slackbot}}\n\t<div class=\"help\">\n\t\t<img src=\"{{versioned_slackbot_72}}\" alt=\"Slackbot\" class=\"slackbot_icon small_top_margin small_bottom_margin float_right left_margin\" \/>\n\t\t\t<p>{{#t}}Slackbot es el robot de la casa, un bot amable y siempre dispuesto a ayudarte a usar Slack. De vez en cuando te enviar\u00e1 notificaciones o recordatorios.{{\/t}} <\/p>\n\t\t{{#isClient}}\n\t\t\t<i class=\"ts_icon ts_icon_question_circle member_help_center callout\"><\/i>\n\t\t\t<p>{{#t new_win_name=(newWindowName) locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}En tus mensajes directos con Slackbot, puedes hacer preguntas sencillas relacionadas con Slack (o escribir un par de palabras clave). Slackbot intentar\u00e1 contestar o buscar\u00e1 en el <a href=\"https:\/\/get.slack.help\/hc\/{locale}?{hcTrackingToken}\" target=\"{new_win_name}\">Centro de Ayuda<\/a> por ti. Tambi\u00e9n puedes escribir <strong>\/sugerencias<\/strong> seguido de un mensaje para enviar una nota o pregunta a los seres humanos que tambi\u00e9n trabajan en Slack.{{\/t}}<\/p>\n\t\t{{\/isClient}}\n\t<\/div>\n{{\/if}}\n\n{{#if (isTeambot member)}}\n\t<div class=\"help\">\n\t\t{{#feature flag=\"feature_teambot_active\"}}\n\t\t\t<img src=\"{{versioned_teambot_72}}\" alt=\"Teambot\" class=\"slackbot_icon small_top_margin small_bottom_margin float_right left_margin\" \/>\n\t\t\t\t<p>{{#t}}Teambot es un bot integrado dedicado a tu equipo. Se puede programar para que responda a los mensajes que le envi\u00e9is t\u00fa y tus compa\u00f1eros en vuestros canales de Slack.{{\/t}} <\/p>\n\t\t\t{{#isClient}}\n\t\t\t\t<i class=\"ts_icon ts_icon_question_circle member_help_center callout\"><\/i>\n\t\t\t\t<p>{{#t new_win_name=(newWindowName) locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}Tu equipo puede personalizar las respuestas de Teambot seg\u00fan sean sus necesidades. Por ejemplo, para ayudaros a encontrar informaci\u00f3n m\u00e1s r\u00e1pido o fortalecer el esp\u00edritu de equipo. Los ajustes de tu espacio de trabajo determinan qui\u00e9n puede configurar sus respuestas: cualquier miembro del espacio de trabajo o solo los administradores. <a href=\"https:\/\/get.slack.help\/hc\/articles\/360001724508\" target=\"{new_win_name}\">M\u00e1s informaci\u00f3n<\/a>{{\/t}}<\/p>\n\t\t\t{{\/isClient}}\n\t\t{{\/feature}}\n\t<\/div>\n{{\/if}}\n";
TS.raw_templates['dm_badge'] = "{{i18n_ns \"team\"}}\n\n\n{{#if members}}\n\t<div class=\"mpdm_badge display_flex align_items_center\">\n\t{{#each members}}\n\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs this 56 false false)}}\n\t{{\/each}}\n{{else}}\n\t<div class=\"dm_badge display_flex align_items_center\">\n\t{{> c-unified_member member=member size=\"large\" linked=true}}\n{{\/if}}\n<\/div>\n\n<p class=\"dm_explanation margin_auto align_left clear_both\">\n\t{{#if member.is_self}}\n\t\t{{#t note=\"Description for self DM\"}}<strong>Este es tu espacio.<\/strong> Redacta borradores de mensajes, listas de tareas, o ten a mano enlaces y archivos. Tambi\u00e9n puedes hablar contigo mismo, pero tendr\u00e1s que hacer las dos partes de la conversaci\u00f3n.{{\/t}}\n\t{{else}}\n\t\t{{#if members~}}\n\t\t\t{{#isModelObExtShared model_ob}}\n\t\t\t\t{{#t teams=(makeTeamNameList model_ob.shared_team_ids strong=true)}}Esta conversaci\u00f3n incluye a personas de {teams}, as\u00ed que comparte archivos e informaci\u00f3n con precauci\u00f3n.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t members=(mpimDisplayName model_ob false false false true)}}Este es <span class=\"not_limited_copy\">el principio de<\/span> tu historial de mensajes con {members}.{{\/t}}\n\t\t\t{{\/isModelObExtShared}}\n\t\t{{else if member.is_external}}\n\t\t\t{{#t member_name=(getPrefCompliantMemberName member) team_name=(getTeamNameByMember member)}}{member_name} es del equipo <strong>{team_name}<\/strong> y no del tuyo, as\u00ed que comparte archivos e informaci\u00f3n con precauci\u00f3n.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t member_name=(getPrefCompliantMemberName member)}}Este es <span class=\"not_limited_copy\">el principio de<\/span> tu historial de mensajes con <strong>{member_name}<\/strong>.{{\/t}}\n\t\t\t{{#if show_bot_about_link}}\n\t\t\t\t\t<button class=\"btn_link bot_about_link\" type=\"button\" data-bot_about_link><i class=\"ts_icon ts_icon_lightbulb_o ts_icon_inherit\"><\/i>{{#t member_name=(getPrefCompliantMemberName member)}}\u00bfC\u00f3mo funciona {member_name}?{{\/t}}<\/button>\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t{{\/if}}\n<\/p>\n{{#if members}}\n\t{{#if desktop_notifs_enabled}}\n\t\t<div class=\"mpim_notif_prefs medium_bottom_margin {{#feature flag=\"feature_turn_mpdm_notifs_on\"}}feature_turn_mpdm_notifs_on{{\/feature}}\">\n\t\t\t{{#feature flag=\"feature_turn_mpdm_notifs_on\"}}\n\t\t\t\t<span>\n\t\t\t\t\t{{#if_equal desktop_setting compare=\"everything\"}}{{#t}}Recibir\u00e1s una notificaci\u00f3n por <strong>cada nuevo mensaje<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t\t\t{{#if_equal desktop_setting compare=\"mentions\"}}{{#t}}Recibir\u00e1s una notificaci\u00f3n cuando <strong>te mencionen, te env\u00eden un mensaje directo o alguien use una de tus palabras clave<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t\t\t{{#if_equal desktop_setting compare=\"nothing\"}}{{#t}}No recibir\u00e1s notificaciones{{\/t}}{{\/if_equal}}\n\t\t\t\t\t<button class=\"more_options btn_link small_left_margin\" type=\"button\">{{#t}}Editar{{\/t}}<\/button>\n\t\t\t\t<\/span>\n\t\t\t{{else}}\n\t\t\t\t<div class=\"quote_bar\">\n\t\t\t\t\t<div class=\"shim\"><\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<p class=\"content\">\n\t\t\t\t\t<span class=\"bold\">{{#t note=\"Followed by various notification preferences e.g. Activity of any kind, Only mentions of my name or highlight words, etc.\"}}Enviarme notificaciones al ordenador para:{{\/t}}<\/span>\n\t\t\t\t\t<span class=\"mini small_left_margin\"><button class=\"more_options btn_link\" type=\"button\">{{#t}}M\u00e1s opciones{{\/t}}<\/button><\/span>\n\t\t\t\t\t{{#if_equal desktop_setting compare=\"nothing\"}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t{{#unless is_muted}}\n\t\t\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t\t\t<input id=\"all_notifications_rd\" type=\"radio\" name=\"notifications\" {{#if_equal desktop_setting compare=\"everything\"}}checked=\"checked\"{{\/if_equal}}>\n\t\t\t\t\t\t\t{{#t note=\"One of many notification preference settings\"}}Todos los mensajes nuevos{{\/t}}\n\t\t\t\t\t\t<\/label>\n\t\t\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t\t\t<input id=\"mentions_rd\" type=\"radio\" name=\"notifications\" {{#if_equal desktop_setting compare=\"mentions\"}}checked=\"checked\"{{\/if_equal}}>\n\t\t\t\t\t\t\t{{#t note=\"One of many notification preference settings\"}}Solo menciones y palabras clave{{\/t}}\n\t\t\t\t\t\t<\/label>\n\t\t\t\t\t{{\/unless}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t<label class=\"checkbox no_margin normal {{#if_equal desktop_setting compare=\"nothing\"}}{{#if is_muted}}hidden{{\/if}}{{else}}hidden{{\/if_equal}}\">\n\t\t\t\t\t\t<input id=\"no_notifications_cb\" type=\"checkbox\" checked=\"checked\">\n\t\t\t\t\t\t\t{{#t note=\"One of many notification preference settings\"}}No hay notificaciones{{\/t}}\n\t\t\t\t\t<\/label>\n\t\t\t\t\t<label class=\"checkbox no_margin normal {{#if is_muted}}{{else}}hidden{{\/if}}\">\n\t\t\t\t\t\t<input id=\"notifications_muted_cb\" type=\"checkbox\" checked=\"checked\">\n\t\t\t\t\t\t{{#t}}Silenciar esta conversaci\u00f3n{{\/t}}\n\t\t\t\t\t<\/label>\n\t\t\t\t<\/p>\n\t\t\t{{\/feature}}\n\t\t<\/div>\n\t{{else}}\n\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t{{#if notifications_not_yet_allowed}}\n\t\t\t\t<span>{{#t}}A\u00fan no has activado las notificaciones en el ordenador. Abre tus <button onclick=\"TS.ui.prefs_dialog.start('notifications')\" class=\"btn_link bold\" type=\"button\">Preferencias<\/button> y sigue las instrucciones si deseas configurarlas.{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t\t{{#if notifications_not_allowed}}\n\t\t\t\t<span>{{#t}}Has rechazado las notificaciones en el navegador. Tendr\u00e1s que abrir las preferencias del navegador para modificar este ajuste.{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t\t{{#if notifications_impossible}}\n\t\t\t\t<span>{{#t}}Tu navegador no permite notificaciones en el ordenador. <a href=\"\/downloads\" target=\"_blank\">\u00bfTe apetece probar alguna de nuestras aplicaciones?<\/a>{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t{{\/if}}\n{{\/if}}\n";
TS.raw_templates['slackbot_badge'] = "{{i18n_ns 'team'}}\n\n<h1>{{#t}}\u00a1Hola, soy Slackbot!{{\/t}}<\/h1>\n<div class=\"cursor_pointer flex_none float_left small_left_margin very_small_top_margin\" onclick=\"TS.client.ui.previewMember('{{member.id}}', 'im_page');\">\n\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs member 48 false true)}}\n<\/div>\n\n<p class=\"icon_offset\">{{#t}}Puedes hacerme preguntas sobre el funcionamiento de Slack o simplemente escribir un par de palabras sueltas. Por ejemplo: <strong>\u00bfpuedo modificar un mensaje despu\u00e9s de haberlo publicado?<\/strong> O simplemente: <strong>editar mensaje<\/strong>{{\/t}}<\/p>\n<div class=\"clear_both\"><\/div>\n<p class=\"icon_offset\">{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}Solo soy un robot, pero har\u00e9 lo que pueda para responder a tus preguntas. Si hay algo que no s\u00e9, lo buscar\u00e9 en el<a href=\"https:\/\/get.slack.help\/hc\/{locale}?{hcTrackingToken}\"> Centro de Ayuda<\/a>.{{\/t}}<\/p>\n";
TS.raw_templates['team_icon'] = "{{i18n_ns \"teams\"}}\n\n{{!-- Please duplicate updates to `js\/modern\/slack-kit\/team-icon\/team-icon.jsx` --}}\n{{#if team}}\n\t{{#or team.isUnknown team.isNonExistent}}\n\t\t{{#if team.isUnknown}}\n\t\t\t<ts-icon class=\"team_image icon_{{size}} default unknown_team_icon {{classes}}\" aria-hidden=\"true\" data-id=\"{{team.id}}\" {{#if with_tooltip}}data-with-tooltip=\"true\"{{\/if}} data-size=\"{{size}}\" data-class=\"{{classes}}\" {{#if is_pending_shared}}data-pending-shared=\"true\"{{\/if}}><\/ts-icon>\n\t\t{{else if team.isNonExistent}}\n\t\t\t<ts-icon class=\"team_image icon_{{size}} default {{classes}}\" aria-hidden=\"true\"><\/ts-icon>\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#shouldUseInitialsIcon team is_pending_shared}}\n\t\t\t<ts-icon class=\"team_image icon_{{size}} default {{classes}}{{#if with_tooltip}} ts_tip ts_tip_top ts_tip_float{{\/if}}\" aria-hidden=\"true\"{{#if with_tooltip}} title=\"{{getTeamDisplayName team}}\"{{\/if}}>{{initialsSafe team.name}}<\/ts-icon>\n\n\t\t{{else}}\n\t\t\t<ts-icon class=\"team_image icon_{{size}} {{classes}}{{#if with_tooltip}} ts_tip ts_tip_top ts_tip_float{{\/if}}\" style=\"background-image: url('{{getTeamIconOfSize team (getIconSizeToFit (math size '*' 2))}}');\"{{#if with_tooltip}} title=\"{{getTeamDisplayName team}}\"{{\/if}}><\/ts-icon>\n\n\t\t{{\/shouldUseInitialsIcon}}\n\t{{\/or}}\n{{\/if}}";
