TS.raw_templates['c-team'] = "{{i18n_ns 'members'}}\n\n{{#if_equal size compare=\"small\"}}\n\n{{#if linked}}\n\t<a href=\"{{linked}}\" data-team-id=\"{{team.id}}\" class=\"c-team c-team--{{size}} {{#if icon}}c-team__with-icon--small{{\/if}} c-team--linked\" target=\"{{linked}}\">\n{{else}}\n\t<span class=\"c-team c-team--{{size}} {{#if icon}}c-team__with-icon--small{{\/if}}\">\n{{\/if}}\n\n\t\t{{#if icon}}\n\t\t\t<span class=\"c-team__icon thumb_20\" data-team-id=\"{{team.id}}\" data-thumb-size=\"20\" style=\"background-image: url('{{team.icon.image_44}}')\" aria-hidden=\"true\"><\/span>\n\t\t{{\/if}}\n\n\t\t<span class=\"c-team__name c-team__name--small\">\n\t\t\t<span class=\"c-team__display-name c-team__display-name--small\">{{getTeamDisplayName team}}<\/span>\n\t\t<\/span>\n{{#if linked}}\n\t<\/a>\n{{else}}\n\t<\/span>\n{{\/if}}\n\n{{\/if_equal}}\n";
