TS.raw_templates['notifications_header'] = "{{i18n_ns \"menu_notifications_header\"}}\n\n{{#if in_dnd}}\n\t<div class=\"dnd_banner\">\n\t\t<div class=\"{{#if is_snoozing}}snooze_illustration{{else}}dnd_illustration{{\/if}}\"><\/div>\n\t\t<div class=\"dnd_on_label\">{{#t}}No molestar ACTIVADO{{\/t}}<\/div>\n\t\t{{#if is_snoozing}}\n\t\t\t<div class=\"snooze_time_label\">{{#t duration=readable_end_time}}No recibir\u00e1s notificaciones durante {duration}{{\/t}}<\/div>\n\t\t{{else}}\n\t\t\t<div class=\"dnd_schedule_label\">{{#t end_time=readable_end_time}}Programadas hasta {end_time}{{\/t}}<\/div>\n\t\t{{\/if}}\n\t<\/div>\n{{\/if}}";
TS.raw_templates['notifications_items'] = "{{i18n_ns \"menu_notifications_items\"}}\n{{#if in_dnd}}\n\t<li><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"turn_off\">{{#t}}Desactivar{{\/t}}<\/a><\/li>\n{{else}}\n\t<div class=\"section_header\"><hr><span class=\"header_label menu_mini\">{{#t note=\"Heading for a list of durations (e.g., 2 hours)\"}}Posponer notificaciones:{{\/t}}<\/span><\/div>\n\t{{> snooze_items}}\n\t<li class=\"divider\"><\/li>\n{{\/if}}\n\n{{#if is_snoozing}}\n\t<li id=\"adjust_snooze_time\" class=\"has_submenu\" role=\"menuitem\"><a class=\"overflow_ellipsis\">{{#t}}Ajustar tiempo <ts-icon class=\"ts_icon_caret_right submenu_caret\"><\/ts-icon>{{\/t}}<\/a><\/li>\n{{else}}\n\t{{#if in_dnd}}\n\t\t<li id=\"adjust_dnd_schedule\" role=\"menuitem\"><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"dnd_schedule\" aria-haspopup=\"true\">{{#t fallback_hash=\"64da288ce53342871800ca4b249e141d104384af\"}}Ajustar horario\u2026{{\/t}}<\/a><\/li>\n\t{{else}}\n\t\t<li id=\"adjust_dnd_schedule\" role=\"menuitem\"><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"dnd_schedule\">{{#t fallback_hash=\"3898ea13ea926c2520554be84ab46abfc9d61a5f\"}}Horario en modo no molestar\u2026{{\/t}}<\/a><\/li>\n\t{{\/if}}\n{{\/if}}\n\n<li class=\"divider\"><\/li>\n\n{{#unless model_ob.is_im}}\n\t{{#unless unread_view_is_showing}}\n\t\t<li id=\"channel_notification_settings\" class=\"overflow_ellipsis\" role=\"menuitem\">\n\t\t\t<a class=\"overflow_ellipsis\" data-dnd-menu-action=\"channel_settings\">{{#t name=model_ob_name note=\"{name} is the title of a channel, group, or mpim\" fallback_hash=\"2ac6beab284bad91450aba85375222b9d0e51e57\"}}Ajustes para <strong>{name}<\/strong>\u2026{{\/t}}<\/a>\n\t\t<\/li>\n\t{{\/unless}}\n{{\/unless}}\n\n<li id=\"notification_settings\" class=\"overflow_ellipsis\" role=\"menuitem\"><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"notif_prefs\">{{#t fallback_hash=\"b4798b8b610d81d396b140a23b3729225d9b62eb\"}}Tus preferencias de notificaciones\u2026{{\/t}}<\/a><\/li>\n";
TS.raw_templates['snooze_items'] = "{{i18n_ns \"menu_snooze_items\"}}\n<li role=\"menuitem\"><a data-snooze-length=\"20\"   data-dnd-menu-action=\"snooze\">{{#t}}20 minutos{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"60\"   data-dnd-menu-action=\"snooze\">{{#t}}1 hora{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"120\"  data-dnd-menu-action=\"snooze\">{{#t}}2 horas{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"240\"  data-dnd-menu-action=\"snooze\">{{#t}}4 horas{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"480\"  data-dnd-menu-action=\"snooze\">{{#t}}8 horas{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"1440\" data-dnd-menu-action=\"snooze\">{{#t}}24 horas{{\/t}}<\/a><\/li>";
TS.raw_templates['mentions_options'] = "{{i18n_ns 'mentions'}}\n\n<p>\n\t<span id=\"mentions_filter_menu_label\" class=\"filter_menu_label cursor_pointer display_flex align_items_baseline mentions_filter_menu_target\">\n\t\t<span class=\"tiny_right_margin bold\">{{#t}}Incluir:{{\/t}}<\/span>\n\t\t<span class=\"tiny_left_margin search_filter_text\">{{include_text}}<\/span>\n\t\t<i class=\"ts_icon ts_icon_chevron_down bold arrow_down very_small_left_margin\"><\/i>\n\t<\/span>\n<\/p>\n";
TS.raw_templates['mentions_item'] = "{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n<h3>\n\t{{#if model_ob.is_channel}}\n\t\t{{{makeChannelLink model_ob}}}\n\t{{\/if}}\n\t{{#if model_ob.is_mpim}}\n\t\t{{{makeMpimLink model_ob true}}}\n\t{{else}}\n\t\t{{#if model_ob.is_group}}\n\t\t\t{{{makeGroupLink model_ob}}}\n\t\t{{\/if}}\n\t{{\/if}}\n<\/h3>";
TS.raw_templates['menu_mentions_filter_items'] = "{{i18n_ns 'menu'}}\n\n<li class=\"{{#if show_user_group_filter}}no_bottom_padding{{\/if}} no_wrap\" role=\"menuitem\">\n\t<label for=\"exclude_at_channels_cb\"><input id=\"exclude_at_channels_cb\" type=\"checkbox\" class=\"small_right_margin\" {{#unless exclude_at_channels}}checked=\"checked\"{{\/unless}}\/>{{#t at_label=(atLabel 'channel')}}Incluir menciones {at_label}{{\/t}}<\/label>\n<\/li>\n{{#if show_user_group_filter}}\n\t<li class=\" no_top_padding no_wrap\" role=\"menuitem\">\n\t\t<label for=\"exclude_at_user_groups_cb\"><input id=\"exclude_at_user_groups_cb\" type=\"checkbox\" class=\"small_right_margin\" {{#unless exclude_at_user_groups}}checked=\"checked\"{{\/unless}}\/>{{#t}}Incluir menciones de grupos de usuarios{{\/t}}<\/label>\n\t<\/li>\n{{\/if}}\n";
TS.raw_templates['star'] = "<span {{#each html_attrs}}{{@key}}=\"{{this}}\" {{\/each}} class=\"{{#each class_names}}{{this}} {{\/each}}\">\n<\/span>\n";
TS.raw_templates['star_item'] = "{{!-- hbslint-disable syntax --}}\n{{!-- TODO: Enable syntax linter and refactor to use a safeString --}}\n{{i18n_ns 'stars'}}\n\n{{#if_equal star.type compare=\"channel\"}}\n\t{{starWithTip 'channel' star.channel null}}\n\t<strong>{{{makeChannelLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(canal){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"group\"}}\n\t{{starWithTip 'group' star.channel null}}\n\t<strong>{{{makeGroupLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(canal cerrado){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"im\"}}\n\t{{starWithTip 'im' star.channel null}}\n\t<strong>{{{makeIMLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(conversaci\u00f3n por mensaje directo){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"file_comment\"}}\n\t{{#if star.file.is_deleted}}\n\t{{else}}\n\t\t{{#if from_starred_item}}\n\t\t\t<div class=\"file_comment_item\">\n\t\t\t\t<div class=\"actions\">\n\t\t\t\t\t<div class=\"file_star btn_icon btn btn_outline ts_tip_btn ts_tip ts_tip_top\">\n\t\t\t\t\t\t{{starWithTip 'file_comment' star.comment star.file true}}\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t{{{comment_standalone star.comment star.file true}}}\n\t\t\t<\/div>\n\t\t{{else}}\n\t\t\t{{starWithTip 'file_comment' star.comment star.file}}\n\t\t\t{{{comment_standalone star.comment star.file}}}\n\t\t{{\/if}}\n\t{{\/if}}\n{{\/if_equal}}\n\n";
TS.raw_templates['star_with_tip'] = "{{i18n_ns 'star'}}\n\n<button type=\"button\" {{#each html_attrs}}{{@key}}=\"{{this}}\" {{\/each}} class=\"{{#each class_names}}{{this}} {{\/each}}ts_tip ts_tip_multiline ts_tip_float ts_tip_hidden btn_unstyle\">\n\t<span class=\"ts_tip_tip\">\n\t\t<span class=\"ts_tip_multiline_inner\" data-tip-toggle-auto=\"{{#if is_starred}}{{star_str}}{{else}}{{unstar_str}}{{\/if}}\">\n\t\t\t{{#if is_starred}}{{unstar_str}}{{else}}{{star_str}}{{\/if}}\n\t\t<\/span>\n\t<\/span>\n<\/button>\n";
TS.raw_templates['purpose_dialog'] = "\t{{i18n_ns \"dialogs_purpose\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if model_ob.purpose.value}}{{#t}}Modificar la finalidad del canal{{\/t}}{{else}}{{#t}}Definir la finalidad del canal{{\/t}}{{\/if}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t<label for=\"purpose_input\" class=\"inline_block\" style=\"min-width: 6rem; padding-right: 1rem;\">\n\t\t\t{{#t name=\"Refers to channel purpose\"}}Finalidad{{\/t}}<br \/>\n\t\t\t<span class=\"normal\">{{#t}}(optativo){{\/t}}<\/span>\n\t\t<\/label>\n\n\t\t<div id=\"purpose_input\" tabindex=\"1\"><\/div>\n\t\t<span class=\"modal_input_note candy_red too_long_warning hidden\" style=\"margin-left: 100px;\"><\/span>\n\n\t\t<span class=\"modal_input_note\" style=\"margin-left: 100px;\">\n\t\t\t{{#t}}Describe el objetivo de este canal.{{\/t}}\n\t\t\t{{#isModelObExtShared model_ob}}\n\t\t\t\t{{#t team_name=(currentTeamNameSafe)}}Solo {team_name} podr\u00e1 ver esto.{{\/t}}\n\t\t\t{{\/isModelObExtShared}}\n\t\t\t{{#if model_ob.purpose.creator}}\n\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\t<br \/>\n\t\t\t\t\t{{#t creator=(makeMemberPreviewLinkById model_ob.purpose.creator) date=(toCalendarDate model_ob.purpose.last_set)}}La finalidad fue definida por {creator} el {date}.{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t<\/span>\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">{{#t}}Cancelar{{\/t}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go\" tabindex=\"2\">{{#t note=\"Update channel purpose\"}}Actualizar la finalidad{{\/t}}<\/button>\n\t<\/div>\n";
TS.raw_templates['channel_prefs_dialog'] = "{{i18n_ns 'dialogs'}}\n{{> channel_prefs_options}}";
TS.raw_templates['channel_prefs_options'] = "{{i18n_ns \"prefs\"}}\n\n{{#unless embedded}}\n<div class=\"channel_prefs_modal_header modal-header\">\n\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t<h3>{{#t}}Preferencias de notificaciones: {display_name}{{\/t}} <span class=\"normal\" data-notification-table-header><\/span><\/h3>\n<\/div>\n{{\/unless}}\n<div class=\"channel_prefs_body {{#unless embedded}}modal-body{{\/unless}} feature_muting\">\n\t<div id=\"muting_div\" class=\"channel_prefs_body__muting_section\">\n\t\t<p class=\"channel_prefs_body__section_header_title inline_block\" data-muting-options-header>\n\t\t\t{{#t}}Opciones de silenciar{{\/t}}\n\t\t<\/p>\n\t\t<div>\n\t\t\t<label class=\"channel_prefs__muting_checkbox_label checkbox\" id=\"muting_label\">\n\t\t\t\t<input id=\"muting_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\"\/>\n\t\t\t\t{{~#if is_mpim~}}\n\t\t\t\t\t{{#t}}Silenciar por completo el mensaje del grupo{{\/t}}\n\t\t\t\t\t<div class=\"channel_prefs_body__mute_help_text\">{{#t}}No recibir\u00e1s notificaciones de los mensajes de grupo que hayas silenciado. Aparecer\u00e1n en gris en tu lista de canales.{{\/t}}<\/div>\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#t}}Silenciar todo el canal{{\/t}}\n\t\t\t\t\t<div class=\"channel_prefs_body__mute_help_text\">{{#t}}No recibir\u00e1s notificaciones en los canales que hayas silenciado. Aparecer\u00e1n en gris en tu lista de canales.{{\/t}}<\/div>\n\t\t\t\t{{\/if}}\n\t\t\t<\/label>\n\t\t<\/div>\n\n\t\t<div id=\"single_suppressed_div\">\n\t\t\t<p>\n\t\t\t\t<label class=\"channel_prefs__muting_checkbox_label checkbox\" id=\"single_suppressed_label\">\n\t\t\t\t\t<input id=\"single_suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/>\n\t\t\t\t\t{{~#isChannelRequired model_ob~}}\n\t\t\t\t\t\t{{#t at_label=(atLabel 'everyone') at_here=(atLabel 'here')}}Ignorar las notificaciones para <strong>{at_label}<\/strong> y <strong>{at_here}<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(en m\u00f3viles)<\/span><span id=\"single_suppressed_desktop_qualifier\">(en el ordenador)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Han sido desactivadas por el <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">administrador<\/strong><\/span>{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#t at_label=(atLabel 'channel') at_here=(atLabel 'here')}}Ignorar las notificaciones para <strong>{at_label}<\/strong> y <strong>{at_here}<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(en m\u00f3viles)<\/span><span id=\"single_suppressed_desktop_qualifier\">(en el ordenador)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Han sido desactivadas por el <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">administrador<\/strong><\/span>{{\/t}}\n\t\t\t\t\t{{\/isChannelRequired}}\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t<\/div>\n\n\t<div id=\"non_muting_prefs\" {{#if is_muted}}style=\"display: none\"{{\/if}}>\n\n\t\t<div id=\"notifications_not_working\" class=\"hidden\">\n\t\t\t<p class=\"channel_prefs_body__section_header\">\n\t\t\t\t<ts-icon class=\"notification_prefs_icon ts_icon_laptop ts_icon_inherit\"><\/ts-icon>\n\t\t\t\t{{#t}}Notificaciones para ordenador{{\/t}}\n\t\t\t<\/p>\n\t\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t\t<span id=\"notifications_not_yet_allowed\" class=\"hidden\">{{#t}}A\u00fan no has activado tus notificaciones para ordenador. Si deseas configurarlas, abre el <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">di\u00e1logo Preferencias<\/a> y sigue las instrucciones.{{\/t}}<\/span>\n\t\t\t\t<span id=\"notifications_not_enabled\" class=\"hidden\">{{#t}}Has desactivado las notificaciones para ordenador. Abre el <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">di\u00e1logo Preferencias<\/a> para modificarlo.{{\/t}}<\/span>\n\t\t\t\t<span id=\"notifications_not_allowed\" class=\"hidden\">{{#t}}Has rechazado las notificaciones en el navegador. Para modificar este ajuste, tendr\u00e1s que abrir las preferencias del navegador.{{\/t}}<\/span>\n\t\t\t\t<span id=\"notifications_impossible\" class=\"hidden\">{{#t}}Tu navegador no permite notificaciones para ordenador. <a href=\"\/downloads\" target=\"_blank\">\u00bfQuieres probar una de nuestras aplicaciones?<\/a>{{\/t}}<\/span>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"notifications_working\" class=\"hidden\">\n\t\t\t<table class=\"channel_prefs_notifications_table\" aria-label=\"{{#t}}Preferencias de notificaciones: {display_name_string}{{\/t}}\">\n\t\t\t\t<tr>\n\t\t\t\t\t<th scope=\"col\" class=\"channel_prefs_notifications_table__large_cell\"><span class=\"black\">{{#t}}Notificaciones{{\/t}}<\/span><\/th>\n\t\t\t\t\t<th scope=\"col\" class=\"channel_prefs_notifications_table__small_cell\">{{#t}}Todo lo nuevo{{\/t}}<\/th>\n\t\t\t\t\t<th scope=\"col\" class=\"channel_prefs_notifications_table__small_cell\">{{#t}}Solo menciones*{{\/t}}<\/th>\n\t\t\t\t\t<th scope=\"col\" class=\"channel_prefs_notifications_table__small_cell\">{{#t}}Nada{{\/t}}<\/th>\n\t\t\t\t<\/tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<th scope=\"row\" class=\"channel_prefs_notifications_table__row_title\"><ts-icon class=\"notification_prefs_icon ts_icon_desktop_notification\"><\/ts-icon>{{#t}}Ordenador{{\/t}}<\/th>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_loud_rd\" value=\"everything\"><span class=\"offscreen\">{{#t}}Todo lo nuevo{{\/t}}<\/span><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_loud_rd\" value=\"mentions\" aria-labelledby=\"channel_prefs_help_text_desc\"><span class=\"offscreen\">{{#t}}Solo menciones*{{\/t}}<\/span><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_loud_rd\" value=\"nothing\"><span class=\"offscreen\">{{#t}}Nada{{\/t}}<\/span><\/label><\/td>\n\t\t\t\t<\/tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<th scope=\"row\" class=\"channel_prefs_notifications_table__row_title\"><ts-icon class=\"notification_prefs_icon ts_icon_mobile_notification\"><\/ts-icon>{{#t}}M\u00f3vil{{\/t}}<\/th>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_push_loud_rd\" value=\"everything\"><span class=\"offscreen\">{{#t}}Todo lo nuevo{{\/t}}<\/span><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_push_loud_rd\" value=\"mentions\" aria-labelledby=\"channel_prefs_help_text_desc\"><span class=\"offscreen\">{{#t}}Solo menciones*{{\/t}}<\/span><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_push_loud_rd\" value=\"nothing\"><span class=\"offscreen\">{{#t}}Nada{{\/t}}<\/span><\/label><\/td>\n\t\t\t\t<\/tr>\n\t\t\t<\/table>\n\n\t\t\t<p id=\"channel_prefs_help_text_desc\" class=\"channel_prefs_help_text\">{{#t}}* Se incluyen menciones a tu nombre o cualquiera de tus palabras clave{{\/t}}<\/p>\n\t\t<\/div>\n\n\t<\/div>\n<\/div>\n\n<div class=\"channel_prefs_modal_footer {{#unless embedded}}modal-footer{{\/unless}}\">\n\t{{#if embedded}}\n\t\t<p class=\"channel_prefs_modal_footer__text small_top_margin no_bottom_margin\"><button class=\"btn_link\" data-action=\"reset_channel_to_defaults\">{{#t}}Restablecer los ajustes predeterminados de notificaciones{{\/t}}<\/button><\/p>\n\t{{else}}\n\t\t{{#feature flag=\"feature_xhp_notification_settings\"}}\n\t\t\t<p class=\"channel_prefs_modal_footer__text mini small_top_margin no_bottom_margin\">{{#t}}Set your default notifications settings in your <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications'); return false;\" target=\"_blank\" class=\"bold\">Account Preferences<\/a>{{\/t}}<\/p>\n\t\t{{else}}\n\t\t\t<p class=\"channel_prefs_modal_footer__text mini small_top_margin no_bottom_margin\">{{#t}}Establece ajustes predeterminados para tus notificaciones en tus <a href=\"\/account\/notifications\" onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications'); return false;\" target=\"_blank\" class=\"bold\">Preferencias de la cuenta<\/a>{{\/t}}<\/p>\n\t\t{{\/feature}}\n\t{{\/if}}\n\t<button type=\"button\" class=\"btn {{#unless embedded}}dialog_go{{\/unless}} channel_prefs_modal_footer__btn\" data-action=\"done\">{{#t}}Listo{{\/t}}<\/button>\n<\/div>";
TS.raw_templates['file_upload_dialog'] = "{{i18n_ns \"upload\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#t note=\"Dialog title\" }}\u00bfSubir un archivo?<span class=\"file_count\"><\/span>{{\/t}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\n\t\t{{#if over_storage_limit}}\n\t\t\t<p class=\"alert alert_warning\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t\t{{#if_equal plan compare=\"std\"}}\n\t\t\t\t\t{{#t\n\t\t\t\t\t\tnew_win_name=(newWindowName)\n\t\t\t\t\t\tnote=\"Shown when a user tries to upload a file after their team has reached storage limit\"\n\t\t\t\t\t}}Tu espacio de trabajo ha alcanzado el l\u00edmite de almacenamiento del plan Est\u00e1ndar. Para a\u00f1adir m\u00e1s archivos a Slack, tendr\u00e1s que <a href=\"\/pricing?ui_step=70&ui_element=5\" target=\"{new_win_name}\" class=\"bold\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"pricing_link\" data-clog-ui-action=\"click\" data-clog-ui-step=\"file_upload\">suscribirte a un plan superior<\/a>.{{\/t}}\n\t\t\t\t{{else if_equal plan compare=\"plus\"}}\n\t\t\t\t\t{{#t\n\t\t\t\t\t\tnew_win_name=(newWindowName)\n\t\t\t\t\t\tnote=\"Shown when a user tries to upload a file after their team has reached storage limit\"\n\t\t\t\t\t}}Tu espacio de trabajo ha alcanzado el l\u00edmite de almacenamiento del plan Plus. Para a\u00f1adir m\u00e1s archivos a Slack, tendr\u00e1s que <a href=\"\/pricing?ui_step=70&ui_element=5\" target=\"{new_win_name}\" class=\"bold\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"pricing_link\" data-clog-ui-action=\"click\" data-clog-ui-step=\"file_upload\">suscribirte a un plan superior<\/a>.{{\/t}}\n\t\t\t\t{{else if_equal plan compare=\"enterprise\"}}\n\t\t\t\t\t{{#t\n\t\t\t\t\t\tnew_win_name=(newWindowName)\n\t\t\t\t\t\tnote=\"Shown when a user tries to upload a file after their team has reached storage limit\"\n\t\t\t\t\t}}Parece que tu organizaci\u00f3n ha alcanzado el l\u00edmite de almacenamiento de archivos. Si crees que se trata de un error, <a href=\"\/help\/requests\/new\" target=\"{new_win_name}\" class=\"bold\">ponte en contacto con Slack<\/a>.{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t\n\t\t\t\t\t\tnew_win_name=(newWindowName)\n\t\t\t\t\t\tnote=\"Shown when a user tries to upload a file after their team has reached storage limit\"\n\t\t\t\t\t}}Tu espacio de trabajo ha alcanzado el l\u00edmite de almacenamiento del plan Gratuito. Para a\u00f1adir m\u00e1s archivos a Slack, tendr\u00e1s que <a href=\"\/pricing?ui_step=70&ui_element=5\" target=\"{new_win_name}\" class=\"bold\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"pricing_link\" data-clog-ui-action=\"click\" data-clog-ui-step=\"file_upload\">suscribirte a un plan de pago<\/a>.{{\/t}}\n\t\t\t\t{{\/if_equal}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\n\t\t<div id=\"upload_image_preview\" class=\"hidden bottom_margin\">\n\t\t\t<img src=\"\" alt=\"{{#t note=\"Text description of the image preview for the file for users who are visually impaired\"}}Vista previa de {filename}{{\/t}}\" \/>\n\t\t<\/div>\n\n\t\t<p>\n\t\t\t<label for=\"upload_file_title\" class=\"inline_block\">{{#t note=\"Label for the title used to describe the file\"}}T\u00edtulo{{\/t}}<\/label>\n\t\t\t<input id=\"upload_file_title\" name=\"upload_file_title\" type=\"text\" class=\"small title_input\" value=\"{{title}}\" aria-describedby=\"upload_file_title_instructions\" \/>\n\t\t\t<span id=\"upload_file_title_instructions\" class=\"modal_input_note\">\n\t\t\t\t{{#t}}Un t\u00edtulo es la manera m\u00e1s f\u00e1cil de buscar un archivo: te recomendamos usar t\u00edtulos descriptivos.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<input id=\"upload_file_name\" name=\"upload_file_name\" type=\"hidden\" {{#if has_name}}disabled=\"disabled\"{{else}}{{\/if}} class=\"filename_input\" value=\"{{filename}}\" \/>\n\t\t<\/p>\n\n\t\t{{{sharing_html}}}\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<div class=\"upload_actions\">\n\t\t\t{{#if file_retention_type}}\n\t\t\t\t<div class=\"modal_input_note_full_width small_bottom_margin align_right\">\n\t\t\t\t\t{{#t}}Debido a tu pol\u00edtica de retenci\u00f3n de archivos personalizada <br \/>, este archivo se eliminar\u00e1 despu\u00e9s de <span class=\"bold\">{file_retention_duration}<\/span>.{{\/t}}\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t\t{{#if more_in_queue}}<button type=\"button\" class=\"btn btn_outline dialog_cancel_all\">{{#t note=\"Label for the button that cancels uploading all files when multiple files have been selected for upload.\"}}Cancelar todo{{\/t}}<\/button>{{\/if}}\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\">{{#t note=\"Label for the cancel button that cancels uploading of the file and closes the dialog\"}}Cancelar{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn dialog_go\">{{#t note=\"Label for the button that confirms the file should be uploaded\"}}Subir{{\/t}}<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">{{#t note=\"Inline confirmation message displayed if the dialog is dismissed\"}}Si cierras la ventana se eliminar\u00e1 el comentario.{{\/t}}<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_go\">{{#t note=\"Label for the cancel button accompanying the inline confirmation message. Cancels the request to close the dialog.\"}}Cancelar{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">{{#t note=\"Label for a button accompanying the inline confirmation message. Closes the dialog without saving changes.\"}}Cerrar ventana{{\/t}}<\/button>\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['gdrive_create_dialog'] = "{{i18n_ns 'google_drive'}}\n\n<p>\n\t<label for=\"document_title\" class=\"inline_block\">{{#t}}T\u00edtulo{{\/t}}<\/label>\n\t<input id=\"document_title\" name=\"document_title\" type=\"text\" class=\"small title_input\" value=\"\" tabindex=\"1\" maxlength=\"255\" \/>\n\t<span class=\"modal_input_note\">\n\t\t{{#t}}Un t\u00edtulo es la manera m\u00e1s f\u00e1cil de buscar un archivo: te recomendamos usar t\u00edtulos descriptivos.{{\/t}}\n\t<\/span>\n<\/p>\n\n{{sharing_html}}";
TS.raw_templates['share_dialog'] = "\t{{i18n_ns \"share_dialog\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>\n\t\t\t{{#if_equal type compare='file'}}{{#t}}Compartir archivo{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_snippet'}}{{#t}}Compartir extracto{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_post'}}{{#t}}Compartir nota{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_space'}}{{#t}}Compartir nota{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_arugula'}}{{#t}}Compartir r\u00facula{{\/t}}{{\/if_equal}}\n\t\t<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<input type=\"hidden\" id=\"share_type\" value=\"{{type}}\" \/>\n\t\t<input type=\"hidden\" id=\"share_item_id\" value=\"{{item.id}}\" \/>\n\n\t\t{{file_html}}\n\n\t\t{{sharing_html}}\n\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t{{#if show_copy_link}}\n\t\t\t<button class=\"btn btn_outline inline_flex ts_icon ts_icon_link ts_tip ts_tip_top ts_tip_float ts_tip_align_left ts_tip_multiline\" data-action=\"copy_link\" data-link=\"{{item.permalink}}\">\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">\n\t\t\t\t\t\t{{#if item.is_public}}\n\t\t\t\t\t\t\t{{#t}}Copia un enlace al archivo.<br>Para compartir, p\u00e9galo donde quieras.{{\/t}}\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t{{#t}}Copia un enlace al archivo.<br>Como es privado, no puedes compartirlo en todos lados.{{\/t}}\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/button>\n\t\t{{\/if}}\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">{{#t}}Cancelar{{\/t}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go\" tabindex=\"2\">{{#t}}Compartir{{\/t}}<\/button>\n\t<\/div>\n";
TS.raw_templates['snippet_dialog'] = "\t{{i18n_ns \"snippet\"}}\n\n\t{{!-- hbslint-disable syntax --}}\n\t{{!-- Todo: enable syntax linter and enable safeString --}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if is_edit}}{{#t}}Editar extracto{{\/t}}{{else}}{{#t}}Crear extracto{{\/t}}{{\/if}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<form action=\"\" id=\"client_file_snippet\" method=\"post\" accept-encoding=\"UTF-8\" onsubmit=\"return false;\" class=\"no_bottom_margin\">\n\n\t\t\t<div class=\"top_margin\">\n\t\t\t\t<label id=\"client_file_snippet_select_label\" class=\"select small float_right no_right_padding\">\n\t\t\t\t\t<select name=\"filetype\" id=\"client_file_snippet_select\" name=\"client_file_snippet_select\" class=\"small no_top_margin\">\n\t\t\t\t\t\t<option value=\"auto\">{{#t}}Autodetectar{{\/t}}<\/option>\n\t\t\t\t\t\t{{#each codemirror_types}}\n\t\t\t\t\t\t\t<option value=\"{{this.type}}\">{{this.label}}<\/option>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t\t<input type=\"text\" id=\"client_file_snippet_title_input\" class=\"small\" name=\"client_file_snippet_title_input\" value=\"\" placeholder=\"{{#t}}T\u00edtulo (optativo){{\/t}}\" \/>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"top_margin bottom_margin\">\n\t\t\t\t<textarea name=\"content\" wrap=\"virtual\" id=\"client_file_snippet_textarea\" class=\"client_file_snippet_textarea full_width{{#unless is_edit}} create_snippet{{\/unless}}\"><\/textarea>\n\t\t\t\t<label class=\"checkbox normal mini float_right no_min_width\" style=\"margin-top: 3px; padding-right: 0; width: auto;\">\n\t\t\t\t\t<input type=\"checkbox\" id=\"client_file_wrap_cb\" {{#if wrap_lines}}checked{{\/if}}> {{#t note=\"Refers to line wraps \/ breaks when writing code in a snippet\"}}ajustar{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t<\/div>\n\n\t\t\t{{{sharing_html}}}\n\n\t\t<\/form>\n\n\t<\/div>\n\n\t<div class=\"modal-footer\">\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">\n\t\t\t\t{{#if is_edit}}\n\t\t\t\t\t{{#t}}Por favor confirma que quieres descartar los cambios.{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Por favor confirma que quieres descartar este extracto.{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel_decline\">{{#t}}No, cons\u00e9rvalo{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">\n\t\t\t\t{{#if is_edit}}\n\t\t\t\t\t{{#t}}S\u00ed, descarta los cambios{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}S\u00ed, descarta este extracto{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-action\">\n\t\t\t<a class=\"btn btn_outline cancel\" data-dismiss=\"modal\" tabindex=\"3\">{{#t}}Cancelar{{\/t}}<\/a>\n\t\t\t{{#if is_edit}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top ts_tip_hide ts_tip_multiline ts_tip_float\" tabindex=\"2\">\n\t\t\t\t{{#t note=\"Button on snippet dialog\"}}Guardar cambios{{\/t}}\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t note=\"Tooltip for 'Save changes' button on snippet dialog\"}}A\u00f1ade texto antes de guardar los cambios{{\/t}}<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/a>\n\t\t\t{{\/if}}\n\t\t\t{{#unless is_edit}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top ts_tip_multiline ts_tip_float\" tabindex=\"2\">\n\t\t\t\t{{#t note=\"Button on snippet dialog\"}}Crear extracto{{\/t}}\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t note=\"Tooltip for 'Create Snippet' button on snippet dialog\"}}A\u00f1ade texto antes de guardar el extracto{{\/t}}<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/a>\n\t\t\t{{\/unless}}\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['growl_prompt_overlay'] = "\t{{i18n_ns \"notifications\"}}\n\n\t<div id=\"growl_prompt_overlay\">\n\n\t\t<div id=\"growl_prompt_overlay_impossible\" class=\"hidden\">\n\t\t\t<h3>{{#t}}El navegador que usas no permite notificaciones para el ordenador.{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}Cuando alguien te mencione o te mande un mensaje directo en Slack, te enviaremos una notificaci\u00f3n al ordenador.{{\/t}}<\/p>\n\t\t\t<p>{{#t new_win_name=(newWindowName)}}Si deseas recibir notificaciones de Slack en el ordenador, puedes usar un navegador compatible (como <a href=\"http:\/\/www.google.com\/chrome\/\" class=\"bold\">Google Chrome<\/a>) o descargar una de nuestras <a href=\"\/downloads\" class=\"bold\" target=\"{new_win_name}\">aplicaciones para ordenador<\/a>.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"large_top_margin no_bottom_margin\">\n\t\t\t\t<a href=\"\/downloads\" class=\"btn btn_small  see-apps\" target=\"{{newWindowName}}\">{{#t note=\"Invites user to see our desktop app offerings, or dismiss the overlay with 'Not for me'\"}}Descarga nuestras aplicaciones<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">o<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">No son lo m\u00edo{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_start\" class=\"hidden\">\n\t\t\t<h3>{{#t}}\u00bfDeseas activar las notificaciones para ordenador?{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}Cuando alguien te mencione o te mande un mensaje directo en Slack, te enviaremos una notificaci\u00f3n al ordenador.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_allow btn btn_small \">{{#t}}S\u00ed, activar notificaciones<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">o<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">No, no activarlas{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_tell_to_allow\" class=\"hidden\">\n\t\t\t<i class=\"ts_icon ts_icon_arrow_circle_up block float_right\" style=\"font-size: 3.5rem; margin: 0 1rem 0 0;\"><\/i>\n\t\t\t<h3>{{#t}}\u00bfDeseas activar las notificaciones para ordenador?{{\/t}}<\/h3>\n\t\t\t<p class=\"no_bottom_margin\">{{#t}}Haz clic en <strong>Permitir<\/strong> para activar las notificaciones para ordenador.{{\/t}}<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_success\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Notificaciones para ordenador activadas{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}Cuando alguien te mencione o te mande un mensaje directo en Slack, te enviaremos una notificaci\u00f3n al ordenador.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_test btn btn_small \">{{#t}}Enviarme una notificaci\u00f3n de prueba<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">o<\/span>\n\t\t\t\t<a class=\"prompt_cancel\">He terminado{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_disallowed\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Notificaciones para ordenador desactivadas{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}Has optado por no permitir las notificaciones para ordenador. Tendr\u00e1s que actualizar las preferencias del navegador para activarlas.{{\/t}}<\/p>\n\t\t\t<p><a class=\"prompt_cancel btn btn_small float_right\">{{#t}}Aceptar{{\/t}}<\/a><\/p>\n\t\t\t<div class=\"clear_both\"><\/div>\n\t\t<\/div>\n\n\t<\/div>\n";
TS.raw_templates['channel_invite_list'] = "{{i18n_ns 'channel_invite'}}\n\n<p class=\"top_margin no_bottom_margin invite_channels\">\n\t\t<label for=\"select_invite_channels\" class=\"auto_width inline_block lazy_filter_select\">\n\t\t\t{{#t}}A\u00f1adir a{{\/t}}\n\t\t<\/label>\n\t\t<select id=\"select_invite_channels\" name=\"select_invite_channels\" class=\"file_share_select no_margin\">\n\t\t\t\t<option value=\"ts_null_value\">{{#t}}Seleccionar un canal{{\/t}}<\/option>\n\t\t\t\t{{#each channels}}\n\t\t\t\t\t\t<option value=\"{{this.id}}\">{{makeModelObNameForDisplay this}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t<\/select>\n\t\t<span class=\"modal_input_note hidden warning_already_member block\">\n\t\t\t{{#t}}{name} ya es miembro de este canal.{{\/t}}\n\t\t<\/span>\n<\/p>\n\n";
TS.raw_templates['group_member_invite_list'] = "{{i18n_ns \"invite\"}}\n\n<div id=\"group_invite_archives_prompt\">\n\t{{#t fallback_hash='c6a8f42380529dfdf5533399d345bce84658c5ea'}}\n\t\t<p>Los nuevos miembros podr\u00e1n ver todo el historial de <b>{channel_name}<\/b>, incluido cualquier archivo que se haya compartido. Si lo prefieres, tambi\u00e9n puedes crear un nuevo canal.<\/p>\n\n\t\t<label for=\"use_existing_channel\" class=\"c-label c-label--inline c-label--pointer\">\n\t\t\t<input type=\"radio\" class=\"c-input_radio\" name=\"group_invite_action\" id=\"use_existing_channel\" value=\"use_existing_channel\" checked>\n\t\t\t<span class=\"c-label__text\">\n\t\t\t\tInvitar a {channel_name}\n\t\t\t\t<p class=\"normal\">A\u00f1adir nuevos miembros a este canal.<\/p>\n\t\t\t<\/span>\n\t\t<\/label>\n\n\t\t<label for=\"create_new_channel\" class=\"c-label c-label--inline c-label--pointer\">\n\t\t\t<input type=\"radio\" class=\"c-input_radio\" name=\"group_invite_action\" id=\"create_new_channel\" value=\"create_new_channel\" data-qa=\"create_new_radio\">\n\t\t\t<span class=\"c-label__text\">\n\t\t\t\t<b>Crear un nuevo canal<\/b>\n\t\t\t\t<p class=\"normal\">Slack archivar\u00e1 el canal e invitar\u00e1 autom\u00e1ticamente a todos sus miembros a un nuevo canal.<\/p>\n\t\t\t<\/span>\n\t\t<\/label>\n\t{{\/t}}\n<\/div>\n";
TS.raw_templates['channel_conversion_dialog'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}Al convertir <strong>#{name}<\/strong> en un canal cerrado, se conservar\u00e1n el historial y su lista de miembros.{{\/t}}<\/p>\n<p class=\"small_bottom_margin\"><strong>{{#t}}Un par de cosas que debes saber:{{\/t}}<\/strong><\/p>\n<ul>\n\t<li>{{#t}}Esta conversi\u00f3n no tiene vuelta atr\u00e1s. Es una calle de un \u00fanico sentido.{{\/t}}<\/li>\n\t<li>{{#t}}Los archivos compartidos anteriormente en este canal no pasar\u00e1n a ser privados. Los dem\u00e1s miembros de tu equipo continuar\u00e1n teniendo acceso p\u00fablico a ellos. {{\/t}}<\/li>\n<\/ul>\n<p>{{#t}}Por favor confirma que quieres convertir <strong>#{name}<\/strong> en un canal cerrado.{{\/t}}<\/p>\n";
TS.raw_templates['channel_deletion_dialog'] = "{{i18n_ns 'web_channel'}}\n\n<p>{{#t}}\u00bfDe verdad que quieres eliminar <strong>{name}<\/strong>? Todo su contenido se eliminar\u00e1 de tus archivos de Slack, y no podr\u00e1s restaurar el contenido una vez eliminado.{{\/t}}<\/p>\n<p class=\"large_left_margin no_bottom_margin\">\n    <label class=\"checkbox normal\" style=\"font-size: 1rem;\">\n        <input id=\"delete_channel_cb\" type=\"checkbox\" class=\"small_right_margin\" \/>\n        {{#t}}S\u00ed, estoy totalmente seguro{{\/t}}\n    <\/label>\n<\/p>\n";
TS.raw_templates['channel_option_archive'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}Archivar es \u00fatil si piensas que ya no vas a necesitar este canal. Esto es lo que pasar\u00e1 cuando archives este canal:{{\/t}}<\/p>\n<ul>\n\t<li>{{#t}}Nadie podr\u00e1 publicar mensajes en \u00e9l{{\/t}}<\/li>\n\t<li>{{#t}}Se desactivar\u00e1n todas las aplicaciones que se hayan instalado{{\/t}}<\/li>\n\t<li>{{#t}}Se publicar\u00e1 un mensaje indicando que lo has archivado{{\/t}}<\/li>\n<\/ul>\n\n<p>{{#t}}Los mensajes de canales archivados continuar\u00e1n apareciendo en la b\u00fasqueda y en los archivos, tal como ocurre en la actualidad. Y si m\u00e1s adelante llegas a volver a necesitarlos, siempre puedes desarchivarlos.{{\/t}}<\/p>\n\n<p>{{#t name=name}}\u00bfDe verdad que quieres archivar {name}?{{\/t}}<\/p>\n";
TS.raw_templates['channel_share_dialog_create'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__contents\">\n\n\t<h3 class=\"p-share_channel_dialog__subheading\">\n\t\t\t{{#t}}Paso 1 de 2{{\/t}}\n\t<\/h3>\n\n\t<h1 class=\"p-share_channel_dialog__heading\">\n\t\t\t{{#t}}Crear un canal compartido{{\/t}}\n\t<\/h1>\n\n\t<p class=\"p-share_channel_dialog__description{{#feature flag=\"feature_shared_channels_enterprise\"}}{{#feature flag=\"feature_tinyspeck\"}} margin_bottom_125{{\/feature}}{{\/feature}}\">\n\t\t{{#t}}En primer lugar, elige un nombre y unos ajustes de privacidad para tu canal.{{\/t}}\n\t<\/p>\n\t{{#feature flag=\"feature_shared_channels_enterprise\"}}{{#feature flag=\"feature_tinyspeck\"}}\n\t<div class=\"c-alert c-alert--boxed c-alert--level_error margin_bottom_200\">\n\t\t<i class=\"c-icon c-icon--warning c-icon--inline c-alert__icon\"><\/i>\n\t\t<span class=\"c-alert__message\">{{#t}}Shared Channels should only be created for our partnership with Last Mile. If you have questions, please reach out to Izzy in <a href=\"https:\/\/slack-pde.slack.com\/messages\/C1Y40HYP6\">#feat-shared-channels<\/a>{{\/t}}<\/span>\n\t<\/div>\n\t{{\/feature}}{{\/feature}}\n\n\t<div class=\"medium_bottom_margin\">\n\t\t<label class=\"radio\">\n\t\t\t<input\n\t\t\t\ttype=\"radio\"\n\t\t\t\tname=\"channel_privacy\"\n\t\t\t\tvalue=\"public\"\n\t\t\t\t{{#unless is_private}}\n\t\t\t\t\tchecked=\"checked\"\n\t\t\t\t\taria-checked=\"true\"\n\t\t\t\t{{\/unless}}\n\t\t\t\/>{{#t}}P\u00fablico <span class=\"normal small_left_margin\">Cualquier miembro de tu espacio de trabajo puede unirse<\/span>{{\/t}}\n\t\t<\/label>\n\t\t<label class=\"radio small_top_margin {{#if disable_private_option}}disabled ts_tip ts_tip_top ts_tip_float ts_tip_multiline ts_tip_hidden{{\/if}}\">\n\t\t\t<input\n\t\t\t\ttype=\"radio\"\n\t\t\t\tname=\"channel_privacy\"\n\t\t\t\tvalue=\"private\"\n\t\t\t\t{{#if disable_private_option}}\n\t\t\t\t\tdisabled=\"disabled\"\n\t\t\t\t\taria-disabled=\"true\"\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if is_private}}\n\t\t\t\t\tchecked=\"checked\"\n\t\t\t\t\taria-checked=\"true\"\n\t\t\t\t{{\/if}}\n\t\t\t\/>{{#t note=\"Channel privacy option\"}}Privado <span class=\"normal small_left_margin\">Este canal solo permite unirse o verse por invitaci\u00f3n<\/span>{{\/t}}\n\n\t\t\t{{#if disable_private_option}}\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t}}Solo los propietarios de un espacio de trabajo<br\/>pueden crear un canal cerrado{{\/t}}<\/span>\n\t\t\t\t<\/span>\n\t\t\t{{\/if}}\n\t\t<\/label>\n\n\t\t<div class=\"c-alert c-alert--boxed c-alert--level_warning top_margin hidden\" data-alert=\"private_channel\">\n\t\t\t<ts-icon class=\"c-alert__icon c-deprecated-icon c-icon--warning\"><\/ts-icon>\n\t\t\t<div class=\"c-alert__message\">\n\t\t\t\t{{#t}}<strong>Nota:<\/strong> este ajuste se aplica solo a <strong>{team.name}<\/strong>. En un canal compartido, cada espacio de trabajo puede elegir sus propios ajustes de privacidad.{{\/t}}\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"medium_bottom_margin\">\n\t\t<label for=\"channel_name\" class=\"block align_left\">{{#t}}Nombre{{\/t}}<\/label>\n\t\t<div class=\"channel_modal_title_input_container\">\n\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon hidden\" \/>\n\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon\" \/>\n\t\t\t<input\n\t\t\t\tname=\"channel_name\"\n\t\t\t\ttype=\"text\"\n\t\t\t\tclass=\"lowercase title_input large_left_padding tiny_bottom_margin\"\n\t\t\t\tplaceholder=\"{{#t note=\"placeholder for a channel name input\"}}p. ej. clientes{{\/t}}\"\n\t\t\t\tdata-input=\"channel_name\"\n\t\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\t\tdata-validation-for=\"channel_name\"\n\t\t\t\tdata-validation-success=\"\"\n\t\t\t\tautocapitalize=\"off\"\n\t\t\t\tautocorrect=\"off\"\n\t\t\t\tautocomplete=\"off\"\n\t\t\t\tvalue=\"{{channel_name}}\"\n\t\t\t\/>\n\t\t<\/div>\n\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t{{#feature flag=\"feature_longer_channel_names\"}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 81 caracteres.{{\/t}}{{else}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 22 caracteres.{{\/t}}{{\/feature}}\n\t\t<\/span>\n\t<\/div>\n\n\t<div class=\"large_bottom_margin\">\n\t\t<label for=\"invite_members_input\" class=\"block align_left\">\n\t\t\t{{#t}}Invitar a otros <span class=\"normal\">(optativo)<\/span>{{\/t}}\n\t\t<\/label>\n\t\t<div class=\"p-share_channel_dialog__invite_people_wrapper\">\n\t\t\t<div id=\"invite_people_picker\"><\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t{{> shared_channels_retention_disclaimer}}\n<\/div>\n";
TS.raw_templates['channel_stop_sharing_dialog'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-stop_sharing_channel_dialog__contents\">\n\t<div class=\"p-stop_sharing_channel_dialog__last_channel_alert c-alert c-alert--inline c-alert--level_error hidden{{#if full_screen}} large_bottom_margin{{else}} very_small_top_margin bottom_margin{{\/if}}\">\n\t\t<div class=\"c-alert__message\">\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t<strong>\n\t\t\t\t\t{{#t team_names=(makeTeamNameList model_ob.shared_team_ids)}}Este es tu \u00fanico canal compartido con <span class=\"p-stop_sharing_channel_dialog__last_channel_team_names\">{team_names}<\/span>{{\/t}}\n\t\t\t\t<\/strong>\n\t\t\t<\/p>\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t{{#t}}Si dejas de compartir este canal, no podr\u00e1s enviar mensajes directos a los miembros de su espacio.{{\/t}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"p-stop_sharing_channel_dialog__description\">\n\t\t<p>\n\t\t\t{{#t}}Puedes dejar de compartir este canal cuando quieras. Esto es lo que pasar\u00e1:{{\/t}}\n\t\t<\/p>\n\n\t\t{{> shared_channels_disconnect_channel_expectations}}\n\n\t\t<p class=\"{{#if full_screen}}large_bottom_margin{{else}}no_bottom_margin{{\/if}}\">\n\t\t\t{{#if model_ob.shared_team_ids.length}}\n\t\t\t\t{{#t team_names=(makeTeamNameList model_ob.shared_team_ids strong=true) channel_name=(makeModelObNameForDisplay model_ob inherit_font_size=true)}}\u00bfDe verdad que quieres dejar de compartir <strong>{channel_name}<\/strong> con {team_names}?{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t team_names=(makeTeamNameList model_ob.pending_shared strong=true) channel_name=(makeModelObNameForDisplay model_ob inherit_font_size=true)}}\u00bfDe verdad que quieres dejar de compartir <strong>{channel_name}<\/strong> con {team_names}?{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_stop_sharing_private_channels_dialog'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-stop_sharing_channel_dialog__contents\">\n\t<p class=\"c-alert c-alert--boxed c-alert--level_error\">\n\t\t<i class=\"c-alert__icon c-deprecated-icon c-icon--warning\" \/>\n\t\t<span class=\"c-alert__message\">{{#t}}<strong>Esta operaci\u00f3n no se podr\u00e1 deshacer<\/strong>. Por favor, revisa la siguiente informaci\u00f3n.{{\/t}}<\/span>\n\t<\/p>\n\n\t<p><strong>{{#t note=\"Note about the consequences of disconnecting multiple channels\"}}Esto es lo que pasar\u00e1:{{\/t}}<\/strong><\/p>\n\n\t<ul>\n\t\t<li>{{#t}}{current_team_name} y {target_team_name} conservar\u00e1n copias independientes de cada canal.{{\/t}}<\/li>\n\t\t<li>{{#t}}Cada espacio de trabajo podr\u00e1 seguir utilizando sus copias.{{\/t}}<\/li>\n\t\t<li>{{#t}}No podr\u00e1s volver a compartir ninguno de estos canales.{{\/t}}<\/li>\n\t<\/ul>\n\n\t<p><strong>{{#t note=\"A list of the channels being disconnecting\"}}Vas a dejar de compartir:{{\/t}}<\/strong><\/p>\n\n\t<ul>\n\t\t<li>{{#t}}{num_private_channels, plural, =1 {# canal cerrado} other {# canales cerrados}}{{\/t}}<\/li>\n\t<\/ul>\n\n\t<label class=\"p-stop_sharing_channel_dialog__label\">\n\t\t<input\n\t\t\ttype=\"checkbox\"\n\t\t\tid=\"confirm_stop_sharing_private_non_member_channels\"\n\t\t\trequired\n\t\t\/>\n\t\t<strong>{{#t note=\"Confirmation checkbox for disconnecting multiple shared channels\"}}S\u00ed, dejar de compartir {num_private_channels, plural, =1 {# canal cerrado} other {# canales cerrados}} con {target_team_name}{{\/t}}<\/strong>\n\t<\/label>\n<\/div>\n";
TS.raw_templates['channel_share_dialog_invite'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__contents\">\n\n\t{{#if show_heading}}\n\t\t<h3 class=\"p-share_channel_dialog__subheading\">\n\t\t\t{{#t}}Paso 2 de 2{{\/t}}\n\t\t<\/h3>\n\n\t\t<h1 class=\"p-share_channel_dialog__heading\">\n\t\t\t{{#t}}Enviar una invitaci\u00f3n{{\/t}}\n\t\t<\/h1>\n\t{{\/if}}\n\n\t{{#feature flag=\"feature_shared_channels_enterprise\"}}{{#feature flag=\"feature_tinyspeck\"}}\n\t<div class=\"c-alert c-alert--boxed c-alert--level_error margin_bottom_125\">\n\t\t<i class=\"c-icon c-icon--warning c-icon--inline c-alert__icon\"><\/i>\n\t\t<span class=\"c-alert__message\">{{#t}}Shared Channels should only be created for our partnership with Last Mile. If you have questions, please reach out to Izzy in <a href=\"https:\/\/slack-pde.slack.com\/messages\/C1Y40HYP6\">#feat-shared-channels<\/a>{{\/t}}<\/span>\n\t<\/div>\n\t{{\/feature}}{{\/feature}}\n\n\t{{#if sharing_existing_channel}}\n\t\t{{> shared_channels_retention_disclaimer}}\n\n\t\t<p class=\"p-share_channel_dialog__description--channel-options-menu\">\n\t\t\t<div class=\"c-alert c-alert--boxed c-alert--level_warning bottom_margin\">\n\t\t\t\t<ts-icon class=\"c-alert__icon c-deprecated-icon c-icon--warning\"><\/ts-icon>\n\t\t\t\t<div class=\"c-alert__message p-share_channel_dialog__share_existing_warning\">\n\t\t\t\t\t{{#t}}Esto permitir\u00e1 que otro espacio de trabajo acceda a todos los archivos, mensajes y aplicaciones en <strong>{channel_name}<\/strong>.{{\/t}} <a class=\"link\" onClick=\"TS.ui.share_channel_dialog.start()\">{{#t}}Compartir en su lugar un nuevo canal{{\/t}}<\/a>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"c-alert c-alert--boxed c-alert--level_error large_bottom_margin hidden\" data-label=\"shared_channel_form_error\">\n\t\t\t\t<ts-icon class=\"c-alert__icon c-deprecated-icon c-icon--warning\"><\/ts-icon>\n\t\t\t\t<span data-label=\"shared_channel_form_error_label\"><\/span>\n\t\t\t<\/div>\n\n\t\t\t{{#t}}Para compartir este canal, necesitar\u00e1s la informaci\u00f3n de contacto de un administrador del otro espacio de trabajo.{{\/t}}\n\t\t<\/p>\n\n\t{{else}}\n\t\t<p class=\"p-share_channel_dialog__description\">\n\t\t\t{{#t}}Despu\u00e9s, invita a otro espacio de trabajo. Necesitar\u00e1s la informaci\u00f3n de contacto de un administrador, que recibir\u00e1 la invitaci\u00f3n a trav\u00e9s del Slackbot.{{\/t}}\n\t\t<\/p>\n\n\t\t<div class=\"c-alert c-alert--boxed c-alert--level_error large_bottom_margin hidden\" data-label=\"shared_channel_form_error\">\n\t\t\t<ts-icon class=\"c-alert__icon c-deprecated-icon c-icon--warning\"><\/ts-icon>\n\t\t\t<span data-label=\"shared_channel_form_error_label\"><\/span>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{> channel_share_dialog_invite_fields}}\n\n\t{{#if sharing_existing_channel}}\n\t\t<p class=\"align_right large_top_margin\">\n\t\t\t<button class=\"btn btn_large btn_outline btn cancel_share\" type=\"button\">{{#t}}Cancelar{{\/t}}<\/button>\n\t\t\t<button class=\"btn btn_large ladda-button submit\" data-style=\"expand-right\">{{#t note=\"Form submit button label\"}}Compartir canal{{\/t}}<\/button>\n\t\t<\/p>\n\t{{\/if}}\n\n<\/div>\n";
TS.raw_templates['channel_cancel_share_invite_dialog'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-channel_cancel_share_invite_dialog__contents\">\n\t<p class=\"p-cancel_share_invite_dialog__description\">\n\t\t{{#if_equal action compare=\"revoke\"}}\n\t\t\t{{#t}}En un principio, esta invitaci\u00f3n la envi\u00f3 <strong>{inviter_name}<\/strong> a <strong>{target_team.name}<\/strong>. \u00bfDe verdad quieres cancelarla?{{\/t}}\n\t\t{{\/if_equal}}\n\n\t\t{{#if_equal action compare=\"decline\"}}\n\t\t\t{{#t}}En un principio, esta invitaci\u00f3n la envi\u00f3 <strong>{inviting_team_name}<\/strong> a <strong>{receiving_user_name}<\/strong>. \u00bfDe verdad quieres rechazarla?{{\/t}}\n\t\t{{\/if_equal}}\n\t<\/p>\n<\/div>\n";
TS.raw_templates['channel_share_dialog_invite_fields'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"medium_bottom_margin\">\n\t<label class=\"p-share_channel_dialog__input_label\" for=\"email_address\">\n\t\t<span class=\"inline_block small_right_margin\">{{#t note=\"Input label for share channel form\"}}Direcci\u00f3n de correo electr\u00f3nico del administrador{{\/t}}<\/span>\n\t<\/label>\n\t<div class=\"p-share_channel_dialog__input_wrapper\">\n\t\t<input\n\t\t\tclass=\"tiny_bottom_margin\"\n\t\t\ttype=\"text\"\n\t\t\tname=\"email_address\"\n\t\t\tplaceholder=\"{{#t}}jane@acme-corp.com{{\/t}}\"\n\t\t\tdata-input=\"email_address\"\n\t\t\tdata-validation=\"is_email=fix\"\n\t\t\tdata-validation-for=\"email_address\"\n\t\t\tdata-validation-success=\"\"\n\t\t\t{{#if email_address}}value={{email_address}}{{\/if}}\n\t\t\/>\n\t<\/div>\n<\/div>\n\n<div class=\"medium_bottom_margin\">\n\t<label class=\"p-share_channel_dialog__input_label\" for=\"team_url\">\n\t\t{{#t note=\"Input label for share channel form\"}}URL de Slack{{\/t}}\n\t<\/label>\n\t<div class=\"p-share_channel_dialog__input_wrapper\">\n\t\t<input\n\t\t\tclass=\"p-share_channel_dialog__team_url tiny_bottom_margin\"\n\t\t\ttype=\"text\"\n\t\t\tname=\"team_url\"\n\t\t\tplaceholder=\"{{#t}}acme-corp{{\/t}}\"\n\t\t\tdata-validation=\"required\"\n\t\t\tdata-input=\"team_url\"\n\t\t\t{{#if team_url}}value={{team_url}}{{\/if}}\n\t\t\/>\n\t\t<span class=\"p-share_channel_dialog__team_url_suffix\">\n\t\t\t.slack.com\n\t\t<\/span>\n\t<\/div>\n\t<span class=\"modal_input_note margin_auto\">\n\t\t{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}\n\t\t\t<a href=\"https:\/\/get.slack.help\/hc\/{locale}\/articles\/221769328-Find-your-Slack-team-URL?{hcTrackingToken}\" target=\"_blank\">\u00bfQu\u00e9 es una URL de Slack?<\/a>\n\t\t{{\/t}}\n\t<\/span>\n<\/div>\n\n<div class=\"small_bottom_margin\">\n\t<label class=\"p-share_channel_dialog__input_label\" for=\"custom_message\">\n\t\t<span class=\"inline_block small_right_margin\">{{#t note=\"Input label for share channel form\"}}A\u00f1ade un mensaje{{\/t}}<\/span>\n\t<\/label>\n\n\t<div class=\"p-share_channel_dialog__custom_message_container\">\n\t\t<div class=\"p-share_channel_dialog__custom_message_user medium_bottom_margin\">\n\t\t\t<div class=\"c-unified_member c-unified_member--medium\">\n\t\t\t\t<span class=\"member_image\">\n\t\t\t\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs inviter 36 false true false)}}\n\t\t\t\t\t{{> member_type_external_badge size=36 badge_size=(getTeamBadgeSize size) with_tooltip=true}}\n\t\t\t\t<\/span>\n\t\t\t\t<div class=\"c-unified_member__flex-container--medium\">\n\t\t\t\t\t<div class=\"c-unified_member__name c-unified_member__name--medium\">\n\t\t\t\t\t\t<span class=\"c-unified_member__display-name c-unified_member__display-name--medium\">{{getPrefCompliantMemberName inviter}}<\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"c-unified_member__title c-unified_member__title--medium\">{{getTeamDisplayName team}}<\/div>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t<textarea\n\t\t\tclass=\"p-share_channel_dialog__custom_message_input\"\n\t\t\tname=\"custom_message\"\n\t\t\tdata-input=\"custom_message\"\n\t\t\tmaxlength=\"560\"\n\t\t\tdata-validation=\"hasnourl\"\n\t\t\tplaceholder=\"{{#t note=\"placeholder for a message input\"}}Por ej. Hola: Estoy trabajando en un proyecto con...{{\/t}}\"\n\t\t>{{#if custom_message}}{{custom_message}}{{\/if}}<\/textarea>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_share_dialog_invite_wrapper'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__channel_options_header\">\n        {{#t}}Compartir <strong>{channel_name}<\/strong> con otro espacio de trabajo{{\/t}}\n<\/div>\n\n{{> channel_share_dialog_invite }}\n";
TS.raw_templates['channel_share_dialog_request'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__contents\">\n\t\t<h1 class=\"share_channel_modal_heading\">\n\t\t\t{{#t}}Invitaci\u00f3n a un canal compartido{{\/t}}<\/h1>\n\t\t<\/h1>\n\n\t\t<p>{{#t}}<strong>{inviting_team.name}<\/strong> desea compartir un canal con tu espacio de trabajo.{{\/t}}<\/p>\n\n\t\t{{> shared_channels_retention_disclaimer}}\n\n\t\t<h2 class=\"large_top_margin\">{{#t}}Invitado(a) por{{\/t}}<\/h2>\n\n\t\t <div class=\"p-share_channel_request_dialog__inviter small_bottom_margin\">\n\t\t\t<div class=\"c-unified_member c-unified_member--large\">\n\t\t\t\t<span class=\"member_image\">\n\t\t\t\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs inviter 44 false true false)}}\n\t\t\t\t\t{{> member_type_external_badge size=44 team=inviting_team badge_size=(getTeamBadgeSize size) with_tooltip=true}}\n\t\t\t\t<\/span>\n\t\t\t\t<div class=\"c-unified_member__flex-container--large\">\n\t\t\t\t\t<div class=\"c-unified_member__name c-unified_member__name--large\">\n\t\t\t\t\t\t<span class=\"c-unified_member__display-name c-unified_member__display-name--large\">{{getPrefCompliantMemberName inviter}}<\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"c-unified_member__title c-unified_member__title--large\">{{getTeamDisplayName inviting_team}}<\/div>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t{{#if custom_message}}\n\t\t<div class=\"bottom_margin\">\n\t\t\t{{#t note=\"Custom message for a shared channel invitation, wrapped in quotes\" custom_message=custom_message}}\n\t\t\t\t\u201c{custom_message}\u201d\n\t\t\t{{\/t}}\n\t\t<\/div>\n\t\t{{\/if}}\n\n\t\t<h2 class=\"large_top_margin small_bottom_margin\">{{#t}}Informaci\u00f3n del canal{{\/t}}<\/h2>\n\t\t<p class=\"greigh large_bottom_margin\">\n\t\t\t{{#t}}Si lo deseas, puedes modificarlos. Estos cambios solo afectar\u00e1n a <strong>{team.name}<\/strong>.{{\/t}}\n\t\t<\/p>\n\n\t\t<div class=\"c-alert c-alert--boxed c-alert--level_error large_bottom_margin hidden\" data-label=\"shared_channel_form_error\">\n\t\t\t<ts-icon class=\"c-alert__icon c-deprecated-icon c-icon--warning\"><\/ts-icon>\n\t\t\t<span data-label=\"shared_channel_form_error_label\"><\/span>\n\t\t<\/div>\n\n\t\t<div class=\"medium_bottom_margin\">\n\t\t\t<label class=\"radio\">\n\t\t\t\t{{#t}}<input type=\"radio\" name=\"channel_privacy\" value=\"public\" checked=\"checked\" aria-checked=\"true\">Abierto <span class=\"normal small_left_margin\">Cualquier miembro de tu espacio de trabajo puede unirse<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t\t<label class=\"radio small_top_margin {{#if disable_private_option}}disabled ts_tip ts_tip_top ts_tip_float ts_tip_multiline ts_tip_hidden{{\/if}}\">\n\t\t\t\t<input\n\t\t\t\t\ttype=\"radio\"\n\t\t\t\t\tname=\"channel_privacy\"\n\t\t\t\t\tvalue=\"private\"\n\t\t\t\t\t{{#if disable_private_option}}\n\t\t\t\t\t\tdisabled=\"disabled\"\n\t\t\t\t\t\taria-disabled=\"true\"\n\t\t\t\t\t{{\/if}}\n\t\t\t\t\/>{{#t note=\"Channel privacy option\"}}Privado <span class=\"normal small_left_margin\">Este canal solo permite unirse o verse por invitaci\u00f3n<\/span>{{\/t}}\n\n\t\t\t\t{{#if disable_private_option}}\n\t\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t}}Solo los propietarios de un espacio de trabajo<br\/>pueden crear un canal cerrado{{\/t}}<\/span>\n\t\t\t\t\t<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t<\/label>\n\n\t\t\t<div class=\"alert alert_warning top_margin hidden\" data-alert=\"private_channel\">\n\t\t\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t\t\t{{#t}}<strong>Nota:<\/strong> este ajuste se aplica solo a <strong>{team.name}<\/strong>. En un canal compartido, cada espacio de trabajo puede elegir sus propios ajustes de privacidad.{{\/t}}\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t<div class=\"medium_bottom_margin\">\n\t\t\t<label for=\"channel_name\" class=\"p-share_channel_dialog__input_label\">\n\t\t\t\t<span class=\"inline_block small_right_margin\">{{#t}}Nombre{{\/t}}<\/span>\n\t\t\t<\/label>\n\t\t\t<div class=\"channel_modal_title_input_container no_margin\">\n\t\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon hidden\" \/>\n\t\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon\" \/>\n\t\t\t\t<input\n\t\t\t\t\tname=\"channel_name\"\n\t\t\t\t\ttype=\"text\"\n\t\t\t\t\tclass=\"lowercase title_input large_left_padding tiny_bottom_margin\"\n\t\t\t\t\tautocapitalize=\"off\"\n\t\t\t\t\tautocorrect=\"off\"\n\t\t\t\t\tautocomplete=\"off\"\n\t\t\t\t\tdata-input=\"channel_name\"\n\t\t\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\t\t\tdata-validation-for=\"channel_name\"\n\t\t\t\t\tdata-validation-success=\"\"\n\t\t\t\t\tvalue=\"{{channel_name}}\"\n\t\t\t\t\/>\n\t\t\t<\/div>\n\t\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t\t{{#feature flag=\"feature_longer_channel_names\"}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 81 caracteres.{{\/t}}{{else}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 22 caracteres.{{\/t}}{{\/feature}}\n\t\t\t<\/span>\n\t\t<\/div>\n\n\t\t<div>\n\t\t\t<label for=\"invite_members_input\" class=\"block align_left\">\n\t\t\t\t{{#t}}Invitar a otros <span class=\"normal\">(optativo)<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t\t<div class=\"p-share_channel_dialog__invite_people_wrapper\">\n\t\t\t\t<div id=\"invite_people_picker\"><\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t{{#if show_free_trial}}\n\t\t\t<div id=\"free_trial_container\" class=\"p-share_channel_dialog__free_trial_wrapper\">\n\t\t\t\t<div>\n\t\t\t\t\t<h3 class=\"p-share_channel_dialog__free_trial_heading black small_bottom_margin\">{{#t}}Para aceptar esta invitaci\u00f3n, inicia una prueba gratuita{{\/t}}<\/h3>\n\t\t\t\t\t<p class=\"p-share_channel_dialog__free_trial_paragraph\">{{#t}}Los canales compartidos son una funci\u00f3n beta de nuestros planes de pago, pero puedes probarlos gratis durante 30 d\u00edas con el plan Est\u00e1ndar. No se requiere tarjeta de cr\u00e9dito.{{\/t}}<\/p>\n\t\t\t\t\t<p class=\"p-share_channel_dialog__free_trial_paragraph\">{{#t}}<b>Nota<\/b>: Los canales compartidos est\u00e1n <a href=\"https:\/\/get.slack.help\/hc\/en-us\/articles\/115004152843-Shared-channel-beta-security-policies-\" target=\"_blank\" data-clog-event=\"UPGRDEXP_FREE_TRIAL_FOR_SC\" data-clog-ui-element=\"link_beta_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"shared_channels_invitation_modal\">actualmente en beta<\/a>, por lo que algunas funciones todav\u00eda no son compatibles.{{\/t}}<\/p>\n\t\t\t\t\t<div class=\"position_relative\">\n\t\t\t\t\t\t<div id=\"free_trial_checkbox_alert\" class=\"p-share_channel_dialog__checkbox_alert sk_warning_red_bg position_absolute\"><\/div>\n\t\t\t\t\t\t<input type=\"checkbox\" id=\"free_trial_checkbox\" class=\"no_top_margin p-share_channel_dialog__free_trial_checkbox\" name=\"accept_free_trial\" value=\"accept_free_trial\">\n\t\t\t\t\t\t<label for=\"free_trial_checkbox\" class=\"p-share_channel_dialog__free_trial_checkbox_label no_bottom_margin inline_block\"><b>{{#t}}Iniciar prueba de 30 d\u00edas{{\/t}}<\/b><\/label>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t{{\/if}}\n<\/div>\n";
TS.raw_templates['channel_share_dialog_error'] = "{{i18n_ns 'shared_channels'}}\n\n{{#if_equal error compare=\"invalid_target_domain\"}}\n    {{#t}}<strong>Parece que {target_domain}.slack.com no lo utiliza nadie.<\/strong> Si tienes la seguridad de haberlo escrito bien, tendr\u00e1s que pedir a tu contacto que compruebe la URL de Slack.{{\/t}}\n{{\/if_equal}}\n\n{{#if_equal error compare=\"shared_channel_invites_disabled\"}}\n    {{#t}}<strong>{target_domain}.slack.com no acepta invitaciones a canales compartidos.<\/strong> Puedes pedirle a su administrador que modifique este ajuste.{{\/t}}\n{{\/if_equal}}\n\n{{#if_equal error compare=\"not_in_shared_channels_beta\"}}\n    {{#t}}<strong>{target_domain}.slack.com no se ha unido a la versi\u00f3n beta de canales compartidos.<\/strong> Tendr\u00e1 que unirse primero para que puedas compartir un canal.{{\/t}}\n{{\/if_equal}}\n\n{{#if_equal error compare=\"target_team_is_enterprise\"}}\n    {{#t}}<strong>En la versi\u00f3n beta, no se pueden compartir canales con organizaciones en Enterprise Grid.<\/strong> Es uno de los peque\u00f1os inconvenientes que estamos intentando resolver. Pronto tendremos novedades.{{\/t}}\n{{\/if_equal}}\n";
TS.raw_templates['coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"coachmark\" class=\"normal hidden\">\n\t<div id=\"coachmark_callout\"><\/div>\n\t<div id=\"coachmark_interior\">\n\t\t{{#if has_close_btn}}\n\t\t<a class=\"coachmark_close_btn\">\n\t\t\t<i class=\"ts_icon ts_icon_times\"><\/i>\t\n\t\t<\/a>\n\t\t{{\/if}}\n\t\t{{! content divs are dynamically added depending on what type of coachmark is being shown }}\n\t\t{{#unless no_footer}}\n\t\t<div id=\"coachmark_footer\">\n\t\t\t<div class=\"coachmark_footer_text\">\n\t\t\t\t{{#t}}<span>\u00bfHas terminado? <\/span><a class=\"coachmark_skip_link\">Haz clic para omitir<\/a>{{\/t}}\n\t\t\t<\/div>\n\t\t\t<a class=\"btn coachmark_got_it float_right hidden\">{{#t}}\u00a1Entendido!{{\/t}}<\/a>\n\n\t\t\t<a class=\"btn coachmark_next_tip float_right\">{{#t}}Siguiente consejo{{\/t}}<\/a>\n\t\t<\/div>\n\t\t{{\/unless}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channels_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n{{!-- TODO: move to separate templates... so many conditions --}}\n<div id=\"channels_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">\n\t\t\t{{#t}}Los mensajes se publican en los canales{{\/t}}\n\t\t<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t<p>{{#t}}Los canales permiten ordenar las conversaciones de tu equipo y buscar en ellas. Puedes organizarlos por tema (#investigaci\u00f3n), grupo de trabajo (#ventas) o proyecto (#anuncio-tv-ventas).{{\/t}}<\/p>\n\t\t{{~else~}}\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t<p>\n\t\t\t\t\t{{~#if in_single_private_channel~}}\n\t\t\t\t\t\t{{#t}}Los canales permiten organizar las conversaciones de tu equipo por tema o grupo de trabajo. Como invitado,{{\/t}}\n\t\t\t\t\t\t{{#t}}tienes acceso a un canal, <span class=\"no_wrap\"><ts-icon class=\"ts_icon_lock\"><\/ts-icon><strong>{first_group_channel_name}<\/strong><\/span>. Es un canal cerrado y solo se puede unir quien reciba una invitaci\u00f3n.{{\/t}}\n\t\t\t\t\t{{~else if in_single_public_channel~}}\n\t\t\t\t\t\t{{#t}}Los canales permiten organizar las conversaciones de tu equipo por tema o grupo de trabajo. Como invitado, puedes enviar mensajes y explorar los archivos de un canal, <strong>{first_listed_channel}<\/strong>.{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#t}}Los canales organizan las conversaciones de tu equipo por tema o grupo de trabajo. Como invitado, puedes enviar mensajes y explorar los archivos de esta lista de canales.{{\/t}}\n\t\t\t\t\t{{~\/if~}}\n\t\t\t\t<\/p>\n\t\t\t{{~else~}}\n\t\t\t\t<p>{{#t}}Los canales permiten ordenar las conversaciones de tu equipo y buscar en ellas. Puedes organizarlos por tema (#investigaci\u00f3n), grupo de trabajo (#ventas) o proyecto (#anuncio-tv-ventas).{{\/t}}<\/p>\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['intl_channel_names_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"intl_channel_names_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t{{#t}}\n\t\t<h2 class=\"black\">Tus canales, tu idioma<\/h2>\n\t\t<p>Aqu\u00ed hay algo que puede resultarte \u00fatil: ahora los nombres de los canales pueden incluir caracteres de muchos m\u00e1s idiomas.<\/p>\n\t\t{{\/t}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['invites_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"invites_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Has terminado, ahora a a\u00f1adir compa\u00f1eros{{\/t}}<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t<p>{{#t}}\u00a1Para aprovechar Slack al m\u00e1ximo, invita a compa\u00f1eros y empieza a enviar mensajes!{{\/t}}<\/p>\n\t\t{{~else~}}\n\t\t\t<p>{{#t}}\u00a1Para aprovechar Slack al m\u00e1ximo, invita a m\u00e1s compa\u00f1eros y empieza a enviar mensajes!{{\/t}}<\/p>\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['direct_messages_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"direct_messages_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Enviar mensajes directos{{\/t}}<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t<p>{{#t}}\u00bfTienes que enviar un mensaje breve a una sola persona o a un grupo reducido? \u00a1Los mensajes directos son fant\u00e1sticos para eso!{{\/t}}<\/p>\n\t\t{{~else~}}\n\t\t\t<p>{{#t}}\u00bfTienes que enviar un mensaje breve a una sola persona o a un grupo reducido?{{\/t}}\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t{{~#if_equal channels_count compare=0}}\n\t\t\t\t\t{{#t}}Puedes enviar mensajes directos a cualquier miembro del mismo canal que t\u00fa.{{\/t}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{~#if_gt groups_count compare=0}}\n\t\t\t\t\t\t{{#t}}Puedes enviar mensajes a cualquier miembro de los mismos canales o grupos que t\u00fa.{{\/t}}\n\t\t\t\t\t{{~else}}\n\t\t\t\t\t\t{{#t}}Puedes enviar un mensaje a cualquiera {channels_count, plural, =1 {del mismo canal} other {de los mismos canales}} que t\u00fa.{{\/t}}\n\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t{{~\/if_equal~}}\n\t\t\t{{~else}}\n\t\t\t\t{{#t}}Los mensajes directos son fant\u00e1sticos para eso.{{\/t}}\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t\t<\/p>\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['highlights_feedback_coachmark'] = "{{i18n_ns 'highlights_coachmark'}}\n\n<div id=\"highlights_feedback_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Afina tus destacados{{\/t}}<\/h2>\n\t\t<p>{{#t}}Cuando un destacado sea (o no) especialmente \u00fatil, muestra una reacci\u00f3n para que Slack realice los oportunos ajustes.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['recent_mentions_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"recent_mentions_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span>{{#t}}<strong class=\"black\">Haz clic<\/strong> si deseas m\u00e1s informaci\u00f3n sobre las @menciones.{{\/t}}<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t{{#t}}\n\t\t<h2 class=\"black\">Todas tus @menciones en un mismo sitio<\/h2>\n\t\t<p>Cada vez que alguien mencione tu nombre o alguna de tus palabras destacadas, el mensaje aparecer\u00e1 aqu\u00ed.<\/p>\n\t\t{{\/t}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['starred_items_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"starred_items_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span>{{#t}}<strong class=\"black\">Haz clic<\/strong> si deseas m\u00e1s informaci\u00f3n sobre los favoritos.{{\/t}}<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Estos son favoritos{{\/t}}<\/h2>\n\t\t<p>{{#t}}Puedes a\u00f1adir a <strong>favoritos<\/strong> cosas que quieres guardar para m\u00e1s adelante, como si estuvieras usando un marcador. Puedes a\u00f1adir a tus favoritos y guardar conversaciones y archivos.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['onboarding_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n{{!-- TODO: move to separate templates... so many conditions --}}\n<div id=\"onboarding_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h4>{{title}}<\/h4>\n\t\t<span>{{description}}<\/span>\n\t<\/div>\n<\/div>\t\t\n";
TS.raw_templates['tractor_send_message_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n {{#feature flag=\"feature_tractor_slackbot_onboarding\"}}\n<div id=\"tractor_send_message_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t note=\"coachmark directing a user how to send a message\"}}Teclea y presiona Intro{{\/t}}<\/h2>\n\t\t<p>{{#t note=\"coachmark helping a user send a message\"}}Tus compa\u00f1eros de equipo de Slack ver\u00e1n tus mensajes cuando se unan. Si lo prefieres, puedes usar tus propias palabras.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n{{\/feature}}";
TS.raw_templates['tractor_upload_file_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n {{#feature flag=\"feature_tractor_slackbot_onboarding\"}}\n<div id=\"tractor_upload_file_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t note=\"coachmark directing a user how to upload a file\"}}Compartir un archivo en el canal{{\/t}}<\/h2>\n\t\t<p>{{#t note=\"coachmark directing a user how to upload a file\"}}Haz clic en el <i class=\"c-icon c-icon--plus-square-o\"><\/i> icono m\u00e1s, junto a la barra de mensajes, para <strong>a\u00f1adir un archivo desde tu ordenador<\/strong>.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n{{\/feature}}";
TS.raw_templates['shortcuts_dialog'] = "\t{{i18n_ns \"shortcuts\"}}\n\n\t<div class=\"modal-body\">\n\n\t\t<h1>\n\t\t\t<span class=\"shortcut_dialog_header_text\">{{#t}}Atajos de teclado{{\/t}}<\/span>\n\t\t\t<span class=\"shortcut_dialog_shortcut\" aria-hidden=\"true\">\n\t\t\t\t<span class=\"c-keyboard_key\">{{#isMac}}{{#t}}Cmd{{\/t}}{{else}}{{#t}}Ctrl{{\/t}}{{\/isMac}}<\/span><span class=\"c-keyboard_key\">\/<\/span>\n\t\t\t<\/span>\n\t\t<\/h1>\n\n\t\t<div class=\"shortcut_categories\">\n\t\t\t<div class=\"shortcut_category\">\n\t\t\t\t<h3>{{#t}}Canales y mensajes directos{{\/t}}<\/h3>\n\t\t\t\t<ul class=\"no_bullets\">\n\t\t\t\t\t<li>{{#t}}Anterior en la lista:{{\/t}} <span class=\"c-keyboard_key\">{{meta_key}}<\/span><span class=\"c-keyboard_key\"><i class=\"ts_icon ts_icon_arrow_up_medium ts_icon_inherit\" aria-label=\"{{#t}}Flecha arriba{{\/t}}\"><\/i><\/span><\/li>\n\t\t\t\t\t<li>{{#t}}Siguiente en lista:{{\/t}} <span class=\"c-keyboard_key\">{{meta_key}}<\/span><span class=\"c-keyboard_key\"><i class=\"ts_icon ts_icon_arrow_down_medium ts_icon_inherit\" aria-label=\"{{#t}}Flecha abajo{{\/t}}\"><\/i><\/span><\/li>\n\t\t\t\t\t<li>{{#t}}Anterior no le\u00eddo:{{\/t}} <span class=\"c-keyboard_key\">{{meta_key}}<\/span><span class=\"c-keyboard_key\">{{#t}}May\u00fas{{\/t}}<\/span><span class=\"c-keyboard_key\"><i class=\"ts_icon ts_icon_arrow_up_medium ts_icon_inherit\" aria-label=\"{{#t}}Flecha arriba{{\/t}}\"><\/i><\/span><\/li>\n\t\t\t\t\t<li>{{#t}}Siguiente no le\u00eddo:{{\/t}} <span class=\"c-keyboard_key\">{{meta_key}}<\/span><span class=\"c-keyboard_key\">{{#t}}May\u00fas{{\/t}}<\/span><span class=\"c-keyboard_key\"><i class=\"ts_icon ts_icon_arrow_down_medium ts_icon_inherit\" aria-label=\"{{#t}}Flecha abajo{{\/t}}\"><\/i><\/span><\/li>\n\t\t\t\t\t<li>{{#t}}Atr\u00e1s en historial:{{\/t}} {{#isMac}}<span class=\"c-keyboard_key\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"c-keyboard_key\">[<\/span>{{else}}<span class=\"c-keyboard_key\">{{meta_key}}<\/span><span class=\"c-keyboard_key\"><i class=\"ts_icon ts_icon_arrow_left\" aria-label=\"{{#t}}Flecha izquierda{{\/t}}\"><\/i><\/span>{{\/isMac}}<\/li>\n\t\t\t\t\t<li>{{#t}}Adelante en historial:{{\/t}} {{#isMac}}<span class=\"c-keyboard_key\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"c-keyboard_key\">]<\/span>{{else}}<span class=\"c-keyboard_key\">{{meta_key}}<\/span><span class=\"c-keyboard_key\"><i class=\"ts_icon ts_icon_arrow_right\" aria-label=\"{{#t}}Flecha derecha{{\/t}}\"><\/i><\/span>{{\/isMac}}<\/li>\n\t\t\t\t\t<li>{{#t}}Marcar como le\u00eddo:{{\/t}} <span class=\"c-keyboard_key\" aria-label=\"{{#t}}Escape{{\/t}}\">{{#t}}Esc{{\/t}}<\/span><\/li>\n\t\t\t\t\t<li>{{#t}}Marcar todo como le\u00eddo:{{\/t}} <span class=\"c-keyboard_key\">{{#t}}May\u00fas{{\/t}}<\/span><span class=\"c-keyboard_key\" aria-label=\"{{#t}}Escape{{\/t}}\">{{#t}}Esc{{\/t}}<\/span><\/li>\n\t\t\t\t\t<li>{{#t}}Quick Switcher:{{\/t}} <span class=\"c-keyboard_key\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"c-keyboard_key\">{{#t note=\"c-keyboard_key shortcut letter\"}}k{{\/t}}<\/span>{{#isOurApp}} {{#t}}o{{\/t}} <span class=\"c-keyboard_key\">{{#t note=\"c-keyboard_key shortcut letter\"}}t{{\/t}}<\/span>{{\/isOurApp}}<\/li>\n\t\t\t\t\t{{#if show_browse_dms_shortcut}}<li>{{#t}}Explorar mensajes directos:{{\/t}} <span class=\"c-keyboard_key\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"c-keyboard_key\">{{#t}}May\u00fas{{\/t}}<\/span><span class=\"c-keyboard_key\">{{#t note=\"c-keyboard_key shortcut letter\"}}k{{\/t}}<\/span><\/li>{{\/if}}\n\t\t\t\t<\/ul>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"shortcut_category\">\n\t\t\t\t<h3>{{#t}}Mensajer\u00eda{{\/t}}<\/h3>\n\t\t\t\t<ul class=\"no_bullets\">\n\t\t\t\t{{#if can_show_a11y_keyboard_shortcuts}}\n\t\t\t\t\t{{! The following four keyboard shortcuts don't show up in the UI, and are only read by screenreaders. }}\n\t\t\t\t\t<li class=\"hidden\" aria-hidden=\"