TS.raw_templates['at_channel_warning_dialog'] = "{{i18n_ns 'at_channel'}}\n\n\t<div class=\"modal-body\">\n\t\t<p class=\"at_channel_flexible_width\">\n\t\t\t{{#if_equal timezone_count compare=1}}\n\t\t\t\t{{#t}}Al teclear <span class=\"mention_yellow_bg\">{keyword}<\/span>, vas a enviar una notificaci\u00f3n a <strong>{member_count, plural, =1 {# persona} other {# personas}}<\/strong>. \u00bfSeguro?{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Al teclear <span class=\"mention_yellow_bg\">{keyword}<\/span>, vas a enviar una notificaci\u00f3n a <strong>{member_count, plural, =1 {# persona} other {# personas}}<\/strong> en <strong>{timezone_count} zonas horarias<\/strong>. \u00bfSeguro?{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t<\/p>\n\t\t<div>\n\t\t\t<div class=\"inline_block align_top\">\n\t\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel block\">{{#t}}Editar el mensaje{{\/t}}<\/button>\n\t\t\t\t<span class=\"tiny dialog_cancel_hint\">{{#t}}<strong aria-label=\"escape\">Esc<\/strong> para editar{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t\t<div class=\"inline_block align_top\">\n\t\t\t\t<button type=\"button\" class=\"btn btn_success dialog_go block\">{{#t}}Enviarlo ahora{{\/t}}<\/button>\n\t\t\t\t<span class=\"tiny dialog_go_hint\">{{#t}}<strong aria-label=\"return\">Retorno <span class=\"return_char\">\u21b5<\/span><\/strong> para enviar{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n{{#currentUserIsAdmin}}\n\t\t<div class=\"at_channel_flexible_width\">\n\t\t\t<span class=\"tiny dialog_admin_hint\">{{#t}}\u00a1Eh, administradores! Se puede activar o desactivar este aviso en los <a href=\"\/admin\/settings#permissions\" target=\"_blank\">ajustes del espacio de trabajo<\/a>{{\/t}}<\/span>\n\t\t<\/div>\n{{else}}\n\t\t<div class=\"at_channel_flexible_width\">\n\t\t\t<span class=\"tiny dialog_admin_hint\">{{#t}}\u00a1Eh! \u00a1Un administrador puede modificar estos avisos!{{\/t}}<\/span>\n\t\t<\/div>\n{{\/currentUserIsAdmin}}\n\n\t\t<div class=\"channel_members popover_menu hidden at_channel_flexible_width\">\n\t\t\t<div class=\"channel_members_scroller\"><\/div>\n\t\t\t<a href=\"#\" class=\"channel_members_count_underlay overflow_ellipsis\">{{#t}}{member_count, plural, =1 {# persona} other {# personas}}{{\/t}}<\/a>\n\t\t<\/div>\n\t<\/div>\n";
