TS.raw_templates['account_notifications_channel_overrides'] = "{{i18n_ns \"account_notifications\"}}\n\n<table>\n    <tr class=\"hide_when_no_overrides\">\n        <td><\/td>\n        <td class=\"align_center extra_right_border\" colspan=\"3\"><i class=\"ts_icon ts_icon_laptop small_right_margin\"><\/i><strong>{{#t}}Escritorio{{\/t}}<\/strong><\/td>\n        <td class=\"align_center extra_left_border\" colspan=\"3\"><i class=\"ts_icon ts_icon_mobile small_right_margin\" style=\"font-size: 1.4rem\"><\/i><strong>{{#t}}M\u00f3vil{{\/t}}<\/strong><\/td>\n        <td><\/td>\n    <\/tr>\n    <tr class=\"hide_when_no_overrides\">\n        <th><\/th>\n        <th>{{#t}}Todo{{\/t}}<\/th>\n        <th class=\"no_wrap\">{{#t}}Menciones{{\/t}}<\/th>\n        <th class=\"extra_right_border right_padding\">{{#t}}Nada{{\/t}}<\/th>\n        <th class=\"extra_left_border\">{{#t}}Todo{{\/t}}<\/th>\n        <th class=\"no_wrap\">{{#t}}Menciones{{\/t}}<\/th>\n        <th>{{#t}}Nada{{\/t}}<\/th>\n        <th class=\"revert_cell_width\"><\/th>\n    <\/tr>\n    <tr id=\"add_override_channel_picker_row\" class=\"hidden\">\n        <td colspan=\"8\"><a id=\"add_override_channel_picker\"><i class=\"ts_icon ts_icon_plus_circle ts_icon_inherit float_left small_right_margin\"><\/i> {{#t}}A\u00f1adir un ajuste personalizado para un canal{{\/t}}<\/a><\/td>\n    <\/tr>\n<\/table>";
TS.raw_templates['account_notifications_channel_overrides_row'] = "{{i18n_ns \"account_notifications\"}}\n\n<tr id=\"channel_override_row_{{channel.id}}\" class=\"channel_override_row {{#if channel.is_muted}}muted{{\/if}}\">\n\t<td class=\"channel_details\">\n\t\t<span class=\"no_wrap\">\n\t\t\t<i class=\"ts_icon ts_icon_bell_slash mute_icon\"><\/i>\n\t\t\t{{~#if channel.is_group~}}\n\t\t\t\t{{~#if channel.is_mpim~}}\n\t\t\t\t\t<i class=\"ts_icon ts_icon_multiparty_dm_{{mpimMemberCount channel.channel}}\"><\/i>\n\t\t\t\t{{~else~}}\n\t\t\t\t\t<i class=\"ts_icon ts_icon_lock_o group_lock_prefix\"><\/i>\n\t\t\t\t{{~\/if~}}\n\t\t\t{{~\/if~}}\n\t\t\t{{~#if channel.is_channel~}}\n\t\t\t\t<span class=\"channel_hash_prefix\">#<\/span>\n\t\t\t{{~\/if~}}\n\t\t\t<strong>{{channel.name}}<\/strong>\n\t\t\t<span class=\"pref_saved inline_block small_left_margin\"><i class=\"ts_icon ts_icon_check_circle_o\"><\/i> {{#t}}Guardado{{\/t}}<\/span>\n\t\t<\/span>\n\n\t\t<label class=\"checkbox no_margin normal\">\n\t\t\t<input id=\"muting_cb_{{channel.id}}\" {{#if channel.is_muted}}checked=\"checked\"{{\/if}} type=\"checkbox\" data-id=\"{{channel.id}}\" data-pref=\"muting\" class=\"small_right_margin\">\n\t\t\t{{#if channel.is_mpim}}\n\t\t\t\t{{#t}}Silenciar esta conversaci\u00f3n{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#if channel.is_group}}\n\t\t\t\t\t{{#t}}Silenciar este canal cerrado{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Silenciar este canal{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t<\/label>\n\n\t\t<label id=\"at_channel_suppressed_{{channel.id}}\" class=\"hidden checkbox no_margin normal {{#if channel.is_muted}}disabled{{\/if}}\">\n\t\t\t<input id=\"at_channel_suppressed_cb_{{channel.id}}\" checked=\"checked\" {{#if channel.is_muted}}disabled{{\/if}} type=\"checkbox\" data-id=\"{{channel.id}}\" data-pref=\"at_channel_suppression\" class=\"small_right_margin\">\n\t\t\t{{#if channel.is_group}}\n\t\t\t\t{{#t at_label=(atLabel 'channel')}}Suprimir menciones con <strong>{at_label}<\/strong>{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#isChannelRequired channel}}\n\t\t\t\t\t{{#t at_label=(atLabel 'everyone')}}Suprimir menciones con <strong>{at_label}<\/strong>{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t at_label=(atLabel 'channel')}}Suprimir menciones con <strong>{at_label}<\/strong>{{\/t}}\n\t\t\t\t{{\/isChannelRequired}}\n\t\t\t{{\/if}}\n\t\t\t<span id=\"at_channel_suppressed_mobile_qualifier_{{channel.id}}\">{{#t}}(en m\u00f3viles){{\/t}}<\/span>\n\t\t\t<span id=\"at_channel_suppressed_desktop_qualifier_{{channel.id}}\">{{#t}}(en ordenador){{\/t}}<\/span>\n\t\t\t<span id=\"at_channel_suppressed_disabled_explain_{{channel.id}}\" class=\"hidden\">\n\t\t\t\t<br>{{#t}}(no disponible a causa de <strong id=\"at_channel_suppressed_disabled_explain_tip_link_{channel.id}\" class=\"{channel.is_muted, select, true{ts_tip_hide}other{}} ts_tip ts_tip_top ts_tip_multiline ts_tip_float\">los ajustes del espacio de trabajo<span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\"><\/span><\/span><\/strong>){{\/t}}\n\t\t\t<\/span>\n\t\t<\/label>\n\n\t<\/td>\n\n\t<td class=\"radio_cell\"><input type=\"radio\" id=\"desktop_everything_{{channel.id}}\" name=\"desktop_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"desktop\" value=\"everything\" {{#if channel.is_muted}}{{#t}}desactivado{{\/t}}{{\/if}}><\/td>\n\t<td class=\"radio_cell\"><input type=\"radio\" id=\"desktop_mentions_{{channel.id}}\" name=\"desktop_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"desktop\" value=\"mentions\" {{#if channel.is_muted}}{{#t}}desactivado{{\/t}}{{\/if}}><\/td>\n\t<td class=\"radio_cell\"><input type=\"radio\" id=\"desktop_nothing_{{channel.id}}\" name=\"desktop_{{channel.id}}\" data-device=\"desktop\" data-id=\"{{channel.id}}\" value=\"nothing\" {{#if channel.is_muted}}{{#t}}desactivado{{\/t}}{{\/if}}><\/td>\n\n\t<td class=\"radio_cell\"><input type=\"radio\" id=\"mobile_everything_{{channel.id}}\" name=\"mobile_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"mobile\" value=\"everything\" {{#if channel.is_muted}}{{#t}}desactivado{{\/t}}{{\/if}}><\/td>\n\t<td class=\"radio_cell\"><input type=\"radio\" id=\"mobile_mentions_{{channel.id}}\" name=\"mobile_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"mobile\" value=\"mentions\" {{#if channel.is_muted}}{{#t}}desactivado{{\/t}}{{\/if}}><\/td>\n\t<td class=\"radio_cell\"><input type=\"radio\" id=\"mobile_nothing_{{channel.id}}\" name=\"mobile_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"mobile\" value=\"nothing\" {{#if channel.is_muted}}{{#t}}desactivado{{\/t}}{{\/if}}><\/td>\n\n\t<td class=\"align_center\"><i class=\"ts_icon ts_icon_times_circle revert_to_default\" data-id=\"{{channel.id}}\" data-toggle=\"tooltip\" title=\"{{#t channel_name=channel.name}}Borrar ajustes personalizados de notificaciones de {channel.is_channel, select, true{#}other{}}{channel_name}{{\/t}}\"><\/i><\/td>\n<\/tr>\n";
TS.raw_templates['sidebar_theme_css'] = "{!--\n * This file is used to theme sidebar elements that haven't been ported to React.\n * It is deprecated by js\/modern\/components\/channel-sidebar\/theme.jsx\n * Yes: this needs to be improved, but this can't be removed until\n * the team menu header block is converted to React (it's also themed).\n --}\n<style type=\"text\/css\" id=\"sidebar_theme_css\">\n\n\t\/* Column Background *\/\n\t.client_channels_list_container {\n\t\tbackground: {{theme.column_bg}};\n\t}\n\n\t\/* Menu Background *\/\n\t#team_menu {\n\t\tcolor: {{theme.text_color}};\n\t\ttext-shadow: 0 1px 1px rgba(0, 0, 0, 0.25);\n\t}\n\t#team_menu,\n\t#team_menu_overlay {\n\t\tborder-color: {{theme.column_bg}};\n\t}\n\tbody:not(.loading) #team_menu:hover,\n\tbody:not(.loading) #team_menu.active {\n\t\tbackground: {{theme.menu_bg}};\n\t\tborder-color: {{theme.menu_bg}};\n\t}\n\n\t\/* Text Color *\/\n\t#team_menu:before,\n\t#team_menu .notifications_menu_btn,\n\t#team_menu .team_name_caret,\n\t#team_menu_user_name {\n\t\tcolor: {{theme.text_color}} !important;\n\t\topacity: 0.6;\n\t}\n\t#team_menu_user,\n\t#team_menu_user_details .current_status ts-icon {\n\t\tcolor: {{theme.text_color}};\n\t}\n\n\t#team_menu:hover:before,\n\t#team_menu.active:before,\n\t#team_menu:hover .team_name_caret,\n\t#team_menu.active .team_name_caret,\n\t#team_menu:hover #team_menu_user_name,\n\t#team_menu:hover .current_user_current_status,\n\t#team_menu .team_name_caret.focus-ring {\n\t\topacity: 1;\n\t}\n\n\t\/* Presence *\/\n\t#team_menu #presence.active:before {\n\t\tcolor: {{theme.active_presence}};\n\t\topacity: 1;\n\t}\n\n\t\/* Badge + Mentions bar *\/\t\t\n \tts-jumper ol li .unread_count {\n \t\tbackground: {{theme.badge}};\t\t\n \t}\n\n\t\/* No text shadows *\/\n\t#team_menu {\n\t\ttext-shadow: none !important;\n\t}\n<\/style>\n";
TS.raw_templates['signin_find_team'] = "{{i18n_ns 'find_team'}}\n\n{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=find_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"37\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n<div class=\"header_error_message hidden\"><\/div>\n\n<div id=\"form_body\" class=\"fs_split_body\">\n\t<h1>\n\t\t{{#if is_second_step}}\n\t\t\t{{#t}}Encontrar otro espacio de trabajo{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Encontrar tu espacio de trabajo{{\/t}}\n\t\t{{\/if}}\n\t<\/h1>\n\t<label id=\"email_label\">{{#t}}<span class=\"normal\">Introduce tu<\/span> direcci\u00f3n de correo{{\/t}}<\/label>\n\n\t<div class=\"input_wrapper email\">\n\t\t<textarea type=\"text\" placeholder=\"{{exampleEmail 'you'}}\" id=\"email_input\" autocomplete=\"off\" spellcheck=\"false\" aria-labelledby=\"email_label email_rule_label\" data-email-healing=\"true\"><\/textarea>\n\t<\/div>\n\n\t<p id=\"email_rule_label\" class=\"subtle_silver\">{{#t}}Prueba con hasta 10 direcciones, separadas por comas.{{\/t}}<\/p>\n\t<p class=\"error_message\"><\/p>\n\t<div class=\"desc\">{{#t}}Te enviaremos un correo con enlaces de inicio de sesi\u00f3n para todos los espacios de trabajo de Slack asociados con la(s) direcci\u00f3n(es) que introduzcas.{{\/t}}<\/div>\n<\/div>\n\n<div id=\"submit_footer\" class=\"fs_split_footer centered\">\n\t<button id=\"submit_btn\" type=\"submit\" class=\"btn btn_large ladda-button submit_setting\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"click_target=find_team_send_signin_email\" data-style=\"expand-right\" aria-disabled=\"true\" disabled=\"true\">\n\t\t<span id=\"submit_btn_label_single\" class=\"ladda-label\">{{#t}}Enviarme un correo para conectarme{{\/t}}<\/span>\n\t\t<span id=\"submit_btn_label_plural\" class=\"ladda-label hidden\">{{#t}}Enviarme correos de inicio de sesi\u00f3n{{\/t}}<\/span>\n\t<\/button>\n\t{{#if reenter_signup_flow}}\n\t\t<p class=\"normal_margin reenter_signup_flow subtle_silver\"><ts-icon class=\"ts_icon_arrow_left\"><\/ts-icon>{{#t}}O bien, <a href=\"\/create\" class=\"clear_blue\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=go_back_create_team,trigger=find_team\">vuelve y contin\u00faa creando un nuevo espacio de trabajo<\/a>{{\/t}}<\/p>\n\t{{\/if}}\n\t{{#if go_back_team_select}}\n\t\t<p class=\"normal_margin go_back_team_select subtle_silver\"><ts-icon class=\"ts_icon_arrow_left\"><\/ts-icon>{{#t}}O bien, <a href=\"\/signin\/find\" class=\"clear_blue\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=go_back_select_team,trigger=find_team\">vuelve y selecciona un espacio de trabajo<\/a>{{\/t}}<\/p>\n\t{{\/if}}\n<\/div>\n<div class=\"fs_split_footer\"><\/div>\n";
TS.raw_templates['signin_find_team_email_sent'] = "{{i18n_ns 'find_team'}}\n\n{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=find_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n<div id=\"sent_invite_body\" class=\"fs_split_body\">\n\t{{#if multi}}\n\t<h1>{{#t}}\u00a1Los recordatorios han sido enviados!{{\/t}}<\/h1>\n\t<p class=\"desc\">{{#t}}Si encontramos cuentas Slack asociadas con {email}, te enviaremos un correo electr\u00f3nico a la brevedad.{{\/t}}<\/p>\n\t{{else}}\n\t<h1>{{#t}}\u00a1El recordatorio ha sido enviado!{{\/t}}<\/h1>\n\t<p class=\"desc\">{{#t}}Si encontramos una cuenta Slack asociada con {email}, te enviaremos un correo electr\u00f3nico a la brevedad.{{\/t}}<\/p>\n\t{{\/if}}\n\n\t{{#t}}\n\t<p class=\"desc small_bottom_margin\">\u00bfNo consigues encontrar tu equipo?<\/p>\n\t<p class=\"desc\">Puedes <strong><a href=\"\/signin\/find\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=try_another_email,trigger=find_team\">probar con otra direcci\u00f3n de correo<\/a><\/strong> o contactar con <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a>. Recuerda que nuestro equipo de Atenci\u00f3n al usuario te puede asistir en espa\u00f1ol.<\/p>\n\t{{\/t}}\n<\/div>\n\n<div class=\"fs_split_footer\"><\/div>\n<div class=\"fs_split_footer subtle_silver\">\n{{#isOurApp}}\n\t{{#t}}(Cuando lo recibas, <a href=\"\/signin\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=try_sign_in,trigger=find_team\" class=\"bold\">haz clic aqu\u00ed para conectarte<\/a>.){{\/t}}\n{{else}}\n\t{{#t}}(Seguramente ya podr\u00e1s cerrar esta p\u00e1gina.){{\/t}}\n{{\/isOurApp}}\n<\/div>";
TS.raw_templates['invite_single_page_form'] = "\n{{i18n_ns 'invite'}}\n\n\n<div class= \"fs_grey large_top_padding col span_3_of_6 margin_auto float_none\">\n\n<div id=\"ratelimit_alert\" class=\"header_error_message hidden bottom_margin\">\n    <h3>{{#t note=\"This refers to a rate limit we have for filling out this form\"}}\u00a1Espera, vas muy deprisa!{{\/t}}<\/h3>\n    <p class=\"no_margin\">{{#t}}Respira hondo y vuelve a intentarlo dentro de un minuto.{{\/t}}<\/p>\n<\/div>\n\n<div id=\"invite_form_body\">\n    <h1>{{#t}}Unirse al espacio de trabajo de Slack {team_name}{{\/t}}<\/h1>\n\n    <div class=\"names_container\" id=\"names_container\">\n        <label>{{#t}}Nombre completo{{\/t}}<\/label>\n        <div class=\"name_field\" id=\"real_name_wrapper\">\n            <input type=\"text\" name=\"full_name\" placeholder=\"{{#t}}Nombre completo{{\/t}}\" id=\"invite_real_name\" autocomplete=\"off\" data-qa=\"real_name_field\" {{#if real_name}}value=\"{{real_name}}\"{{\/if}} data-validation=\"membername=required\" data-validation-for=\"real_name_profile_field_warnings\" data-validation-success\/>\n            <label for=\"real_name_profile_field_warnings\"><span class=\"validation_message\"><\/span><\/label>\n        <\/div>\n    <\/div>\n\n    <div id=\"username_container\">\n        <label for=\"display_name_overlay\">{{#t}}Nombre de Slack (optativo){{\/t}}<\/label>\n            <div class=\"input_wrapper display_name\">\n            <p id=\"display_name_overlay\" class=\"input_overlay\"><\/p>\n            <input type=\"text\" name=\"display_name\" id=\"invite_display_name\" autocomplete=\"off\" data-qa=\"display_name_field\" placeholder=\"{{#if display_name_placeholder_prefill}}{{display_name_placeholder_prefill}}{{else}}{{#t}}Nombre de Slack{{\/t}}{{\/if}}\" data-validation=\"membername\" data-validation-for=\"display_name_profile_field_warnings\" data-validation-success\/>\n        <\/div>\n        <label for=\"display_name_profile_field_warnings\"><span class=\"validation_message\"><\/span><\/label>\n        <p class=\"sk_dark_grey\">{{#t}}Por defecto, Slack muestra tu nombre completo, pero puedes elegir uno m\u00e1s corto si lo prefieres.{{\/t}}<\/p>\n\n        {{#if custom_username_policy}}\n            <div id=\"custom_username_policy\" class=\"large_bottom_margin\">\n                <p class=\"bold small_bottom_margin\">{{#t}}Reglas personalizadas para este espacio de trabajo:{{\/t}}<\/p>\n                <p class=\"sk_dark_grey no_bottom_margin\">{{custom_username_policy}}<\/p>\n            <\/div>\n        {{\/if}}\n    <\/div>\n\n    <div id=\"password_container\">\n        <label for=\"password\">{{#t}}Contrase\u00f1a (obligatoria){{\/t}}<\/label>\n        <input type=\"password\" id=\"invite_password\" data-qa=\"password-field\" placeholder=\"{{#t}}Contrase\u00f1a{{\/t}}\" name=\"password\"\/>\n        <p class=\"error_message small_bottom_margin\" id=\"password_error_message\"><\/p>\n\n        <p class=\"sk_dark_grey\">{{#t}}Las contrase\u00f1as deben tener al menos 6 caracteres y no vale usar \u201ccontrase\u00f1a\u201d, \u201c123456\u201d ni \u201cabcdef\u201d.{{\/t}}<\/p>\n    <\/div>\n\n    {{#if collect_guest_user_role}}\n        {{> invite_inc_guest_user_role}}\n    {{\/if}}\n\n    <div id=\"submit\">\n        {{! show europe GDPR-friendly radio buttons #feat-gdpr-acct-create}}\n        {{#if is_europe}}\n            <div id=\"email_misc_radio_button\">\n                <p>{{#t}}<strong>\u00bfPodemos escribirte con consejos para usar Slack, noticias y ofertas?<\/strong>{{\/t}}<\/p>\n                <label class=\"radio normal\">\n                    <input type=\"radio\" id=\"email_misc\" name=\"emailok\" value=\"true\" data-qa=\"email_radio_dial_true\" \/>{{#t note=\"A radio dial option for opting into Slack email\"}}\u00a1Por supuesto!{{\/t}}\n                <\/label>\n                <label class=\"radio normal\">\n                    <input type=\"radio\" id=\"email_misc_false\" name=\"emailok\" value=\"false\" data-qa=\"email_radio_dial_false\" \/>{{#t note=\"A radio dial option for opting out of Slack email\"}}Prefiero que no.{{\/t}}\n                <\/label>\n            <\/div>\n        {{else}}\n            <div id=\"email_checkbox\">\n                <input class=\"spf_input\" type=\"checkbox\" id=\"email_misc\" data-qa=\"email_checkbox\" {{#if uncheck_email}}{{else}}checked{{\/if}}>\n                <label class=\"spf_label\" for=\"email_misc\">{{#t}}Me parece bien que me envi\u00e9is correos sobre Slack.{{\/t}}<\/label>\n            <\/div>\n        {{\/if}}\n\n        <div class=\"align_center\">\n            <button id=\"submit_btn\" type=\"submit\" class=\"{{#unless email_reminded}}disabled{{\/unless}} btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n                <span class=\"ladda-label\">{{#t}}Siguiente{{\/t}}<\/span>\n            <\/button>\n        <\/div>\n    <\/div>\n\n<\/div>\n<\/div>\n";
TS.raw_templates['invite_sso_form'] = "{{i18n_ns \"invite\"}}\n\n<div class=\"fs_split_header\"><\/div>\n\n<div class= \"fs_grey large_top_padding col span_3_of_6 margin_auto float_none\">\n<div id=\"invite_sso_form_body\" class=\"fs_split_body\">\n    <h1>{{#t}}Unirte a {team_name}{{\/t}}<\/h1>\n    <div id=\"sso_container\">\n        {{#if_equal auth_mode compare=\"google\"}}\n            {{#if sso_required}}\n                <p>{{#t}}Este espacio de trabajo exige que te conectes usando tu cuenta de Google <strong>@{email_domain}.<\/strong>{{\/t}}<\/p>\n            {{else}}\n                {{#if domain_match}}\n                    <p>\n                        {{#if_gt allowed_domains_count compare=1}}\n                            {{#t}}Este espacio de trabajo permite que te registres con tu cuenta de <strong>Google Apps<\/strong>.{{\/t}}\n                        {{else}}\n                            {{#t}}Este espacio de trabajo permite que te conectes con tu cuenta de Google <strong>@{google_sso_domain}.<\/strong>{{\/t}}\n                        {{\/if_gt}}\n                    <\/p>\n                {{\/if}}\n            {{\/if}}\n            {{#or sso_required domain_match}}\n                <p>\n                    <a href=\"{{auth_url}}\" class=\"btn btn_info btn_large btn_with_icon full_width\">\n                        <i class=\"ts_icon ts_icon_google\"><\/i>\n                        {{#t}}Registrarse con Google{{\/t}}\n                    <\/a>\n                <\/p>\n            {{\/or}}\n            {{#unless sso_required}}\n                {{#if domain_match}}\n                    <p class=\"large_top_margin\">{{#t}}Tambi\u00e9n puedes registrarte con un <strong>nombre de usuario<\/strong> y <strong>una contrase\u00f1a<\/strong>.{{\/t}}<\/p>\n                    <p id=\"no_sso_btn\" class=\"btn btn_large full_width ladda-button\">\n                        <span class=\"ladda-label\">{{#t}}A\u00f1adir usuario o contrase\u00f1a{{\/t}}<\/span>\n                    <\/p>\n                {{\/if}}\n            {{\/unless}}\n        {{else}}\n            <p>\n                {{#if sso_required}}\n                    {{#t}}Este espacio de trabajo exige que te conectes con tu cuenta de {saml_provider_label}.{{\/t}}\n                {{else}}\n                    {{#t}}Este espacio de trabajo permite que te conectes con tu cuenta de {saml_provider_label}.{{\/t}}\n                {{\/if}}\n            <\/p>\n            <p>\n                <a href=\"{{invite_sso_url}}?action=invite&redir=%2Finvite%2F{{invite_code}}\" class=\"btn btn_info btn_large btn_with_icon full_width\">\n                    <i class=\"ts_icon ts_icon_key\"><\/i>\n                    {{#t}}Conectarse con {saml_provider_label}{{\/t}}\n                <\/a>\n            <\/p>\n            {{#unless sso_required}}\n                <p class=\"large_top_margin\">{{#t}}Tambi\u00e9n puedes registrarte con un <strong>nombre de usuario<\/strong> y <strong>una contrase\u00f1a<\/strong>.{{\/t}}<\/p>\n                <p id=\"no_sso_btn\" class=\"btn btn_large full_width ladda-button\">\n                    <span class=\"ladda-label\">{{#t}}A\u00f1adir usuario o contrase\u00f1a{{\/t}}<\/span>\n                <\/p>\n            {{\/unless}}\n        {{\/if_equal}}\n    <\/div>\n<\/div>\n<\/div>\n\n<div class=\"fs_split_footer\"><\/div>\n<div class=\"fs_split_footer\"><\/div>\n";
TS.raw_templates['invite_name_form'] = "{{i18n_ns 'invite'}}\n\n<div class=\"fs_split_header\"><\/div>\n\n<div id=\"ratelimit_alert\" class=\"header_error_message hidden bottom_margin\">\n    <h3>{{#t note=\"This refers to a rate limit we have for filling out this form\"}}\u00a1Espera, vas muy deprisa!{{\/t}}<\/h3>\n    <p class=\"no_margin\">{{#t}}Respira hondo y vuelve a intentarlo dentro de un minuto.{{\/t}}<\/p>\n<\/div>\n\n<div id=\"invite_form_body\" class=\"fs_split_body\">\n    <h1>{{#t}}Unirse al espacio de trabajo de Slack <span class=\"bold\">{team_name}<\/span>{{\/t}}<\/h1>\n\n    <div class=\"names_container no_top_padding bottom_padding\" id=\"names_container\">\n        <label>{{#t}}Nombre completo{{\/t}}<\/label>\n        <div class=\"name_field\" id=\"real_name_wrapper\">\n            <input type=\"text\" name=\"full_name\" placeholder=\"{{#t}}Nombre completo{{\/t}}\" id=\"invite_real_name\" autocomplete=\"off\" data-qa=\"real_name_field\" {{#if real_name}}value=\"{{real_name}}\"{{\/if}} data-validation=\"membername=required\" data-validation-for=\"real_name_profile_field_warnings\" data-validation-success\/>\n            <label for=\"real_name_profile_field_warnings\"><span class=\"validation_message\"><\/span><\/label>\n        <\/div>\n    <\/div>\n\n    <div id=\"username_container\">\n        <label for=\"display_name_overlay\">{{#t}}Nombre de Slack (optativo){{\/t}}<\/label>\n            <div class=\"input_wrapper display_name\">\n            <p id=\"display_name_overlay\" class=\"input_overlay\"><\/p>\n            <input type=\"text\" name=\"display_name\" id=\"invite_display_name\" autocomplete=\"off\" data-qa=\"display_name_field\" placeholder=\"{{#if display_name_placeholder_prefill}}{{display_name_placeholder_prefill}}{{else}}{{#t}}Nombre de Slack{{\/t}}{{\/if}}\" data-validation=\"membername\" data-validation-for=\"display_name_profile_field_warnings\" data-validation-success\/>\n        <\/div>\n        <label for=\"display_name_profile_field_warnings\"><span class=\"validation_message\"><\/span><\/label>\n        <p class=\"subtle_silver\">{{#t}}Por defecto, Slack mostrar\u00e1 tu nombre completo cuando la gente te mencione, pero puedes elegir uno m\u00e1s corto si lo prefieres.{{\/t}}<\/p>\n\n        {{#if custom_username_policy}}\n            <div id=\"custom_username_policy\" class=\"large_bottom_margin\">\n                <p class=\"bold small_bottom_margin\">{{#t}}Reglas personalizadas para este espacio de trabajo:{{\/t}}<\/p>\n                <p class=\"no_bottom_margin\">{{custom_username_policy}}<\/p>\n            <\/div>\n        {{\/if}}\n    <\/div>\n<\/div>\n\n{{#if collect_user_role}}\n    <div id=\"submit\" class=\"fs_split_footer full_width\">\n        <div id=\"email_checkbox\" class=\"align_left no_top_margin large_bottom_margin\">\n            <input type=\"checkbox\" id=\"email_misc\" data-qa=\"email_checkbox\" {{#if uncheck_email}}{{else}}checked{{\/if}}>\n            <label for=\"email_misc\">{{#t}}Me parece bien que me envi\u00e9is correos sobre Slack.{{\/t}}<\/label>\n        <\/div>\n\n\n        <button id=\"submit_btn\" type=\"submit\" class=\"{{#unless email_reminded}}disabled{{\/unless}} btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n            <span class=\"ladda-label\">{{#t}}Siguiente{{\/t}}<i class=\"ts_icon ts_icon_arrow_right\"><\/i><\/span>\n        <\/button>\n    <\/div>\n{{else}}\n<div id=\"submit\" class=\"fs_split_footer\">\n\n    <div id=\"email_checkbox\">\n        <input type=\"checkbox\" id=\"email_misc\" data-qa=\"email_checkbox\" {{#if uncheck_email}}{{else}}checked{{\/if}}>\n        <label for=\"email_misc\">{{#t}}Me parece bien que me envi\u00e9is (muy de vez en cuando)<br class=\"hide_on_mobile\" \/> correos sobre Slack. {{\/t}}<\/label>\n    <\/div>\n\n\n    <button id=\"submit_btn\" type=\"submit\" class=\"{{#unless email_reminded}}disabled{{\/unless}} btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n        <span class=\"ladda-label\">{{#t}}Siguiente{{\/t}}<i class=\"ts_icon ts_icon_arrow_right\"><\/i><\/span>\n    <\/button>\n<\/div>\n{{\/if}}\n\n<p class=\"mobile_legalese fs_split_well show_on_mobile align_center\">\n    {{#t}}Si creas una cuenta y utilizas Slack, aceptas nuestras <a class=\"bold\" href=\"\/terms-of-service\">Condiciones de servicio<\/a> y nuestra <a href=\"\/privacy-policy\" class=\"bold\">Pol\u00edtica de privacidad<\/a>. Si no los aceptas, deber\u00e1s dejar de utilizar Slack.{{\/t}}\n<\/p>\n";
TS.raw_templates['invite_password_form'] = "{{i18n_ns \"invite\"}}\n<div class=\"fs_split_header\"><\/div>\n\n<div id=\"ratelimit_alert\" class=\"header_error_message hidden bottom_margin\">\n    <h3>{{#t note=\"This refers to a rate limit we have for filling out this form\"}}\u00a1Espera, vas muy deprisa!{{\/t}}<\/h3>\n    <p class=\"no_margin\">{{#t}}Respira hondo y vuelve a intentarlo dentro de un minuto.{{\/t}}<\/p>\n<\/div>\n\n<div id=\"invite_form_body\" class=\"fs_split_body\">\n     <h1>{{#t}}Configurar contrase\u00f1a{{\/t}}<\/h1>\n\n    <p class=\"subtle_silver\">{{#t}}Elige una contrase\u00f1a para conectarte a {team_name} en Slack.{{\/t}}<\/p>\n\n    <div id=\"password_container\">\n        <label class=\"normal\" for=\"password\">{{#t}}Contrase\u00f1a{{\/t}}<\/label>\n        <input type=\"password\" id=\"invite_password\" data-qa=\"password-field\" placeholder=\"{{#t}}Contrase\u00f1a{{\/t}}\" name=\"password\"\/>\n        <p class=\"error_message\" id=\"password_error_message\"><\/p>\n\n        <p class=\"subtle_silver\">{{#t}}Las contrase\u00f1as deben tener al menos 6 caracteres y no vale usar \u201ccontrase\u00f1a\u201d, \u201c123456\u201d ni \u201cabcdef\u201d.{{\/t}}<\/p>\n    <\/div>\n<\/div>\n\n<div id=\"submit\" class=\"fs_split_footer large_bottom_margin \">\n    <button id=\"submit_btn\" type=\"submit\" class=\"disabled btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n        <span class=\"ladda-label\">{{#t}}Siguiente{{\/t}}<i class=\"ts_icon ts_icon_arrow_right\"><\/i><\/span>\n    <\/button>\n<\/div>\n";
TS.raw_templates['invite_guest_user_role_form'] = "{{i18n_ns \"invite\"}}\n<div class=\"fs_split_header\"><\/div>\n\n<div id=\"invite_form_body\" class=\"fs_split_body\">\n    <h1>{{#t}}H\u00e1blanos de tu rol{{\/t}}<\/h1>\n\n    <p class=\"subtle_silver\">{{#t}}\u00bfQu\u00e9 tipo de trabajo realizas en {team_name}?{{\/t}}<\/p>\n\n    {{> invite_inc_guest_user_role}}\n<\/div>\n\n<div id=\"submit\" class=\"fs_split_footer large_bottom_margin \">\n    <button id=\"submit_btn\" type=\"submit\" class=\"disabled btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n        <span class=\"ladda-label\">{{#t}}Siguiente{{\/t}}<i class=\"ts_icon ts_icon_arrow_right\"><\/i><\/span>\n    <\/button>\n<\/div>\n";
TS.raw_templates['invite_tos_form'] = "{{i18n_ns 'invite'}}\n\n{{#if has_custom_tos}}\n\t<div class=\"fs_grey\">\n\t\t<div class=\"custom_tos__contents margin_auto\">\n\t\t\t{{terms_of_service}}\n\n\t\t\t<button id=\"submit_btn\" type=\"button\" class=\"btn btn_large ladda-button full_width\" data-style=\"expand-right\">\n\t\t\t\t<span class=\"ladda-label\">{{#t}}Acepto{{\/t}}<\/span>\n\t\t\t<\/button>\n\t\t<\/div>\n\t<\/div>\n{{else}}\n\t<div class=\"fs_split_header\"><\/div>\n\n\t<div id=\"invite_form_body\" class=\"fs_grey\">\n\n\t\t<div id=\"tos_graphics\" class=\"tos_graphics\"><\/div>\n\n\t\t<h1 class=\"tos_title_form\">{{#t}}Revisa las Condiciones de servicio al usuario, por favor{{\/t}}<\/h1>\n\n\t\t<div class=\"tos_contents\">\n\t\t\t{{terms_of_service}}\n\n\t\t\t<p class=\"align_center\">\n\t\t\t\t<img {srcset src=\"\/img\/signup\/tos_raised_hands.png\" sizes=\"1x, 2x\"} alt=\"{{#t}}Condiciones de servicio al usuario{{\/t}}\" \/>\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n\n\n\t<div class=\"tos_i_agree_banner invite_flow full_width\">\n\t\t<div class=\"tos_full_width col span_4_of_6 margin_auto float_none\">\n\t\t\t<div class=\"col span_2_of_3\">\n\t\t\t\t<p class=\"tos_disclaimer\">\n\t\t\t\t\t{{#t}}Al elegir <strong>Acepto<\/strong>, comprendes y aceptas \n\t\t\t\tlas Condiciones del Servicio al Usuario de Slack y nuestras <a href=\"{abs_root_url}privacy-policy\" target=\"_blank\">pol\u00edticas de privacidad<\/a> y <a href=\"\/cookie-policy\" target=\"_blank\">de cookie<\/a>.{{\/t}}\n\t\t\t\t<\/p>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"col span_1_of_3 justify_content_center\">\n\t\t\t\t<button id=\"submit_btn\" type=\"submit\" class=\"btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t\t<span class=\"ladda-label\">{{#t}}Acepto{{\/t}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"clear_both\"><\/div>\n\t\t<\/div>\n\t<\/div>\n{{\/if}}\n";
TS.raw_templates['invite_user_tos_content'] = "{{i18n_ns 'invite'}}\n\n{{#feature flag=\"feature_user_invite_tos_april_2018\"}}\n\n\t<p><strong>{{#t}}Fecha efectiva: 20 de abril de 2018{{\/t}}<\/strong><\/p>\n\n\t<p>\n\t\t\t{{#t}}Estas Condiciones de servicio al usuario (las <strong>\u201cCondiciones para el usuario\u201d<\/strong>) rigen tu acceso y tu uso de nuestras herramientas y de la plataforma en l\u00ednea para la productividad en el lugar de trabajo (los <strong>\u201cServicios\u201d<\/strong>).  L\u00e9elos detenidamente, por favor.  Aunque est\u00e1s conect\u00e1ndote a un espacio que ya existe, estos t\u00e9rminos para el usuario se aplican a ti como usuario de los Servicios.  Estamos encantados de tenerte aqu\u00ed.{{\/t}}\n\t\t<\/p>\n\n\t{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}\n\t<p>\n\t\t<h2>Lo primero es lo primero<\/h2>\n\t<\/p>\n\n\t<h4>Estas Condiciones para el usuario son jur\u00eddicamente vinculantes.<\/h4>\n\n\t<p>\n\t\tEstas Condiciones del usuario son un contrato jur\u00eddicamente vinculante entre t\u00fa y nosotros.  Como parte de estas Condiciones del usuario, \n\t\taceptas cumplir la versi\u00f3n m\u00e1s reciente de nuestra <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, \n\t\tincorporada como referencia en estas Condiciones del usuario.  Si utilizas los Servicios o accedes a ellos, o contin\u00faas accediendo o utilizando\n\t\tlos Servicios despu\u00e9s de recibir una notificaci\u00f3n de un cambio en los T\u00e9rminos o la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>,\n\t\tconfirmas que has le\u00eddo, comprendido y aceptado vincularte a las Condiciones del usuario y a la\n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>.  &quot;Nosotros&quot;, &quot;nuestro\/a(s)&quot; y &quot;nos&quot; se refieren actualmente a\n\t\tla entidad de Slack aplicable en el Contrato (definido a continuaci\u00f3n).\n\t<\/p>\n\n\t<p>\n\t\t<h2>Opciones e instrucciones del cliente<\/h2>\n\t<\/p>\n\n\t<h4>Eres un usuario autorizado de un espacio controlado por un &quot;cliente&quot;<\/h4>\n\n\t<p>\n\t\tUna organizaci\u00f3n u otro tercero al que nos referimos como <strong>\u201cCliente\u201d<\/strong> en estas Condiciones para el usuario te ha invitado a un equipo (por ejemplo, un dominio \u00fanico en el que un grupo de usuarios pueden acceder a los Servicios, como se detalla en las p\u00e1ginas de nuestro <a href=\"https:\/\/get.slack.help\/hc\/{locale}?{hcTrackingToken}\">Centro de ayuda<\/a>).  Si, por ejemplo, vas a unirte a uno de los espacios de tu empresa, el Cliente es tu empresa.  Si vas a unirte a un espacio que ha creado una amiga tuya con su direcci\u00f3n de correo personal para trabajar en su nueva idea para una startup, ella es nuestra Cliente y es quien te autoriza para unirte a su espacio de trabajo.\n\t<\/p>\n\n\t<h4>Lo que significa esto para ti y para nosotros<\/h4>\n\n\t<p>\n\t\tEl Cliente ha aceptado por separado nuestras <a href=\"{abs_root_url}terms-of-service\">Condiciones de servicio del cliente<\/a> o llegado por escrito a \n\t\tun acuerdo con nosotros (en cualquier caso, el <strong>&quot;Contrato&quot;<\/strong>) que permiti\u00f3 al Cliente crear y configurar un \n\t\tequipo de tal modo que t\u00fa y otras personas pod\u00e1is uniros (cada uno de los invitados con acceso a los Servicios, incluido t\u00fa, \n\t\tes un <strong>&quot;Usuario autorizado<\/strong>).  El Contrato incluye nuestro compromiso de ofrecer los Servicios al Cliente, \n\t\tquien puede despu\u00e9s invitar a los Usuarios autorizados a unirse a su espacio o espacios.  Cuando un Usuario autorizado (incluido t\u00fa) \n\t\tenv\u00eda contenido o informaci\u00f3n a los Servicios, como mensajes o archivos(<strong>Datos del cliente<\/strong>), t\u00fa \n\t\treconoces y aceptas que los Datos del cliente son propiedad del Cliente y el Contrato ofrece al Cliente \n\t\tmuchas opciones y control sobre los Datos del cliente.  Por ejemplo, el Cliente puede proporcionar o \n\t\tdenegar el acceso a los Servicios, activar o desactivar las integraciones de terceros, \tgestionar las autorizaciones, \n\t\tlos ajustes de retenci\u00f3n y exportaci\u00f3n, transferir o asignar espacios de trabajo, compartir canales o unir tu espacio\n\t\to canales a otros espacios o canales, y estas opciones e instrucciones pueden afectar al acceso, \n\t\ta la utilizaci\u00f3n, a la divulgaci\u00f3n, a la modificaci\u00f3n o a a la eliminaci\u00f3n de ciertos Datos del cliente.  Consulta las p\u00e1ginas de nuestro \n\t\t<a href=\"https:\/\/get.slack.help\/hc\/{locale}\/categories\/200122103-Team-Administration?{hcTrackingToken}\">Centro de ayuda<\/a> \n\t\tpara recibir m\u00e1s informaci\u00f3n sobre nuestros diferentes planes de Servicio y las opciones disponibles para el Cliente.\n\t<\/p>\n\n\t<h4>La relaci\u00f3n entre t\u00fa, el Cliente y nosotros<\/h4>\n\n\t<p>\n\t\tEN CUANTO A NOSOTROS Y EL CLIENTE, ACEPTAS QUE ES \u00daNICAMENTE RESPONSABILIDAD DEL CLIENTE (A) INFORMARTE A TI Y A\n\t\tLOS USUARIOS AUTORIZADOS DE CUALQUIER POL\u00cdTICA Y PR\u00c1CTICA RELEVANTE EN RELACI\u00d3N CON EL CLIENTE Y DE CUALQUIER AJUSTE QUE PUEDA AFECTAR AL PROCESAMIENTO DE\n\t\tLOS DATOS DEL CLIENTE; (B) OBTENER CUALQUIER DERECHO, AUTORIZACI\u00d3N O CONSENTIMIENTO DE LOS USUARIOS AUTORIZADOS QUE SEA NECESARIO PARA\n\t\tEL USO LEGAL DE LOS DATOS DEL CLIENTE Y LA GESTI\u00d3N DE LOS SERVICIOS; (C) ASEGURAR QUE LA TRANSFERENCIA Y PROCESAMIENTO DE LOS DATOS DEL CLIENTE CONFORME AL CONTRATO SE REALIZAN DE FORMA L\u00cdCITA; Y (D) RESPONDER Y RESOLVER CUALQUIER\n\t\tCONFLICTO CON UN USUARIO AUTORIZADO EN RELACI\u00d3N CON O EN BASE A LOS DATOS DEL CLIENTE, LOS SERVICIOS O LA INCAPACIDAD DEL CLIENTE\n\t\tPARA CUMPLIR CON ESTAS OBLIGACIONES.  SLACK NO SE RESPONSABILIZA NI OFRECE NING\u00daN TIPO DE GARANT\u00cdA, NI EXPRESA\n\t\tNI IMPL\u00cdCITA, EN RELACI\u00d3N CON LOS SERVICIOS, QUE SE TE PROPORCIONAN EN BASE A LA &quot;CONDICI\u00d3N ACTUAL&quot; Y A &quot;LA DISPONIBILIDAD&quot;.\n\t<\/p>\n\n\t<p>\n\t\t<h2>Algunas reglas b\u00e1sicas<\/h2>\n\t<\/p>\n\n\t<h4>Debes ser mayor de edad<\/h4>\n\n\t<p>\n\t\tExcepto, hasta el punto que lo proh\u00edban las leyes aplicables, los Servicios no est\u00e1n dirigidos a menores de diecis\u00e9is a\u00f1os, y no deber\u00eda utilizarlos nadie por debajo de esta edad.  Declaras que eres mayor de 13 a\u00f1os y que eres la persona a la que se dirige la invitaci\u00f3n del Cliente a los Servicios.  No puedes utilizar los Servicios ni acceder a ellos, cualquiera sea la finalidad, si alguna de las declaraciones en la anterior oraci\u00f3n no es cierta.  Sin perjuicio de lo anterior, debes cumplir con la edad m\u00ednima legal para trabajar.\n\t<\/p>\n\n\t<h4>Mientras est\u00e9s aqu\u00ed, debes cumplir las reglas<\/h4>\n\n\t<p>Para garantizar un entorno de trabajo seguro y productivo, todos los Usuarios autorizados deben cumplir nuestra \n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a> permanecer atentos para informar de cualquier \n\t\tcontenido o comportamiento inadecuado al Cliente y a nosotros.<\/p>\n\n\t<h4>Est\u00e1s aqu\u00ed a discreci\u00f3n del Cliente (y a la nuestra)<\/h4>\n\n\t<p>Estas Condiciones del usuario permanecer\u00e1n en vigor hasta que la suscripci\u00f3n del Cliente para ti caduque o concluya, o hasta que \n\t\tel Cliente o nosotros cancelemos tu acceso a los Servicios.  Ponte en contacto con el Cliente si en alg\u00fan momento o por alguna \n\t\traz\u00f3n deseas cancelar tu cuenta, incluyendo a causa de un desacuerdo con una actualizaci\u00f3n de estas Condiciones del usuario o de \n\t\tla <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>.<\/p>\n\n\t<p>\n\t\t<h2>Limitaci\u00f3n de responsabilidad<\/h2>\n\t<\/p>\n\n\t<p>\n\t\tSi consideramos que se da una violaci\u00f3n del Contrato, de las Condiciones del usuario, de la Pol\u00edtica de uso aceptable o de cualquier \n\totra pol\u00edtica que pueda remediarse mediante la eliminaci\u00f3n de ciertos Datos del cliente u otra acci\u00f3n por parte del Cliente, \n\ten la mayor\u00eda de los casos pediremos al Cliente que lleve a cabo dicha acci\u00f3n en vez de intervenir nosotros.  Puede que intervengamos y realicemos lo que \n\tnos parezca la acci\u00f3n m\u00e1s apropiada (lo que incluye desactivar tu cuenta) si el Cliente no realiza la \n\tacci\u00f3n apropiada o consideramos que existe un riesgo cre\u00edble de da\u00f1arnos a nosotros, a los Servicios, a los Usuarios autorizados o a terceros. \n\tNI T\u00da NI NOSOTROS TENDREMOS NINGUNA RESPONSABILIDAD, EN NING\u00daN CASO, DE NING\u00daN BENEFICIO O INGRESO PERDIDO, NI DE \n\tNING\u00daN DA\u00d1O INDIRECTO, ESPECIAL, ACCIDENTAL, CONSIGUIENTE, DE COBERTURA O PUNITIVO, SEA CUAL FUERE LA CAUSA, YA SEA POR CONTRATO, AGRAVIO O BAJO \n\tCUALQUIER OTRO PRINCIPIO DE RESPONSABILIDAD, TANTO SI LA PARTE HA SIDO INFORMADA DE LA POSIBILIDAD DE DICHOS DA\u00d1OS COMO SI NO. \n\tSALVO QUE TAMBI\u00c9N SEAS CLIENTE (Y SIN LIMITAR NUESTROS DERECHOS Y REMEDIOS EN VIRTUD DEL CONTRATO), \n\tNO TENDR\u00c1S RESPONSABILIDAD FINANCIERA ANTE NOSOTROS POR LA INFRACCI\u00d3N DE ESTAS CONDICIONES DEL USUARIO.  EL L\u00cdMITE M\u00c1XIMO DE NUESTRA RESPONSABILIDAD ANTE TI POR \n\tCUALQUIER INFRACCI\u00d3N DE LAS CONDICIONES DEL USUARIO ES DE CIEN D\u00d3LARES (100\u00a0$) EN TOTAL.  LOS DESCARGOS DE RESPONSABILIDAD DESCRITOS NO \n\tSE APLICAR\u00c1N HASTA EL PUNTO EN QUE LO PROH\u00cdBA LA LEGISLACI\u00d3N APLICABLE NI LIMITAR\u00c1N EL DERECHO DE CUALQUIERA DE LAS PARTES A BUSCAR Y OBTENER \n\tCOMPENSACI\u00d3N EQUITATIVA.\n\t<\/p>\n\n\n\t<h3>Aplicaci\u00f3n del derecho del consumidor<\/h3>\n\n\t<p>\n\t\tSlack es una herramienta de trabajo destinada para el uso por parte de empresas y organizaciones, y no con fines de consumo.  Hasta el m\u00e1ximo alcance permitido por la ley, por el presente reconoces y aceptas que no se apliquen las leyes de consumo.  No obstante, si cualquier ley de consumo (p. ej., en Australia, la Competition and Consumer Act 2010 (Cth)) resulta de aplicaci\u00f3n y no puede ser excluida conforme a la legislaci\u00f3n vigente, no hay nada en las presentes Condiciones de uso que restrinja, excluya o modifique cualquier garant\u00eda legal, aval, derecho o recurso que pudieras tener; y nuestra responsabilidad estar\u00e1 limitada (a nuestra elecci\u00f3n) a la sustituci\u00f3n, reparaci\u00f3n o reabastecimiento de los Servicios o el reembolso prorrateado al Cliente de las cuotas pagadas por anticipado en relaci\u00f3n con tu suscripci\u00f3n hasta el final del per\u00edodo.\n\t<\/p>\n\n\n\t<h4>Vigencia<\/h4>\n\n\t<p>\n\t\tLas secciones tituladas &quot;La relaci\u00f3n entre t\u00fa, el Cliente y nosotros&quot;, &quot;Limitaci\u00f3n de responsabilidad&quot; y &quot;Vigencia&quot;, \n\tas\u00ed como todas las cl\u00e1usulas bajo el encabezado general &quot;Cl\u00e1usulas generales&quot;, seguir\u00e1n vigentes incluso en caso de que se produzca cualquier t\u00e9rmino o expiraci\u00f3n \n\tde las Condiciones del usuario.\n\t<\/p>\n\n\t<p>\n\t\t<h2>Cl\u00e1usulas generales<\/h2>\n\t<\/p>\n\n\t<h4>Correo electr\u00f3nico y mensajes de Slack<\/h4>\n\n\t<p>\n\t\tSalvo que se establezca aqu\u00ed lo contrario, todas las notificaciones bajo las Condiciones del usuario se producir\u00e1n por correo electr\u00f3nico, aunque podamos \n\t\telegir notificar a los Usuarios autorizados mediante los Servicios (por ejemplo, con una notificaci\u00f3n de Slackbot) en su lugar.  Las notificaciones a \n\t\tSlack deben enviarse a <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a>, salvo las de car\u00e1cter legal \n\t\tque deben enviarse a <a href=\"mailto:legal@slack.com\">legal@slack.com<\/a>.  Se considerar\u00e1 que una notificaci\u00f3n se ha \n\t\tentregado debidamente (a) el d\u00eda despu\u00e9s de enviarse, en el caso de enviarse por correo electr\u00f3nico; y (b) el mismo d\u00eda, en el caso \n\t\tde notificaciones enviadas mediante los Servicios.  Las notificaciones bajo el Contrato se enviar\u00e1n exclusivamente al Cliente, de \n\t\tacuerdo con los t\u00e9rminos de ese acuerdo.\n\t<\/p>\n\n\n\t<h4>Pol\u00edtica de privacidad<\/h4>\n\n\t<p>\n\t\tPor favor, revisa nuestra <a href=\"{abs_root_url}privacy-policy\">pol\u00edtica de privacidad<\/a> para recibir m\u00e1s informaci\u00f3n sobre c\u00f3mo recopilamos y utilizamos \n\t\tdatos relativos a la utilizaci\u00f3n y al funcionamiento de nuestros productos.\n\t<\/p>\n\n\t<h4>Modificaciones<\/h4>\n\n\t<p>\n\t\tA medida que evolucione nuestro negocio, puede que cambiemos estas Condiciones del usuario o la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>. \n\t\tSi realizamos un cambio sustancial en las Condiciones del usuario o en la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, \n\t\tte notificaremos de forma razonable antes de del que el cambio tenga efecto, ya escribiendo a la direcci\u00f3n de correo asociada a \n\t\ttu cuenta, ya envi\u00e1ndote un mensaje mediante los Servicios. Puedes revisar la versi\u00f3n m\u00e1s reciente de las Condiciones del usuario cuando quieras \n\t\tvisitando esta p\u00e1gina, y visitando las siguientes para las versiones m\u00e1s recientes de las otras p\u00e1ginas referenciadas \n\t\ten estas Condiciones del usuario: <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a> y <a href=\"{abs_root_url}privacy-policy\">pol\u00edtica de privacidad<\/a>. \n\t\tCualquier revisi\u00f3n sustancial de estas Condiciones del usuario se har\u00e1 efectiva en la fecha indicada en nuestra notificaci\u00f3n, y cualquier otro cambio \n\t\tse har\u00e1 efectivo en la fecha en la que lo publiquemos.  Si utilizas los Servicios despu\u00e9s de la fecha efectiva de cualquier cambio, dicha utilizaci\u00f3n \n\t\tconstituir\u00e1 la aceptaci\u00f3n de los t\u00e9rminos y condiciones revisados.\n\t<\/p>\n\n\t<h4>Renuncia<\/h4>\n\n\t<p>\n\t\tNinguna falta o demora de ninguna de las partes al ejercer un derecho bajo las Condiciones del usuario, incluida la \n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, constituir\u00e1 una renuncia a dicho derecho. Ninguna renuncia bajo \n\t\tlas Condiciones del usuario ser\u00e1 efectiva salvo que se haga por escrito y est\u00e9 firmada por un representante autorizado de la parte, \n\t\tconsider\u00e1ndose autorizada la renuncia.\n\t<\/p>\n\n\n\t<h4>Nulidad parcial<\/h4>\n\n\t<p>\n\t\tLas Condiciones del usuario, incluida la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, se respetar\u00e1n en \n\t\tla mayor medida posible permitida por la legislaci\u00f3n aplicable.  Si un tribunal competente determinara que cualquier cl\u00e1usula de las Condiciones del usuario \n\t\tes contraria a la ley, el tribunal modificar\u00e1 la cl\u00e1usula, que se interpretar\u00e1 \n\t\tlo mejor posible para cumplir los objetivos de la cl\u00e1usula original en la mayor medida posible permitida por la ley, y \n\t\tlas cl\u00e1usulas restantes de las Condiciones del usuario permanecer\u00e1n vigentes.\n\t<\/p>\n\n\t<h4>Cesi\u00f3n<\/h4>\n\n\t<p>\n\t\tNo puedes ceder ninguno de tus derechos o delegar tus obligaciones bajo estas Condiciones del usuario, incluida la \n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, ni por operaci\u00f3n de la ley ni de otra manera, \n\t\tsin nuestro consentimiento previo por escrito (que no se negar\u00e1 sin raz\u00f3n).  Podemos ceder estas Condiciones del usuario \n\t\ten su totalidad (incluyendo todos los t\u00e9rminos y condiciones incorporados aqu\u00ed para referencia) sin tu consentimiento \n\t\ta una corporaci\u00f3n afiliada o en relaci\u00f3n con una fusi\u00f3n, adquisici\u00f3n, reorganizaci\u00f3n corporativa o venta de todas \n\t\t o casi todas nuestras acciones.\n\t<\/p>\n\n\t<h4>Legislaci\u00f3n aplicable; Juzgado; Renuncia a juicio con jurado; Honorarios legales<\/h4>\n\n\t<p>\n\t\tLas Condiciones del usuario, incluida la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, y cualquier disputa que surja de los mismos o est\u00e9 relacionada con estos, se regir\u00e1 exclusivamente por la misma legislaci\u00f3n aplicable del Contrato, sin tener en cuenta conflictos de leyes o la Convenci\u00f3n de Naciones Unidas sobre los Contratos de Compraventa Internacional de Mercader\u00edas. Los tribunales situados en la jurisdicci\u00f3n correspondiente del Contrato, tendr\u00e1n competencia exclusiva para juzgar cualquier disputa que surja de o se relacione con estas Condiciones del usuario, incluida la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, o su formaci\u00f3n, interpretaci\u00f3n o cumplimiento.  Las partes consienten y se someten a la jurisdicci\u00f3n exclusiva de dichos tribunales.  Las partes renuncian a todo derecho a juicio con jurado en relaci\u00f3n con cualquier acci\u00f3n o litigio que pueda surgir de cualquier manera de o en relaci\u00f3n con el Contrato.  En toda acci\u00f3n o procedimiento para ejercer los derechos bajo las Condiciones para el usuario, la parte que prevalezca podr\u00e1 recuperar los gastos razonables y los honorarios de los abogados.\n\t<\/p>\n\t<p>\n\t\tLas partes consienten y se someten a la jurisdicci\u00f3n exclusiva de dichos tribunales.  Las partes renuncian a cualquier derecho a juicio con jurado \n\t\ten relaci\u00f3n con cualquier acci\u00f3n o litigio que pueda surgir de cualquier manera de o en relaci\u00f3n con las Condiciones del usuario. En cualquier acci\u00f3n o procedimiento para ejercer los derechos bajo las Condiciones del usuario, la parte que prevalezca podr\u00e1 recuperar los gastos razonables y los honorarios de los abogados.\n\t<\/p>\n\n\t<h4>Acuerdo completo<\/h4>\n\n\t<p>\n\t\tLas Condiciones del usuario, incluido cualquier t\u00e9rmino incorporado por referencia a las Condiciones del usuario, constituyen el acuerdo completo \n\t\tentre t\u00fa y nosotros, y reemplazan cualquier acuerdo, propuesta o representaci\u00f3n previa y contempor\u00e1nea, oral \n\t\to escrita, referente al tema. En caso de conflicto o inconsistencia entre las cl\u00e1usulas de \n\t\testas Condiciones del usuario y las p\u00e1ginas referenciadas en ellos, los t\u00e9rminos de estas Condiciones del usuario prevalecer\u00e1n; \n\t\tsin embargo, si se da un conflicto o una inconsistencia entre el Contrato y las Condiciones del usuario, los \n\t\tt\u00e9rminos del Contrato prevalecer\u00e1n, seguidos de las cl\u00e1usulas de estas Condiciones del usuario, y a continuaci\u00f3n \n\t\tlas p\u00e1ginas referenciadas en estas Condiciones del usuario (como la pol\u00edtica de privacidad).  El Cliente se responsabilizar\u00e1 de notificar a \n\t\tlos Usuarios autorizados de tales conflictos o inconsistencias, y hasta ese momento los t\u00e9rminos aqu\u00ed establecidos ser\u00e1n vinculantes.\n\t<\/p>\n\n\t{{\/t}}\n\n\n\t<h3>{{#t}}Contactar con Slack{{\/t}}<\/h3>\n\n\t<p>\n\t\t{{#t}}No dudes en contactar con nosotros si tienes alguna pregunta sobre las Condiciones de servicio al usuario de Slack. \n \t\tPuedes escribirnos a <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a> o \n\t\ta nuestra direcci\u00f3n de correo:{{\/t}}\n\t<\/p>\n\n\t<p>\n\t\t{{#t}}Para aquellos Clientes y Usuarios autorizados que hagan uso de Espacios de trabajo establecidos por Clientes en Estados Unidos y Canad\u00e1:{{\/t}}\n\t<\/p>\n\n\t<p>\n\t\t{{#t}}Slack Technologies<br \/>\n\t\t500 Howard Street<br \/>\n\t\tSan Francisco, CA 94105<br \/>\n\t\tEE.\u00a0UU.{{\/t}}\n\t<\/p>\n\n\t<p>\n\t\t{{#t}}Para aquellos Clientes y Usuarios autorizados que hagan uso de Espacios de trabajo establecidos por Clientes fuera de Estados Unidos y Canad\u00e1:{{\/t}}\n\t<\/p>\n\n\t<p>\n\t\t{{#t}}Slack Technologies Limited<br \/>\n\t\t4th Floor, One Park Place<br \/>\n\t\tHatch Street Upper<br \/>\n\t\tDublin 2 (Irlanda){{\/t}}\n\t<\/p>\n\n{{else}}\n\n\t{{#feature flag=\"feature_gdpr_user_join_tos\"}}\n\t<div class=\"c-alert c-alert--boxed c-alert--level_default margin_bottom_100\">\n\t\t<i class=\"c-icon c-icon--warning\"><\/i>\n\t\t<span class=\"margin_left_100\">\n\t\t\t {{#t}}<strong>Actualizaci\u00f3n:<\/strong> Los cambios en las Condiciones de servicio al usuario de Slack entrar\u00e1n en vigor el 20 de abril del 2018.<br>\n\t\t\t<a href=\"{abs_root_url}terms-of-service\/user-updated\">Haga clic aqu\u00ed<\/a> para consultar los nuevos t\u00e9rminos.  {{\/t}}\n\t\t<\/span>\n\t<\/div>\n\t{{\/feature}}\n\n\t<p><strong>{{#t}}En vigor: 17 de nov. del 2016{{\/t}}<\/strong><\/p>\n\n\t<p>\n\t\t{{#t}}Estas Condiciones de servicio al usuario (las <strong>\u201cCondiciones para el usuario\u201d<\/strong>) rigen tu acceso y uso de nuestras herramientas y plataforma en l\u00ednea \n\t\tpara la productividad en el lugar de trabajo (los <strong>\u201cServicios\u201d<\/strong>).  L\u00e9elos detenidamente, por favor.  Aunque est\u00e1s \n\t\t conect\u00e1ndote a un espacio que ya existe, estos t\u00e9rminos para el usuario se aplican a ti, el futuro usuario que est\u00e1 leyendo \n\t\testas palabras. Estamos encantados de tenerte aqu\u00ed.{{\/t}}\n\t<\/p>\n\n\t{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}\n\t<p>\n\t\t<h2>Lo primero es lo primero<\/h2>\n\t<\/p>\n\n\t<h4>Estas Condiciones para el usuario son jur\u00eddicamente vinculantes.<\/h4>\n\n\t<p>\n\t\tEstas Condiciones del usuario son un contrato jur\u00eddicamente vinculante entre t\u00fa y nosotros.  Como parte de estas Condiciones del usuario, \n\t\taceptas cumplir la versi\u00f3n m\u00e1s reciente de nuestra <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, \n\t\tincorporada como referencia en estas Condiciones del usuario.  Si utilizas los Servicios o accedes a ellos, o contin\u00faas accediendo o utilizando\n\t\tlos Servicios despu\u00e9s de recibir una notificaci\u00f3n de un cambio en los T\u00e9rminos o la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>,\n\t\tconfirmas que has le\u00eddo, comprendido y aceptado vincularte a las Condiciones del usuario y a la\n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>.  &quot;Nosotros&quot;, &quot;nuestro\/a(s)&quot; y &quot;nos&quot; se refieren actualmente a\n\t\tla entidad de Slack aplicable en el Contrato (definido a continuaci\u00f3n).\n\t<\/p>\n\n\n\t<p>\n\t\t<h2>Opciones e instrucciones del cliente<\/h2>\n\t<\/p>\n\n\t<h4>Eres un usuario autorizado de un espacio controlado por un &quot;cliente&quot;<\/h4>\n\n\t<p>\n\t\tUna organizaci\u00f3n u otro tercero al que nos referimos como <strong>\u201cCliente\u201d<\/strong> en estas Condiciones del usuario te ha invitado \n\t\ta un equipo (por ejemplo, una URL \u00fanica en la que un grupo de usuarios pueden acceder a los Servicios, como se detalla en las p\u00e1ginas de \n\t\tnuestro <a href=\"https:\/\/get.slack.help\/hc\/{locale}?{hcTrackingToken}\">Centro de ayuda<\/a>).  Si, por ejemplo, vas a unirte a uno de los \n\t\tespacios de tu empresa, el Cliente es tu empresa.  Si vas a unirte a un espacio que ha creado una amiga tuya con su \n\t\tdirecci\u00f3n de correo personal para trabajar en su nueva idea para una startup, ella es nuestro Cliente y quien te autoriza \n\t\tpara unirte a su espacio de trabajo.\n\t<\/p>\n\n\t<h4>Lo que significa esto para ti y para nosotros<\/h4>\n\n\t<p>\n\t\tEl Cliente ha aceptado por separado nuestras <a href=\"{abs_root_url}terms-of-service\">Condiciones de servicio del cliente<\/a> o llegado por escrito a \n\t\tun acuerdo con nosotros (en cualquier caso, el <strong>&quot;Contrato&quot;<\/strong>) que permiti\u00f3 al Cliente crear y configurar un \n\t\tequipo de tal modo que t\u00fa y otras personas pod\u00e1is uniros (cada uno de los invitados con acceso a los Servicios, incluido t\u00fa, \n\t\tes un <strong>&quot;Usuario autorizado<\/strong>).  El Contrato incluye nuestro compromiso de ofrecer los Servicios al Cliente, \n\t\tquien puede despu\u00e9s invitar a los Usuarios autorizados a unirse a su espacio o espacios.  Cuando un Usuario autorizado (incluido t\u00fa) \n\t\tenv\u00eda contenido o informaci\u00f3n a los Servicios, como mensajes o archivos(<strong>Datos del cliente<\/strong>), t\u00fa \n\t\treconoces y aceptas que los Datos del cliente son propiedad del Cliente y el Contrato ofrece al Cliente \n\t\tmuchas opciones y control sobre los Datos del cliente.  Por ejemplo, el Cliente puede proporcionar o \n\t\tdenegar el acceso a los Servicios, activar o desactivar las integraciones de terceros, \tgestionar las autorizaciones, \n\t\tlos ajustes de retenci\u00f3n y exportaci\u00f3n, transferir o asignar espacios de trabajo, compartir canales o unir tu espacio\n\t\to canales a otros espacios o canales, y estas opciones e instrucciones pueden afectar al acceso, \n\t\ta la utilizaci\u00f3n, a la divulgaci\u00f3n, a la modificaci\u00f3n o a a la eliminaci\u00f3n de ciertos Datos del cliente.  Consulta las p\u00e1ginas de nuestro \n\t\t<a href=\"https:\/\/get.slack.help\/hc\/{locale}\/categories\/200122103-Team-Administration?{hcTrackingToken}\">Centro de ayuda<\/a> \n\t\tpara recibir m\u00e1s informaci\u00f3n sobre nuestros diferentes planes de Servicio y las opciones disponibles para el Cliente.\n\t<\/p>\n\n\t<h4>La relaci\u00f3n entre t\u00fa, el Cliente y nosotros<\/h4>\n\n\t<p>\n\t\tEN CUANTO A NOSOTROS Y EL CLIENTE, ACEPTAS QUE ES \u00daNICAMENTE RESPONSABILIDAD DEL CLIENTE (A) INFORMARTE A TI Y A\n\t\tLOS USUARIOS AUTORIZADOS DE CUALQUIER POL\u00cdTICA Y PR\u00c1CTICA RELEVANTE EN RELACI\u00d3N CON EL CLIENTE Y DE CUALQUIER AJUSTE QUE PUEDA AFECTAR AL PROCESAMIENTO DE\n\t\tLOS DATOS DEL CLIENTE; (B) OBTENER CUALQUIER DERECHO, AUTORIZACI\u00d3N O CONSENTIMIENTO DE LOS USUARIOS AUTORIZADOS QUE SEA NECESARIO PARA\n\t\tEL USO LEGAL DE LOS DATOS DEL CLIENTE Y LA GESTI\u00d3N DE LOS SERVICIOS; (C) ASEGURAR QUE LA TRANSFERENCIA Y PROCESAMIENTO DE LOS DATOS DEL CLIENTE CONFORME AL CONTRATO SE REALIZAN DE FORMA L\u00cdCITA; Y (D) RESPONDER Y RESOLVER CUALQUIER\n\t\tCONFLICTO CON UN USUARIO AUTORIZADO EN RELACI\u00d3N CON O EN BASE A LOS DATOS DEL CLIENTE, LOS SERVICIOS O LA INCAPACIDAD DEL CLIENTE\n\t\tPARA CUMPLIR CON ESTAS OBLIGACIONES.  SLACK NO SE RESPONSABILIZA NI OFRECE NING\u00daN TIPO DE GARANT\u00cdA, NI EXPRESA\n\t\tNI IMPL\u00cdCITA, EN RELACI\u00d3N CON LOS SERVICIOS, QUE SE TE PROPORCIONAN EN BASE A LA &quot;CONDICI\u00d3N ACTUAL&quot; Y A &quot;LA DISPONIBILIDAD&quot;.\n\t<\/p>\n\n\n\t<p>\n\t\t<h2>Algunas reglas b\u00e1sicas<\/h2>\n\t<\/p>\n\n\t<h4>Debes ser mayor de 16 a\u00f1os.<\/h4>\n\n\t<p>\n\t\tLos Servicios no est\u00e1n dirigidos a menores de diecis\u00e9is a\u00f1os, y no deber\u00eda utilizarlos nadie por debajo de esta edad.\n\t\tDeclaras que eres mayor de 16 a\u00f1os y que eres la persona a la que se dirige la invitaci\u00f3n del Cliente a\n\t\tlos Servicios.  No puedes utilizar los Servicios ni acceder a ellos para ninguna finalidad si alguna de las declaraciones en\n\t\tla anterior oraci\u00f3n no es cierta. Sin perjuicio de lo anterior, debes cumplir con la edad m\u00ednima legal para trabajar.\n\t<\/p>\n\n\t<h4>Mientras est\u00e9s aqu\u00ed, debes cumplir las reglas<\/h4>\n\n\t<p>\n\t\tPara garantizar un entorno de trabajo seguro y productivo, todos los Usuarios autorizados deben cumplir nuestra \n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a> permanecer atentos para informar de cualquier \n\t\tcontenido o comportamiento inadecuado al Cliente y a nosotros.\n\t<\/p>\n\n\t<h4>Est\u00e1s aqu\u00ed a discreci\u00f3n del Cliente (y a la nuestra)<\/h4>\n\n\t<p>\n\t\tEstas Condiciones del usuario permanecer\u00e1n en vigor hasta que la suscripci\u00f3n del Cliente para ti caduque o concluya, o hasta que \n\t\tel Cliente o nosotros cancelemos tu acceso a los Servicios.  Ponte en contacto con el Cliente si en alg\u00fan momento o por alguna \n\t\traz\u00f3n deseas cancelar tu cuenta, incluyendo a causa de un desacuerdo con una actualizaci\u00f3n de estas Condiciones del usuario o de \n\t\tla <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>.\n\t<\/p>\n\n\t<p>\n\t\t<h2>Limitaci\u00f3n de responsabilidad<\/h2>\n\t<\/p>\n\n\t<p>\n\t\tSi consideramos que se da una violaci\u00f3n del Contrato, de las Condiciones del usuario, de la Pol\u00edtica de uso aceptable o de cualquier \n\totra pol\u00edtica que pueda remediarse mediante la eliminaci\u00f3n de ciertos Datos del cliente u otra acci\u00f3n por parte del Cliente, \n\ten la mayor\u00eda de los casos pediremos al Cliente que lleve a cabo dicha acci\u00f3n en vez de intervenir nosotros.  Puede que intervengamos y realicemos lo que \n\tnos parezca la acci\u00f3n m\u00e1s apropiada (lo que incluye desactivar tu cuenta) si el Cliente no realiza la \n\tacci\u00f3n apropiada o consideramos que existe un riesgo cre\u00edble de da\u00f1arnos a nosotros, a los Servicios, a los Usuarios autorizados o a terceros. \n\tNI T\u00da NI NOSOTROS TENDREMOS NINGUNA RESPONSABILIDAD, EN NING\u00daN CASO, DE NING\u00daN BENEFICIO O INGRESO PERDIDO, NI DE \n\tNING\u00daN DA\u00d1O INDIRECTO, ESPECIAL, ACCIDENTAL, CONSIGUIENTE, DE COBERTURA O PUNITIVO, SEA CUAL FUERE LA CAUSA, YA SEA POR CONTRATO, AGRAVIO O BAJO \n\tCUALQUIER OTRO PRINCIPIO DE RESPONSABILIDAD, TANTO SI LA PARTE HA SIDO INFORMADA DE LA POSIBILIDAD DE DICHOS DA\u00d1OS COMO SI NO. \n\tSALVO QUE TAMBI\u00c9N SEAS CLIENTE (Y SIN LIMITAR NUESTROS DERECHOS Y REMEDIOS EN VIRTUD DEL CONTRATO), \n\tNO TENDR\u00c1S RESPONSABILIDAD FINANCIERA ANTE NOSOTROS POR LA INFRACCI\u00d3N DE ESTAS CONDICIONES DEL USUARIO.  EL L\u00cdMITE M\u00c1XIMO DE NUESTRA RESPONSABILIDAD ANTE TI POR \n\tCUALQUIER INFRACCI\u00d3N DE LAS CONDICIONES DEL USUARIO ES DE CIEN D\u00d3LARES (100\u00a0$) EN TOTAL.  LOS DESCARGOS DE RESPONSABILIDAD DESCRITOS NO \n\tSE APLICAR\u00c1N HASTA EL PUNTO EN QUE LO PROH\u00cdBA LA LEGISLACI\u00d3N APLICABLE NI LIMITAR\u00c1N EL DERECHO DE CUALQUIERA DE LAS PARTES A BUSCAR Y OBTENER \n\tCOMPENSACI\u00d3N EQUITATIVA.\n\t<\/p>\n\n\t<h3>Aplicaci\u00f3n del derecho del consumidor<\/h3>\n\n\t<p>Slack es una herramienta de trabajo destinada para el uso por parte de empresas y organizaciones, y no con fines de consumo.  Hasta el m\u00e1ximo alcance permitido por la ley, por el presente reconoces y aceptas que no se apliquen las leyes de consumo.  No obstante, si cualquier ley de consumo (p. ej., en Australia, la Competition and Consumer Act 2010 (Cth)) resulta de aplicaci\u00f3n y no puede ser excluida conforme a la legislaci\u00f3n vigente, no hay nada en las presentes Condiciones de uso que restrinja, excluya o modifique cualquier garant\u00eda legal, aval, derecho o recurso que pudieras tener; y nuestra responsabilidad estar\u00e1 limitada (a nuestra elecci\u00f3n) a la sustituci\u00f3n, reparaci\u00f3n o reabastecimiento de los Servicios o el reembolso prorrateado al Cliente de las cuotas pagadas por anticipado en relaci\u00f3n con tu suscripci\u00f3n hasta el final del per\u00edodo.<\/p>\n\n\t<h4>Vigencia<\/h4>\n\n\t<p>\n\t\tLas secciones tituladas &quot;La relaci\u00f3n entre t\u00fa, el Cliente y nosotros&quot;, &quot;Limitaci\u00f3n de responsabilidad&quot; y &quot;Vigencia&quot;, \n\tas\u00ed como todas las cl\u00e1usulas bajo el encabezado general &quot;Cl\u00e1usulas generales&quot;, seguir\u00e1n vigentes incluso en caso de que se produzca cualquier t\u00e9rmino o expiraci\u00f3n \n\tde las Condiciones del usuario.\n\t<\/p>\n\n\n\n\t<p>\n\t\t<h2>Cl\u00e1usulas generales<\/h2>\n\t<\/p>\n\n\t<h4>Correo electr\u00f3nico y mensajes de Slack<\/h4>\n\n\t<p>\n\t\tSalvo que se establezca aqu\u00ed lo contrario, todas las notificaciones bajo las Condiciones del usuario se producir\u00e1n por correo electr\u00f3nico, aunque podamos \n\t\telegir notificar a los Usuarios autorizados mediante los Servicios (por ejemplo, con una notificaci\u00f3n de Slackbot) en su lugar.  Las notificaciones a \n\t\tSlack deben enviarse a <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a>, salvo las de car\u00e1cter legal \n\t\tque deben enviarse a <a href=\"mailto:legal@slack.com\">legal@slack.com<\/a>.  Se considerar\u00e1 que una notificaci\u00f3n se ha \n\t\tentregado debidamente (a) el d\u00eda despu\u00e9s de enviarse, en el caso de enviarse por correo electr\u00f3nico; y (b) el mismo d\u00eda, en el caso \n\t\tde notificaciones enviadas mediante los Servicios.  Las notificaciones bajo el Contrato se enviar\u00e1n exclusivamente al Cliente, de \n\t\tacuerdo con los t\u00e9rminos de ese acuerdo.\n\t<\/p>\n\n\t<h4>Pol\u00edtica de privacidad<\/h4>\n\n\t<p>\n\t\tPor favor, revisa nuestra <a href=\"{abs_root_url}privacy-policy\">pol\u00edtica de privacidad<\/a> para recibir m\u00e1s informaci\u00f3n sobre c\u00f3mo recopilamos y utilizamos \n\t\tdatos relativos a la utilizaci\u00f3n y al funcionamiento de nuestros productos.\n\t<\/p>\n\n\t<h4>Modificaciones<\/h4>\n\n\t<p>\n\t\tA medida que evolucione nuestro negocio, puede que cambiemos estas Condiciones del usuario o la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>. \n\t\tSi realizamos un cambio sustancial en las Condiciones del usuario o en la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, \n\t\tte notificaremos de forma razonable antes de que el cambio tenga efecto, ya escribiendo a la direcci\u00f3n de correo asociada a \n\t\ttu cuenta, ya envi\u00e1ndote un mensaje mediante los Servicios. Puedes revisar la versi\u00f3n m\u00e1s reciente de las Condiciones del usuario cuando quieras \n\t\tvisitando esta p\u00e1gina, y visitando las siguientes para las versiones m\u00e1s recientes de las otras p\u00e1ginas referenciadas \n\t\ten estas Condiciones del usuario: <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a> y <a href=\"{abs_root_url}privacy-policy\">pol\u00edtica de privacidad<\/a>. \n\t\tCualquier revisi\u00f3n sustancial de estas Condiciones del usuario se har\u00e1 efectiva en la fecha indicada en nuestra notificaci\u00f3n, y cualquier otro cambio \n\t\tse har\u00e1 efectivo en la fecha en la que lo publiquemos. Si utilizas los Servicios despu\u00e9s de la fecha efectiva de cualquier cambio, dicha utilizaci\u00f3n \n\t\tconstituir\u00e1 la aceptaci\u00f3n de los t\u00e9rminos y condiciones revisados.\n\t<\/p>\n\n\t<h4>Renuncia<\/h4>\n\n\t<p>\n\t\tNinguna falta o demora de ninguna de las partes al ejercer un derecho bajo las Condiciones del usuario, incluida la \n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, constituir\u00e1 una renuncia a dicho derecho. Ninguna renuncia bajo \n\t\tlas Condiciones del usuario ser\u00e1 efectiva salvo que se haga por escrito y est\u00e9 firmada por un representante autorizado de la parte, \n\t\tconsider\u00e1ndose autorizada la renuncia.\n\t<\/p>\n\n\t<h4>Nulidad parcial<\/h4>\n\n\t<p>\n\t\tLas Condiciones del usuario, incluida la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, se respetar\u00e1n en \n\t\tla mayor medida posible permitida por la legislaci\u00f3n aplicable.  Si un tribunal competente determinara que cualquier cl\u00e1usula de las Condiciones del usuario \n\t\tes contraria a la ley, el tribunal modificar\u00e1 la cl\u00e1usula, que se interpretar\u00e1 \n\t\tlo mejor posible para cumplir los objetivos de la cl\u00e1usula original en la mayor medida posible permitida por la ley, y \n\t\tlas cl\u00e1usulas restantes de las Condiciones del usuario permanecer\u00e1n vigentes.\n\t<\/p>\n\n\t<h4>Cesi\u00f3n<\/h4>\n\n\t<p>\n\t\tNo puedes ceder ninguno de tus derechos o delegar tus obligaciones bajo estas Condiciones del usuario, incluida la \n\t\t<a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, ni por operaci\u00f3n de la ley ni de otra manera, \n\t\tsin nuestro consentimiento previo por escrito (que no se negar\u00e1 sin raz\u00f3n).  Podemos ceder estas Condiciones del usuario \n\t\ten su totalidad (incluyendo todos los t\u00e9rminos y condiciones incorporados aqu\u00ed para referencia) sin tu consentimiento \n\t\ta una corporaci\u00f3n afiliada o en relaci\u00f3n con una fusi\u00f3n, adquisici\u00f3n, reorganizaci\u00f3n corporativa o venta de todas \n\t\t o casi todas nuestras acciones.\n\t<\/p>\n\n\t<h4>Legislaci\u00f3n aplicable; Juzgado; Renuncia a juicio con jurado; Honorarios legales<\/h4>\n\n\t<p>\n\t\tLas Condiciones del usuario, incluida la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, y cualquier disputa que surja de los mismos o est\u00e9 relacionada con estos, se regir\u00e1 exclusivamente por la misma legislaci\u00f3n aplicable del Contrato, sin tener en cuenta conflictos de leyes o la Convenci\u00f3n de Naciones Unidas sobre los Contratos de Compraventa Internacional de Mercader\u00edas. Los tribunales situados en la jurisdicci\u00f3n correspondiente del Contrato, tendr\u00e1n competencia exclusiva para juzgar cualquier disputa que surja de o se relacione con estas Condiciones del usuario, incluida la <a href=\"{abs_root_url}acceptable-use-policy\">Pol\u00edtica de uso aceptable<\/a>, o su formaci\u00f3n, interpretaci\u00f3n o cumplimiento.  Las partes consienten y se someten a la jurisdicci\u00f3n exclusiva de dichos tribunales. <strong>Las partes renuncian a cualquier derecho a juicio con jurado en relaci\u00f3n con cualquier acci\u00f3n o litigio que pueda surgir de cualquier manera de o en relaci\u00f3n con el Contrato.<\/strong> En cualquier acci\u00f3n o procedimiento para ejercer los derechos bajo las Condiciones del usuario, la parte que prevalezca podr\u00e1 recuperar los gastos razonables y los honorarios de los abogados. Las partes consienten y \n\t\tse someten a la jurisdicci\u00f3n exclusiva de dichos tribunales. <strong>Las partes renuncian a cualquier derecho a juicio con jurado \n\t\ten relaci\u00f3n con cualquier acci\u00f3n o litigio que pueda surgir de cualquier manera de o en relaci\u00f3n con las Condiciones del usuario.<\/strong> En cualquier\n\t\tacci\u00f3n o procedimiento para ejercer los derechos bajo las Condiciones del usuario, la parte que prevalezca podr\u00e1 recuperar \n\t\tlos gastos razonables y los honorarios de los abogados.\n\t<\/p>\n\n\t<h4>Acuerdo completo<\/h4>\n\n\t<p>\n\t\tLas Condiciones del usuario, incluido cualquier t\u00e9rmino incorporado por referencia a las Condiciones del usuario, constituyen el acuerdo completo \n\t\tentre t\u00fa y nosotros, y reemplazan cualquier acuerdo, propuesta o representaci\u00f3n previa y contempor\u00e1nea, oral \n\t\to escrita, referente al tema. En caso de conflicto o inconsistencia entre las cl\u00e1usulas de \n\t\testas Condiciones del usuario y las p\u00e1ginas referenciadas en ellos, los t\u00e9rminos de estas Condiciones del usuario prevalecer\u00e1n; \n\t\tsin embargo, si se da un conflicto o una inconsistencia entre el Contrato y las Condiciones del usuario, los \n\t\tt\u00e9rminos del Contrato prevalecer\u00e1n, seguidos de las cl\u00e1usulas de estas Condiciones del usuario, y a continuaci\u00f3n \n\t\tlas p\u00e1ginas referenciadas en estas Condiciones del usuario (como la pol\u00edtica de privacidad).  El Cliente se responsabilizar\u00e1 de notificar a \n\t\tlos Usuarios autorizados de tales conflictos o inconsistencias, y hasta ese momento los t\u00e9rminos aqu\u00ed establecidos ser\u00e1n vinculantes.\n\t<\/p>\n\t{{\/t}}\n\n\t<h3>{{#t}}Contactar con Slack{{\/t}}<\/h3>\n\n\t<p>\n\t\t{{#t}}No dudes en contactar con nosotros si tienes alguna pregunta sobre las Condiciones de servicio al usuario de Slack. \n \t\tPuedes escribirnos a <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a> o \n\t\ta nuestra direcci\u00f3n de correo:{{\/t}}\n\t<\/p>\n\n\t<p>\n\t\t{{#t}}Slack Technologies, Inc.<br \/>\n\t\t500 Howard Street<br \/>\n\t\tSan Francisco, CA 94105<br \/>\n\t\tEstados Unidos{{\/t}}\n\t<\/p>\n\n\n{{\/feature}}";
