TS.raw_templates['channel_page_view_all_files_link'] = "{{i18n_ns 'channel_pages'}}\n\n<a class=\"view_all_files_link blue_link overflow_ellipsis\">\n\t<i class=\"ts_icon ts_icon_search_files\"><\/i>\n\t{{#if model_ob.is_im}}\n\t\t{{#if member.profile.first_name}}\n\t\t\t{{#t user=member.profile.first_name}}Ver todos los archivos compartidos con {user}{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t user=member.name}}Ver todos los archivos compartidos con {user}{{\/t}}\n\t\t{{\/if}}\n\t{{\/if}}\n\t{{#if model_ob.is_group}}\n\t\t{{#t}}Ver los archivos de <i class=\"ts_icon ts_icon_lock\"><\/i> {model_ob.name}{{\/t}}\n\t{{\/if}}\n\t{{#if model_ob.is_channel}}\n\t\t{{#t}}Ver todos los archivos de #{model_ob.name}{{\/t}}\n\t{{\/if}}\n<\/a>\n";
TS.raw_templates['channel_page_notif_prefs'] = "{{i18n_ns \"channel_pages\"}}\n\n{{#unless is_muted}}\n\t<div class=\"channel_desktop_notifs small_bottom_margin\">\n\t\t<div class=\"greigh mini black small_bottom_margin\">{{#t}}Notificaciones para ordenador{{\/t}}<\/div>\n\t\t{{#if desktop_notifs_enabled}}\n\t\t\t{{#if desktop_everything}}{{#t}}Todo lo nuevo{{\/t}}{{\/if}}\n\t\t\t{{#if desktop_mentions}}{{#t}}Menciones y palabras clave{{\/t}}{{\/if}}\n\t\t\t{{#if desktop_nothing}}{{#t}}Nada{{\/t}}{{\/if}}\n\t\t{{else}}\n\t\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t\t{{#if notifications_not_yet_allowed}}\n\t\t\t\t\t<span>{{#t}}A\u00fan no has activado las notificaciones en el ordenador. Para hacerlo, abre el <button onclick=\"TS.ui.prefs_dialog.start('notifications')\" class=\"preference_dialog_btn cursor_pointer bold btn_link\" type=\"button\">di\u00e1logo Preferencias<\/button> y sigue las instrucciones.{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if notifications_not_allowed}}\n\t\t\t\t\t<span>{{#t}}Has rechazado las notificaciones en el navegador. Para modificar este ajuste, tendr\u00e1s que abrir las preferencias del navegador.{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if notifications_impossible}}\n\t\t\t\t\t<span>{{#t}}Tu navegador no permite notificaciones para ordenador. <a href=\"\/downloads\" target=\"_blank\">\u00bfQuieres probar una de nuestras aplicaciones?<\/a>{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t<\/div>\n\t<div class=\"channel_push_notifs bottom_margin\">\n\t\t<div class=\"greigh mini black small_bottom_margin\">{{#t}}Notificaciones m\u00f3viles{{\/t}}<\/div>\n\t\t\t{{#if push_everything}}{{#t}}Todo lo nuevo{{\/t}}{{\/if}}\n\t\t\t{{#if push_mentions}}{{#t}}Menciones y palabras clave{{\/t}}{{\/if}}\n\t\t\t{{#if push_nothing}}{{#t}}Nada{{\/t}}{{\/if}}\n\t<\/div>\n{{\/unless}}\n{{#if is_muted}}\n\t<div class=\"bold bottom_margin\">\n\t\t{{#if model_ob.is_channel}}\n\t\t\t{{#t}}Este canal est\u00e1 silenciado{{\/t}}\n\t\t{{else}}\n\t\t\t{{#if model_ob.is_mpim}}\n\t\t\t\t{{#t}}Esta conversaci\u00f3n est\u00e1 silenciada{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Este canal est\u00e1 silenciado{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/div>\n{{\/if}}\n<button class=\"edit_notif_prefs_btn btn btn_small btn_outline\">{{#t}}Modificar preferencias{{\/t}}<\/button>\n";
