TS.raw_templates['channel_page_all_members_dialog'] = "{{i18n_ns \"channel_pages\"}}\n\n<div id=\"channel_membership_dialog_container\" class=\"searchable_member_list\">\n\t<div id=\"channel_membership_dialog_scroller\" class=\"searchable_member_list_scroller\"><\/div>\n<\/div>\n";
TS.raw_templates['channel_page_apps_list'] = "{{i18n_ns 'channel_pages'}}\n\n<div>\n\t{{#each apps}}\n\t\t<div class=\"p-channel_page_apps__list__row cursor_pointer display_flex align_items_center\" data-app-user-id=\"{{this.app_user_id}}\" data-qa=\"channel_apps_section_row\">\n\t\t\t<div class=\"p-channel_page_apps__list__row__wrapper rounded{{#if this.can_be_removed}} right_margin{{\/if}} display_flex align_items_center flex_one full_height\">\n\t\t\t\t<img src=\"{{#if this.icons}}{{this.icons.image_32}}{{else}}{{#if this.app_icon}}{{this.app_icon}}{{else}}{{versioned_default_application_icon}}{{\/if}}{{\/if}}\" width=\"20\" height=\"20\" class=\"p-channel_page_apps__list__row__image very_small_left_margin\" \/>\n\t\t\t\t<span class=\"small_left_margin\">{{this.name}}<\/span>\n\t\t\t<\/div>\n\t\t\t{{#if this.can_be_removed}}\n\t\t\t\t<ts-icon class=\"ts_icon_times p-channel_page_apps__list__row__remove ts_tip ts_tip_top ts_tip_float\" data-action=\"remove_app\" data-qa=\"channel_apps_section_row_remove\">\n\t\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Eliminar{{\/t}}<\/span>\n\t\t\t\t<\/ts-icon>\n\t\t\t{{\/if}}\n\t\t<\/div>\n\t{{\/each}}\n\t{{#if can_add_app}}\n\t<button class=\"p-channel_page_apps__list__row--add_app btn_link display_flex align_items_center\">\n\t\t<ts-icon class=\"ts_icon_plus very_small_top_margin very_small_left_margin\"><\/ts-icon>\n\t\t<span class=\"small_left_margin\" data-js=\"channel_page_apps_add\" data-qa=\"channel_apps_section_add\">{{#t}}A\u00f1adir aplicaci\u00f3n{{\/t}}<\/span>\n\t<\/button>\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['bot_icon_modal'] = "{{i18n_ns 'bot_icon'}}\n<h1>{{#t}}Subir un icono{{\/t}}<\/h1>\n<div class=\"alert bottom_margin hidden\" id=\"icon_upload_alert\"><i class=\"ts_icon ts_icon_warning\"><\/i><span class=\"alert_body\"><\/span><\/div>\n<div id=\"bot_icon_modal\" data-current-step=\"upload\">\n\t<div class=\"step\" data-progress=\"prompt\" data-step=\"upload\" id=\"upload_step\">\n\t\t<div class=\"drop_zone\">\n\t\t\t<span class=\"upload_prompt\">{{#t}}Suelte un archivo de imagen aqu\u00ed o haz clic para subirlo.{{\/t}}<\/span>\n\t\t\t<div class=\"upload_progress\">\n\t\t\t\t<div id=\"upload_progress_circle\"><\/div>\n\t\t\t\t<span>{{#t}}Subiendo...{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<form>\n\t\t\t<input type=\"file\" id=\"hidden_file\" name=\"image\">\n\t\t<\/form>\n\t<\/div>\n\t<div class=\"step\" data-step=\"crop\">\n\t\t<img id=\"crop_img\">\n\t\t<div class=\"actions\">\n\t\t\t<button class=\"btn ladda-button disabled\" data-style=\"expand-right\" id=\"crop_btn\" disabled=\"disabled\"><span class=\"ladda-label\">{{#t}}Recortar{{\/t}}<\/span><\/button>\n\t\t<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['bot_icon_preview'] = "{{!-- hbslint-disable syntax --}}\n{{!-- TODO: Enable syntax linter and refactor to use safeString --}}\n{{#if emoji}}\n\t<span class=\"{{classes}} transparent\">{{{emoji}}}<\/span>\n{{else}}\n\t<img src=\"{{image}}\" class=\"{{classes}}\">\n{{\/if}}\n";
TS.raw_templates['apps_typeahead'] = "{{i18n_ns \"app_directory\"}}\n<div class=\"apps_typeahead\">\n\t{{#if data.suggestions}}\n\t\t{{#each data.suggestions}}\n\t\t\t<a href=\"\/apps\/{{encoded_id}}\" class=\"plastic_typeahead_item\" data-app-id=\"{{encoded_id}}\" data-app-name=\"{{name}}\" data-app-is-slack-owned=\"{{is_slack_owned}}\" data-position={{math @index '+' 1}}>\n\t\t\t\t{{#if payload.icons.image_48}}\n\t\t\t\t\t<img src=\"{{payload.icons.image_48}}\" class=\"apps_typeahead_item_media\" \/>\n\t\t\t\t{{else}}\n\t\t\t\t\t<img src=\"{{versioned_default_application_icon}}\" class=\"apps_typeahead_item_media\" \/>\n\t\t\t\t{{\/if}}\n\t\t\t\t<div class=\"apps_typeahead_item_text\">\n\t\t\t\t\t<span class=\"apps_typeahead_item_title\">{{name}}<\/span>\n\t\t\t\t\t<span class=\"apps_typeahead_item_desc\">{{desc}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t<\/a>\n\t\t{{\/each}}\n\t\t{{#if data.has_more_suggestions}}\n\t\t\t<a href=\"\/apps\/search?q={{term}}\" class=\"plastic_typeahead_item\">\n\t\t\t\t<ts-icon class=\"ts_icon_search apps_typeahead_item_media\"><\/ts-icon>\n\t\t\t\t<div>\n\t\t\t\t\t<span class=\"apps_typeahead_item_title\">{{#t note='Link at bottom of search typeahead to see more'}}Ver todos los resultados para \"{term}\"{{\/t}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t<\/a>\n\t\t{{\/if}}\n\t{{else}}\n\t\t<div class=\"plastic_typeahead_item plastic_typeahead_item_no_results\">{{#t note='Message at bottom of search typeahead when no results of'}}Ning\u00fan resultado para \"{term}\"{{\/t}}<\/div>\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['generic_dialog'] = "{{!\n\nNote: this template used to be inlined in TS.templates.source.js, and as a side effect of the way\nwe represented templates, all of the newlines were actually elided. So, that's what the crazy\nthings are around all of the line endings below. If you're refactoring this, future engineer,\nfeel free to take them out -- I just didn't want to change the meaning of the templates during\nmy refactoring. Love, Mark.\n\n}}<div class=\"modal-header c-modal_header--{{type}}\">{{!\n}}  {{#if img}}<span class=\"modal-header-image modal-header-image--{{img}}\"><\/span>{{\/if}}{{!\n}}\t<button type=\"button\" class=\"close c-modal_header__close--{{type}} ts_icon ts_icon_times\" data-dismiss=\"modal\" aria-hidden=\"true\"><\/button>{{!\n}}\t<h3>{{title}} <img src=\"{{versioned_loading_animation}}\" width=\"16\" height=\"16\" class=\"throbber hidden\"><\/h3>{{!\n}}<\/div>{{!\n}}<div class=\"modal-body c-modal_body--{{type}}\">{{!\n}}\t{{body}}{{!\n}}<\/div>{{!\n}}<div class=\"modal-footer c-modal_footer--{{type}}\">{{!\n}}\t{{#if footer_content}}{{!\n}}\t\t{{footer_content}}{{!\n}}  {{\/if}}{{!\n}}\t<button type=\"button\" class=\"btn btn_outline dialog_cancel c-modal_footer__cancel--{{type}}\" data-qa=\"generic_dialog_cancel\"><\/button>{{!\n}}\t<button type=\"button\" class=\"btn btn dialog_secondary_go hidden c-modal_footer__secondary_go--{{type}}\" data-qa=\"generic_dialog_secondary_go\"><\/button>{{!\n}}{{#if ladda}}{{!\n}}\t<button type=\"button\" class=\"btn dialog_go ladda-button c-modal_footer__go--{{type}}\" data-style=\"expand-right\" data-qa=\"generic_dialog_go\"><span class=\"ladda-label\"><\/span><\/button>{{!\n}}{{else}}{{!\n}}\t<button type=\"button\" class=\"btn dialog_go c-modal_footer__go--{{type}}\" data-qa=\"generic_dialog_go\"><\/button>{{!\n}}{{\/if}}{{!\n}}<\/div>\n";
TS.raw_templates['privacy_policy_dialog'] = "{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n<div class=\"modal-content\">{{!\n}}\t{{#if title}}{{!\n}}\t\t<div class=\"modal-header\">{{!\n}}\t\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>{{!\n}}\t\t<\/div>{{!\n}}\t{{\/if}}{{!\n}}\t<div class=\"modal-body\" style=\"overflow-x: hidden;\">{{!\n}}\t\t{{{body}}}{{!\n}}\t<\/div>{{!\n}}\t<div class=\"modal-footer\">{{!\n}}\t\t{{#if footer}}{{!\n}}\t\t\t{{{footer}}}{{!\n}}\t\t{{\/if}}{{!\n}}\t<\/div>{{!\n}}<\/div>{{!\n}}\n";
TS.raw_templates['app_slack_commands_modal'] = "{{i18n_ns \"developer_apps\"}}\n<form class=\"app_slack_commands_form margin_auto\" action=\"\/api\/app.commands.{{api_function}}\">\n\t<input type=\"hidden\" name=\"app\" value=\"{{app_id}}\">\n\t<input type=\"hidden\" name=\"token\" value=\"{{token}}\">\n\t{{#if command}}\n\t\t<input type=\"hidden\" name=\"command\" value=\"{{command}}\">\n\t{{\/if}}\n\n\t<div id=\"app_slack_commands_error_alert\" class=\"alert alert_error hidden\"><i class=\"ts_icon ts_icon_warning\"><\/i> <span id=\"app_slack_commands_error_message\">{{#t note=\"warning modal telling the developer that a slash command already exists\"}}El comando ya existe.{{\/t}}<\/span><\/div>\n\n\t<div class=\"app_slack_commands_form_section display_flex justify_content_between align_items_baseline top_border top_padding bottom_padding position_relative\">\n\t\t<label for=\"name\" class=\"no_bottom_margin no_wrap right_margin\">{{#t note=\"label for the name of a new slash command\"}}Comando{{\/t}}<\/label>\n\n\t\t<div class=\"app_slack_commands_form_input_label_container\">\n\t\t\t<input type=\"text\" name=\"name\" placeholder=\"{{#t note=\"placeholder for a slash command.\"}}\/comando{{\/t}}\" class=\"small no_bottom_margin overflow_ellipsis\" data-qa=\"command_name\" value=\"{{name}}\" autocomplete=\"off\" data-validation=\"required reservedwords={{reserved_commands}}\" data-validation-for=\"name_validation_label\" data-validation-success=\"{{#t note=\"successful data validation message\"}}\u00a1Suena bien!{{\/t}}\">\n\t\t\t<label for=\"name_validation_label\" class=\"app_slack_commands_form_validation_label plastic_grey no_bottom_margin\"><\/label>\n\t\t<\/div>\n\n\t\t<i class=\"ts_icon ts_icon_info_circle subtle_silver help_icon\"><\/i>\n\t\t<div class=\"app_slack_commands_info_tooltip small position_absolute neutral_white_bg normal_padding\">\n\t\t\t<p class=\"no_bottom_margin\">{{#t note=\"instructions on how Slack slash commands work\"}}Los comandos de Slack deben empezar con una barra diagonal, estar escritos en min\u00fasculas y no contener espacios. Ejemplos: \/implementar, \/recibido, \/tiempo{{\/t}}<\/p>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"app_slack_commands_form_section display_flex justify_content_between align_items_baseline top_border top_padding bottom_padding position_relative\">\n\t\t<label for=\"url\" class=\"no_bottom_margin no_wrap right_margin\">{{#t note=\"URL to send slash commands to\"}}URL de solicitud{{\/t}}<\/label>\n\n\t\t<div class=\"app_slack_commands_form_input_label_container\">\n\t\t\t<input type=\"url\" name=\"url\" placeholder=\"https:\/\/example.com\/slack\/command\" class=\"small no_bottom_margin overflow_ellipsis\" data-qa=\"command_request_url\"value=\"{{url}}\" data-validation=\"required isurl{{#if https_only}}=https{{else}}=http{{\/if}}\" data-validation-for=\"url_validation_label\" data-validation-success=\"{{#t note=\"successful data validation message\"}}\u00a1Suena bien!{{\/t}}\">\n\t\t\t<label for=\"url_validation_label\" class=\"app_slack_commands_form_validation_label plastic_grey no_bottom_margin\"><\/label>\n\t\t<\/div>\n\n\t\t<i class=\"ts_icon ts_icon_info_circle subtle_silver help_icon\"><\/i>\n\t\t<div class=\"app_slack_commands_info_tooltip small position_absolute neutral_white_bg normal_padding\">\n\t\t\t<p class=\"no_bottom_margin\">{{#t}}Te enviaremos una solicitud HTTP POST con informaci\u00f3n que podr\u00edas necesitar a esta URL cuando se ejecute el comando.{{\/t}}<\/p>\n\n\t\t\t<br>\n\t\t\t{{#if https_only}}\n\t\t\t\t<p class=\"no_bottom_margin\">{{#t note=\"The URL described here is a url provided by the developer and it must be https\"}}Esta URL debe utilizar el protocolo \"https\".{{\/t}}<\/p>\n\t\t\t{{\/if}}\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"app_slack_commands_form_section display_flex justify_content_between align_items_baseline top_border top_padding bottom_padding\">\n\t\t<label for=\"desc\" class=\"no_bottom_margin no_wrap right_margin\">{{#t note=\"label for a short description of a slash command\"}}Descripci\u00f3n corta{{\/t}}<\/label>\n\n\t\t<div class=\"app_slack_commands_form_input_label_container\">\n\t\t\t<input type=\"text\" name=\"desc\" placeholder=\"{{#t note=\"Placeholder text. Example of a description of a slash command\"}}\u00a1Lanza el cohete!{{\/t}}\" class=\"small no_bottom_margin overflow_ellipsis\" data-qa=\"command_description\" value=\"{{desc}}\" data-validation=\"required\" data-validation-for=\"desc_validation_label\" data-validation-success=\"{{#t note=\"successful data validation message\"}}\u00a1Suena bien!{{\/t}}\">\n\t\t\t<label for=\"desc_validation_label\" class=\"app_slack_commands_form_validation_label plastic_grey no_bottom_margin\"><\/label>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"app_slack_commands_form_section display_flex justify_content_between align_items_baseline top_border top_padding bottom_padding\">\n\t\t<label for=\"usage\" class=\"no_bottom_margin no_wrap right_margin\">{{#t note=\"a hint on how a slash command could be used. shows up in the message bar of the slack client\"}}Consejo de utilizaci\u00f3n{{\/t}}<\/label>\n\n\t\t<div class=\"app_slack_commands_form_input_label_container\">\n\t\t\t<input type=\"text\" name=\"usage\" placeholder=\"[{{#t note=\"an example of a slash command's arguments. It is wrapped in [] brackets and will show up in the message bar of the slack client\"}}qu\u00e9 cohete lanzar{{\/t}}]\" class=\"small no_bottom_margin overflow_ellipsis\" data-qa=\"command_usage_hint\" value=\"{{usage}}\">\n\n\t\t\t<p class=\"no_bottom_margin small_top_margin plastic_grey\">{{#t note=\"Description of a form input field where a developer can list parameters for their new slash command\"}}De manera optativo, lista los par\u00e1metros que se pueden aprobar.{{\/t}}<\/p>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"app_slack_commands_form_section display_flex justify_content_between align_items_baseline top_border top_padding bottom_padding\">\n\t\t<div class=\"app_slack_commands_form_input_label_container\">\n\t\t\t<label for=\"parse_full\" class=\"no_bottom_margin no_wrap right_margin\">{{#t note=\"Whether to parse and mark up user, channel, and link references\"}}Saltarte canales, usuarios y enlaces enviados a tu aplicaci\u00f3n{{\/t}}<\/label>\n\n\t\t\t<p id=\"unescaped_parse_hint\" class=\"no_bottom_margin small_top_margin plastic_grey no_wrap {{#if parse_full}}hidden{{\/if}}\">\n\t\t\t\t{{#t note=\"Example of unescaped text\"}}<b>Sin escape:<\/b> @usuario #general{{\/t}}\n\t\t\t<\/p>\n\t\t\t<p id=\"escaped_parse_hint\" class=\"no_bottom_margin small_top_margin plastic_grey no_wrap {{#unless parse_full}}hidden{{\/unless}}\">\n\t\t\t\t{{#t note=\"Example of escaped text\"}}<b>Escapado:<\/b> &lt;@U1234|usuario&gt; &lt;#C1234|general&gt;{{\/t}}\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div>\n\t\t\t<input type=\"checkbox\" name=\"parse_full\" data-style=\"toggle\"\n\t\t\t\t{{#if parse_full}}checked{{\/if}}\n\t\t\t>\n\t\t<\/div>\n\n\t<\/div>\n\n\t<div class=\"app_slack_commands_form_section top_border top_padding bottom_padding\">\n\t\t<p class=\"small bold\">{{#t note=\"This is a title of a screenshot for how the slash command will look in the message bar of the slack client. The autocomplete entry refers to a box that shows up as they type in the slash command\"}}Vista previa del campo de Autocompletar{{\/t}}<\/p>\n\t\t<div class=\"preview_container small_padding bordered\">\n\t\t\t<div class=\"preview_popup rounded neutral_white_bg bordered position_relative\">\n\t\t\t\t<div class=\"preview_popup_title off_white_bg subtle_silver small_padding left_padding small\">\n\t\t\t\t\t{{#t note=\"this is a preview of what the autocomplete form looks like for a new slash command\"}}Combinaci\u00f3n de comandos{{\/t}} \"<span class=\"preview_popup_command_text bold\"><\/span>\"\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"app_label normal_margin small_bottom_margin display_flex subtle_silver\">\n\t\t\t\t\t<span class=\"neutral_white_bg small_right_padding bold tiny\">{{app_name}}<\/span>\n\t\t\t\t\t<hr class=\"no_margin flex_one top_margin\">\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"normal_margin small display_flex small_top_margin\">\n\t\t\t\t\t<div class=\"preview_popup_command_container overflow_ellipsis subtle_silver flex_one\">\n\t\t\t\t\t\t<span class=\"bold indifferent_grey\">\n\t\t\t\t\t\t\t\/<span class=\"preview_popup_command_text\"><\/span>\n\t\t\t\t\t\t<\/span>\n\t\t\t\t\t\t<span class=\"preview_popup_usage_text\"><\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"preview_popup_desc_container left_padding float_right align_right\">\n\t\t\t\t\t\t<span class=\"preview_popup_desc_text overflow_ellipsis subtle_silver\"><\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<i class=\"arrow_box neutral_white_bg position_absolute\"><\/i>\n\t\t\t<\/div>\n\t\t\t<div class=\"messages_input_container bordered neutral_white_bg top_margin rounded clearfix\">\n\t\t\t\t<div class=\"file_upload_button float_left right_border align_center\">\n\t\t\t\t\t<i class=\"ts_icon ts_icon_plus_thick cloud_silver bold\"><\/i>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"text_input float_left small left_padding\">\n\t\t\t\t\t\/<span class=\"preview_popup_command_text\"><\/span>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/div>\n<\/form>\n";
