{{\/t}}<\/button>\n\t\t\t<button id=\"edit_member_profile_confirm_photo_crop_btn\" type=\"submit\" class=\"col btn btn_large ladda-button\" data-style=\"expand-right\" data-action=\"edit_member_profile_confirm_photo_crop\">{{#t note=\"Taken by your computer\"}}Guardar tu foto de perfil{{\/t}}<\/button>\n\t\t<\/div>\n\t<\/section>\n\n\t<section id=\"edit_member_profile_photo_delete\" class=\"hidden\">\n\t\t<div class=\"edit_member_profile_photo__modal_container\">\n\t\t\t<p class=\"small center_and_narrow\">{{#t}}Por favor confirma que quieres eliminar la foto.<br>La sustituiremos por un avatar predeterminado de Slack.{{\/t}}<\/p>\n\n\t\t\t<div class=\"clearfix bottom_margin large_top_margin display_flex justify_content_center flex_wrap\">\n\t\t\t\t<button id=\"edit_member_profile_cancel_photo_delete_btn\" class=\"col btn btn_large btn_outline\" data-action=\"edit_member_profile_cancel_photo\">{{#t note=\"Cancel removal of profile photo\"}}Cancelar{{\/t}}<\/button>\n\t\t\t\t<button id=\"edit_member_profile_confirm_photo_delete_btn\" type=\"submit\" class=\"col btn btn_large btn_danger ladda-button\" data-style=\"expand-right\" data-action=\"edit_member_profile_confirm_photo_delete\">{{#t note=\"Profile photo\"}}S\u00ed, eliminar foto{{\/t}}<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/section>\n\n\t<section id=\"edit_member_profile_photo_format_error\" class=\"hidden\">\n\t\t<div class=\"edit_member_profile_photo__modal_container\">\n\t\t\t<p class=\"small photo_well align_center\">\n\t\t\t\t{{#t emoji=(emojiGraphicReplace ':flushed:')}}{emoji}<br><strong>Las fotos de perfil deben ser<br>GIF, JPG o PNG.<\/strong>{{\/t}}\n\t\t\t<\/p>\n\t\t\t<div class=\"clearfix bottom_margin large_top_margin display_flex justify_content_center flex_wrap\">\n\t\t\t\t<button id=\"edit_member_profile_cancel_photo_format_error_btn\" class=\"col btn btn_large btn_outline\" data-action=\"edit_member_profile_cancel_photo\">{{#t note=\"Cancel uploading a photo\"}}Cancelar{{\/t}}<\/button>\n\t\t\t\t<button id=\"edit_member_profile_retry_photo_format_error_btn\" type=\"submit\" class=\"col btn btn_large btn_info ladda-button\" data-style=\"expand-right\" data-action=\"edit_member_profile_photo_menu\">{{#t note=\"For your profile photo\"}}Probar con otra{{\/t}}<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/section>\n\n\t<section id=\"edit_member_profile_photo_oversize_error\" class=\"hidden\">\n\t\t<div class=\"edit_member_profile_photo__modal_container\">\n\t\t\t<p class=\"small photo_well align_center\">\n\t\t\t\t{{#t emoji=(emojiGraphicReplace ':worried:')}}{emoji}<br><strong>Es una foto preciosa <br> pero un poco grande. Prueba con una<br>menor de 4000\u00a0px<br>de alto por 4000\u00a0px de ancho.<\/strong>{{\/t}}\n\t\t\t<\/p>\n\n\t\t\t<div class=\"clearfix bottom_margin large_top_margin display_flex justify_content_center flex_wrap\">\n\t\t\t\t<button id=\"edit_member_profile_cancel_photo_oversize_error_btn\" class=\"col btn btn_large btn_outline\" data-action=\"edit_member_profile_cancel_photo\">{{#t note=\"Cancel uploading a profile photo\"}}Cancelar{{\/t}}<\/button>\n\t\t\t\t<button id=\"edit_member_profile_retry_photo_oversize_error_btn\" type=\"submit\" class=\"col btn btn_large btn_info ladda-button\" data-style=\"expand-right\" data-action=\"edit_member_profile_photo_menu\">{{#t note=\"For your profile photo\"}}Probar con otra{{\/t}}<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/section>\n<\/div>";
TS.raw_templates['edit_member_profile_list'] = "{{i18n_ns \"profile\"}}\n<div class=\"edit_profile_drop_overlay hidden\"><\/div>\n<div class=\"clearfix display_flex flex_wrap position_relative\">\n\t<p class=\"col span_2_of_3\">\n\t\t<label for=\"real_name_profile_field\">{{#t note=\"For a members profile\"}}Nombre completo{{\/t}}<\/label>\n\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"real_name\" value=\"{{member.profile.real_name}}\" data-validation=\"membername=required\" data-validation-for=\"real_name_profile_field_warnings\" data-validation-success placeholder=\"{{#t note='For a members profile'}}Nombre completo{{\/t}}\" id=\"real_name_profile_field\" \/>\n\t\t<label for=\"real_name_profile_field_warnings\"><span class=\"validation_message\"><\/span><\/label>\n\t<\/p>\n\t<div id=\"edit_member_profile_photo_container\" class=\"col\">\n\t\t<label>{{#t note=\"Label for the profile fiend\"}}Foto de perfil{{\/t}}<\/label>\n\t\t<div class=\"member_image_wrapper\" data-instructions-text=\"{{#t}}Cambiar tu foto de perfil{{\/t}}\" data-action=\"edit_member_profile_photo_menu\"><ts-icon class=\"upload_camera_icon ts_icon_camera\" aria-label=\"{{#t}}subir una foto{{\/t}}\">{{> member_preview_link_image (getMemberPreviewLinkImageArgs member.id 192 false true true)}}<\/ts-icon><\/div>\n\t<\/div>\n<\/div>\n\n<div class=\"clearfix\">\n\t<div class=\"col span_2_of_3\">\n\t\t<p>\n\t\t\t{{#if lock_display_name}}\n\t\t\t\t<label for=\"display_name_profile_field\">\n\t\t\t\t\t<ts-icon class=\"ts_icon_lock sk_light_grey ts_tip ts_tip_top ts_tip_multiline\">\n\t\t\t\t\t\t<span class=\"ts_tip_tip ts_tip_multiline_inner\">{{#t}}Tu organizaci\u00f3n establece autom\u00e1ticamente los nombres que se muestran.{{\/t}}<\/span>\n\t\t\t\t\t<\/ts-icon>\n\t\t\t\t\t{{#t note=\"For a members profile\"}}Nombre de Slack <span class=\"normal\">(optativo)<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" value=\"{{member.profile.display_name}}\" placeholder=\"{{member.profile.real_name}}\" disabled\/>\n\t\t\t{{else}}\n\t\t\t\t<label for=\"display_name_profile_field\">{{#t note=\"For a members profile\"}}Nombre de Slack <span class=\"normal\">(optativo)<\/span>{{\/t}}<\/label>\n\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"display_name\" value=\"{{member.profile.display_name}}\" placeholder=\"{{member.profile.real_name}}\" id=\"display_name_profile_field\" data-validation=\"membername\" data-validation-for=\"display_name_profile_field_warnings\" data-validation-success \/>\n\t\t\t\t<label for=\"display_name_profile_field_warnings\"><span class=\"validation_message\"><\/span><\/label>\n\t\t\t\t<span class=\"input_note\">{{#t note=\"Helper note for setting a display name\"}}Este podr\u00eda ser tu nombre o un apodo; como quieras que la gente se refiera a ti en Slack.{{\/t}}<\/span>\n\t\t\t\t{{#if custom_username_policy}}\n\t\t\t\t\t<div id=\"custom_username_policy\" class=\"large_bottom_margin\">\n\t\t\t\t\t\t<p class=\"bold small_bottom_margin\">{{#t}}Reglas personalizadas para este espacio de trabajo:{{\/t}}<\/p>\n\t\t\t\t\t\t<p class=\"sk_dark_grey no_bottom_margin\">{{custom_username_policy}}<\/p>\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t<\/div>\n<\/div>\n\n<div class=\"clearfix\">\n\t<p class=\"col span_2_of_3\">\n\t\t<label for=\"title_profile_field\">{{#t note=\"Label for a members profile field\"}}A qu\u00e9 me dedico{{\/t}}<\/label>\n\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"title\" value=\"{{member.profile.title}}\" placeholder=\"{{#t note='Label for a members profile field'}}A qu\u00e9 me dedico{{\/t}}\" data-validation=\"maxlength=249\" data-validation-for=\"title_profile_field\" id=\"title_profile_field\" \/>\n\t\t{{#pageNeedsEnterprise}}\n\t\t\t<span class=\"input_note\">{{#t note=\"For a members profile\" currentEnterpriseName=(currentEnterpriseName)}}Cu\u00e9ntales a los dem\u00e1s lo que haces en {currentEnterpriseName}.{{\/t}}<\/span>\n\t\t{{else}}\n\t\t\t<span class=\"input_note\">{{#t note=\"For a members profile\"}}Dile a los dem\u00e1s qu\u00e9 haces en {team.name}.{{\/t}}<\/span>\n\t\t{{\/pageNeedsEnterprise}}\n\t<\/p>\n<\/div>\n\n<div class=\"clearfix\">\n\t<p class=\"col span_2_of_3\">\n\t\t<label for=\"phone_profile_field\">{{#t note=\"Label for a members profile field\"}}N\u00famero de tel\u00e9fono{{\/t}}<\/label>\n\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"phone\" value=\"{{member.profile.phone}}\" placeholder=\"{{#t note=\"fake example telephone number used as placeholder text for a form input\"}}(34) 91 555 55 55{{\/t}}\" data-validation=\"maxlength=98\" data-validation-for=\"phone_profile_field\" id=\"phone_profile_field\" \/>\n\t\t<span class=\"input_note\">{{#t note=\"Help text for a members profile field\"}}Indica un n\u00famero de tel\u00e9fono.{{\/t}}<\/span>\n\t<\/p>\n<\/div>\n\n<div class=\"clearfix\">\n\t<p class=\"col span_2_of_3\">\n\t\t<label class=\"select with_hint\" for=\"timezone_profile_field\">\n\t\t\t{{#t}}Zona horaria{{\/t}}\n\t\t\t<select class=\"no_bottom_margin\" name=\"tz\" id=\"timezone_profile_field\">\n\t\t\t\t{{#each timezone_options}}\n\t\t\t\t\t<option value=\"{{this.val}}\"{{#if_equal this.val compare=..\/member_tz}} selected{{\/if_equal}}>{{this.label}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t\t<\/select>\n\t\t<\/label>\n\t\t<span class=\"input_note\">{{#t}}La zona horaria en la que te encuentras. La usamos para enviar correos con res\u00famenes, correos con notificaciones, para las horas en tus actualizaciones de actividad y para los recordatorios.{{\/t}}<\/span>\n\t<\/p>\n<\/div>\n\n{{#if team_member_profile_fields.length}}\n\t{{#each team_member_profile_fields}}\n\t\t<div class=\"clearfix\">\n\t\t\t<p class=\"col {{#if_equal this.type compare=\"link\"}}span_2_of_3{{else}}{{#if_equal this.type compare=\"date\"}}span_2_of_3{{else}}span_1_of_1{{\/if_equal}}{{\/if_equal}} no_padding\">\n\t\t\t\t{{#if_not_equal this.type compare=\"options_list\"}}\n\t\t\t\t\t<label for=\"{{this.id}}_profile_field\">\n\t\t\t\t\t\t{{#if this.options.is_scim}}\n\t\t\t\t\t\t\t<ts-icon class=\"ts_icon_lock sk_light_grey ts_tip ts_tip_top ts_tip_multiline\">\n\t\t\t\t\t\t\t\t<span class=\"ts_tip_tip ts_tip_multiline_inner\">{{#t}}Tu organizaci\u00f3n sincroniza autom\u00e1ticamente este campo.{{\/t}}<\/span>\n\t\t\t\t\t\t\t<\/ts-icon>\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t{{this.label}}\n\t\t\t\t\t<\/label>\n\t\t\t\t{{\/if_not_equal}}\n\t\t\t\t{{#if_equal this.type compare=\"text\"}}\n\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"{{this.id}}\" placeholder=\"{{this.label}}\" data-qa=\"{{this.label}}\" data-validation=\"maxlength=256\" data-validation-for=\"{{this.id}}_profile_field\" value=\"{{this.value}}\" id=\"{{this.id}}_profile_field\" {{#if this.options.is_scim}}disabled{{\/if}}\/>\n\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{#if_equal this.type compare=\"options_list\"}}\n\t\t\t\t\t<label class=\"select no_bottom_margin with_hint\" id=\"{{this.id}}_profile_field\">{{this.label}}\n\t\t\t\t\t\t<select class=\"no_bottom_margin\" name=\"{{this.id}}\" data-qa=\"{{this.label}}\" id=\"{{this.id}}_profile_field\" {{#if this.options.is_scim}}disabled{{\/if}}>\n\t\t\t\t\t\t\t<option value='' {{#unless ..\/this.value}} selected{{\/unless}}>{{#t note=\"Select a date\" fallback_hash=\"48270fb63a3c998cd58de73f1fa330a325e41ad0\"}}Seleccionar\u2026{{\/t}}<\/option>\n\t\t\t\t\t\t\t{{#each this.possible_values}}\n\t\t\t\t\t\t\t\t<option{{#if_equal ..\/this.value compare=this}} selected{{\/if_equal}}>{{this}}<\/option>\n\t\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t\t<\/select>\n\t\t\t\t\t<\/label>\n\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{#if_equal this.type compare=\"date\"}}\n\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin ts_icon_placeholder\" name=\"{{this.id}}\" data-plastic-type=\"date\" placeholder=\"&#xe023;\" data-qa=\"{{this.label}}\" data-validation=\"dateandformat=Y-m-d\" data-validation-for=\"{{this.id}}_profile_field\" value=\"{{this.value}}\" id=\"{{this.id}}_profile_field\" {{#if this.options.is_scim}}disabled{{\/if}}\/>\n\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{#if_equal this.type compare=\"link\"}}\n\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"{{this.id}}\" placeholder=\"https:\/\/\" data-qa=\"{{this.label}}\" data-validation=\"maxlength=256 isurl=http\" data-validation-for=\"{{this.id}}_profile_field\" value=\"{{this.value}}\" id=\"{{this.id}}_profile_field\"  {{#if this.options.is_scim}}disabled{{\/if}}\/>\n\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{#if_equal this.type compare=\"user\"}}\n\t\t\t\t\t<input class=\"edit_member_profile_lazy_filter_select no_bottom_margin\" name={{this.id}} data-qa=\"{{this.label}}\" data-validation=\"maxcsv=25\" data-validation-for=\"{{this.id}}_profile_field\" value=\"{{this.value}}\" id=\"{{this.id}}_profile_field\" {{#if this.options.is_scim}}disabled{{\/if}}\/>\n\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{#if this.hint}}\n\t\t\t\t\t<span class=\"input_note\">{{this.hint}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t\t{{#if_equal this.type compare=\"link\"}}\n\t\t\t\t<p class=\"col span_1_of_3 no_padding\">\n\t\t\t\t\t<label for=\"{{this.id}}_alt_profile_field\">{{#t}}Mostrar texto{{\/t}}<\/label>\n\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"{{this.id}}_alt\" placeholder=\"{{#t}}Mi enlace{{\/t}}\" data-qa=\"{{this.label}}_display\" data-validation=\"maxlength=256\" data-validation-for=\"{{this.id}}_alt_profile_field\" value=\"{{this.alt}}\" id=\"{{this.id}}_alt_profile_field\" {{#if this.options.is_scim}}disabled{{\/if}}\/>\n\t\t\t\t\t<span class=\"input_note\">{{#t}}Optativo{{\/t}}<\/span>\n\t\t\t\t<\/p>\n\t\t\t{{\/if_equal}}\n\t\t\t{{#if_equal this.type compare=\"date\"}}\n\t\t\t\t<p class=\"col span_1_of_3 no_padding\">\n\t\t\t\t\t<label for=\"{{this.id}}_alt_profile_field\">{{#t}}Mostrar texto{{\/t}}<\/label>\n\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"{{this.id}}_alt\" placeholder=\"{{#t}}Mi fecha{{\/t}}\" data-qa=\"{{this.label}}_display\" data-validation=\"maxlength=256\" data-validation-for=\"{{this.id}}_alt_profile_field\" value=\"{{this.alt}}\" id=\"{{this.id}}_alt_profile_field\" {{#if this.options.is_scim}}disabled{{\/if}}\/>\n\t\t\t\t\t<span class=\"input_note\">{{#t}}Optativo{{\/t}}<\/span>\n\t\t\t\t<\/p>\n\t\t\t{{\/if_equal}}\n\t\t<\/div>\n\t{{\/each}}\n{{\/if}}\n";
TS.raw_templates['edit_member_profile_footer'] = "{{i18n_ns \"profile\"}}\n\n{{#if can_edit_team_profile}}\n\t<p class=\"auto_right_margin small no_bottom_margin\"><a data-action=\"edit_team_profile_modal\">{{#t note=\"Fields on a member's profile\"}}A\u00f1adir, editar o reorganizar campos.{{\/t}}<\/a><\/p>\n{{\/if}}";
TS.raw_templates['menu_edit_member_profile_photo_action_items'] = "{{i18n_ns \"profile\"}}\n\n<li data-action=\"edit_member_profile_upload_image\">\n\t<a class=\"position_relative\">\n\t\t{{#if is_iOS}}<input type=\"file\" accept=\"image\/*;capture=camera\" aria-hidden=\"true\" data-action=\"edit_member_profile_upload_photo\" \/>{{\/if}}\n\t\t{{#t note=\"For your profile photo\"}}Subir una imagen{{\/t}}\n\t<\/a>\n<\/li>\n{{#if show_delete}}\n\t<li data-action=\"edit_member_profile_to_delete\" class=\"danger\" data-id=\"{{id}}\"><a>{{#t note=\"Remove your profile photo\"}}Eliminar foto{{\/t}}<\/a><\/li>\n{{\/if}}";
TS.raw_templates['drop_zone_overlay'] = "{{i18n_ns \"drop_zone\"}}\n\n<div class=\"drop_zone_overlay{{#if fullscreen}} drop_zone_fullscreen{{\/if}}\">\n\t<div class=\"drop_zone_overlay_inner\">\n\t\t{{#if state.prompt}}\n\t\t\t{{#if inline}}\n\t\t\t\t<div class=\"display_flex align_items_center justify_content_center\">\n\t\t\t\t\t<img class=\"drop_zone_upload_icon drop_zone_block drop_zone_upload_icon_small\"\n\t\t\t\t\t\tsrc=\"{{versioned_upload_file_icon 1x}}\" srcset=\"{{versioned_upload_file_icon 1x}} 1x, {{versioned_upload_file_icon 2x}} 2x\" >\n\t\t\t\t\t<span class=\"drop_zone_block drop_zone_overlay_text_inline\">{{#t}}Subir tu archivo{{\/t}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t{{else}}\n\t\t\t\t<img class=\"drop_zone_upload_icon drop_zone_block\"\n\t\t\t\t\tsrc=\"\/img\/upload_file_icon.png\" srcset=\"\/img\/upload_file_icon.png 1x, \/img\/upload_file_icon@2x.png 2x\" >\n\t\t\t\t<span class=\"drop_zone_block\">{{#t}}Subir tu archivo{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t\t{{#if state.progress}}\n\t\t\t{{#if inline}}\n\t\t\t\t{{! Want the spinner next to the text}}\n\t\t\t\t<div class=\"display_flex align_items_center justify_content_center\">\n\t\t\t\t\t<div class=\"drop_zone_progress\"><\/div>\n\t\t\t\t\t\t<span class=\"drop_zone_overlay_text_inline\">{{#t}}Cargando{{\/t}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t{{else}}\n\t\t\t\t{{! Want the spinner above the text}}\n\t\t\t\t<div class=\"drop_zone_progress drop_zone_block\"><\/div>\n\t\t\t\t{{#if state.is_attaching_logs}}\n\t\t\t\t\t<span class=\"drop_zone_block\">{{#t}}Adjuntando registros{{\/t}}<\/span>\n\t\t\t\t{{else}}\n\t\t\t\t\t<span class=\"drop_zone_block\">{{#t}}Cargando{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['drop_zone_attachment'] = "<div class=\"drop_zone_attachment\" data-drop-zone-attachment-id=\"{{attachment_id}}\">\n\t<a class=\"drop_zone_remove_attachment\" href=\"#\">\n\t\t<ts-icon class=\"ts_icon_times_circle\"><\/ts-icon>\n\t<\/a>\n\t{{#if icon}}\n\t\t<div class=\"drop_zone_preview large_padding\">\n\t\t\t<ts-icon class=\"ts_icon_{{icon}}\"><\/ts-icon> {{description}}\n\t\t<\/div>\n\t{{else}}\n\t\t<img class=\"drop_zone_preview large_padding\" src=\"{{img_src}}\">\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['channel_browser'] = "{{i18n_ns \"channel_browser\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n<div id=\"channel_browser\" class=\"channel_modal_with_list channel_modal {{#feature flag='feature_channel_browser_dropdown'}}feature_channel_browser_dropdown{{\/feature}}\">\n\t<div class=\"large_bottom_margin display_flex align_items_center\">\n\t\t<h1 class=\"no_bottom_margin channel_modal_header\">{{title}}<\/h1>\n\t\t{{#if can_create}}\n\t\t\t<button class=\"new_channel btn btn_primary auto_left_margin\">{{#t}}Crear canal{{\/t}}<\/button>\n\t\t{{\/if}}\n\t<\/div>\n\t<div class=\"small_bottom_margin display_flex align_items_center\">\n\t\t<div class=\"channel_browser_filter_container channel_modal_filter_container flex_one\">\n\t\t\t<i class=\"ts_icon ts_icon_search cloud_silver search_icon\"><\/i>\n\t\t\t<i class=\"ts_icon ts_icon_times_circle cloud_silver clear_filter_icon\"><\/i>\n\t\t\t<input type=\"text\" id=\"channel_browser_filter\" class=\"small\" placeholder=\"{{#t}}Buscar canales{{\/t}}\" title=\"Search channels\">\n\t\t<\/div>\n\t<\/div>\n\t<div class=\"channel_browser_filter_sort {{#feature flag='feature_channel_browser_dropdown'}}{{#if can_create_shared_channel}}{{else}}margin_bottom_100{{\/if}}{{else}}{{#if can_create_shared_channel}}margin_bottom_100{{else}}margin_bottom_200{{\/if}}{{\/feature}}\">\n\t\t<div class=\"show_which_channels_container flex_one {{#feature flag='feature_channel_browser_dropdown'}}{{else}}bottom_margin{{\/feature}}\">\n\t\t\t{{#feature flag=\"feature_react_lfs\"}}\n\t\t\t\t<div id=\"show_which_channels_react\"><\/div>\n\t\t\t{{\/feature}}\n\t\t\t<select id=\"show_which_channels\" class=\"small display_none\">\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"all\"}}selected{{\/if_equal}} value=\"all\">{{#t}}Todos los canales{{\/t}}<\/option>\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"private\"}}selected{{\/if_equal}} value=\"private\">{{#t}}Canales cerrados{{\/t}}<\/option>\n\t\t\t\t{{#pageNeedsEnterprise}}\n\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"org_shared\"}}selected{{\/if_equal}} value=\"org_shared\">{{#t}}Canales compartidos{{\/t}}<\/option>\n\t\t\t\t{{\/pageNeedsEnterprise}}\n\t\t\t\t{{#pageNeedsEnterprise}}\n\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"local\"}}selected{{\/if_equal}} value=\"local\">{{#t team_name=(currentTeamName)}}canales de {team_name}{{\/t}}<\/option>\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#sharedChannelsEnabled}}\n\t\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"local\"}}selected{{\/if_equal}} value=\"local\">{{#t team_name=(currentTeamName)}}canales de {team_name}{{\/t}}<\/option>\n\t\t\t\t\t{{else if (objectKeyCount external_teams)}}\n\t\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"local\"}}selected{{\/if_equal}} value=\"local\">{{#t team_name=(currentTeamName)}}canales de {team_name}{{\/t}}<\/option>\n\t\t\t\t\t{{\/sharedChannelsEnabled}}\n\t\t\t\t{{\/pageNeedsEnterprise}}\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"archived\"}}selected{{\/if_equal}} value=\"archived\">{{#t}}Canales archivados{{\/t}}<\/option>\n\t\t\t\t{{#sharedChannelsEnabled}}\n\t\t\t\t\t{{! show filter options for individual external teams if there are more than one }}\n\t\t\t\t\t{{#if_gt (objectKeyCount external_teams) compare=1}}\n\t\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"ext_shared\"}}selected{{\/if_equal}} value=\"ext_shared\">{{#t}}Todos los canales compartidos (beta){{\/t}}<\/option>\n\t\t\t\t\t\t{{#each external_teams}}\n\t\t\t\t\t\t\t<option value=\"ext_shared_team_{{this.id}}\">{{#t team_name=(escape name)}}Compartido con {team_name}{{\/t}}<\/option>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"ext_shared\"}}selected{{\/if_equal}} value=\"ext_shared\">{{#t}}Canales compartidos (beta){{\/t}}<\/option>\n\t\t\t\t\t{{\/if_gt}}\n\t\t\t\t{{else if (objectKeyCount external_teams)}}\n\t\t\t\t\t{{! show filter options for individual external teams if there are more than one }}\n\t\t\t\t\t{{#if_gt (objectKeyCount external_teams) compare=1}}\n\t\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"ext_shared\"}}selected{{\/if_equal}} value=\"ext_shared\">{{#t}}Todos los canales compartidos (beta){{\/t}}<\/option>\n\t\t\t\t\t\t{{#each external_teams}}\n\t\t\t\t\t\t\t<option value=\"ext_shared_team_{{this.id}}\">{{#t team_name=(escape name)}}Compartido con {team_name}{{\/t}}<\/option>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<option {{#if_equal sort_by_selected compare=\"ext_shared\"}}selected{{\/if_equal}} value=\"ext_shared\">{{#t}}Canales compartidos (beta){{\/t}}<\/option>\n\t\t\t\t\t{{\/if_gt}}\n\t\t\t\t{{\/sharedChannelsEnabled}}\n\t\t\t<\/select>\n\t\t<\/div>\n\t\t<div class=\"channel_browser_sort_container flex_one\">\n\t\t\t{{#feature flag=\"feature_react_lfs\"}}\n\t\t\t\t<div id=\"channel_browser_sort_react\"><\/div>\n\t\t\t{{\/feature}}\n\t\t\t<select id=\"channel_browser_sort\" class=\"small display_none\">\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"name\"}}selected{{\/if_equal}} value=\"name\">\n\t\t\t\t{{#t}}Nombre del canal{{\/t}}\n\t\t\t\t<\/option>\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"creator\"}}selected{{\/if_equal}} value=\"creator\">{{#t}}Nombre del creador{{\/t}}<\/option>\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"created\"}}selected{{\/if_equal}} value=\"created\">{{#t}}Fecha de creaci\u00f3n (m\u00e1s reciente){{\/t}}<\/option>\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"members_high\"}}selected{{\/if_equal}} value=\"members_high\">{{#t}}Miembros (de m\u00e1s a menos){{\/t}}<\/option>\n\t\t\t\t<option {{#if_equal sort_by_selected compare=\"members_low\"}}selected{{\/if_equal}} value=\"members_low\">{{#t}}Miembros (de menos a m\u00e1s){{\/t}}<\/option>\n\t\t\t<\/select>\n\t\t<\/div>\n\t\t{{#feature flag=\"feature_channel_browser_dropdown\"}}\n\t\t\t<select id=\"temp_select_width\" class=\"display_none\">\n\t\t\t\t<option id=\"temp_option_width\"><\/option>\n\t\t\t<\/select>\n\t\t{{\/feature}}\n\t<\/div>\n\t{{#if can_create_shared_channel}}\n\t\t<p class=\"c-alert c-alert--boxed c-alert--level_info p-connected_workspaces_alert margin_bottom_200 hidden\">\n\t\t\t<span class=\"c-alert__message\">{{#t num_workspaces=external_teams_count}}Tu espacio de trabajo comparte canales con <strong>{num_workspaces, plural, =1{# espacio m\u00e1s}other{# espacios m\u00e1s}}<\/strong>. <button class=\"view_connected_workspaces c-link--button\">Gestionar canales compartidos<\/button>{{\/t}}<\/span>\n\t\t<\/p>\n\t{{\/if}}\n\t<div id=\"channel_browser_empty\" class=\"hidden align_center margin_auto display_flex align_items_center justify_content_center\">\n\t\t<span class=\"channel_browser_empty_message\"><\/span>\n\t<\/div>\n\t<div id=\"channel_list_container\" class=\"channel_modal_list\">\n\t\t{{{loadingHTML}}}\n\t<\/div>\n<\/div>\n\n<div id=\"new_channel_container\" class=\"no_opacity\"><\/div>\n";
TS.raw_templates['channel_browser_row'] = "{{i18n_ns \"channel_browser\"}}\n\n<div class=\"channel_browser_row\">\n\t<div class=\"channel_browser_row_header overflow_ellipsis\">\n\t\t<ts-icon class=\"channel_browser_type_icon greigh\"><\/ts-icon>\n\t\t<span class=\"channel_browser_channel_name bold\"><\/span>\n\t\t<ts-icon class=\"shared_channel_icon greigh ts_icon_shared_channel hidden\"><\/ts-icon>\n\t\t<span class=\"shared_channels_icon hidden\">{{> shared_channels_icon model_ob=model_ob}}<\/span>\n\t\t<span class=\"shared_channels_pending_icon hidden\">{{> shared_channels_icon model_ob=model_ob}}<\/span>\n\t<\/div>\n\t<div class=\"channel_browser_channel_purpose sk_black margin_bottom_25\"><\/div>\n\t<div class=\"channel_browser_channel_created_info overflow_ellipsis\">\n\t\t{{!--\n\t\t\tThis copy is actually replaced wholesale by the JS.\n\t\t\tWe keep a placeholder here so that the initial row height is calculated correctly.\n\t\t--}}\n\t\t{{#t}}Cargando{{\/t}}\n\t<\/div>\n\n\t<div class=\"channel_browser_channel_shared_info hidden overflow_ellipsis\">\n\t\t{{!--\n\t\t\tThis copy is actually replaced wholesale by the JS.\n\t\t\tWe keep a placeholder here so that the initial row height is calculated correctly.\n\t\t--}}\n\t\t{{#t}}Cargando{{\/t}}\n\t<\/div>\n\n\t<div class=\"channel_browser_channel_invite_info hidden\">\n\t\t<span class=\"channel_browser_invite_text\"><\/span> <span class=\"channel_browser_invite_status\">{{#t note=\"Refers to the status of a shared channel invitation\"}}A\u00fan no se ha aceptado.{{\/t}}<\/span>\n\t\t<div class=\"channel_browser_invite_actions\">\n\t\t\t{{> shared_channel_invite_info}}\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"channel_browser_private_channel_rollup_info hidden\">\n\t\t{{#t}}Los canales cerrados solo permiten unirse por invitaci\u00f3n.{{\/t}}\n\t<\/div>\n\n\t<div class=\"channel_browser_member_count_container greigh small_left_margin\"><i class=\"ts_icon ts_icon_user\"><\/i> <span class=\"channel_browser_member_count\"><\/span><\/div>\n\t<div class=\"channel_browser_open\">\n\t\t<i class=\"ts_icon ts_icon_enter\"><\/i>\n\t<\/div>\n\t<div class=\"channel_browser_preview align_center\">\n\t\t<i class=\"ts_icon ts_icon_enter\"><\/i><br>{{#t}}vista previa{{\/t}}\n\t<\/div>\n\n\t<div class=\"channel_browser_teams small_top_margin tiny_bottom_margin\"><\/div>\n<\/div>\n";
