TS.raw_templates['channel_new_modal'] = "{{i18n_ns \"channel_modal\"}}\n\n<div id=\"new_channel_modal\" class=\"channel_modal\">\n\t<div>\n\t\t<h1 class=\"channel_modal_header\">\n\t\t\t<span class=\"public_channel_item{{#unless is_public}} hidden{{\/unless}}\">{{#t}}Crear un canal{{\/t}}<\/span>\n\t\t\t<span class=\"private_channel_item{{#is_public}} hidden{{\/is_public}}\">{{#t}}Crear un canal cerrado{{\/t}}<\/span>\n\t\t<\/h1>\n\t\t<p class=\"input_note_special medium_bottom_margin\">{{#t}}Los canales son el lugar donde se comunican los miembros de tu espacio de trabajo. Funcionan mejor cuando se organizan en torno a un tema, por ejemplo #clientes.{{\/t}}<\/p>\n\t<\/div>\n\t<div class=\"bottom_margin private_toggle_container\">\n\t\t{{#if can_toggle_private}}\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"channel_public_private_toggle\" type=\"checkbox\" name=\"public\" value=\"public\" {{#is_public}}checked=\"checked\"{{\/is_public}} data-style=\"toggle\" data-on-text=\"{{#t}}Abierto{{\/t}}\" data-off-text=\"{{#t}}Cerrado{{\/t}}\" data-label=\"{{#t}}Cualquier miembro del espacio de trabajo puede ver y unirse a este canal.{{\/t}}\" data-off-label=\"{{#t}}Solo quienes reciban una invitaci\u00f3n podr\u00e1n unirse o ver este canal.{{\/t}}\" data-off-class=\"ts_toggle_orange\">\n\t\t\t<\/label>\n\t\t{{\/if}}\n\t<\/div>\n\t<div>\n\t\t<div class=\"bottom_margin\">\n\t\t\t<label for=\"channel_create_title\" class=\"align_left\">{{#t}}Nombre{{\/t}}<\/label>\n\t\t\t<div class=\"channel_modal_title_input_container no_margin\">\n\t\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon {{#is_public}}hidden{{\/is_public}}\" \/>\n\t\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon {{#unless is_public}}hidden{{\/unless}}\" \/>\n\t\t\t\t<input\n\t\t\t\t\tid=\"channel_create_title\"\n\t\t\t\t\tname=\"title_input\"\n\t\t\t\t\ttype=\"text\"\n\t\t\t\t\tclass=\"lowercase title_input large_left_padding\"\n\t\t\t\t\tvalue=\"{{title}}\"\n\t\t\t\t\tplaceholder=\"{{#t}}p. ej. clientes{{\/t}}\"\n\t\t\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\t\t\tdata-validation-for=\"channel_create_title\"\n\t\t\t\t\tdata-validation-success=\"\"\n\t\t\t\t\tautocapitalize=\"off\"\n\t\t\t\t\tautocorrect=\"off\"\n\t\t\t\t\tautocomplete=\"off\"\n\t\t\t\t\/>\n\t\t\t<\/div>\n\t\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t\t{{#feature flag=\"feature_longer_channel_names\"}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 81 caracteres.{{\/t}}{{else}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 22 caracteres.{{\/t}}{{\/feature}}\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden name_taken_warning margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}Ese nombre ya lo est\u00e1 usando un canal, usuario o grupo de usuarios.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden invalid_chars_warning margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}Hemos eliminado los caracteres no permitidos de tu nombre. Si te parece bien, vuelve a hacer clic en \"Crear canal\".{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden other_error margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t<span class=\"error_message\"><\/span>\n\t\t\t<\/span>\n\t\t<\/div>\n\n\t\t{{#unless is_ra}}\n\t\t<div class=\"medium_bottom_margin purpose_container\">\n\t\t\t<label for=\"channel_purpose_input\" class=\"block align_left\">\n\t\t\t\t{{#t}}\n\t\t\t\tFinalidad\n\t\t\t\t<span class=\"greigh normal\">(optativo)<\/span>\n\t\t\t\t{{\/t}}\n\t\t\t<\/label>\n\t\t\t<div id=\"channel_purpose_input\" name=\"channel_purpose_input\" class=\"texty_single_line_input\" data-validation=\"maxlength={{ChannelPurposeMaxLength}}\" data-validation-for=\"channel_purpos