t\t\t\t{{#t}}<strong>Consejo:<\/strong> Salta f\u00e1cilmente de un canal o mensaje directo a otro con Quick Switcher ({quickswitcher_shortcut}).{{\/t}}\n\t\t\t<\/div>\n\t\t{{\/unless}}\n\t<\/div>\n\t<div id=\"im_browser_empty\" class=\"hidden align_center margin_auto display_flex align_items_center justify_content_center\">\n\t\t<span class=\"im_browser_empty_message\"><\/span>\n\t<\/div>\n\t{{#canUserCreateGroups}}\n\t\t<div class=\"create_private_channel_container align_center large_top_margin\">\n\t\t\t<div class=\"greigh\">{{#t}}\u00bfTienes que a\u00f1adir m\u00e1s gente?{{\/t}}<\/div>\n\t\t\t<button class=\"btn btn_outline small_top_margin create_private_channel\">{{#t}}Crear en su lugar un canal cerrado{{\/t}}<\/button>\n\t\t<\/div>\n\t{{\/canUserCreateGroups}}\n\n\t{{#if is_admin_only_mode}}\n\t\t<div class=\"bold small small_bottom_margin\">{{#t team_name=team_name}}Administradores{{\/t}}<\/div>\n\t{{else}}\n\t\t<div class=\"recent_label greigh mini small_bottom_margin\">{{#t}}Conversaciones recientes{{\/t}}<\/div>\n\t{{\/if}}\n\n\t<div id=\"im_list_container\" class=\"channel_modal_list\">\n\t\t{{#feature flag=\"feature_ms_latest\"}}\n\t\t\t{{!-- hbslint-disable syntax --}}\n\t\t\t{{{loadingHTML}}}\n\t\t\t{{!-- hbslint-enable syntax --}}\n\t\t{{\/feature}}\n\t<\/div>\n<\/div>\n\n<div id=\"new_channel_container\" class=\"hidden\"><\/div>\n";
TS.raw_templates['im_browser_row'] = "{{i18n_ns \"ims\"}}\n{{#if item.disabled_dm}}<div class=\"disabled_dm_warning float_right greigh small_left_margin\">{{#t note=\"Warning that this external member cannot be added to this shared group DM\"}}De otro espacio de trabajo{{\/t}}<\/div>\n{{else if last_msg_time}}<div class=\"im_last_msg_time float_right greigh small_left_margin\">{{last_msg_time}}<\/div>{{\/if}}\n<i class=\"ts_icon ts_icon_enter ts_icon_inherit enter_icon float_right blue_link small_top_margin\"><\/i>\n{{#if item.members}}\n\t{{#if member_one}}\n\t\t{{makeMemberPreviewLinkImage member_one.id 32 false true}}\n\t{{\/if}}\n\t{{#if member_two}}\n\t\t{{makeMemberPreviewLinkImage member_two.id 32 false true}}\n\t{{\/if}}\n\t<div class=\"overflow_ellipsis bold im_display_name_container\">\n\t\t<i class=\"ts_icon ts_icon_multiparty_dm_{{mpimMemberCount model_ob}} mpim_member_count\"><\/i>\n\t\t<span class=\"im_display_name\">{{display_name}}<\/span>\n\t<\/div>\n{{else}}\n\t{{> c-unified_member member=item.member size=\"medium\"}}\n{{\/if}}\n{{#if unread_cnt}}\n\t<div class=\"im_unread_cnt float_right small_left_margin\">{{unread_cnt}}<\/div>\n{{\/if}}\n";
TS.raw_templates['im_browser_tokens'] = "{{i18n_ns \"ims\"}}\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n<div id=\"im_browser_tokens\">\n\t{{#each members}}\n\t\t<div class=\"member_token {{getMemberTypeClass this}}{{#if this.is_external}} external_member{{\/if}}\" data-member-id=\"{{this.id}}\">\n\t\t\t{{{makeMemberPreviewLinkImage this.id 24 false true true}}}\n\t\t\t{{getPrefCompliantMemberName this}}\n\t\t\t<i class=\"ts_icon ts_icon_times ts_icon_inherit remove_member_icon\"><\/i>\n\t\t<\/div>\n\t{{\/each}}\n\t<input type=\"text\" id=\"im_browser_filter\" {{#unless members}}placeholder=\"{{#pageNeedsEnterprise}}{{#t}}Buscar por nombre{{\/t}}{{else}}{{#t}}Buscar o iniciar una conversaci\u00f3n{{\/t}}{{\/pageNeedsEnterprise}}\"{{\/unless}}>\n\t{{> loading_indicator id=\"im_browser_spinner\" class=\"hidden\"}}\n<\/div>\n";
TS.raw_templates['im_browser_guest_alert'] = "{{i18n_ns \"ims\"}}\n\n<div id=\"im_browser_alert\" class=\"alert alert_warning\">\n\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\n\t{{#if ra_alert}}\n\t\t{{#if member}}\n\t\t\t{{#t member_display_name=(getPrefCompliantMemberName member)}}\n\t\t\t\t<strong>{member_display_name}<\/strong> es un invitado de tu equipo, as\u00ed que comparte archivos e informaci\u00f3n con precauci\u00f3n.\n\t\t\t{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Algunos participantes tienen cuentas de invitados, as\u00ed que comparte archivos e informaci\u00f3n con precauci\u00f3n.{{\/t}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#t external_team_name=team}}\n\t\t\tEst\u00e1s iniciando una conversaci\u00f3n con <strong>{external_team_name}<\/strong>. Comparte archivos e informaci\u00f3n con precauci\u00f3n.\n\t\t{{\/t}}\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['im_archives_list'] = "{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n{{#each ims}}\n\t<div class=\"{{#unless @first}}top_padding{{\/unless}} {{#unless @last}}bottom_border{{\/unless}}\">\n\t\t<div class=\"position_relative\">\n\t\t\t{{#if this.is_mpim}}\n\t\t\t\t<span class=\"avatar avatar_one\">{{{makeMemberPreviewLinkImage this.member_one_id 36 false true}}}<\/span>\n\t\t\t\t<span class=\"avatar avatar_two\">{{{makeMemberPreviewLinkImage this.member_two_id 36 false true}}}<\/span>\n\t\t\t{{else}}\n\t\t\t\t<span class=\"avatar\">{{{makeMemberPreviewLinkImage this.member.id 48 false true}}}<\/span>\n\t\t\t{{\/if}}\n\t\t<\/div>\n\t\t<h4 class=\"no_bottom_margin\" style=\"padding-left: 4rem;\">\n\t\t\t{{#if this.is_mpim}}\n\t\t\t\t<a href=\"{{mpimArchivesPath this.model_ob}}\" class=\"slate_blue\">\n\t\t\t\t\t<i class=\"ts_icon ts_icon_multiparty_dm_{{mpimMemberCount this.model_ob}}\"><\/i>{{mpimDisplayName this.model_ob}}\n\t\t\t\t<\/a>\n\t\t\t{{else}}\n\t\t\t\t<a href=\"\/archives\/{{this.id}}\" class=\"slate_blue\">\n\t\t\t\t\t{{getPrefCompliantMemberName this.member}}\n\t\t\t\t<\/a>\n\t\t\t{{\/if}}\n\t\t<\/h4>\n\t\t<div class=\"col span_4_of_6 subtle_silver\" style=\"padding-left: 4rem\">\n\t\t\t<p class=\"small no_bottom_margin\">\n\t\t\t\t{{{this.last_msg_html}}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t\t<div class=\"col span_2_of_6 subtle_silver hide_on_mobile\">\n\t\t\t{{this.latest_date}}\n\t\t<\/div>\n\t\t<div class=\"clear_both\"><\/div>\n\t<\/div>\n{{\/each}}\n";
TS.raw_templates['transfer_ownership'] = "{{i18n_ns \"transfer_ownership\"}}\n\n{{#if member_not_found}}\n\t<p>{{#t}}\u00a1Caramba! No hemos encontrado a <strong>{name}<\/strong> en tu espacio de trabajo de Slack. Dale otra oportunidad a esa lista desplegable.{{\/t}}<\/p>\n{{else}}\n\t{{#t}}\n\t<p>\u00bfDe verdad que quieres transferir la propiedad del espacio de trabajo a <strong>{name}<\/strong>? Esta operaci\u00f3n no se podr\u00e1 deshacer.<\/p> \n\t<p><strong>Transferir propiedad a:<\/strong><\/p>\n\t{{\/t}}\n\n\t<div class=\"member_card\">\n\t\t<div class=\"member_image thumb_72 medium_right_margin\" style=\"background-image: url('{{profile_image}}');\"><\/div>\n\t\t<div class=\"member_card_details\">\n\t\t\t<div class=\"member_card_name\"><strong>{{real_name}}<\/strong><\/div>\n\t\t\t<div class=\"member_card_email\">{{email}}<\/div>\n\t\t<\/div>\n\t<\/div>\n{{\/if}}\n";
TS.raw_templates['spaces_attachment'] = "{{! This Template is only used for Posts}}\n\n{{i18n_ns 'spaces_attachments'}}\n\n{{initial_caret_html}}\n<div {{#if real_src}}data-real-src=\"{{real_src}}\"{{\/if}} class=\"inline_attachment{{#unless expand_it}} hidden{{\/unless}} {{max_width_class}}\" data-attachment-id=\"{{attachment.id}}\">\n\t{{#if attachment.pretext}}\n\t\t<div class=\"attachment_pretext\">{{formatMessageAttachmentPart attachment.pretext msg true attachment.mrkdwn_in_hash.pretext}}<\/div>\n\t{{\/if}}\n\t{{#if has_content}}\n\t\t<div class=\"inline_attachment_wrapper{{#if is_standalone}} standalone{{\/if}}\">\n\t\t\t<div class=\"attachment_bar\" style=\"background:#{{bg_color}};\"><div class=\"shim\"><\/div><\/div>\n\t\t\t<div class=\"content dynamic_content_max_width\">\n\n\t\t\t\t{{#if thumb_at_top}}\n\t\t\t\t\t{{#if small_thumb}}\n\t\t\t\t\t\t<div class=\"msg_inline_attachment_thumb_holder at_top\">\n\t\t\t\t\t\t\t{{#if thumb_link}}<a {{makeRefererSafeLink url=thumb_link}} target=\"{{thumb_link}}\">{{\/if}}\n\t\t\t\t\t\t\t{{!using style for width height is important! we must override default img styles}}\n\t\t\t\t\t\t\t<img class=\"msg_inline_attachment_thumb\" src=\"{{small_thumb_url}}\" style=\"width:{{attachment._floated_thumb_display_width}}px; height:{{attachment._floated_thumb_display_height}}px;\" alt=\"\">\n\t\t\t\t\t\t\t{{#if thumb_link}}<\/a>{{\/if}}\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\n\t\t\t\t{{#if can_delete}}\n\t\t\t\t\t<div class=\"delete_attachment_link\" data-attachment-id=\"{{attachment.id}}\"><i class=\"ts_icon ts_icon_times_small\"><\/i><\/div>\n\t\t\t\t{{\/if}}\n\n\t\t\t\t<div>\n\t\t\t\t\t{{#if attachment.service_icon}}<img class=\"attachment_service_icon\" src=\"{{attachment.service_icon}}\" width=\"16\" height=\"16\">{{\/if}}\n\t\t\t\t\t{{#if attachment.author_icon}}\n\t\t\t\t\t\t{{#if attachment.author_link}}\n\t\t\t\t\t\t\t<a {{makeRefererSafeLink url=attachment.author_link}} target=\"{{attachment.auth