ment.mrkdwn_in_hash.fallback enable_slack_action_links}}{{else}}{{#t}}NO SE MUESTRAN OPCIONES{{\/t}}{{\/if}}<\/div>{{\/if}}\n";
TS.raw_templates['spaces_connected_members'] = "{{i18n_ns 'spaces'}}\n\n<div class=\"connected_members_count_container\">\n    {{>spaces_connected_member_count}}\n<\/div>\n\n<ul class=\"members\">\n    {{! Note: whitespace inside of #each will cause elements to jump around when the tooltip\n              is first shown.\n        TODO: unify this with spaces_connected_member_template, below.\n    }}\n\n    {{#if editing_member}}\n        <li>{{> member_preview_link_image (getMemberPreviewLinkImageArgs this 36 false true)}}<\/li>\n    {{\/if}}\n\n\t{{#each members}}\n        <li>{{> member_preview_link_image (getMemberPreviewLinkImageArgs this 36 false true)}}<\/li>\n    {{\/each}}\n\n    {{#has_more_count}}\n        <li><button class=\"toggle_more_members_popover\" data-has-tooltip=\"true\" title=\"{{#t}}Clic para mostrar {more_count} visitantes m\u00e1s{{\/t}}\">{{more_count}}<\/button><\/li>\n    {{\/has_more_count}}\n<\/ul>\n";
