TS.raw_templates['spaces_link_popover'] = "{{i18n_ns \"link_popover\"}}\n\t<div class=\"textstyle_menu link {{#show_unfurl}}has_unfurl_button{{\/show_unfurl}}\">\n\t\t<input type=\"text\" placeholder=\"{{#t}}Por ej. www.slack.com{{\/t}}\"><\/input>\n\t\t<a class=\"link tsm_edit_link\" target=\"_blank\"><\/a>\n\t\t<div class=\"buttons\">\n\t\t\t<a data-toggle=\"tooltip\" class=\"item link_unfurl\" data-which=\"unfurl\" title=\"{{#t}}Desplegar enlace{{\/t}}\"><ts-icon class=\"ts_icon_eye\"><\/ts-icon><\/a>\n\t\t\t<a data-toggle=\"tooltip\" class=\"item link_remove\" data-which=\"remove\" title=\"{{#t}}Eliminar enlace{{\/t}}\"><ts-icon class=\"ts_icon_times\"><\/ts-icon><\/a>\n\t\t\t<a data-toggle=\"tooltip\" class=\"item link_edit\" data-which=\"edit\" title=\"{{#t}}Editar direcci\u00f3n del enlace{{\/t}}\"><ts-icon class=\"ts_icon_pencil\"><\/ts-icon><\/a>\n\t\t\t<a data-toggle=\"tooltip\" class=\"item link_ok\" data-which=\"okay\" title=\"{{#t}}Guardar cambios{{\/t}}\"><ts-icon class=\"ts_icon_check_large\"><\/ts-icon><\/a>\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['spaces_shared_in'] = "{{!-- hbslint-disable syntax --}}\n{{!-- TODO: Enable syntax linter and refactor to use safeString --}}\n{{i18n_ns 'spaces'}}\n\n{{! Note: whitespace before the closing <\/li> tags will add spacing before the comma separating\n          the items, so be careful. }}\n{{#if public_link}}\n\t<li>\n\t\t{{#feature flag=\"feature_external_files\"}}\n\t\t\t{{#t}}ha compartido <a href=\"{public_link}\" class=\"space_toggle_public_url\" target=\"public_{public_link}\">externamente<\/a>{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}ha compartido <a href=\"{public_link}\" class=\"space_toggle_public_url\" target=\"public_{public_link}\">p\u00fablicamente<\/a>{{\/t}}\n\t\t{{\/feature}}\n\t\t{{#if can_unshare}}<a class=\"unshare_link ts_tip ts_tip_top ts_tip_float\" onclick=\"TS.web.file.revokePublicURL(TS.files.getFileById('{{file_id}}'))\"><span class=\"ts_tip_tip\">{{#feature flag=\"feature_external_files\"}}{{#t}}Anular el enlace externo{{\/t}}{{else}}{{#t}}Anular la URL p\u00fablica{{\/t}}{{\/feature}}<\/span><i class=\"ts_icon ts_icon_minus_circle_small\"><\/i><\/a>{{\/if}}{{#if shared_in}} {{#t note='part of a larger string, like \"Zachary Forrest shared publicly and in random, general\"'}}y en{{\/t}}{{\/if}}\n\t<\/li>\n{{else}}\n\t<li>{{#t note='part of a larger string like \"Zachary Forrest shared in random\"'}}ha compartido en{{\/t}}<\/li>\n{{\/if}}\n{{#if in_our_app}}\n\t{{#each shared_in}}\n\t<li class=\"list\">{{{makeChannelOrGroupSSBLinkById this}}} {{#if ..\/can_unshare}}{{{makeUnshareLinkById this}}}{{\/if}}<\/li>\n\t{{\/each}}\n{{else}}\n\t{{#each shared_in}}\n\t<li class=\"list\">{{{makeChannelOrGroupLinkById this}}} {{#if ..\/can_unshare}}{{{makeUnshareLinkById this}}}{{\/if}}<\/li>\n\t{{\/each}}\n{{\/if}}\n{{#has_overflow}}\n\t<li><a href=\"javascript:void(0)\" class=\"show_overflow\">{{#t}}{overflow_count} m\u00e1s{{\/t}}<\/a><\/li>\n{{\/has_overflow}}\n";
