en ir en min\u00fascula, sin espacios ni puntos, y no exceder los 81 caracteres.{{\/t}}{{else}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 22 caracteres.{{\/t}}{{\/feature}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden name_taken_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}Ese nombre ya se utiliza. Prueba con uno distinto.{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden invalid_chars_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}Has introducido caracteres no permitidos en el nombre, pero lo hemos solucionado. Aseg\u00farate de que est\u00e1 bien y vuelve a intentarlo.{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden single_punctuation_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}Los nombres no pueden incluir guiones ni guiones bajos.{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden other_error margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t<span class=\"error_message\"><\/span>\n\t<\/span>\n\t<p class=\"large_top_margin\">\n\t\t{{#t member_list=(listify (getDisplayNames members) strong=true no_escape=true)}}\n\t\t\tVas a convertir el mensaje de grupo con {member_list} en un canal cerrado. <strong>Esta operaci\u00f3n no se podr\u00e1 deshacer.<\/strong>\n\t\t{{\/t}}\n\t<\/p>\n\t<button type=\"button\" class=\"btn btn_outline dialog_cancel tiny_right_margin\">{{#t}}Cancelar{{\/t}}<\/button>\n\t<button type=\"button\" class=\"btn btn_primary convert_mpim_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">{{#t}}Convertir a un canal cerrado{{\/t}}<\/span><\/button>\n<\/div>";
