TS.raw_templates['calls_incoming_call'] = "{{i18n_ns \"calls\"}}\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n<div id=\"incoming_call_window\">\n\t<div class=\"avatar_holder\">\n\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs caller.id 192 false true)}}\n\t<\/div>\n\t<div class=\"name_label_holder\"><span class=\"name\">{{name}}<\/span><\/div>\n\t<div class=\"type_label_holder\">\n\t\t<span class=\"type_label type_label_0\">&nbsp;<\/span>\n\t\t<span class=\"type_label type_label_fade\">{{#if is_video_call}}{{#t}}Videollamada{{\/t}}{{else}}{{#t}}Llamada de voz{{\/t}}{{\/if}}<\/span>\n\t\t<span class=\"type_label type_label_fade type_label_fade_delay\">{{team}}<\/span>\n\t<\/div>\n\t<div class=\"button_holder\">\n\t\t<a class=\"ts_icon ts_icon_phone_flat reject\"><\/a>\n\t\t<a class=\"ts_icon ts_icon_phone accept accept_audio\"><\/a>\n\t\t{{#if is_video_call}}<a class=\"ts_icon ts_icon_video_camera accept accept_video\"><\/a>{{\/if}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['calls_incoming_call_window'] = "{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n<html lang=\"{{#if locale}}{{locale}}{{\/if}}\">\n<head>\n<script>\n_sendMessageToParentWindow = function(args) {\n\targs.origin_window_type = 'incoming_call';\n\twindow.opener.postMessage(args);\n};\n_userClickedAcceptOrReject = function(did_accept, did_choose_video) {\n\t_sendMessageToParentWindow({\n\t\tmessage_type: 'user_clicked_accept_or_reject',\n\t\tuser_id: '{{user_id}}',\n\t\troom_id: '{{room_id}}',\n\t\tdid_accept: did_accept,\n    did_choose_video: did_choose_video\n\t});\n};\ndocument.addEventListener('DOMContentLoaded', function(event) { \n  var accept_video_elements = document.getElementsByClassName('accept_video');\n  if (accept_video_elements.length > 0) {\n    accept_video_elements[0].addEventListener('click', function() {\n      _userClickedAcceptOrReject(true, true);\n    });\n  }\n\tdocument.getElementsByClassName('accept_audio')[0].addEventListener('click', function() {\n\t\t_userClickedAcceptOrReject(true);\n\t});\n\tdocument.getElementsByClassName('reject')[0].addEventListener('click', function() {\n\t\t_userClickedAcceptOrReject(false);\n\t});\n});\n<{{!}}\/script>\n{{#each css_urls}}\n<link href=\"{{this}}\" rel=\"stylesheet\">\n{{\/each}}\n<\/head>\n<body class=\"incoming_call_window_body {{#if no_border}}no_border{{\/if}}\">\n<div id=\"incoming_call\">\n{{{incoming_call_div}}}\n<\/div>\n<\/body>\n<\/html>\n";
TS.raw_templates['calls_minipanel'] = "{{i18n_ns \"calls\"}}\n<html lang=\"{{#if locale}}{{locale}}{{\/if}}\">\n<head>\n{{#each js_urls}}\n<script src=\"{{this}}\"><\/{{!}}script>\n{{\/each}}\n{{#each css_urls}}\n<link href=\"{{this}}\" rel=\"stylesheet\">\n{{\/each}}\n<\/head>\n<body class=\"loading minipanel_body {{#if no_border}}no_border{{\/if}}\">\n\t<div id=\"minipanel_window\">\n\t\t<span id=\"minipanel_magnify_button\" class=\"fade_on_hover\">\n\t\t\t<svg xmlns=\"http:\/\/www.w3.org\/2000\/svg\" width=\"7\" height=\"7\" viewBox=\"0 0 7 7\">\n\t\t\t\t<path fill=\"#FFFFFF\" fill-opacity=\"0.95\" d=\"M7 1c0-0.6-0.4-1-1-1H3C2.4 0 2.3 0.3 2.7 0.7l3.6 3.6C6.7 4.7 7 4.6 7 4V1zM4 7c0.6 0 0.7-0.3 0.3-0.7L0.7 2.7C0.3 2.3 0 2.4 0 3v3c0 0.6 0.4 1 1 1H4z\"\/>\n\t\t\t<\/svg>\n\t\t<\/span>\n\t\t<div id=\"big_active_participant_holder\">\n\t\t\t<div id=\"big_active_participant_content\">\n\t\t\t\t<canvas><\/canvas>\n\t\t\t\t<img id=\"big_active_avatar\"\/>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t<div id=\"minipanel_body_holder\" class=\"fade_on_hover\">\n\t\t\t<div id=\"minipanel_body\">\n\t\t\t\t<span id=\"minipanel_active_content\">\n\t\t\t\t\t<span id=\"avatar_holder\">\n\t\t\t\t\t\t<img id=\"active_avatar\" src=\"\"\/>\n\t\t\t\t\t<\/span>\n\t\t\t\t\t<span id=\"minipanel_info\">\n\t\t\t\t\t\t<div id=\"minipanel_info_name\"><\/div>\n\t\t\t\t\t\t<div id=\"minipanel_info_text\"><\/div>\n\t\t\t\t\t<\/span>\n\t\t\t\t<\/span>\n\n\t\t\t\t<span id=\"minipanel_waiting_text\"><\/span>\n\n\t\t\t\t<span id=\"button_holder\">\n\t\t\t\t\t<span id=\"minipanel_mute_button\" class=\"mute_button ts_icon ts_icon_microphone mute\"><\/span>\n\t\t\t\t\t<span id=\"minipanel_leave_button\" class=\"ts_icon ts_icon_phone_flat leave\"><\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<div id=\"screenshare_control\">\n\t\t\t<span class=\"status\">\n\t\t\t\t<span class=\"presence\"><\/span>\n\t\t\t\t<span class=\"status_text\"><span class=\"screen_sharer_name\"><\/span><\/span>\n\t\t\t<\/span>\n\t\t\t<span id=\"ss_mute_button\" class=\"mute_button ts_icon ts_icon_microphone\"><\/span>\n\t\t\t<span id=\"ss_sh_button\" class=\"screenhero_button inactive ts_icon\"><\/span>\n\t\t\t<span class=\"stop_button ts_icon ts_icon_stop_screen_sharing_alt\"><\/span>\n\t\t\t<span class=\"tooltip tooltip_mute\">{{#t}}Silenciar tu micr\u00f3fono{{\/t}}<\/span>\n\t\t\t<span class=\"tooltip tooltip_unmute\">{{#t}}Volver a activar tu micr\u00f3fono{{\/t}}<\/span>\n\t\t\t<span class=\"tooltip tooltip_start_screenhero\">{{#t}}Permite que otras personas interact\u00faen con tu pantalla{{\/t}}<\/span>\n\t\t\t<span class=\"tooltip tooltip_stop_screenhero\">{{#t}}Impide que otros puedan interactuar con tu pantalla{{\/t}}<\/span>\n\t\t\t<span class=\"tooltip tooltip_screen\">{{#t}}Dejar de compartir tu pantalla{{\/t}}<\/span>\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"screen_share_controls\" >\n\t\t{{> calls_screen_share_controls is_host=true }}\n\t<\/div>\n<\/body>\n<\/html>\n";
TS.raw_templates['calls_screen_share_controls'] = "{{i18n_ns \"calls\"}}\n\n<div class=\"ss_controls ss_controls--{{#if is_host }}host{{else}}guest{{\/if}}\">\n    <div class=\"ss_controls__info_container\">\n        <div class=\"ss_controls__speaker\">\n            <span class=\"ss_controls__empty_speaker_message\">{{#t}}Esperando que llegue gente...{{\/t}}<\/span>\n            <img class=\"ss_controls__speaker--avatar\" \/>\n            <div class=\"ss_controls__speaker_info_container\">\n                <span class=\"ss_controls__speaker--desc\">{{#t note=\"shown above the user's name that is currently speaking\"}}Interlocutor actual{{\/t}}<\/span>\n                <span class=\"ss_controls__speaker--name\"><\/span>\n            <\/div>\n        <\/div>\n        <div class=\"ss_controls__reaction\">\n            <span class=\"ss_controls__reaction--emoji\"><\/span>\n            <span class=\"ss_controls__reaction--name\"><\/span>\n        <\/div>\n        <span class=\"ss_controls__help_text\">\n            {{!-- These translations need to live here because we don't have TS.i18n in the mini panel --}}\n            <span name=\"end_share\">{{#t}}Dejar de compartir tu pantalla{{\/t}}<\/span>\n            <span name=\"options\">{{#t}}M\u00e1s opciones{{\/t}}<\/span>\n            <span name=\"mute_on\">{{#t}}Silenciar tu micr\u00f3fono{{\/t}}<\/span>\n            <span name=\"mute_off\">{{#t}}Activar tu micr\u00f3fono{{\/t}}<\/span>\n            <span name=\"doodle_on\">{{#t}}No dejar que otras personas escriban en tu pantalla{{\/t}}<\/span>\n            <span name=\"doodle_off\">{{#t}}Dejar que otras personas escriban en tu pantalla{{\/t}}<\/span>\n            <span name=\"doodle_disabled_linux\">{{#t}}Dejar que otras personas escriban en tu pantalla no est\u00e1 disponible en Linux{{\/t}}<\/span>\n            <span name=\"interactive_on\">{{#t fallback_hash=e422d0e2bd5d0fa2fce9ebbd12890cb35d1337cb}}Dejar de compartir el control{{\/t}}<\/span>\n            <span name=\"interactive_off\">{{#t fallback_hash=22764871de9c3a5e2579c06d7f126b02b10bfa97}}Compartir el control de tu pantalla{{\/t}}<\/span>\n            <span name=\"interactive_disabled_linux\">{{#t}}El control de pantalla compartido no est\u00e1 disponible en Linux{{\/t}}<\/span>\n            <span name=\"interactive_disabled_mas\">{{#t}}Descarga la aplicaci\u00f3n de Slack en nuestro sitio web para usar esta funci\u00f3n{{\/t}}<\/span>\n            <span name=\"video_on\">{{#t}}Desactivar la c\u00e1mara{{\/t}}<\/span>\n            <span name=\"video_off\">{{#t}}Activar la c\u00e1mara{{\/t}}<\/span>\n        <\/span>\n    <\/div>\n\n    <div class=\"ss_controls__button_container\">\n        <button data-action=\"mute\" class=\"ss_controls__button ss_controls__button--mute\"><\/button>\n        {{#if is_host }}\n        <button data-action=\"doodle\" class=\"ss_controls__button ss_controls__button--doodle\n            {{#if is_linux }}ss_controls__button--disabled disabled_linux{{\/if}}\">\n        <\/button>\n        {{#unless is_screenhero_disabled_by_admin}}\n            <button data-action=\"interactive\" class=\"ss_controls__button ss_controls__button--interactive\n                {{#if is_linux }}ss_controls__button--disabled disabled_linux{{\/if}}\"><\/button>\n        {{\/unless}}\n        <button data-action=\"end_share\" class=\"ss_controls__button ss_controls__button--end_share\"><\/button>\n        {{else}}\n        <button data-action=\"video\" class=\"ss_controls__button ss_controls__button--video\"><\/button>\n        <button data-action=\"options\" class=\"ss_controls__button ss_controls__button--options\"><\/button>\n        {{\/if}}\n    <\/div>\n\n    {{#feature flag=\"feature_calls_clipboard_broadcasting_optin\"}}\n    <div class=\"ss_controls__clipboard_confirmation\">\n        <span class=\"ss_controls__clipboard_help_text\">\n            {{#t}}\n            \u00bfPermitir el acceso del portapapeles, para que puedas copiar\/pegar en la pantalla compartida?\n            <a\n                href=\"https:\/\/get.slack.help\/hc\/en-us\/articles\/115003501303-Share-your-screen-with-Slack-Calls#clipboard-sharing\"\n                target=\"_blank\">\n                Ver los riesgos de seguridad<\/a>.\n            {{\/t}}\n        <\/span>\n        <div class=\"ss_controls__clipboard_button_container\">\n            <button id=\"clipboard_deny\" class=\"btn ss_controls__clipboard_button--deny\">{{#t note=\"Clipboard access refusal button copy\"}}No{{\/t}}<\/button>\n            <button id=\"clipboard_approve\" class=\"btn ts_icon ts_icon_warning ss_controls__clipboard_button--approve\">{{#t note=\"Clipboard access approval button copy\"}}Permitir{{\/t}}<\/button>\n        <\/div>\n    <\/div>\n    {{\/feature}}\n<\/div>";
TS.raw_templates['calls_cursors'] = "<html lang=\"{{#if locale}}{{locale}}{{\/if}}\">\n<head>\n{{#each js_urls}}\n<script src=\"{{this}}\"><\/{{!}}script>\n{{\/each}}\n{{#each css_urls}}\n<link href=\"{{this}}\" rel=\"stylesheet\">\n{{\/each}}\n<\/head>\n<body class=\"cursors_body\" style=\"background-color: transparent\">\n\t<canvas id=\"doodle\"><\/canvas>\n\t<div id=\"border_holder\"><\/div>\n\t<div class=\"cursor native\" data-participant-id=\"host\" data-cursor-type=\"none\">\n\t\t<div class=\"pointer\"\/>\n\t<\/div>\n<\/body>\n<\/html>\n";
TS.raw_templates['calls_interactive_screen_share_coachmark'] = "{{i18n_ns \"calls\"}}\n<div id=\"calls_interactive_screen_share_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t{{#experiment name=\"calls_interactive_ss\" group=\"enabled\"}}\n\t\t\t<h2 class=\"black\">{{#t}}Comparte tu pantalla al estilo Screenhero{{\/t}}<\/h2>\n\t\t\t<p>{{#t}}\n\n\t\t\t\tYa puedes coeditar documentos durante cualquier llamada de Slack, igual que en Screenhero: comparte tu pantalla y pulsa\n\t\t\t\t<i id=\"calls_interactive_icon\" class=\"ts_icon ts_icon_collab_screenshare_on\"><\/i>\n\t\t\t\tpara permitir que hagan clic y tecleen.\n\t\t\t\t\t\t{{\/t}}<\/p>\n\t\t{{\/experiment}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['user_group_list'] = "\t{{#each user_groups}}\n\t\t{{> user_group_list_item user_group=this show_delete=..\/show_delete show_toggle=..\/show_toggle is_flexpane=..\/is_flexpane}}\n\t{{\/each}}\n\n\t{{#unless is_flexpane}}\n\t\t{{#each disabled_user_groups}}\n\t\t\t{{> user_group_list_item user_group=this show_delete=..\/show_delete show_toggle=..\/show_toggle  is_flexpane=..\/is_flexpane}}\n\t\t{{\/each}}\n\t{{\/unless}}\n\n\t{{#if show_user_groups_help}}\n\t\t{{> user_group_tip is_flexpane=..\/is_flexpane}}\n\t{{\/if}}";
TS.raw_templates['user_group_list_item'] = "{{i18n_ns 'user_groups'}}\n\n<div class=\"user_group_item small_padding bottom_border clearfix\" data-qa=\"user_group_list_item\" data-user-group-id=\"{{user_group.id}}\">\n\t{{#if is_flexpane}}\n\t\t<div class=\"col span_5_of_6 small_padding no_bottom_margin\">\n\t\t\t<a href=\"\/usergroups\/{{user_group.id}}\" target=\"\/usergroups\/{{user_group.id}}\" data-user-group-id=\"{{user_group.id}}\" class=\"internal_user_group_link\">\n\t\t\t\t<h4>{{user_group.name}}<\/h4>\n\t\t\t\t{{#if user_group.description}}\n\t\t\t\t\t<p>{{user_group.description}}<\/p>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#or user_group.handle user_group.user_count}}\n\t\t\t\t\t<p class=\"subtle_silver tiny_bottom_margin\">\n\t\t\t\t\t\t{{#t user_count=user_group.user_count}}\n\t\t\t\t\t\t\t{user_count, plural, =1 {# miembro} other {# miembros}}\n\t\t\t\t\t\t{{\/t}}\n\t\t\t\t\t\t{{#and user_group.handle user_group.user_count}}-{{\/and}}\n\t\t\t\t\t\t{{#if user_group.handle}}@{{\/if}}{{user_group.handle}}\n\t\t\t\t\t<\/p>\n\t\t\t\t{{\/or}}\n\t\t\t<\/a>\n\t\t<\/div>\n\t{{else}}\n\t\t{{#if user_group.date_delete}}\n\t\t\t<div class=\"col span_4_of_6 small_padding no_bottom_margin\">\n\t\t\t\t<p class=\"no_bottom_margin subtle_silver\"><span class=\"bold\">{{user_group.name}}<\/span> {{#t note=\"inline indication that group is disabled\"}}(Desactivado){{\/t}}<\/p>\n\t\t\t<\/div>\n\t\t\t<div class=\"col span_2_of_6 small_padding no_bottom_margin float_right align_right\">\n\t\t\t\t{{#if show_toggle}}\n\t\t\t\t\t<a data-action=\"enable_user_group\" class=\"user_group_toggle_btn no_bottom_margin subtle_silver small small_right_padding\"><i class=\"ts_icon ts_icon_power_off ts_tip ts_tip_left\"><span class=\"ts_tip_tip\">{{#t note=\"link to enable a group\"}}Activar grupo{{\/t}}<\/span><\/i><\/a>\n\t\t\t\t\t{{#and show_delete user_group.can_delete}}\n\t\t\t\t\t\t<a data-action=\"delete_user_group\" class=\"user_group_toggle_btn small_left_padding no_bottom_margin subtle_silver small\"><i class=\"ts_icon ts_icon_times_circle ts_tip ts_tip_left\"><span class=\"ts_tip_tip\">{{#t note=\"link to delete a group\"}}Eliminar grupo{{\/t}}<\/span><\/i><\/a>\n\t\t\t\t\t{{\/and}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/div>\n\t\t{{else}}\n\t\t\t<div class=\"col span_3_of_4 small_padding no_bottom_margin\">\n\t\t\t\t<p class=\"bold no_bottom_margin\">{{user_group.name}} {{#if user_group.handle}}<span class=\"subtle_silver\">@{{user_group.handle}}<\/span>{{\/if}}<\/p>\n\t\t\t\t{{#if user_group.description}}\n\t\t\t\t\t<p class=\"small no_bottom_margin\">{{user_group.description}}<\/p>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#or user_group.prefs.channels.length user_group.prefs.groups.length}}\n\t\t\t\t\t<p class=\"small subtle_silver no_bottom_margin\">\n\t\t\t\t\t\t<span class=\"bold\">{{#t note=\"heading for list of default channels\"}}Canales predeterminados:  {{\/t}}<\/span>\n\t\t\t\t\t\t{{#each user_group.prefs.channels}}\n\t\t\t\t\t\t\t{{getCorGNameWithPrefixById this}}\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t\t{{#each user_group.prefs.groups}}\n\t\t\t\t\t\t\t{{getCorGNameWithPrefixById this}}\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/p>\n\t\t\t\t{{\/or}}\n\t\t\t\t{{#if user_group.created_by}}\n\t\t\t\t\t<p class=\"small subtle_silver no_bottom_margin\">\n\t\t\t\t\t\t{{#t note=\"description of the user group creator and user group creation date\" creator=(getPrefCompliantMemberNameById user_group.created_by) creation_date=(convertTimestampToMilliseconds user_group.date_create)}}\n\t\t\t\t\t\t\tCreado por <strong>{creator}<\/strong> el {creation_date, date, long}\n\t\t\t\t\t\t{{\/t}}\n\t\t\t\t\t<\/p>\n\t\t\t\t{{\/if}}\n\t\t\t<\/div>\n\t\t\t<div class=\"float_right right_padding\">\n\t\t\t\t<p class=\"user_group_count no_bottom_margin float_right small subtle_silver\">\n\t\t\t\t\t{{#or user_group.is_external user_group.auto_type}}<i class=\"ts_icon ts_icon_sync\"><\/i>{{\/or}}\n\t\t\t\t\t<i class=\"ts_icon ts_icon_user\"><\/i>{{user_group.user_count}}\n\t\t\t\t<\/p>\n\t\t\t\t<p class=\"user_group_actions small no_bottom_margin\">\n\t\t\t\t\t{{#if show_toggle}}\n\t\t\t\t\t\t<button class=\"user_group_toggle_btn btn_icon btn_outline btn ts_icon ts_icon_disable ts_tip ts_tip_bottom ts_tip_float ts_tip_multiline\" title=\"{{#t note=\"title for button to disable a group\"}}Desactivar{{\/t}}\" data-action=\"disable_user_group\"><span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">{{#t note=\"button to disable a group\"}}Desactivar grupo{{\/t}}<\/span><\/span><\/button>\n\t\t\t\t\t{{\/if}}\n\n\t\t\t\t\t<button class=\"btn_icon btn_outline btn ts_icon ts_icon_cog_o ts_tip ts_tip_bottom ts_tip_float ts_tip_multiline\" title=\"{{#t note=\"title for button to edit group information\"}}Ajustes{{\/t}}\"  data-action=\"open_form\"><span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">{{#t note=\"button to edit group information\"}}Editar informaci\u00f3n del grupo{{\/t}}<\/span><\/span><\/button>\n\n\t\t\t\t\t{{#or user_group.auto_type user_group.is_external}}\n\t\t\t\t\t\t<button class=\"btn_icon btn_outline btn ts_icon ts_icon_user ts_tip ts_tip_bottom ts_tip_float ts_tip_multiline\" title=\"{{#t note=\"title for button to show a list of group members\"}}Miembros{{\/t}}\" data-action=\"edit_members\"><span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">{{#t note=\"button to show a list of group members\"}}Ver miembros del grupo{{\/t}}<\/span><\/span><\/button>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<button class=\"btn_icon btn_outline btn ts_icon ts_icon_user ts_tip ts_tip_bottom ts_tip_float ts_tip_multiline\" title=\"{{#t note=\"title for button to edit group members\"}}Miembros{{\/t}}\" data-action=\"edit_members\"><span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">{{#t note=\"button to edit group members\"}}Editar miembros del grupo{{\/t}}<\/span><\/span><\/button>\n\t\t\t\t\t{{\/or}}\n\t\t\t\t<\/p>\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['user_group_tip'] = "{{i18n_ns 'user_groups'}}\n\n{{#if is_flexpane}}\n\t<div>\n\t\t<span class=\"user_groups_img\"><\/span>\n\t<\/div>\n{{\/if}}\n\n<div{{#unless is_flexpane}} class=\"col span_3_of_4\"{{\/unless}}>\n\n\t<div class=\"normal_padding{{#if is_flexpane}} dull_grey{{\/if}}\">\n\t\t<p class=\"user_groups_tip\">\n\t\t\t{{#t at_everyone=(atLabel 'everyone') at_channel=(atLabel 'channel') at_here=(atLabel 'here') note=\"note explaining user groups\"}}Mientras que los comandos como <span class=\"mention\">{at_everyone}<\/span>, <span class=\"mention\">{at_channel}<\/span> y <span class=\"mention\">{at_here}<\/span> llaman la atenci\u00f3n de todos los miembros en una conversaci\u00f3n, los grupos de usuarios te permiten establecer exactamente qui\u00e9n recibe tu mensaje.{{\/t}}\n\t\t<\/p>\n\t\t<p class=\"user_groups_tip\">\n\t\t\t{{#t note=\"note explaining how to set up a user group\"}}Elige un nombre para el grupo, como <span class=\"mention\">@dise\u00f1o<\/span> o <span class=\"mention\">@marketing<\/span>. A continuaci\u00f3n selecciona a los miembros del grupo. Ahora, cuando alguien del espacio de trabajo mencione el grupo de usuarios, solo se notificar\u00e1 a sus miembros. Incluso puedes a\u00f1adir autom\u00e1ticamente esos miembros a los canales que t\u00fa quieras.{{\/t}}\n\t\t<\/p>\n\t<\/div>\n\n<\/div>\n\n{{#unless is_flexpane}}\n\t<div class=\"col span_1_of_4 no_right_padding\">\n\t\t<span class=\"user_groups_img\"><\/span>\n\t<\/div>\n{{\/unless}}\n";
TS.raw_templates['user_group_channel_list_item'] = "{{i18n_ns \"groups\"}}\n\n<div class=\"user_group_item channel_item normal_padding bottom_border clearfix\">\n\t<div class=\"col span_6_of_6 no_bottom_margin\">\n\t\t<a target=\"\/messages\/{{this.id}}\" {{#if this.is_channel}}data-channel-id=\"{{this.id}}\" class=\"internal_channel_link\"{{else}}data-group-id=\"{{this.id}}\" class=\"internal_group_link\"{{\/if}}>\n\t\t\t<h4 class=\"tiny_bottom_margin bold\">{{#if this.is_channel}}<span class=\"subtle_silver\">#<\/span>{{\/if}}{{this.name}}{{#if is_org_shared}}{{> shared_channel_icon}}{{else}}{{#isModelObExtShared this}}{{> shared_channels_icon model_ob=this tooltip=true shared_team_ids=this.shared_team_ids}}{{\/isModelObExtShared}}{{\/if}} {{#if this.is_member}}<span class=\"mini subtle_silver\">{{#t note=\"Logged in member has joined this channel\"}}UNIDO{{\/t}}<\/span>{{\/if}}<\/h4>\n\t\t\t{{#if this.creator}}\n\t\t\t\t{{#if this.created}}\n\t\t\t\t\t{{#if this.prefCompliantMemberName}}\n\t\t\t\t\t\t<p class=\"subtle_silver tiny_bottom_margin\">\n\t\t\t\t\t\t\t{{#t note=\"Channel created information\" member=prefCompliantMemberName date_created=(convertTimestampToMilliseconds this.created)}}Creado por <b>{member}<\/b> el {date_created, date, long}{{\/t}}\n\t\t\t\t\t\t<\/p>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t\t{{#if this.purposeString}}\n\t\t\t\t<p class=\"subtle_silver tiny_bottom_margin\">\n\t\t\t\t\t{{this.purposeString}}\n\t\t\t\t<\/p>\n\t\t\t{{\/if}}\n\t\t<\/a>\n\t<\/div>\n<\/div>";
TS.raw_templates['user_group_alerts'] = "{{i18n_ns \"alerts\"}}\n\n{{#if_equal error compare=\"forbidden_name\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}El nombre \"{group_name}\" est\u00e1 reservado y no se puede usar.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"name_already_exists\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}Ya hay un grupo de usuarios con el nombre \"{group_name}\".{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"handle_already_exists\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}El nombre de grupo \"@{group_handle}\" ya se utiliza. Los grupos no pueden tener el mismo nombre que los canales o los usuarios.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"missing_subteam_name\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}Un grupo de usuarios debe tener un nombre.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"bad_handle\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}El identificador debe escribirse en min\u00fasculas y sin espacios.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"forbidden_handle\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}El nombre de grupo \"@{group_handle}\" est\u00e1 reservado y no puedes usarlo.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"no_users_provided\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}Los grupos de usuarios deben tener miembros.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if can_create_auto_owners}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}\u00bfQuieres crear un grupo para todos los propietarios de espacios de trabajo? <a href=\"#auto-group\" data-auto-type=\"owners\" data-auto-action=\"create\" class=\"user_group_auto_action\">Crea uno autom\u00e1tico<\/a> que est\u00e9 siempre actualizado.{{\/t}}<\/p>\n{{\/if}}\n\n{{#if can_enable_auto_owners}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}\u00bfQuieres crear un grupo para todos los propietarios de espacios de trabajo? <a href=\"#auto-group\" data-auto-type=\"owners\" data-auto-action=\"enable\" class=\"user_group_auto_action\">Reactiva el autom\u00e1tico<\/a> que siempre est\u00e1 actualizado.{{\/t}}<\/p>\n{{\/if}}\n\n{{#if can_create_auto_admins}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}\u00bfQuieres crear un grupo para todos los administradores de espacios de trabajo? <a href=\"#auto-group\" data-auto-type=\"admins\" data-auto-action=\"create\" class=\"user_group_auto_action\">Crea uno autom\u00e1tico<\/a> que est\u00e9 siempre al d\u00eda.{{\/t}}<\/p>\n{{\/if}}\n\n{{#if can_enable_auto_admins}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}\u00bfQuieres crear un grupo para todos los administradores de espacios de trabajo? <a href=\"#auto-group\" data-auto-type=\"admins\" data-auto-action=\"enable\" class=\"user_group_auto_action\">Reactiva el autom\u00e1tico<\/a> que siempre est\u00e1 actualizado.{{\/t}}<\/p>\n{{\/if}}\n";
TS.raw_templates['user_group_modal'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_groups_container\"{{#feature flag=\"feature_lazy_user_groups\"}} class=\"full_height\"{{\/feature}} data-qa=\"user_groups_admin_modal\">\n\n\t<div id=\"all_user_groups\"{{#feature flag=\"feature_lazy_user_groups\"}} class=\"full_height\"{{\/feature}}>\n\t\t<div id=\"user_groups_header\" class=\"clearfix bottom_border\">\n\t\t\t{{#if show_user_groups_add}}\n\t\t\t\t<a id=\"user_groups_create_btn\" data-action=\"open_form\" class=\"btn float_right\">{{#t}}Crear un nuevo grupo{{\/t}}<\/a>\n\t\t\t{{\/if}}\n\t\t\t<h1>{{#t}}Grupos de usuarios{{\/t}}<\/h1>\n\t\t\t<div class=\"user_groups_search\">\n\t\t\t\t<i class=\"icon_search ts_icon ts_icon_search\"><\/i>\n\t\t\t\t<a class=\"ts_icon ts_icon_times_circle icon_close hidden\"><\/a>\n\t\t\t\t<input id=\"user_group_modal_search\" type=\"text\" class=\"member_filter no_margin small\" name=\"team_filter\" placeholder=\"{{#t}}Buscar por nombre{{\/t}}\" \/>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t{{#ifClient}}\n\t\t\t{{#if show_info_pane}}\n\t\t\t\t<div class=\"info_panel clearfix\">\n\t\t\t\t\t<p>\n\t\t\t\t\t\t{{#t at_everyone=(atLabel 'everyone') at_channel=(atLabel 'channel') at_here=(atLabel 'here') note=\"note explaining user groups\"}}Mientras que los comandos como <span class=\"mention\">{at_everyone}<\/span>, <span class=\"mention\">{at_channel}<\/span> y <span class=\"mention\">{at_here}<\/span> llaman la atenci\u00f3n de todos los miembros en una conversaci\u00f3n, los grupos de usuarios te permiten establecer exactamente qui\u00e9n recibe tu mensaje.{{\/t}}\n\t\t\t\t\t<\/p>\n\t\t\t\t\t<p class=\"col span_3_of_4 no_bottom_margin\">\n\t\t\t\t\t\t{{#t note=\"note explaining how to set up a user group\"}}Elige un nombre para el grupo, como <span class=\"mention\">@dise\u00f1o<\/span> o <span class=\"mention\">@marketing<\/span>. A continuaci\u00f3n selecciona a los miembros del grupo. Ahora, cuando alguien del espacio de trabajo mencione el grupo de usuarios, solo se notificar\u00e1 a sus miembros. Incluso puedes a\u00f1adir autom\u00e1ticamente esos miembros a los canales que t\u00fa quieras.{{\/t}}<br>\n\t\t\t\t\t\t<a data-action=\"hide_info_pane\" class=\"bold\">{{#t}}Bien, ya puedes ocultar esto.{{\/t}}<\/a>\n\t\t\t\t\t<\/p>\n\t\t\t\t\t<div class=\"col span_1_of_4 top_margin no_padding\">\n\t\t\t\t\t\t<span class=\"user_groups_img\"><\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t{{\/ifClient}}\n\t\t<div id=\"user_groups_list_scroller\"{{#feature flag=\"feature_lazy_user_groups\"}} class=\"full_height\"{{\/feature}}>\n\t\t\t{{!-- hbslint-disable syntax --}}\n\t\t\t{{!-- TODO: Enable syntax linter and refactor to use a safeString --}}\n\t\t\t<div id=\"user_groups_list_div\"{{#feature flag=\"feature_lazy_user_groups\"}} class=\"full_height\"{{\/feature}}>{{{loadingHTML}}}<\/div>\n\t\t\t{{!-- hbslint-enable syntax --}}\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"user_groups_form_div\" class=\"hidden\"><\/div>\n\n\t<div id=\"user_groups_toggle_div\" class=\"hidden\"><\/div>\n\n<\/div>\n";
TS.raw_templates['user_group_settings_form'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_groups_header\" class=\"clearfix\">\n\t<h1 class=\"channel_modal_header\" data-qa=\"user_group_settings_form_header\">{{#if this.id}}{{#t note=\"heading for editing a user group\" name=this.name}}Editar {name}{{\/t}}{{else}}{{#t note=\"heading for creating a user group\"}}Crear un grupo de usuarios{{\/t}}{{\/if}}<\/h1>\n<\/div>\n\n<p class=\"input_note medium_bottom_margin\">{{#unless this.id}}{{#t}}Los grupos de usuarios permiten captar la atenci\u00f3n de varios miembros a la vez. Si utilizas un identificador de grupo, por ejemplo @cuentas, todos los miembros de ese grupo recibir\u00e1n una notificaci\u00f3n.{{\/t}}{{\/unless}}<\/p>\n\n<div id=\"user_group_alerts\"><\/div>\n\n<form class=\"user_group_settings_form\" data-qa=\"user_group_settings_form\">\n\t{{#if this.is_external}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> {{#t}}Un servicio externo gestiona el nombre de este grupo de usuarios. Utiliza ese servicio si quieres cambiar el nombre de este grupo de usuarios.{{\/t}}<\/p>\n\t{{\/if}}\n\n\t{{#if this.auto_type}}\n\t\t<p class=\"alert alert_info\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t{{#if_equal this.auto_type compare=\"admin\"}}\n\t\t\t\t{{#t}}Este grupo de usuarios se genera autom\u00e1ticamente para los administradores del espacio de trabajo.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Este grupo de usuarios se genera autom\u00e1ticamente para los propietarios del espacio de trabajo.{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t<\/p>\n\t{{\/if}}\n\n\t<p>\n\t\t<label for=\"user_group_name_input\">{{#t note=\"label for user group name input\"}}Nombre{{\/t}}<\/label>\n\t\t<input id=\"user_group_name_input\" type=\"text\" class=\"no_bottom_margin {{#or this.is_external this.auto_type}}disabled{{\/or}}\" name=\"name\" value=\"{{this.name}}\" maxlength=\"100\" placeholder=\"{{#t note=\"placeholder text for user group name input\"}}p. ej. Equipo de cuentas{{\/t}}\" {{#or this.is_external this.auto_type}}disabled{{\/or}} data-qa=\"user_group_name_input\"\/>\n\t<\/p>\n\n\t<p class=\"handle_input empty\">\n\t\t<label for=\"user_group_handle_input\">{{#t note=\"label for user group handle input\"}}Identificador{{\/t}}<\/label>\n\t\t<span class=\"icon_at\">@<\/span>\n\t\t<input id=\"user_group_handle_input\" type=\"text\" class=\"no_bottom_margin\" name=\"handle\" value=\"{{this.handle}}\" maxlength=\"100\" placeholder=\"{{#t note=\"an example user group handle\"}}p. ej. @cuentas{{\/t}}\" data-qa=\"user_group_handle_input\"\/><br \/>\n\t\t<span class=\"input_note\">{{#t}}Utilizaremos este identificador para captar la atenci\u00f3n del grupo. Debe escribirse en min\u00fasculas y sin espacios.{{\/t}}<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"description\">{{#t note=\"label for optional user group purpose input\"}}Finalidad <span class=\"subtle_silver normal\">(optativo)<\/span>{{\/t}}<\/label>\n\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"description\" value=\"{{this.description}}\" placeholder=\"\" maxlength=\"140\"\/>\n\t\t<span class=\"input_note\">{{#t note=\"help text below user group purpose input\"}}\u00bfDe qu\u00e9 trata este grupo?{{\/t}}<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"user_group_default_channels\">{{#t note=\"label for optional user group default channels input\"}}Canales predeterminados: <span class=\"subtle_silver normal\">(optativo)<\/span>{{\/t}}<\/label>\n\t\t<select class=\"hidden\" multiple=\"true\" id=\"user_group_default_channels\" name=\"defaultchannels[]\"><\/select>\n\t\t{{#if this.user_count}}\n\t\t\t<span class=\"input_note\">{{#t note=\"help text below user group default channels input\"}}Los nuevos miembros se a\u00f1adir\u00e1n autom\u00e1ticamente a los canales predeterminados. Se a\u00f1adir\u00e1 inmediatamente a los miembros existentes.{{\/t}}<\/span>\n\t\t{{else}}\n\t\t\t<span class=\"input_note\">{{#t note=\"help text below user group default channels input\"}}Los miembros del grupo se a\u00f1adir\u00e1n autom\u00e1ticamente a estos canales.{{\/t}}<\/span>\n\t\t{{\/if}}\n\t<\/p>\n\n\t<button id=\"save_user_group\" type=\"submit\" class=\"btn btn_large ladda-button float_right\"><span class=\"ladda-label\" data-qa=\"user_group_create_btn\">{{#if this.id}}{{#t}}Guardar{{\/t}}{{else}}{{#t}}Crear grupo{{\/t}}{{\/if}}<\/span><\/button>\n\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">{{#t}}Cancelar{{\/t}}<\/span><\/button>\n\n<\/form>\n";
TS.raw_templates['user_group_members_form'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_groups_header\" class=\"clearfix\">\n\t<h1>{{#if is_new}}{{#t group_name=user_group.name}}Invitar a miembros a {group_name}{{\/t}}{{else}}{{#t group_name=user_group.name}}Editar miembros de {group_name}{{\/t}}{{\/if}}<\/h1>\n<\/div>\n\n<form class=\"user_group_members_form\" data-qa=\"user_group_members_form\">\n\n\t{{#if user_group.is_external}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> {{#t note=\"warning shown beside user groups that cannot be edited because they are managed elsewhere\"}}Un servicio externo gestiona los miembros de este grupo de usuarios. Utiliza ese servicio si quieres editar esta lista.{{\/t}}<\/p>\n\t{{\/if}}\n\n\t{{#if user_group.auto_type}}\n\t\t<p class=\"alert alert_info\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t{{#if_equal user_group.auto_type compare=\"admin\"}}\n\t\t\t\t{{#t}}Este grupo de usuarios se genera autom\u00e1ticamente para los administradores del espacio de trabajo.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Este grupo de usuarios se genera autom\u00e1ticamente para los propietarios del espacio de trabajo.{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t<\/p>\n\t{{\/if}}\n\n\t<p id=\"user_group_member_invite_div\">\n\t\t<label for=\"members\">{{#t note=\"label for text input for members to optionally send invitations to this user group\"}}Enviar invitaciones a: <span class=\"subtle_silver normal\">(optativo)<\/span>{{\/t}}<\/label>\n\t\t<select class=\"hidden\" multiple=\"true\" id=\"user_group_members_select\" name=\"members[]\"><\/select>\n\t<\/p>\n\n\t{{#if is_locked}}\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">{{#t}}Vale{{\/t}}<\/span><\/button>\n\t{{else}}\n\t\t<button type=\"submit\" id=\"{{#if is_new}}create_group{{else}}save_group{{\/if}}\" class=\"btn btn_large float_right ladda-button\" data-qa=\"user_group_create_confirm_btn\"><span class=\"ladda-label\">{{#if is_new}}{{#t note=\"submit a list of members to invite to a group\"}}Invitar{{\/t}}{{else}}{{#t note=\"submit changes to a list of group members\"}}Guardar{{\/t}}{{\/if}}<\/span><\/button>\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">{{#t note=\"abandon changes to a list of group members\"}}Cancelar{{\/t}}<\/span><\/button>\n\t{{\/if}}\n<\/form>\n";
TS.raw_templates['user_group_toggle'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_group_alerts\"><\/div>\n\n{{#if_equal action compare=\"delete_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>{{#t note=\"heading above delete a user group section\"}}\u00bfQuieres eliminar {user_group.name}?{{\/t}}<\/h1>\n\t\t<p>{{#t note=\"note explaining consequences of deleting a user group\"}}Se eliminar\u00e1 de forma permanente toda la informaci\u00f3n sobre este grupo de usuarios. Esta acci\u00f3n no se puede deshacer.{{\/t}}<\/p>\n\t\t<button type=\"button\" data-action=\"cancel\" class=\"btn btn_outline\">{{#t}}Cancelar{{\/t}}<\/button>\n\t\t<button type=\"button\" data-action=\"deleteUserGroup\" class=\"user_group_toggle_btn btn btn_danger\">{{#t}}Eliminar este grupo{{\/t}}<\/button>\n\t<\/div>\n{{\/if_equal}}\n{{#if_equal action compare=\"disable_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>{{#t note=\"heading above disable a user group section\"}}\u00bfQuieres desactivar {user_group.name}?{{\/t}}<\/h1>\n\t\t<p>\n\t\t\t{{#if user_group.handle}}\n\t\t\t\t{{#t}}\n\t\t\t\t\tSi desactivas este grupo de usuarios, no podr\u00e1s usar @{user_group.handle} ni ver su lista de miembros (puedes volver a activarlo m\u00e1s tarde).\n\t\t\t\t{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}\n\t\t\t\t\tSi desactivas este grupo de usuarios, no podr\u00e1s ver su lista de miembros (puedes volver a activarlo m\u00e1s tarde).\n\t\t\t\t{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t\t<button type=\"button\" data-action=\"cancel\" class=\"btn btn_outline bottom_margin\">{{#t}}Cancelar{{\/t}}<\/button>\n\t\t<button type=\"button\" data-action=\"disableUserGroup\" class=\"user_group_toggle_btn btn bottom_margin\">{{#t}}Desactivar este grupo{{\/t}}<\/button>\n\t\t{{#if show_delete}}\n\t\t\t<p>{{#t}}Tambi\u00e9n puedes <button type=\"button\" data-action=\"switch_delete_user_group\" class=\"bold\">eliminar de forma permanente este grupo.<\/button>{{\/t}}<\/p>\n\t\t{{\/if}}\n\t<\/div>\n{{\/if_equal}}\n{{#if_equal action compare=\"enable_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>{{#t group_name=user_group.name note=\"heading above enable a user group section\"}}\u00bfQuieres activar {group_name}?{{\/t}}<\/h1>\n\t\t{{#if user_group.handle}}<p>{{#t note=\"note explaining that the user group will notify its members if it is enabled\"}}Si lo habilitas, @{user_group.handle} notificar\u00e1 a los miembros del grupo.{{\/t}}<\/p>{{\/if}}\n\t\t<button type=\"button\" data-action=\"cancel\" class=\"btn btn_outline\">{{#t}}Cancelar{{\/t}}<\/button>\n\t\t<button type=\"button\" data-action=\"enableUserGroup\" class=\"user_group_toggle_btn btn\">{{#t}}Activar este grupo{{\/t}}<\/button>\n\t<\/div>\n{{\/if_equal}}\n";
TS.raw_templates['user_group_invite_member_small'] = "<div class=\"user_group_invite_member_small clearfix\" data-qa=\"user_group_invite_member_item\">\n\t<i class=\"enter_icon ts_icon ts_icon_enter blue_link not_in_token float_right small_top_margin\"><\/i>\n\t{{> c-unified_member member=member size=\"small\" avatar=true omit_status=true omit_presence=true}}\n<\/div>\n";
TS.raw_templates['user_group_preview'] = "{{i18n_ns 'user_groups'}}\n\n{{#if is_user_group_deleted}}\n\t<p class=\"alert alert_error small_right_margin small_left_margin\"><i class=\"ts_icon ts_icon_warning\"><\/i> {{#t}}Se ha eliminado este grupo de usuarios.{{\/t}}<\/p>\n{{else}}\n\t{{#if user_group.date_delete}}\n\t\t<p class=\"alert alert_error small_right_margin small_left_margin\"><i class=\"ts_icon ts_icon_warning\"><\/i> {{#t}}Este grupo de usuarios est\u00e1 desactivado.{{\/t}}<\/p>\n\t{{\/if}}\n{{\/if}}\n<div class=\"clearfix no_bottom_margin top_margin left_margin right_margin\" data-user-group-id=\"{{user_group.id}}\">\n\n\t<h3 class=\"tiny_bottom_margin right_margin\" data-qa=\"user_group_name\">\n\t\t{{user_group.name}}\n\t\t{{#unless is_user_group_deleted}}\n\t\t\t{{#if show_user_groups_edit}}\n\t\t\t\t<button id=\"user_group_menu_toggle\" class=\"float_right btn_icon btn_outline btn ts_icon ts_icon_chevron_large_down\" aria-label=\"{{#t}}Imprimir{{\/t}}\"><\/button>\n\t\t\t{{\/if}}\n\t\t{{\/unless}}\n\t<\/h3>\n\t{{#if user_group.handle}}\n\t<p class=\"subtle_silver {{#if user_group.created_by}}tiny_bottom_margin{{\/if}}\">\n\t\t{{#t}}Usa <b>@{user_group.handle}<\/b> para notificar a este grupo{{\/t}}\n\t<\/p>\n\t{{\/if}}\n\t{{#if user_group.created_by}}\n\t\t{{#if user_group.date_create}}\n\t\t\t<p class=\"subtle_silver\">\n\t\t\t\t{{#t note=\"description of the user group creator and user group creation date\" creator=(getPrefCompliantMemberNameById user_group.created_by) creation_date=(convertTimestampToMilliseconds user_group.date_create)}}\n\t\t\t\t\tCreado por <strong>{creator}<\/strong> el {creation_date, date, long}\n\t\t\t\t{{\/t}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t{{\/if}}\n\n\t{{#if user_group.description}}\n\t\t<p>{{user_group.description}}<\/p>\n\t{{\/if}}\n<\/div>\n\n<ul id=\"user_group_tabs\" class=\"flexpane_tab_bar small_top_margin no_bottom_margin bottom_border\">\n\t<li id=\"user_group_members_tab\" class=\"bold active\"><a href=\"#user_group_members\" class=\"tab\" data-name=\"user_group_members\"><span class=\"tab_text\">{{#t}}Miembros{{\/t}} <span class=\"normal\">({{members.length}})<\/span><\/span><\/a><\/li>\n\t<li id=\"user_group_channels_tab\" class=\"bold\"><a href=\"#user_group_channels\" class=\"tab\" data-name=\"user_group_channels\"><span class=\"tab_text\">{{#t}}Canales{{\/t}} <span class=\"normal\">({{channels.length}})<\/span><\/span><\/a><\/li>\n<\/ul>\n\n<div class=\"user_group_member_list flex_content_scroller small_top_margin\">\n\t<div class=\"tab_panels large_bottom_margin\">\n\t\t<div id=\"user_group_members\" class=\"panel active\">\n\t\t\t<div id=\"team_list\">\n\t\t\t\t{{#each members}}\n\t\t\t\t\t{{> team_list_item member=this}}\n\t\t\t\t{{\/each}}\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<div id=\"user_group_channels\" class=\"panel\">\n\t\t\t{{#if channels}}\n\t\t\t\t<div data-js=\"user_group_channel_list\" id=\"channel_list\">\n\t\t\t\t\t{{#each channels}}\n\t\t\t\t\t\t{{> user_group_channel_list_item}}\n\t\t\t\t\t{{\/each}}\n\t\t\t\t<\/div>\n\t\t\t{{else}}\n\t\t\t\t\t<p class=\"no_results align_left\">\n\t\t\t\t\t\t{{#t note=\"note explaining benefit of setting default channels for a user group, shown when none are configured\"}}\n\t\t\t\t\t\t\tEste grupo no tiene ning\u00fan canal predeterminado. <br><br>\n\t\t\t\t\t\t\tLos canales predeterminados sirven para incluir los miembros de un grupo en los canales adecuados. Cuando se a\u00f1ade un nuevo canal predeterminado a un grupo, autom\u00e1ticamente se invita a todos los miembros a ese canal.<br><br>\n\t\t\t\t\t\t\tAs\u00ed, los miembros que se acaban de incorporar al espacio de trabajo forman parten de las discusiones adecuadas desde el principio.\n\t\t\t\t\t\t{{\/t}}\n\t\t\t\t\t\t<br><br>\n\t\t\t\t\t\t{{#if show_user_groups_edit}}\n\t\t\t\t\t\t\t<button id=\"edit_default_channels\" class=\"btn small_right_margin\">{{#t note=\"button to add default channels to the user group\"}}A\u00f1adir canales predeterminados para este grupo{{\/t}}<\/button>\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t{{#t note=\"note explaining why action to add default channels to the user group is unavailable\"}}Solo los administradores o propietarios pueden a\u00f1adir canales a un grupo de usuarios.{{\/t}}\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t<\/p>\n\t\t\t{{\/if}}\n\t\t<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['user_group_preview_loading'] = "<div id=\"user_group_preview_loading_spinner\">\n    {{> loading_indicator}}\n<\/div>";
