><\/li>\n\t\t{{\/if}}\n\t\t{{#if show_restricted_members}}\n\t\t\t<li id=\"restricted_members_tab\" class=\"bold {{#if restricted_members.length}}{{else}}hidden{{\/if}}\"><a href=\"#restricted_members\" class=\"tab\" data-name=\"restricted_members\" data-action=\"search\"><span class=\"tab_text\">{{#t}}Invitados{{\/t}} <span id=\"restricted_members_count\" class=\"normal\">(<span id=\"restricted_members_count_value\">{{restricted_members.length}}<\/span>)<\/span><\/span><\/a><\/li>\n\t\t{{\/if}}\n\t\t{{#if show_user_groups}}\n\t\t\t<li id=\"user_groups_list_tab\" class=\"bold usergroup_action {{#if user_groups.length}}{{else}}hidden{{\/if}}\"><a href=\"#user_groups_list\" class=\"tab\" data-name=\"user_groups\" data-action=\"user_group_edit\"><span class=\"tab_text\">{{#t}}Grupos{{\/t}} <span id=\"usergroup_count\" class=\"normal\">(<span class=\"usergroup_count\">{{user_groups.length}}<\/span>)<\/span><\/span><\/a><\/li>\n\t\t{{\/if}}\n\t\t{{#if show_disabled_members}}\n\t\t\t<li id=\"disabled_members_tab\" class=\"bold {{#if disabled_members.length}}{{else}}hidden{{\/if}}\"><a href=\"#disabled_members\" class=\"tab\" data-name=\"disabled_members\" data-action=\"search\"><span class=\"tab_text\">{{#t}}Desactivado{{\/t}} <span id=\"disabled_members_count\" class=\"normal\">(<span id=\"disabled_members_count_value\">{{disabled_members.length}}<\/span>)<\/span><\/span><\/a><\/li>\n\t\t{{\/if}}\n\t<\/ul>\n\t<div class=\"flexpane_tab_toolbar\">\n\t\t<div id=\"search\" class=\"tab_action bottom_border\">\n\t\t\t<div id=\"team_filter\" class=\"position_relative small_margin\" data-list-items-id=\"#team_list_scroller\">\n\t\t\t\t<i class=\"icon_search ts_icon ts_icon_search\"><\/i>\n\t\t\t\t<a class=\"ts_icon ts_icon_times_circle icon_close hidden\"><\/a>\n\t\t\t\t<input type=\"text\" class=\"member_filter no_margin small\" name=\"team_filter\" placeholder=\"{{#t}}Directorio de b\u00fasqueda{{\/t}}\"\/>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<div id=\"user_group_edit\" class=\"tab_action bottom_border hidden\">\n\t\t\t<a class=\"tab_action_button bold {{#unless show_user_groups_edit}}hidden{{\/unless}}\" data-action=\"admin_user_groups_modal\"><i class=\"ts_icon ts_icon_cog_o\"><\/i> {{#t}}Editar grupos de usuarios{{\/t}}<\/a>\n\t\t\t<a class=\"tab_action_button bold {{#unless show_user_groups_add}}hidden{{\/unless}}\" data-action=\"admin_user_groups_modal_new\"><i class=\"ts_icon ts_icon_plus_circle\"><\/i> {{#t}}Crear un grupo de usuario{{\/t}}<\/a>\n\t\t<\/div>\n\t<\/div>\n{{\/isWeb}}\n";
