TS.raw_templates['import_user_mapping_row'] = "{{i18n_ns \"imports\"}}\n\n<div class=\"col span_3_of_6 break_all\">{{user.name}} ({{#if user.import_email}}{{user.import_email}}{{else}}{{#t note=\"placeholder if the user has no email address\"}}sin correo{{\/t}}{{\/if}})<\/div>\n<div id=\"user_{{user.id}}_options\" class=\"user_map_selector col span_3_of_6\">\n\t<label class=\"select small\">\n\t\t<select name=\"user_{{user.id}}\" class=\"small user_change\">\n\t\t\t<option value=\"-\" {{#if_equal user.mapping compare=\"-\"}}SELECTED{{\/if_equal}}>{{#t note=\"drop-down menu option\"}}Elige uno:{{\/t}}<\/option>\n\t\t\t<option value=\"invite\" {{#if_equal user.mapping compare=\"invite\"}}SELECTED{{\/if_equal}}>{{#t note=\"drop-down menu option\"}}Crear e invitar a un usuario{{\/t}}<\/option>\n\t\t\t<option value=\"create\" {{#if_equal user.mapping compare=\"create\"}}SELECTED{{\/if_equal}}>{{#t note=\"drop-down menu option\"}}Crear un usuario desactivado sin invitarlo{{\/t}}<\/option>\n\t\t\t<option value=\"bot\" {{#if_equal user.mapping compare=\"bot\"}}SELECTED{{\/if_equal}}>{{#t note=\"drop-down menu option\"}}No crear usuario, solo importar mensajes{{\/t}}<\/option>\n\t\t\t<option value=\"0\" {{#if_equal user.mapping compare=\"0\"}}SELECTED{{\/if_equal}}>{{#t note=\"drop-down menu option\"}}Omitir usuario, no importar mensajes{{\/t}}<\/option>\n\t\t\t<optgroup label=\"{{#t note=\"drop-down menu option\"}}Usuarios existentes{{\/t}}\">\n\t\t\t\t{{#foreach existing_users}}\n\t\t\t\t\t<option value=\"{{this.value.id}}\" {{#if_equal this.value.id compare=..\/user.mapping}}SELECTED{{\/if_equal}}>{{getPrefCompliantMemberNameById this.value.id}}<\/option>\n\t\t\t\t{{\/foreach}}\n\t\t\t<\/optgroup>\n\t\t<\/select>\n\t<\/label>\n\t<div class=\"control-group{{#if_equal user.email_state compare=\"ok\"}}{{else}} error{{\/if_equal}} small_top_margin\">\n\t\t<span class=\"small_left_margin help-inline dup-email {{#if_equal user.email_state compare=\"duped\"}}{{else}}hidden{{\/if