TS.raw_templates['unread_group'] = "{{i18n_ns \"all_unreads\"}}\n<div class=\"unread_group {{#if show_footer}}with_footer{{\/if}} {{#if is_im}}unread_group_im{{\/if}} {{#if marked_as_read}}marked_as_read{{\/if}} {{#if collapsed}}collapsed{{\/if}} {{#if active}}active{{\/if}}\" data-model-id=\"{{model_ob_id}}\">\n\t<div class=\"unread_group_header display_flex justify_content_between {{#if active}}active{{\/if}}\">\n\t\t{{> unread_group_header is_channel=is_channel is_mpim=is_mpim is_group=is_group is_im=is_im im_member=im_member marked_as_read=marked_as_read model_ob=model_ob unread_cnt=unread_cnt }}\n\t<\/div>\n\t<div class=\"msgs_holder unread_group_msgs\"><\/div>\n\t{{#unless collapsed}}\n\t\t<div class=\"unread_group_footer\">\n\t\t\t<div class=\"unread_group_new cursor_pointer\">\n\t\t\t\t<span class=\"unread_group_new_text\">\n\t\t\t\t\t{{#t}}{new_unread_cnt, plural, =1 {# nuevo mensaje} other {# nuevos mensajes}}{{\/t}}\n\t\t\t\t<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/unless}}\n\t<div class=\"bottom_mark_all_read large_top_padding large_bottom_padding align_center\">\n\t\t<button class=\"bottom_mark_all_read_btn btn_outline btn\">\n\t\t\t{{#t}}Marcar todos los mensajes como le\u00eddos{{\/t}}\n\t\t<\/button>\n\t<\/div>\n<\/div>\n";
