TS.raw_templates['unread_error'] = "{{i18n_ns \"all_unreads\"}}\n<div class=\"unread_empty_state_wrapper\">\n\t<div class=\"unread_empty_state unread_error_state\">\n\t\t{{emoji}}\n\t\t<div class=\"unread_error_state_message align_center\">{{#t}}Aqu\u00ed hay gato encerrado. Parece que Slack no puede cargar tus mensajes sin leer. Seguiremos intent\u00e1ndolo o prueba t\u00fa ahora.{{\/t}}<\/div>\n\t\t<button type=\"button\" class=\"btn unread_error_state_refresh_button\">{{#t}}Probar{{\/t}}<\/button>\n\t<\/div>\n<\/div>";
