TS.raw_templates['unread_header_info'] = "{{i18n_ns 'unread'}}\n\n{{#if messages_loaded}}\n\t<div class=\"channel_header_info_item\">\n\t\t<button type=\"button\" class=\"btn_unstyle channel_header_info_count\">\n\t\t\t{{~#if total_unread_count~}}\n\t\t\t\t{{~#if_gt total_unread_count compare=50~}}\n\t\t\t\t\t{{#t}}+ 50 mensajes{{\/t}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#t}}{total_unread_count, plural, =1 {# nuevo mensaje} other {# nuevos mensajes}}{{\/t}}\n\t\t\t\t{{~\/if_gt~}}\n\t\t\t{{~else~}}\n\t\t\t\t{{#t}}Ning\u00fan mensaje sin leer{{\/t}}\n\t\t\t{{~\/if~}}\n\t\t<\/button>\n\t<\/div>\n\t<div class=\"channel_header_info_item\">\n\t\t<button type=\"button\" class=\"btn_unstyle channel_header_info_sort_order\">\n\t\t\t{{~#if_equal sort_order compare=\"alphabetical\"~}}\n\t\t\t\t{{#t}}Ordenados alfab\u00e9ticamente{{\/t}}\n\t\t\t{{~\/if_equal~}}\n\t\t\t{{~#if_equal sort_order compare=\"priority\"~}}\n\t\t\t\t{{#t}}Ordenados cient\u00edficamente{{\/t}}\n\t\t\t{{~\/if_equal~}}\n\t\t\t{{~#if_equal sort_order compare=\"oldest\"~}}\n\t\t\t\t{{#t}}Ordenados por canal m\u00e1s antiguo{{\/t}}\n\t\t\t{{~\/if_equal~}}\n\t\t\t{{~#if_equal sort_order compare=\"newest\"~}}\n\t\t\t\t{{#t}}Ordenados por canal m\u00e1s reciente{{\/t}}\n\t\t\t{{~\/if_equal~}}\n\t\t\t<ts-icon class=\"ts_icon_chevron_down\"><\/ts-icon>\n\t\t<\/button>\n\t<\/div>\n{{else}}\n\t{{#t}}Cargando mensajes{{\/t}}\n{{\/if}}\n";
TS.raw_templates['unread_sort_order_menu'] = "{{i18n_ns \"all_unreads\"}}\n\n<div class=\"c-menu_item__header\">\n\t{{#t note=\"This this the heading for a sort group of options and will be followed by things like alphabettically and scientifically\"}}Ordenar...{{\/t}}\n<\/div>\n\n<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='alphabetical'}}selected{{\/if_equal}} alphabetical\"><a data-sort-order=\"alphabetical\">\n\t{{#t note=\"A sorting option for unread channels\"}}Alfab\u00e9ticamente{{\/t}}\n<\/a><\/li>\n{{#if is_paid_team}}\n\t<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='priority'}}selected{{\/if_equal}} priority\"><a data-sort-order=\"priority\">\n\t\t{{#t note=\"A sorting option for unread channels\"}}Cient\u00edficamente{{\/t}}\n\t<\/a><\/li>\n{{\/if}}\n<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='newest'}}selected{{\/if_equal}} newest\"><a data-sort-order=\"newest\">\n\t{{#t note=\"A sorting option for unread channels\"}}M\u00e1s recientes{{\/t}}\n<\/a><\/li>\n<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='oldest'}}selected{{\/if_equal}} oldest\"><a data-sort-order=\"oldest\">\n\t{{#t note=\"A sorting option for unread channels\"}}M\u00e1s antiguos{{\/t}}\n<\/a><\/li>";
