TS.raw_templates['thread_view_section'] = "{{i18n_ns 'threads'}}\n<section class=\"threads_section\">\n\t{{#if show_threads_notification_banner}}\n\t\t<div id=\"thread_notification_banner\">\n\t\t\t<button type=\"button\" class=\"close btn_icon btn_outline btn ts_icon ts_icon_times_small ts_icon_inherit\"><\/button>\n\n\t\t\t<div id=\"banner_prompt\">\n\t\t\t\t<div class=\"banner_title\">{{#t}}Recibir notificaci\u00f3n por cada respuesta{{\/t}}<\/div>\n\t\t\t\t<div class=\"banner_description\">{{#t}}Si quieres, Slack puede enviarte una notificaci\u00f3n cada vez que alguien responda a un hilo que est\u00e9s siguiendo.{{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t\t<div id=\"banner_confirmation\">\n\t\t\t\t<div class=\"banner_title\">{{#t}}\u00a1Genial!{{\/t}}<\/div>\n\t\t\t\t<div class=\"banner_description\">{{#t}}Puedes modificar esta opci\u00f3n desde el men\u00fa de <a id=\"thread_notification_banner_pref_link\" href=\"#\">Preferencias<\/a>{{\/t}}<\/div>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"banner_buttons\">\n\t\t\t\t<div class=\"btn btn_info\" data-turn-on-pref=\"true\">{{#t}}Activar notificaciones{{\/t}}<\/div>\n\t\t\t\t<div class=\"btn btn_outline\" data-turn-on-pref=\"false\">{{#t}}No notificarme{{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if is_old_section}}\n\t\t<div class=\"threads_caught_up_divider\">\n\t\t\t<div class=\"divider_line\"><\/div>\n\t\t\t<div class=\"divider_label\">{{#t note=\"divider between new and old threads\"}}Est\u00e1s al d\u00eda{{\/t}}<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\t<div class=\"msgs_holder\"><\/div>\n<\/section>\n";
TS.raw_templates['thread_channel_link'] = "{{i18n_ns 'threads'}}\n\n{{#if model_ob.is_mpim}}\n\t<div class=\"thread_channel_link_container\">\n\t\t<{{#if permalink}}a href=\"{{permalink}}\" target=\"{{newWindowName}}\"{{else}}span{{\/if}} class=\"thread_channel_link ts_tip ts_tip_bottom ts_tip_float ts_tip_multiline\">\n\t\t\t{{#t count=(mpimMemberCount model_ob)}}Mensaje directo con {count} m\u00e1s{{\/t}}\n\t\t\t<span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">{{mpimDisplayName model_ob}}<\/span><\/span>\n\t\t<\/{{#if permalink}}a{{else}}span{{\/if}}>\n\t<\/div>\n{{else}}\n\t<div class=\"thread_channel_link_container\">\n\t\t{{#feature flag=\"feature_file_threads\"}}\n\t\t\t<{{#if permalink}}a href=\"{{permalink}}\" target=\"{{newWindowName}}\"{{else}}span{{\/if}} class=\"thread_channel_link\">{{model_ob_name}}<\/{{#if permalink}}a{{else}}span{{\/if}}>\n\t\t{{else}}\n\t\t\t<{{#if permalink}}a href=\"{{permalink}}\" target=\"{{newWindowName}}\"{{else}}span{{\/if}} class=\"thread_channel_link\">{{model_ob_name}}{{#if model_ob.is_org_shared}}{{> shared_channel_icon}}{{else}}{{#isModelObExtShared model_ob}}{{> shared_channels_icon model_ob=model_ob tooltip=true shared_team_ids=model_ob.shared_team_ids}}{{\/isModelObExtShared}}{{\/if}}<\/{{#if permalink}}a{{else}}span{{\/if}}>\n\t\t{{\/feature}}\n\t<\/div>\n{{\/if}}";
TS.raw_templates['join_channel_from_thread'] = "{{i18n_ns \"threads\"}}\n<div class=\"join_channel_from_thread_container\">\n\t{{#if is_threads_view}}\n\t\t<span>{{#t}}Tendr\u00e1s que unirte a #{model_ob_name} para responder.{{\/t}}<\/span>\n\t{{\/if}}\n\t<button class=\"join_channel_from_thread btn btn_small\">{{#t}}Unirse a canal{{\/t}}<\/button>\n\t{{#if is_convo}}\n\t\t{{#if has_replies}}\n\t\t\t<p>{{#t}}Tendr\u00e1s que unirte a #{model_ob_name} para responder.{{\/t}}<\/p>\n\t\t{{else}}\n\t\t\t<p>{{#t}}Tendr\u00e1s que unirte a #{model_ob_name} para iniciar un hilo.{{\/t}}<\/p>\n\t\t{{\/if}}\n\t{{\/if}}\n<\/div>";
TS.raw_templates['threads_alternative_view'] = "{{i18n_ns \"threads\"}}\n<div class=\"threads_alternative_view_wrapper\">\n\t<div class=\"threads_alternative_view_content\">\n\t\t<img class=\"threads_alternative_view_emoji\" src=\"{{emoji}}\" alt=\"\" \/>\n\t\t{{#if is_error}}\n\t\t\t<div class=\"threads_alternative_view_message align_center\">{{#t}}Aqu\u00ed hay gato encerrado. Parece que Slack no puede cargar tus hilos. <br\/> Puedes intentarlo otra vez, pero si el problema contin\u00faa, <a href=\"https:\/\/slack.com\/help\/contact\">env\u00edanos un mensaje.<\/a>{{\/t}}<\/div>\n\t\t\t<button type=\"button\" class=\"btn thread_error_state_refresh_button\">{{#t}}Volver a intentar{{\/t}}<\/button>\n\t\t{{else is_empty}}\n\t\t\t<div class=\"threads_alternative_view_message align_center\">\n\t\t\t\t{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}\n\t\t\t\t\t<p class=\"threads_empty_state_message_header\">Atiende a tus hilos<\/p>\n\t\t\t\t\t<p>Aqu\u00ed se mostrar\u00e1n los hilos de los que eres parte.<br\/><a href=\"https:\/\/get.slack.help\/hc\/{locale}\/articles\/115000769927?{hcTrackingToken}\" target=\"_blank\">M\u00e1s informaci\u00f3n sobre los hilos<\/a><\/p>\n\t\t\t\t{{\/t}}\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t<\/div>\n<\/div>";
