TS.raw_templates['thread_flexpane_error'] = "{{i18n_ns \"threads\"}}\n<div id=\"thread_load_error_wrapper\" class=\"display_flex align_items_center full_height\">\n\t<div class=\"align_center full_width\">\n\t\t<img class=\"error_emoji\" src=\"{{emoji}}\" alt=\"\" \/>\n\t\t{{#t note=\"thread error message in flexpane\"}}\n\t\t\t<p class=\"error_header\">Imposible cargar el hilo<\/p>\n\t\t\t<p>Si contin\u00faa el problema, <a href=\"https:\/\/slack.com\/help\/contact\">env\u00edanos un mensaje.<\/a><\/p>\n\t\t{{\/t}}\n\t\t<button type=\"button\" class=\"btn thread_flexpane_retry_button\">{{#t note=\"button to retry opening a thread\"}}Volver a intentar{{\/t}}<\/button>\n\t<\/div>\n<\/div>";
