TS.raw_templates['sli_briefing'] = "{{i18n_ns \"highlights\"}}\n\n<div class=\"sli_briefing\" id=\"sli_briefing\">\n\t<div class=\"sli_briefing_preview_container sli_briefing_preview--loading {{#if show_onboarding}}sli_briefing_preview--onboarding{{\/if}}\" data-js=\"sli_briefing_preview_container\">\n\t\t<div class=\"sli_briefing_preview\" data-js=\"sli_briefing_preview\">\n\t\t\t<div class=\"sli_briefing_preview__inner display_flex align_items_center\">\n\t\t\t\t<div class=\"sli_briefing_preview__logo\" data-js=\"sli_briefing_preview_icon\">\n\t\t\t\t\t<ts-icon class=\"ts_icon_sparkles\"><\/ts-icon>\n\t\t\t\t\t<ts-icon class=\"ts_icon_sparkles_filled\"><\/ts-icon>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"sli_briefing_preview__overview\">\n\t\t\t\t\t<h3 class=\"sli_briefing_preview__title\">\n\t\t\t\t\t\t<ts-icon class=\"ts_icon_sparkles_filled sli_briefing_preview__title_sparkles\"><\/ts-icon>\n\t\t\t\t\t\t<span class=\"sli_briefing_preview__title_content\" data-js=\"sli_briefing_preview_title\"><\/span>\n\t\t\t\t\t<\/h3>\n\t\t\t\t\t<div class=\"sli_briefing_preview__description display_flex align_items_center\">\n\t\t\t\t\t\t<div class=\"sli_briefing_preview__facepile hidden\" data-js=\"sli_briefing_preview_facepile\"><\/div>\n\t\t\t\t\t\t<p class=\"sli_briefing_preview__description_text no_bottom_margin\" data-js=\"sli_briefing_preview_description\">\n\t\t\t\t\t\t\t{{#if show_onboarding}}\n\t\t\t\t\t\t\t\t{{#t}}Los destacados son un buen modo de meterse en faena. Es lo esencial: los mensajes m\u00e1s importantes bas\u00e1ndose en c\u00f3mo utilizas Slack.{{\/t}}\n\t\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t<\/p>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"sli_briefing_preview__action btn btn_outline auto_left_margin hidden\" data-js=\"sli_briefing_preview_action\">{{#t}}Ver{{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t<\/div>\n\t<div class=\"sli_briefing_view sticky hidden\" data-js=\"sli_briefing_view\">\n\t\t<div class=\"sli_briefing_view__messages\"><\/div>\n\t\t<div class=\"sli_briefing_view__footer align_center\">\n\t\t\t<h3 class=\"sli_briefing_view__footer_title black no_bottom_margin\">{{#t}}Estos son todos los destacados{{\/t}}<\/h3>\n\t\t\t<p class=\"sli_briefing_view__footer_description\">{{#t}}A continuaci\u00f3n encontrar\u00e1s el resto de tus mensajes sin leer.{{\/t}}<\/p>\n\t\t<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['sli_briefing_header'] = "{{i18n_ns \"highlights\"}}\n\n<div class=\"sli_briefing__header display_flex justify_content_between sticky hidden\" data-js=\"sli_briefing_header\">\n\t<div class=\"sli_briefing__header_title inline_flex\">\n\t\t<div class=\"sli_briefing_preview__logo sli_briefing_preview__logo--small\" data-js=\"sli_briefing_preview_icon\">\n\t\t\t<ts-icon class=\"ts_icon_sparkles\"><\/ts-icon>\n\t\t<\/div>\n\t\t<h2 class=\"sli_briefing__title align_self_center\">{{#t}}Lo m\u00e1s destacado{{\/t}}<\/h2>\n\t<\/div>\n\t<div class=\"sli_briefing__header_actions align_self_center\">\n\t\t<button class=\"btn btn_outline btn_small\" data-js=\"sli_briefing_header_dismiss_all\">{{#t}}Descartar todo{{\/t}}<\/button>\n\t<\/div>\n<\/div>";
TS.raw_templates['sli_briefing_message_view'] = "{{i18n_ns \"highlights\"}}\n\n<div class=\"sli_briefing__grid\">\n\t{{#each groups}}\n\t<div class=\"sli_briefing__channel\" data-channel-id=\"{{this.channel.id}}\">\n\t\t<h3 class=\"sli_briefing__channel_link\">{{makeChannelLink this.channel}} {{this.star}}<\/h3>\n\t\t<div class=\"sli_briefing__message_group\">\n\t\t\t{{#each this.messages}}\n\t\t\t\t<div class=\"sli_briefing__message {{#if this.message.file}}sli_briefing__has_file{{\/if}} {{this.feedback_class}}\" data-cache-id=\"{{this.message.channel_id}}-{{this.message.ts}}\">\n\t\t\t\t\t<div class=\"sli_briefing__justification {{#if this.justification}}has_justification{{\/if}}\" data-ts=\"{{this.message.ts}}\" data-model-ob-id=\"{{this.message.channel_id}}\">\n\t\t\t\t\t\t{{dangerouslyRenderHTML this.justification}}\n\t\t\t\t\t<\/div>\n\t\t\t\t\t{{dangerouslyRenderHTML this.message_markup}}\n\t\t\t\t\t<ul class=\"hidden sli_briefing__feedback_leavebehind\" data-feedback-for-cache-id=\"{{this.message.channel_id}}-{{this.message.ts}}\">\n\t\t\t\t\t\t<p class=\"sli_briefing__feedback_leavebehind_cta\">{{#t}}<strong>\u00bfQu\u00e9 es lo que no funciona de este destacado?<\/strong> D\u00ednoslo y lo arreglaremos.{{\/t}}<\/p>\n\t\t\t\t\t\t{{#each this.negative_feedback_options}}\n\t\t\t\t\t\t\t<li role=\"menuitem\" data-js=\"sli_briefing_feedback_item\" data-index=\"{{@index}}\"><a href=\"#\">{{this.text}}<\/a><\/li>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/ul>\n\t\t\t\t\t<div class=\"sli_briefing__feedback_controls align_right\">\n\t\t\t\t\t\t<div class=\"sli_briefing__feedback_controls_container inline_block\">\n\t\t\t\t\t\t\t{{#unless @index}}<div class=\"highlights_feedback_to_coach position_relative\"><\/div>{{\/unless}}\n\t\t\t\t\t\t\t{{#t}}\u00bfTe ha resultado \u00fatil?{{\/t}}\n\t\t\t\t\t\t\t<button type=\"button\" data-feedback=\"positive\" class=\"sli_briefing__feedback_control sli_briefing__feedback_positive btn_unstyle ts_icon {{#if_equal this.feedback compare=\"positive\"}}ts_icon_thumbs_up_filled{{else}}ts_icon_thumbs_up{{\/if_equal}} ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}Me ha resultado \u00fatil{{\/t}}\"><\/button>\n\t\t\t\t\t\t\t<button type=\"button\" data-feedback=\"negative\" class=\"sli_briefing__feedback_control sli_briefing__feedback_negative btn_unstyle ts_icon {{#if_equal this.feedback compare=\"negative\"}}ts_icon_thumbs_down_filled{{else}}ts_icon_thumbs_down{{\/if_equal}} ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}No me ha resultado muy \u00fatil{{\/t}}\"><\/button>\n\t\t\t\t\t\t\t\u2022\n\t\t\t\t\t\t\t<a class=\"sli_briefing__feedback_control sli_briefing__feedback_dismiss\" href=\"#\" data-feedback=\"dismiss\">{{#t}}Descartar{{\/t}}<\/a>\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t{{\/each}}\n\t\t<\/div>\n\t<\/div>\n\t{{\/each}}\n<\/div>";
TS.raw_templates['sli_briefing_message_justification'] = "{{i18n_ns \"highlights\"}}\n\n<div class=\"sli_briefing__justification greigh sli_briefing_target {{#if justification}}has_justification{{\/if}}\" data-ts=\"{{message.ts}}\" data-model-ob-id=\"{{message.channel.id}}\">\n\t{{#if justification}}\n\t\t{{justification}}\n\t{{else}}\n\t\t{{#t}}Este mensaje a\u00fan no ha sido justificado{{\/t}}\n\t{{\/if}}\n<\/div>";
TS.raw_templates['sli_briefing_message_feedback'] = "{{i18n_ns \"highlights\"}}\n\n<div class=\"sli_briefing__feedback action_hover_container {{#if show_positive_feedback}}has_positive_feedback\"{{\/if}}>\n\t{{#if show_positive_feedback}}\n\t\t<button type=\"button\" data-action=\"positive_feedback\" class=\"sli_briefing__feedback_positive btn_unstyle btn_msg_action ts_icon ts_icon_thumbs_up ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}Me ha resultado \u00fatil{{\/t}}\"><\/button>\n\t{{\/if}}\n\t<button type=\"button\" {{#if_equal context compare=\"channel\"}}data-action=\"negative_feedback_in_channel\"{{else}}data-action=\"negative_feedback\"{{\/if_equal}} class=\"sli_briefing__feedback_negative btn_unstyle btn_msg_action ts_icon ts_icon_thumbs_down ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}No me ha resultado muy \u00fatil{{\/t}}\"><\/button>\n\t{{#if show_dismiss}}\n\t\t<button type=\"button\" data-action=\"dismiss\" class=\"sli_briefing__dismiss btn_unstyle btn_msg_action ts_icon ts_icon_times ts_tip ts_tip_top ts_tip_float ts_tip_delay_60\" title=\"{{#t}}Descartar{{\/t}}\"><\/button>\n\t{{\/if}}\n<\/div>";
TS.raw_templates['sli_briefing_message_secondary_feedback'] = "{{i18n_ns \"highlights\"}}\n\n<div class=\"sli_briefing__secondary_feedback\">\n\t{{#if positive}}\n\t\t{{#t}}Gracias por tus comentarios. Ay\u00fadanos a entender por qu\u00e9 no te ha sido \u00fatil. <a href=\"#\" data-js=\"sli_briefing_secondary_feedback\">Selecciona una raz\u00f3n <ts-icon class=\"ts_icon_chevron_down\"><ts-icon><\/a>{{\/t}}\n\t{{else}}\n\t\t{{#t}}Gracias por tus comentarios. Ay\u00fadanos a entender por qu\u00e9 no te ha sido \u00fatil. <a href=\"#\" data-js=\"sli_briefing_secondary_feedback\">Selecciona una raz\u00f3n <ts-icon class=\"ts_icon_chevron_down\"><ts-icon><\/a>{{\/t}}\n\t{{\/if}}\n\t<ul class=\"hidden sli_briefing__feedback_options\">\n\t\t{{#each options}}\n\t\t\t<li role=\"menuitem\" data-js=\"sli_briefing_feedback_item\"><a href=\"#\">{{this.text}}<\/a><\/li>\n\t\t{{\/each}}\n\t<\/ul>\n<\/div>";
TS.raw_templates['footer_archives_preview'] = "{{i18n_ns \"archives\"}}\n\n<div class=\"c-archive_footer\">\n\t<div class=\"c-archive_footer__title\">{{message}}<\/div>\n\t<div class=\"c-archive_footer__metadata\">{{metadata}}<\/div>\n\t<div class=\"c-archive_footer__controls display_flex\">\n\t\t<button class=\"c-archive_footer__join btn btn_green\" data-js=\"join_channel\">{{#t}}Unirse a canal{{\/t}}<\/button>\n\t\t<button class=\"c-archive_footer__see_more btn btn_outline left_margin {{#if hide_more_details}}hidden{{\/if}}\" data-js=\"see_more_details\"><ts-icon class=\"ts_icon_info_circle\"><\/ts-icon> {{#t}}Ver m\u00e1s detalles{{\/t}}<\/button>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_insights_user'] = "{{i18n_ns \"archives\"}}\n\n{{> c-unified_member member=member size=\"medium\" short=true linked=true}}\n";
TS.raw_templates['app_space'] = "{{i18n_ns \"app_space\"}}\n\n<ul class=\"navigation\">\n\t<li class=\"featured_apps_link\">{{#t}}Aplicaciones destacadas{{\/t}}<\/li>\n\t<li class=\"your_apps_link active\">{{#t}}Tus aplicaciones{{\/t}}<\/li>\n\t<li class=\"build_apps_link\">{{#t}}Dise\u00f1a tu propia aplicaci\u00f3n{{\/t}}<\/li>\n<\/ul>\n<div class=\"content\">\n\t<div class=\"apps featured_apps display_none\">{{#t}}Aqu\u00ed encontrar\u00e1s las apps destacadas{{\/t}}<\/div>\n\t<div class=\"apps your_apps display_flex\"><\/div>\n\t<div class=\"apps build_apps display_none\">{{#t}}Aqu\u00ed aprender\u00e1s a dise\u00f1ar aplicaciones{{\/t}}<\/div>\n<\/div>\n<div class=\"footer small\"><a href=\"https:\/\/www.slack.com\/apps\" class=\"subtle_silver\">{{#t}}Explorar Directorio de Aplicaciones  {{\/t}}<ts-icon class=\"ts_icon_external_link_square\"><\/ts-icon><\/a><\/div>";
TS.raw_templates['app_space_alternative_view'] = "{{i18n_ns \"app_space\"}}\n<div class=\"app_space_alternative_view_wrapper\">\n\t<div class=\"app_space_alternative_view_content\">\n\t\t<span class=\"app_space_alternative_view_emoji\">{{emoji}}<\/span>\n\t\t{{#if is_error}}\n\t\t\t<div class=\"app_space_alternative_view_message align_center\">{{#t}}Aqu\u00ed hay gato encerrado. Parece que Slack no puede cargar tus apps.<br\/> Puedes intentarlo otra vez, pero si el problema contin\u00faa, <a href=\"https:\/\/slack.com\/help\/contact\">env\u00edanos un mensaje.<\/a>{{\/t}}<\/div>\n\t\t\t<button type=\"button\" class=\"btn app_space_error_state_refresh_button\">{{#t}}Reintentar{{\/t}}<\/button>\n\t\t{{else is_empty}}\n\t\t\t<div class=\"app_space_alternative_view_message align_center\">\n\t\t\t\t\t{{#t}}\n\t\t\t\t\t\t<p class=\"app_space_empty_state_message_header\">No has instalado ninguna aplicaci\u00f3n.<\/p>\n\t\t\t\t\t<p>Las aplicaciones instaladas en tu espacio se mostrar\u00e1n aqu\u00ed. <br\/> <a href=\"\" target=\"_blank\">Aprender m\u00e1s sobre las aplicaciones<\/a><\/p>\n\t\t\t\t\t{{\/t}}\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['app_space_app_card'] = "<div class=\"app_card flex_third display_flex align_items_center height_60 featured_category_app\" data-app-id=\"{{app_id}}\">\n\t<img class=\"app_card_icon rounded\"\n\t\t{{#if icons}}\n\t\t\tsrc=\"{{icons.image_64}}\"\n\t\t{{else}}\n\t\t\tsrc=\"{{versioned_default_application_icon}}\"\n\t\t{{\/if}}\n\t>\n\t<div class=\"small_padding indifferent_grey inline_block overflow_ellipsis\">\n\t\t<div class=\"app_name small overflow_ellipsis\">{{name}}<\/div>\n\t\t<div class=\"app_category light overflow_ellipsis\">{{category}}<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['app_space_screenshot'] = "{{i18n_ns \"app_space\"}}\n<div class=\"p-app_space__screenshot\">\n\t<img src=\"{{image_url}}\" \/>\n<\/div>";
TS.raw_templates['app_space_channel_header'] = "{{i18n_ns \"channel_header\"}}\n{{!--\n\t## Channel header tabs\n\tCurrently used only when viewing a DM with an App\/Bot user\n --}}\n<div class=\"channel_header__tabs\" data-js=\"channel_header_tabs\">\n\n\t<button\n\t\ttype=\"button\"\n\t\tclass=\"btn_unstyle channel_header__tab --active\"\n\t\tdata-action=\"toggleAppSpaceView\"\n\t\tdata-target=\"messages\"\n\t\tdata-qa=\"messages\"\n\t>\n\t\t{{#t}}Mensajes{{\/t}}\n\t<\/button>\n\n\t<button\n\t\ttype=\"button\"\n\t\tclass=\"btn_unstyle channel_header__tab\"\n\t\tdata-action=\"toggleAppSpaceView\"\n\t\tdata-target=\"about\"\n\t\tdata-qa=\"about\"\n\t>\n\t\t{{#t}}Acerca de{{\/t}}\n\t<\/button>\n\n<\/div>\n";
TS.raw_templates['shared_invites_modal'] = "{{i18n_ns 'invites'}}\n<div id=\"shared_invite_link_modal\">\n\t<div id=\"shared_invite_link_modal_header\">\n\t\t<div id=\"shared_invite_modal_link_title\">{{#t}}Comparte el enlace de invitaci\u00f3n de tu equipo{{\/t}}<\/div>\n\t\t<div class=\"shared_invite_link_description\">{{#t}}Cualquiera puede usar este enlace para unirse a tu equipo de Slack.{{\/t}}<\/div>\n\t<\/div>\n\n\t<div id=\"shared_invite_link_modal_body\"><\/div>\n\n\t<div id=\"shared_invite_link_modal_footer\">\n\t\t<a class=\"link_btn no_underline\" data-action=\"shared_invite_open_email_invites\"><ts-icon class=\"ts_icon_envelope_o subtle_silver align_bottom small_right_margin\"><\/ts-icon>{{#t}}Invitar a gente por correo...{{\/t}}<\/a>\n\t<\/div>\n<\/div>\n\n";
TS.raw_templates['shared_invites_modal_admin_create_link_body'] = "{{i18n_ns 'invites'}}\n\n\t<div id=\"select_shared_invite_expiration_warning\"><\/div>\n\t<br>\n\n\t<div id=\"create_shared_invite_link_container\">\n\t\t<div id=\"select_shared_invite_expiration_container\">\n\t\t\t<select name=\"select_shared_invite_expiration\" id=\"select_shared_invite_expiration\" class=\"small\">\n\t\t\t{{#t note=\"the amount of time before their shared invite link expires\"}}\n\t\t\t\t<option value=\"1\">Caduca en 1 d\u00eda<\/option>\n\t\t<option value=\"7\">Caduca en 7 d\u00edas<\/option>\n\t\t<option selected=\"selected\" value=\"30\">Caduca en 30 d\u00edas<\/option>\n\t\t<option value=\"365000\">Nunca caduca<\/option>\n\t\t\t{{\/t}}\n\t\t\t<\/select>\n\t\t<\/div>\n\t\t<button id=\"select_shared_invite_expiration_button\" type=\"button\" class=\"btn ladda-button\" data-action=\"shared_invite_create_link\" data-style=\"expand-right\">{{#t}}<span class=\"ladda-label\">Crear enlace de invitaci\u00f3n{{\/t}}<\/span><\/button>\n\t<\/div>\n";
TS.raw_templates['shared_invites_modal_warning'] = "{{i18n_ns 'invites'}}\n\n{{#if_equal warning compare=\"link_disabled\"}}\n\t<div id=\"shared_invite_link_modal_warning\">\n\t\t<ts-icon class=\"ts_icon ts_icon_info_circle inline_block align_top candy_red\"><\/ts-icon>\n\t\t<div class=\"inline_block\">\n\t\t\t<div class=\"candy_red bold very_small_bottom_margin\">{{#t}}Se ha desactivado tu enlace{{\/t}}<\/div>\n\t\t\t<div class=\"small subtle_silver\">{{#t}}Si quieres, puedes crear uno nuevo.{{\/t}}<\/div>\n\t\t<\/div>\n \t<\/div>\n{{else if_equal warning compare=\"ratelimited\"}}\n\t<div id=\"shared_invite_link_modal_warning\">\n\t\t<ts-icon class=\"ts_icon ts_icon_info_circle inline_block align_top candy_red\"><\/ts-icon>\n\t\t<div class=\"inline_block\">\n\t\t\t<div class=\"candy_red bold tiny_bottom_margin\">{{#t}}Est\u00e1s creando enlaces demasiado r\u00e1pido.{{\/t}}<\/div>\n\t\t\t<div class=\"small subtle_silver\">{{#t}}Vuelve a intentarlo en unos minutos.{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/div>\n{{\/if_equal}}\n";
TS.raw_templates['shared_invites_modal_share_link_body'] = "{{i18n_ns 'invites'}}\n\n<label class=\"shared_invite_link_url_label\" for=\"shared_invite_link_url\">{{#t team_name=team_name}}Enlace de invitaci\u00f3n para {team_name}{{\/t}}<\/label>\n\n<div class=\"shared_invite_link_url_input_wrapper\">\n\t<input name=\"shared_invite_link_url\" type=\"text\" id=\"shared_invite_link_url\" class=\"shared_invite_link_input small\" value=\"{{shared_invite_url}}\" data-invite-url=\"{{shared_invite_url}}\" readonly onclick=\"this.select();\">\n\n\t<a id=\"shared_invite_modal_link_copy_btn\" class=\"shared_invite_link_copy_btn btn ts_tip ts_tip_top hide_copy_btn_ts_tip\" role=\"btn\" data-action=\"copy_shared_link\" data-clog-click=\"true\" data-clog-event=\"INVITE_SHARED_CLICK\" data-clog-params=\"action=copy_shared_invite_link,trigger=click_copy_btn\">\n\t\t<span class=\"ts_tip_btn\">{{#t}}Copiar{{\/t}}<\/span>\n\t\t<span class=\"ts_tip_tip\">{{#t}}Se ha copiado el enlace de invitaci\u00f3n{{\/t}}<\/span>\n\t<\/a>\n<\/div>\n\n<br>\n\n<div class=\"shared_invite_modal_expiration small_top_margin small\">\n\t{{#if time_until_expiration_string}}\n\t<a class=\"link_btn bold no_underline ts_tip ts_tip_top ts_tip_left\" role=\"button\" disabled=\"disabled\">\n\t\t<span class=\"ts_tip_btn\">\n\t\t\t{{#t expiration_string=time_until_expiration_string}}Caduca {expiration_string}.{{\/t}}\n\t\t<\/span>\n\t\t<span class=\"ts_tip_tip ts_tip_multiline\">{{#t expiration_date=expiration_date expiration_time=expiration_time}}Este enlace caducar\u00e1 el <br>{expiration_date} a la(s) {expiration_time}{{\/t}}<\/span>\n\t<\/a>\n\t{{else}}\n\t\t<span class=\"bold\">{{#t}}Este enlace no caduca.{{\/t}}<\/span>\n\t{{\/if}}\n\t{{#if can_create_invite_links}}\n\t\t{{#t}}\u00bfNecesitas cambiar esto? Desactiva tu enlace y escoge una nueva duraci\u00f3n. <a class=\"candy_red underline link_btn\" role=\"button\" data-action=\"disable_shared_link\"><nobr>Desactivar enlace<\/nobr><\/a>{{\/t}}\n\t{{\/if}}\n<\/div>\n\n{{#feature flag=\"feature_disable_join_notifications\"}}\n\t<div class=\"large_top_margin\">\n\t\t<label id=\"notification_pref_label\" class=\"checkbox no_margin normal\">\n\t\t\t<input id=\"notification_pref\" {{#if notifications_enabled}}checked=\"checked\"{{\/if}} type=\"checkbox\" data-pref=\"muting\" data-action=\"toggle_notification_pref\" class=\"small_right_margin\">\n\t\t\t<span id=\"notification_pref_copy\">{{#t}}Env\u00edame un mensaje de Slackbot cada vez que alguien se una mediante este enlace.{{\/t}}<\/span>\n\t\t<\/label>\n\t<\/div>\n{{\/feature}}\n";
TS.raw_templates['apps_browser'] = "{{i18n_ns \"apps_browser\"}}\n\n<div class=\"links_container\">\n\t<a class=\"manage_apps_link\" href=\"\/apps\/manage\" data-manage_apps_link>\n\t\t<ts-icon class=\"ts_icon_cog_o\"><\/ts-icon>{{#t}}Gestionar aplicaciones...{{\/t}}\n\t<\/a>\n\t<a class=\"view_tutorial_link {{#unless showTutorial}}display_none{{\/unless}}\" data-view_tutorial_link>\n\t\t<ts-icon class=\"ts_icon_lightbulb_o\"><\/ts-icon>{{#t}}\u00bfQu\u00e9 son las aplicaciones?{{\/t}}\n\t<\/a>\n<\/div>\n<div id=\"apps_browser_container\"><\/div>\n";
TS.raw_templates['card_carousel'] = "{{i18n_ns \"card_carousel\"}}\n\n<div class=\"c-card_carousel__image_section\">\n\t<div>\n\t\t{{#if allow_animations }}\n\t\t\t{{#if card.animation }}\n\t\t\t\t<img src=\"{{card.animation}}\"><\/img>\n\t\t\t{{else}}\n\t\t\t\t<img src=\"{{card.image}}\"><\/img>\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t<img src=\"{{card.image}}\"><\/img>\n\t\t{{\/if}}\n\t<\/div>\n<\/div>\n<div class=\"c-card_carousel__text_section\">\n\t<div>\n\t\t<p class=\"bold\">{{card.title}}<\/p>\n\t\t<p>{{card.text}}<\/p>\n\t<\/div>\n<\/div>";
TS.raw_templates['card_carousel_buttons'] = "{{i18n_ns \"card_carousel_buttons\"}}\n\n\t<div class=\"c-card_carousel__btn_container\"><p class=\"c-card_carousel__page_count\">{{#t}}{display_card_index} de {number_of_cards}{{\/t}}<\/p><\/div>\n\n\t{{#unless first_card}}\n\t\t<div class=\"c-card_carousel__btn_container\">\n\t\t\t<a class=\"c-card_carousel__btn c-card_carousel__btn--left\" data-card_left_button>\n\t\t\t\t<i class=\"ts_icon ts_icon_arrow_large_left\"><\/i>\n\t\t\t<\/a>\n\t\t<\/div>\n\t{{\/unless}}\n\n\t<div class=\"c-card_carousel__btn_container\">\n\t\t<a class=\"c-card_carousel__btn c-card_carousel__btn--right\" data-card_right_button>\n\t\t\t<i class=\"ts_icon ts_icon_arrow_large_right\"><\/i>\n\t\t<\/a>\n\t<\/div>\n\n\t{{#if last_card }}\n\t\t<div class=\"c-card_carousel__btn_container\">\n\t\t\t<a class=\"c-card_carousel__btn c-card_carousel__btn--close\" data-card_close_button>\n\t\t\t\t<i class=\"ts_icon ts_icon_check_large\"><\/i>\n\t\t\t<\/a>\n\t\t<\/div>\n\t{{\/if}}";
TS.raw_templates['quick_promo_invite_nudge'] = "{{i18n_ns \"dialogs_quick_promo\"}}\n<button type=\"button\" class=\"close c-modal_close--quick_promo\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n<div class=\"c-modal_graphic_wrapper--quick_promo\">\n\t<img class=\"c-modal_graphic--quick_promo\" src=\"{{versioned_ill_team '2x'}}\" srcset=\"{{versioned_ill_team '1x'}} 1x, {{versioned_ill_team '2x'}} 2x\" alt=\"{{#t}}Una ilustraci\u00f3n de un amable grupo de compa\u00f1eros de trabajo.{{\/t}}\"\/>\n<\/div>\n<h3 class=\"c-modal_copy_header--quick_promo\">\n\t{{#if copy_is_contextual_with_invites}}\n\t\t{{#t}}Descubre lo que puede hacer Slack: \u00a1invita a m\u00e1s compa\u00f1eros de equipo!{{\/t}}\n\t{{else}}\n\t\t{{#t}}Descubre lo que puede hacer Slack: \u00a1invita a tus compa\u00f1eros de equipo!{{\/t}}\n\t{{\/if}}\n<\/h3>\n<p class=\"c-modal_copy--quick_promo\">\n\t{{#if copy_is_contextual_with_invites}}\n\t\t{{#t invite_count=invite_count}}\n\t\t\tHasta ahora, has invitado a {invite_count, plural, =1{# persona}other{# personas}} a este espacio de trabajo. Tr\u00e1ete a m\u00e1s compa\u00f1eros de equipo a Slack, as\u00ed reducir\u00e9is el volumen de correos electr\u00f3nicos y empezar\u00e9is a colaborar de manera m\u00e1s eficiente.\n\t\t{{\/t}}\n\t{{else}}\n\t\t{{#t}}\n\t\t\tDe momento, no has invitado a nadie a este espacio de trabajo. Tr\u00e1ete a tus compa\u00f1eros de equipo a Slack, as\u00ed reducir\u00e9is el volumen de correos electr\u00f3nicos y empezar\u00e9is a colaborar de manera m\u00e1s eficiente.\n\t\t{{\/t}}\n\t{{\/if}}\n<\/p>\n";
TS.raw_templates['tabcomplete_menu'] = "{{i18n_ns 'tabcomplete'}}\n\n<div id=\"chat_input_tab_ui_header\" class=\"tab_complete_ui_header\">\n\t<span id=\"chat_input_tab_ui_header_query\">{{safe_header_html}}<\/span>\n\t<span class=\"header_help\">\n\t\t{{#t note=\"Keyboard shortcut help text\"}}<strong>pulsa<\/strong> o <strong>\u2191<\/strong> <strong>\u2193<\/strong> para navegar{{\/t}}\n\t\t<span class=\"left_margin\">\n\t\t\t{{#t note=\"Keyboard shortcut help text\"}}<strong>\u21b5<\/strong> para seleccionar{{\/t}}\n\t\t<\/span>\n\t\t<span class=\"left_margin\">\n\t\t\t{{#t note=\"Keyboard shortcut help text\"}}<strong>esc<\/strong> para descartar{{\/t}}\n\t\t<\/span>\n\t<\/span>\n<\/div>\n<div id=\"chat_input_tab_ui_scroller\" class=\"tab_complete_ui_scroller\">{{safe_results_html}}<\/div>\n";
TS.raw_templates['tabcomplete_member_header'] = "{{i18n_ns \"tabcomplete\"}}\n{{#t note=\"Heading for search results\"}}Nombres que coincidan con &quot;<strong>{text}<\/strong>&quot;{{\/t}}\n";
TS.raw_templates['tabcomplete_member_results'] = "{{i18n_ns \"tabcomplete\"}}\n<ul class=\"type_members\" role=\"listbox\">\n{{#each results as |result|}}\n\t{{#if result.is_broadcast_keyword}}\n\t\t<li role=\"option\" tabindex=\"-1\" class=\"tab_complete_ui_item\" id=\"tab_complete_ui_item_{{@index}}\" data-type=\"keyword\" data-index=\"{{@index}}\" data-qa=\"tab_complete_ui_item\">\n\t\t\t<span class=\"broadcast unify_broadcast\">\n\t\t\t\t<i class=\"ts_icon ts_icon_broadcast\"><\/i>\n\t\t\t\t@{{result.name}}\n\t\t\t\t<span class=\"broadcast_info\">{{result.description}}<\/span>\n\t\t\t<\/span>\n\t\t<\/li>\n\t{{else if result.is_usergroup}}\n\t\t<li role=\"option\" tabindex=\"-1\" class=\"tab_complete_ui_item\" id=\"tab_complete_ui_item_{{@index}}\" data-type=\"usergroup\" data-index=\"{{@index}}\" data-qa=\"tab_complete_ui_item\">\n\t\t\t{{> c-usergroup size=\"small\" result=result}}\n\t\t<\/li>\n\t{{else if result.is_member}}\n\t\t<li role=\"option\" tabindex=\"-1\" class=\"tab_complete_ui_item\" id=\"tab_complete_ui_item_{{@index}}\" data-type=\"member\" data-index=\"{{@index}}\" data-qa=\"tab_complete_ui_item\">\n\t\t\t{{> c-unified_member member=member size=\"small\" avatar=true context=\"not_in_channel\" not_channel_member=member_does_not_belong_to_channel forced_primary=\"display_name\" }}\n\t\t<\/li>\n\t{{\/if}}\n{{\/each}}\n<\/ul>\n";
TS.raw_templates['tabcomplete_channel_header'] = "{{i18n_ns \"tabcomplete\"}}\n{{#t note=\"Heading for search results\"}}Canales que coincidan con &quot;<strong>{text}<\/strong>&quot;{{\/t}}\n";
TS.raw_templates['tabcomplete_channel_results'] = "{{i18n_ns \"tabcomplete\"}}\n<ul class=\"type_channels\" role=\"listbox\">\n{{#each results as |result|}}\n\t<li role=\"option\" tabindex=\"-1\" class=\"tab_complete_ui_item p-tabcomplete-channel-item display_flex\" id=\"tab_complete_ui_item_{{@index}}\" data-index=\"{{@index}}\">\n\t\t<span class=\"p-tabcomplete-channel-item__channel\">\n\t\t\t<span class=\"channelname\">#{{result.name}}<\/span>\n\t\t\t{{~#if result.is_org_shared}}<ts-icon class=\"ts_icon_shared_channel very_small_left_margin\"><\/ts-icon>{{\/if}}\n\t\t\t{{~#if result._jumper_previous_name_match~}}\n\t\t\t\t<span class=\"small_left_margin\">\n\t\t\t\t\t{{~#t note=\"Shown when a user is typing the old name of a channel, e.g. '(formerly #cats)'\" old_name=result._jumper_previous_name_match}}(anteriormente #{old_name}){{\/t~}}\n\t\t\t\t<\/span>\n\t\t\t{{\/if}}\n\t\t<\/span>\n\t\t{{~#isModelObExtShared result}}{{~#unless result.is_org_shared}}{{> shared_channels_icon model_ob=result tooltip=true shared_team_ids=result.shared_team_ids}}{{\/unless}}{{\/isModelObExtShared}}\n\t<\/li>\n{{\/each}}\n<\/ul>\n";
TS.raw_templates['tabcomplete_command_header'] = "{{i18n_ns \"tabcomplete\"}}\n{{#t note=\"Heading for search results\"}}Comandos que coincidan con &quot;<strong>{text}<\/strong>&quot;{{\/t}}\n";
TS.raw_templates['tabcomplete_command_results'] = "{{i18n_ns \"cmd_handlers\"}}\n\n<ul class=\"type_cmds\" role=\"listbox\">\n{{#each results as |group|}}\n\t<li class=\"tab_complete_ui_group\">\n\t\t<span class=\"group_name\">{{group.name}}<\/span>\n\t\t{{#if group.xoxa_app_not_in_channel}}<span class=\"not_in_channel\">(not in channel)<\/span>{{\/if}}\n\t\t<hr class=\"group_divider\">\n\t<\/li>\n\t{{#each group.cmds as |cmd|}}\n\t\t<li role=\"option\" tabindex=\"-1\" class=\"tab_complete_ui_item\" id=\"tab_complete_ui_item_{{cmd.index}}\" data-index=\"{{cmd.index}}\">\n\t\t\t<div>\n\t\t\t\t<span class=\"cmdname\">{{cmd.name}}<\/span>\n\t\t\t\t{{#if cmd.aliases}}\n\t\t\t\t\t({{#t note=\"'or' used when describing alternative slash commands, ex. '\/leave or \/part, \/close'\"}}o{{\/t}}\n\t\t\t\t\t{{#if cmd.localized_aliases}}\n\t\t\t\t\t\t{{#each cmd.localized_aliases as |alias|}}{{~#if @index}}, {{\/if}}{{alias}}{{\/each}})\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#each cmd.aliases as |alias|}}{{~#if @index}}, {{\/if}}{{alias}}{{\/each}})\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if cmd.usage}}\n\t\t\t\t\t{{cmd.usage}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#each cmd.args as |arg|}}\n\t\t\t\t\t\t{{#if arg.optional}}\n\t\t\t\t\t\t\t<span class=\"argname argoptional\">[{{arg.name}}]<\/span>\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t<span class=\"argname\">{{arg.name}}<\/span>\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t{{\/each}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/div>\n\t\t\t<div>\n\t\t\t\t<span class=\"cmddesc\">{{cmd.desc}}<\/span>\n\t\t\t<\/div>\n\t\t<\/li>\n\t{{\/each}}\n{{\/each}}\n<\/ul>\n";
TS.raw_templates['tabcomplete_emoji_header'] = "{{i18n_ns \"tabcomplete\"}}\n{{#if_equal action compare='search'}}\n\t{{#t note=\"Heading for search results\"}}Emojis que coincidan con &quot;<strong>{text}<\/strong>&quot;{{\/t}}\n{{\/if_equal}}\n{{#if_equal action compare='add_rxn'}}\n\t{{#t}}A\u00f1adir reacci\u00f3n que coincida con &quot;<strong>{text}<\/strong>&quot;{{\/t}}\n{{\/if_equal}}\n{{#if_equal action compare='remove_rxn'}}\n\t{{#t}}Eliminar reacci\u00f3n que coincida con &quot;<strong>{text}<\/strong>&quot;{{\/t}}\n{{\/if_equal}}\n";
TS.raw_templates['tabcomplete_emoji_results'] = "<ul class=\"type_emoji\" role=\"listbox\">\n{{#each results as |result|}}\n\t<li role=\"option\" tabindex=\"-1\" class=\"tab_complete_ui_item\" id=\"tab_complete_ui_item_{{@index}}\" data-index=\"{{@index}}\">\n\t\t{{#if show_skin_tone_variant}}\n\t\t\t{{emojiGraphicReplace emoji_name_with_colons_and_skin}}\n\t\t\t{{#unless emoji_is_plain_text_only}}\n\t\t\t\t{{emoji_display_name_with_colons_and_skin}}\n\t\t\t{{\/unless}}\n\t\t{{else}}\n\t\t\t{{emojiGraphicReplace emoji_name_with_colons}}\n\t\t\t{{#unless emoji_is_plain_text_only}}\n\t\t\t\t{{emoji_display_name_with_colons}}\n\t\t\t{{\/unless}}\n\t\t{{\/if}}\n\t<\/li>\n{{\/each}}\n<\/ul>\n";
TS.raw_templates['message_broadcast_meta'] = "{{i18n_ns 'threads'}}\n{{#if root_excerpt}}\n\t<div class=\"meta broadcast_meta\">{{#t}}ha respondido a un hilo:{{\/t}} <a href=\"{{permalink}}\" target=\"{{newWindowName}}\">{{root_excerpt}}<\/a><\/div>\n{{else}}\n\t<div class=\"meta broadcast_meta\">{{#t new_window_name=(newWindowName)}}ha respondido <a href=\"{permalink}\" target=\"{new_window_name}\">a un hilo<\/a>{{\/t}}<\/div>\n{{\/if}}\n{{#if root_repliers_summary}}\n\t<div class=\"broadcast_repliers\"><ts-icon class=\"ts_icon_comment_alt repliers_icon\"><\/ts-icon> <a href=\"{{permalink}}\" target=\"{{newWindowName}}\">{{root_repliers_summary}}<\/a><\/div>\n{{\/if}}";
TS.raw_templates['message_broadcast_indicator'] = "{{i18n_ns \"threads\"}}\n\n{{#feature flag=\"feature_broadcast_indicator\"}}\n<div class=\"broadcast_indicator_holder\">\n\t<span class=\"broadcast_indicator_holder_content\">\n\t\t<ts-icon class=\"broadcast_indicator_icon ts_icon_jump ts_icon_inherit\" \/>\n\t\t{{#or model_ob.is_im model_ob.is_mpim}}\n\t\t\t{{#t}}Tambi\u00e9n se ha enviado a la conversaci\u00f3n{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Tambi\u00e9n se ha enviado al canal{{\/t}}\n\t\t{{\/or}}\n\t<\/span>\n<\/div>\n{{\/feature}}";
TS.raw_templates['thread_broadcast_repliers_with_overflow'] = "{{i18n_ns \"threads\"}}\n{{#t}}\n{reply_count, plural, =1{1 respuesta} other{# respuestas}} de {user_name1}, {user_name2}, y\n<span class=\"other_participants ts_tip ts_tip_top ts_tip_float ts_tip_multiline\">\n\t{num_others, plural, =1{# m\u00e1s} other{# m\u00e1s}}\n\t<span class=\"ts_tip_tip\">\n\t\t<span class=\"ts_tip_multiline_inner\">{other_names}<\/span>\n\t<\/span>\n<\/span>\n{{\/t}}";
TS.raw_templates['thread_confirm_remove_broadcast'] = "{{i18n_ns 'msg_edit'}}\n<p class=\"bottom_margin\">\n\t{{#if is_channel_or_group}}\n\t\t{{#t}}Por favor confirma que quieres eliminar este mensaje del canal.{{\/t}}\n\t{{else}}\n\t\t{{#t}}Por favor confirma que quieres eliminar este mensaje de la conversaci\u00f3n.{{\/t}}\n\t{{\/if}}\n\t{{#t}}La respuesta original seguir\u00e1 estando visible en su hilo.{{\/t}}\n<\/p>\n\n{{msg_html}}";
TS.raw_templates['sonic_emoji'] = "<span class=\"{{emojiClassNames}}\" style=\"background-image: url({{url}});\"{{#if displayTitle}} title=\"{{displayTitle}}\"{{\/if}}>{{#if displayText}}{{displayText}}{{\/if}}<\/span>";
TS.raw_templates['admin_list_item'] = "{{i18n_ns \"loading_messages\"}}\n\n<div class=\"admin_list_item active member_item {{#if_equal member.is_inactive compare=\"1\"}}{{#unless member.is_bot}}{{#unless (isSlackbotOrTeambot member)}}inactive{{\/unless}}{{\/unless}}{{\/if_equal}} {{#if show_inactive_tip}}ts_tip ts_tip_top ts_tip_float ts_tip_multiline ts_tip_delay_600{{\/if}}\" id=\"row_{{member.id}}\" data-member-id=\"{{member.id}}\">\n    {{#if show_inactive_tip}}\n        <span class=\"ts_tip_tip\">\n            <span class=\"ts_tip_multiline_inner\">\n                {{#t}}Esta persona no ha estado activa en Slack \u00faltimamente.{{\/t}}\n            <\/span>\n        <\/span>\n    {{\/if}}\n\n    {{#if exclude_lazy_load}}\n        {{> member_preview_link_image (getMemberPreviewLinkImageArgs member 36 false)}}\n    {{else}}\n        {{> member_preview_link_image (getMemberPreviewLinkImageArgs member 36 true)}}\n    {{\/if}}\n\n    {{#if show_rename}}\n        {{#memberIsSelf id=member.id}}\n            <span class=\"admin_member_real_name\">{{#t}}T\u00fa{{\/t}} <span class=\"normal bullet\">\u2022<\/span><span class=\"normal inline_name\">{{getMemberRealName member}}<\/span><\/span>\n        {{else}}\n            <span class=\"inline_name admin_member_real_name\" title=\"{{#t}}Haz clic para editar el nombre completo{{\/t}}\">{{getMemberRealName member}}<\/span>\n        {{\/memberIsSelf}}\n\n        <form class=\"inline_name_edit_form hidden inline_block no_bottom_margin\" onsubmit=\"TS.web.admin.submitNameForm('{{member.id}}');\">\n            {{! no need for crumb_input }}\n            <input type=\"text\" name=\"real_name\" placeholder=\"{{#t}}Nombre completo{{\/t}}\" value=\"{{getMemberRealName member}}\" \/>\n            <span class=\"inline_edit_form_actions\">{{#t}}<a onclick=\"$(this).closest('form').submit();\">guardar<\/a> o <a onclick=\"TS.web.admin.cancelNameForm(''{member.id}'');\">cancelar<\/a>{{\/t}}<\/span>\n        <\/form>\n\n    {{else}}\n\n        {{#memberIsSelf id=member.id}}\n            <span class=\"admin_member_real_name\">{{#t}}T\u00fa{{\/t}} <span class=\"normal\"><span class=\"bullet\">\u2022<\/span> {{getMemberRealName member}}<\/span><\/span>\n        {{else}}\n            <span class=\"admin_member_real_name\">{{getMemberRealName member}}<\/span>\n        {{\/memberIsSelf}}\n\n    {{\/if}}\n\n    <br \/>\n\n        <span class=\"admin_member_display_name_and_email\">\n            {{#memberHasProfileFieldDisplayName member}}\n                {{#if show_displayname_edit}}\n                    <span class=\"inline_display_name indifferent_grey\" title=\"{{#t}}Haz clic para editar nombre de Slack{{\/t}}\">\n                {{else}}\n                    <span class=\"indifferent_grey\">\n                {{\/if}}\n                        {{getMemberProfileFieldDisplayName member}}\n                        <span class=\"bullet\">\u2022<\/span>\n                    <\/span>\n            {{else}}\n                {{#if show_displayname_edit}}\n                    <span class=\"inline_display_name indifferent_grey\" title=\"{{#t}}Haz clic para editar nombre de Slack{{\/t}}\">{{#t}}Haz clic para a\u00f1adir un nombre de Slack{{\/t}}<span class=\"bullet\">\u2022<\/span><\/span>\n                {{\/if}}\n            {{\/memberHasProfileFieldDisplayName}}\n            <form class=\"inline_display_name_edit_form hidden inline_block no_bottom_margin\" onsubmit=\"TS.web.admin.submitDisplayNameForm('{{member.id}}');\">\n                {{! no need for crumb_input }}\n                <input type=\"text\" name=\"display_name\" placeholder=\"{{#t}}Nombre de Slack{{\/t}}\" value=\"{{getMemberProfileFieldDisplayName member}}\" \/>\n                <span class=\"inline_edit_form_actions\">{{#t}}<a onclick=\"$(this).closest('form').submit();\">guardar<\/a> o <a onclick=\"TS.web.admin.cancelDisplayNameForm(''{member.id}'');\">cancelar<\/a>{{\/t}}<\/span>\n                <span class=\"bullet\">\u2022<\/span>\n            <\/form>\n\n            {{#unless member.is_bot}}\n                <span{{#if show_email_edit}} class=\"inline_email\" title=\"{{#t}}Clic para editar correo{{\/t}} {{member.profile.email}}\"{{\/if}}>{{member.profile.email}}<\/span>\n            {{\/unless}}\n            {{#or member.is_restricted member.is_ultra_restricted}}\n                {{#if guest_expiration_str}}\n                    <br\/>\n                    <span class=\"no_wrap\" title=\"{{#t}}L\u00edmite de tiempo{{\/t}}\">{{guest_expiration_str}}<\/span>\n                {{\/if}}\n            {{\/or}}\n        <\/span>\n    <\/span>\n\n    {{#if show_email_edit}}\n        {{#if member.email_is_editable}}\n        <form class=\"inline_email_edit_form hidden inline_block no_bottom_margin\" onsubmit=\"TS.web.admin.submitEmailForm('{{member.id}}')\">\n            {{! no need for crumb_input }}\n            <input type=\"email\" name=\"email\" placeholder=\"{{#t}}Direcci\u00f3n de correo{{\/t}}\" value=\"{{member.profile.email}}\" required \/>\n            <span class=\"inline_edit_form_actions\">{{#t}}<a onclick=\"$(this).closest('form').submit();\">guardar<\/a> o <a onclick=\"TS.web.admin.cancelEmailForm(''{member.id}'');\">cancelar<\/a>{{\/t}}<\/span>\n        <\/form>\n        {{\/if}}\n    {{\/if}}\n\n    {{#if member.email_pending}}\n        <span title=\"{{#t}}Te hemos enviado un correo de confirmaci\u00f3n a esta direcci\u00f3n.{{\/t}}\" class=\"inline_email_pending\">{{#t}}(pendiente: {member.email_pending.new_email}){{\/t}}<\/span>\n    {{\/if}}\n\n    <span class=\"admin_member_type show_pill_action\">\n\n        {{#if member.has_sso_token}}<span title=\"{{#t}}Tiene token para inicio de sesi\u00f3n \u00fanico{{\/t}}\" class=\"small_right_margin two_factor_auth_badge\">{{#t}}Inicio de sesi\u00f3n \u00fanico{{\/t}} <i class=\"ts_icon ts_icon_check_circle_o\"><\/i><\/span>{{\/if}}\n\n        {{#if member.two_factor_auth_enabled}}<span title=\"{{#t}}Autenticaci\u00f3n de dos factores activada{{\/t}}\" class=\"small_right_margin two_factor_auth_badge\">{{#t}}Autenticaci\u00f3n de dos factores{{\/t}} <i class=\"ts_icon ts_icon_check_circle_o\"><\/i><\/span>{{\/if}}\n\n        {{#if member_status}}<em class=\"greigh\">{{member_status}}<\/em>{{\/if}}\n        {{#if member.is_restricted}}\n            {{#if member.deleted}}\n                {{member_type}}\n            {{else}}\n                {{#if member.is_ultra_restricted}}\n                    {{#each channels}}\n                        <a class=\"channel pill inline_block api_change_ura_channel\" title=\"{{#t member_name=..\/member.name}}Cambiar el canal al que tiene acceso {member_name}{{\/t}}\">#{{this.name}}\n                            {{#isModelObExtShared this}}\n                                {{> shared_channels_icon model_ob=this tooltip=true shared_team_ids=this.shared_team_ids}}\n                            {{\/isModelObExtShared}}\n                            <i class=\"ts_icon ts_icon_pencil ts_icon_inherit pill_action edit\"><\/i>\n                        <\/a>\n                    {{\/each}}\n                    {{#each member.groups}}\n                        <a class=\"group pill inline_block api_change_ura_channel\" title=\"{{#t member_name=..\/member.name}}Cambiar el canal al que tiene acceso {member_name}{{\/t}}\">{{this}} <i class=\"ts_icon ts_icon_pencil ts_icon_inherit pill_action edit\"><\/i><\/a>\n                    {{\/each}}\n                    {{#if member.more_groups}}\n                        <a class=\"group pill inline_block api_change_ura_channel\" title=\"{{#t member_name=..\/member.name}}Cambiar el canal al que tiene acceso {member_name}{{\/t}}\">{{#t}}Canal cerrado{{\/t}} <i class=\"ts_icon ts_icon_pencil ts_icon_inherit pill_action edit\"><\/i><\/a>\n                    {{\/if}}\n                    {{#if show_add_channel_btn}}\n                        <a class=\"channel pill inline_block api_channel_invite no_pill_action\" title=\"{{#t member_name=..\/member.name}}A\u00f1adir un canal al que pueda acceder {member_name}{{\/t}}\"><i class=\"ts_icon ts_icon_plus\"><\/i><\/a>\n                    {{\/if}}\n                {{else}}\n                    <span class=\"admin_list_item_channel_membership\">\n                        {{#if channels_count}}\n                            {{#if group_count}}\n                                {{#t}}Pertenece a {channels_count, plural, =1{# canal abierto}other{# canales abiertos}} y {group_count} {group_count, plural, =1{canal cerrado}other{canales cerrados}}{{\/t}}\n                            {{else}}\n                                {{#t}}Pertenece a {channels_count, plural, =1{# canal abierto}other{# canales abiertos}}{{\/t}}\n                            {{\/if}}\n                        {{else}}\n                            {{#if group_count}}\n                                {{#t}}Pertenece a {group_count, plural, =1{# canal cerrado}other{# canales cerrados}}{{\/t}}\n                            {{\/if}}\n                        {{\/if}}\n                    <\/span>\n                {{\/if}}\n            {{\/if}}\n        {{else}}\n            {{member_type}}\n        {{\/if}}\n    <\/span>\n\n    {{#unless omit_caret}}\n        <i class=\"admin_member_caret ts_icon ts_icon_caret_right\"><\/i>\n        <i class=\"admin_member_caret ts_icon ts_icon_caret_down\"><\/i>\n    {{\/unless}}\n\n    <div class=\"member_actions clearfix\">\n        {{#if actions}}\n            {{#each actions}}\n                <a\n                    class=\"{{this.cls}} {{#if this.primary}}btn btn_outline btn_small{{else}}sub_action{{\/if}}\"\n                    {{#if this.href}}href=\"{{this.href}}\"{{\/if}}\n                    {{#if this.title}}title=\"{{#t}}{title}{{\/t}}\"{{\/if}}\n                >{{label}}<\/a>\n            {{\/each}}\n        {{else}}\n            {{#if show_transfer_btn}}\n                <a href=\"\/admin\/transfer\" class=\"btn btn_outline btn_small btn_outline btn_small admin_transfer_ownership_btn\">{{#t}}Transferir propiedad del espacio de trabajo{{\/t}}<\/a>\n\n                {{#memberIsSelf id=member.id}}\n                    {{#t}}Para hacer cambios, revisa tus <a href=\"\/account\/settings\">ajustes de la cuenta<\/a>.{{\/t}}\n                {{\/memberIsSelf}}\n            {{else}}\n                {{#memberIsSelf id=member.id}}\n                    {{#if show_displayname_edit}}\n                        {{#if show_email_edit}}\n                            {{#t}}No hay acciones que realizar respecto a ti. Haz clic sobre tu nombre o correo para editarlo.{{\/t}}\n                        {{else}}\n                            {{#t}}No hay acciones que realizar respecto a ti. Haz clic sobre tu nombre para editarlo. Para editar tu correo, anda a tus <a href=\"\/account\/settings\">ajustes de cuenta<\/a>.{{\/t}}\n                        {{\/if}}\n                    {{else}}\n                        {{#t}}No hay acciones que realizar respecto a ti. Para hacer cambios, revisa tus <a href=\"\/account\/settings\">ajustes de la cuenta<\/a>.{{\/t}}\n                    {{\/if}}\n                {{else}}\n                    {{#if show_email_edit}}\n                        {{#if show_displayname_edit}}\n                            {{#t}}No hay acciones que realizar respecto a <strong>@{member.name}<\/strong> ({member_type}). Haz clic sobre el nombre o el correo para editarlo.{{\/t}}\n                        {{else}}\n                            {{#t}}No hay acciones que realizar respecto a <strong>@{member.name}<\/strong> ({member_type}). Haz clic sobre el correo para editarlo.{{\/t}}\n                        {{\/if}}\n                    {{else}}\n                        {{#if show_displayname_edit}}\n                            {{#t}}No hay acciones que realizar respecto a <strong>@{member.name}<\/strong> ({member_type}). Haz clic sobre el nombre para editarlo.{{\/t}}\n                        {{else}}\n                            {{#t}}No hay acciones que realizar respecto a <strong>@{member.name}<\/strong> ({member_type}).{{\/t}}\n                        {{\/if}}\n                    {{\/if}}\n                {{\/memberIsSelf}}\n            {{\/if}}\n        {{\/if}}\n        {{#if paid_team}}\n            {{#if member.is_restricted}}\n                {{#if member.is_ultra_restricted}}\n                \t{{#if_equal is_enterprise compare=false}}\n                    \t\t{{#if member.deleted}}\n                    \t\t    <p class=\"small_bottom_margin small_top_margin show_pill_action\">\n                    \t\t        {{#each member.channels}}\n                    \t\t            <a class=\"channel pill inline_block api_change_ura_channel\" title=\"{{#t member_name=..\/member.name}}Cambiar el canal al que tiene acceso {member_name}{{\/t}}\">#{{this}} <i class=\"ts_icon ts_icon_pencil ts_icon_inherit pill_action edit\"><\/i><\/a>\n                    \t\t        {{\/each}}\n                    \t\t        {{#each member.groups}}\n                    \t\t            <a class=\"group pill inline_block api_change_ura_channel\" title=\"{{#t member_name=..\/member.name}}Cambiar el canal al que tiene acceso {member_name}{{\/t}}\">{{this}} <i class=\"ts_icon ts_icon_pencil ts_icon_inherit pill_action edit\"><\/i><\/a>\n                    \t\t        {{\/each}}\n                    \t\t        {{#if member.more_groups}}\n                    \t\t            <a class=\"group pill inline_block api_change_ura_channel\" title=\"{{#t member_name=..\/member.name}}Cambiar el canal al que tiene acceso {member_name}{{\/t}}\">{{#t}}Canal cerrado{{\/t}} <i class=\"ts_icon ts_icon_pencil ts_icon_inherit pill_action edit\"><\/i><\/a>\n                    \t\t        {{\/if}}\n                    \t\t    <\/p>\n                    \t\t{{\/if}}\n                    \t{{\/if_equal}}\n                {{else}}\n                    <p class=\"small_bottom_margin small_top_margin pill_container\">\n                        {{#if_gt total_memberships compare=1}}<span class=\"show_pill_action\">{{\/if_gt}}\n                            {{#each channels}}\n                                <span class=\"channel pill\">\n                                    #{{this.name}}\n                                    {{#isModelObExtShared this}}\n                                        {{> shared_channels_icon model_ob=this tooltip=true shared_team_ids=this.shared_team_ids}}\n                                    {{\/isModelObExtShared}}\n                                    {{#if_gt ..\/total_memberships compare=1}}\n                                        {{#canKickFromChannels}}\n                                            <i class=\"ts_icon ts_icon_times_circle pill_action api_channel_kick\" data-channel-id=\"{{this.id}}\" title=\"{{#t member_name=..\/member.name channel_name=this.name}}Eliminar a {member_name} de #{channel_name}{{\/t}}\"><\/i>\n                                        {{\/canKickFromChannels}}\n                                    {{\/if_gt}}\n                                <\/span>\n                            {{\/each}}\n                            {{#each member.groups}}\n                                <span class=\"group pill\">{{this}}{{#if_gt ..\/total_memberships compare=1}}{{#canKickFromGroups}} <i class=\"ts_icon ts_icon_times_circle pill_action api_group_kick\" data-group-id=\"{{@key}}\" title=\"{{#t fallback_hash=66c09654fca702d1cf229b05556c041b1fb5b468 member_name=..\/member.name this=this}}Eliminar a {member_name} de {this}{{\/t}}\"><\/i>{{\/canKickFromGroups}}{{\/if_gt}}<\/span>\n                            {{\/each}}\n                        {{#if show_add_channel_btn}}\n                            <a class=\"channel pill api_channel_invite\"><i class=\"ts_icon ts_icon_plus\"><\/i><\/a>\n                        {{\/if}}\n                        {{#if_gt total_memberships compare=1}}<\/span>{{\/if_gt}}\n                        {{#if member.more_groups}}\n                            {{#if group_count}}\n                                {{#t}}+ {member.more_groups, plural, =1{# canal cerrado m\u00e1s}other{# canales cerrados m\u00e1s}}{{\/t}}\n                            {{else}}\n                                {{#t}}+ {member.more_groups, plural, =1{# canal cerrado}other{# canales cerrados}}{{\/t}}\n                            {{\/if}}\n                        {{\/if}}\n                    <\/p>\n                {{\/if}}\n            {{\/if}}\n        {{\/if}}\n    <\/div>\n\n    <div class=\"notice_processing progress_bar_progress_animated\">{{#t}}Actualizando...{{\/t}}<\/div>\n    <div class=\"notice_success\">\n        <span class=\"success_message\"><\/span>\n        <a class=\"notice_dismiss neutral_white\" data-action=\"success_ok\">{{#t}}Aceptar{{\/t}}<\/a>\n    <\/div>\n    <div class=\"notice_error\">\n        <span class=\"error_message\">\n            <span class=\"error_generic\">{{#t}}\u00a1Uy! Se ha producido un error al realizar la acci\u00f3n.{{\/t}}<\/span> <span class=\"error_detail\"><\/span>\n        <\/span>\n        <span class=\"notice_dismiss neutral_white\" data-action=\"error_try_again\">{{#t}}Volver a intentar{{\/t}}<\/span>\n    <\/div>\n\n<\/div>\n";
TS.raw_templates['admin_cant_reactivate_or_convert_list_item_label'] = "{{i18n_ns \"pages_admin\"}}\n<span class=\"ts_tip ts_tip_top ts_tip_float data-tip-toggle-auto ts_tip_multiline inline_flex\">\n\t{{#if_equal action compare=\"cant_reactivate_as_guest\"}}\n\t\t{{#t}}No se puede reactivar como colaborador invitado{{\/t}}\n\t\t<ts-icon class=\"very_small_left_padding ts_icon_question_circle\"><\/ts-icon>\n\t\t<span class=\"ts_tip_multiline_inner ts_tip_tip\">\n\t\t\t\t{{#t name=formatted_member_name }}\n\t\t\t\t\t{name} es un miembro pleno en otros espacios de esta organizaci\u00f3n. Debe tener el mismo tipo de cuenta en todos los espacios.\n\t\t\t\t{{\/t}}\n\t\t<\/span>\n\t{{else if_equal action compare=\"cant_convert_member_role\"}}\n\t\t{{#t}}No se puede cambiar el tipo de cuenta{{\/t}}\n\t\t<ts-icon class=\"very_small_left_padding ts_icon_question_circle\"><\/ts-icon>\n\t\t<span class=\"ts_tip_multiline_inner ts_tip_tip\">\n\t\t\t{{#if member.is_single_channel_guest}}\n\t\t\t\t{{#t name=formatted_member_name}}\n\t\t\t\t\t{name} es un invitado monocanal en otros espacios de trabajo de esta organizaci\u00f3n, por lo que su cuenta solo puede cambiarse a nivel de la organizaci\u00f3n.\n\t\t\t\t{{\/t}}\n\t\t\t{{else if member.is_multi_channel_guest}}\n\t\t\t\t{{#t name=formatted_member_name}}\n\t\t\t\t\t{name} es un invitado multicanal en otros espacios de trabajo de esta organizaci\u00f3n, por lo que su cuenta solo puede cambiarse a nivel de la organizaci\u00f3n.\n\t\t\t\t{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t name=formatted_member_name}}\n\t\t\t\t\t{name} es un miembro en otros espacios de trabajo de esta organizaci\u00f3n, por lo que su cuenta solo puede cambiarse a nivel de la organizaci\u00f3n.\n\t\t\t\t{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/span>\n\t{{else if_equal action compare=\"cant_deactivate\"}}\n\t\t{{#t}}Imposible eliminar el miembro{{\/t}}\n\t\t<ts-icon class=\"very_small_left_padding ts_icon_question_circle\"><\/ts-icon>\n\t\t<span class=\"ts_tip_multiline_inner ts_tip_tip\">\n\t\t\t\t{{#t note=\"text explaining that a member can't be removed from a team\/workspace because of IDP group membership\" name=formatted_member_name num_groups=group_list.length label=formatted_group_label }}\n\t\t\t\t{name} es parte de {num_groups, plural, =1 {one {idp_label} grupo asignado} other {# {idp_label} grupos asignados}} a este espacio: ({label}).\n\t\t\t\t{{\/t}}\n\t\t<\/span>\n\t{{else if_equal action compare=\"cant_convert_or_deactivate\"}}\n\t\t{{#t}}No se puede eliminar el miembro ni cambiar el tipo de cuenta{{\/t}}\n\t\t<ts-icon class=\"very_small_left_padding ts_icon_question_circle\"><\/ts-icon>\n\t\t<span class=\"ts_tip_multiline_inner ts_tip_tip\">\n\t\t\t\t{{#t note=\"text explaining that a member can't be removed from a team\/workspace because of IDP group membership\" name=formatted_member_name num_groups=group_list.length label=formatted_group_label }}\n\t\t\t\t{name} no se puede eliminar porque forma parte de {num_groups, plural, =1 {un grupo {idp_label} asignado} other {# grupos {idp_label} asignados}} a este espacio: ({label}). Tambi\u00e9n pertenece a m\u00faltiples espacios en esta organizaci\u00f3n, por lo que su tipo de cuenta solo puede cambiarse a nivel de la organizaci\u00f3n.\n\t\t\t\t{{\/t}}\n\t\t<\/span>\n\t{{\/if_equal}}\n<\/span>\n";
TS.raw_templates['admin_invite_list_item'] = "{{i18n_ns \"invite\"}}\n\t<div class=\"admin_list_item active member_item invite_item {{#if invite.is_pending}}pending{{\/if}} {{#if invite.bouncing}}bouncing{{\/if}}\" id=\"row_{{invite.id}}\" data-invite-id=\"{{invite.id}}\">\n\n\t\t<div class=\"admin_list_item_invite_info\">\n\n\t\t\t{{#if member}}\n\t\t\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs member.id 36)}}\n\t\t\t{{\/if}}\n\n\t\t\t<div class=\"admin_list_item_name_email\">\n\t\t\t{{#if member}}\n\t\t\t\t<a href=\"\/team\/{{member.id}}\" class=\"admin_member_real_name\">{{getPrefCompliantMemberName member}}<\/a><br \/>\n\t\t\t{{else if invite.real_name}}\n\t\t\t\t<span class=\"admin_member_real_name\">{{invite.real_name}}<\/span><br \/>\n\t\t\t{{\/if}}\n\n\t\t\t<span class=\"admin_member_display_name_and_email\">\n\t\t\t\t{{#if member}}\n\t\t\t\t\t{{#memberHasSecondaryName member}}\n\t\t\t\t\t\t<span class=\"indifferent_grey\">{{getMemberSecondaryName member}}<\/span> <span class=\"bullet\">\u2022<\/span>\n\t\t\t\t\t{{\/memberHasSecondaryName}}\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if invite}}\n\t\t\t\t\t{{#if invite.type}}\n\t\t\t\t\t\t{{invite_type_label}} <span class=\"bullet\">\u2022<\/span>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t\t<span class=\"email\">{{invite.email}}<\/span>\n\t\t\t\t{{#if invite.bouncing}}<span class=\"bullet\">\u2022<\/span> {{#t}}Direcci\u00f3n de correo devuelta{{\/t}}{{\/if}}\n\t\t\t<\/span>\n\t\t\t<\/div>\n\n\t\t\t<span class=\"admin_invite_sent_date\">\n\t\t\t\t{{#if invite.is_pending}}\n\t\t\t\t\t{{#if_equal invite.date_resent compare=\"0\"}}\n\t\t\t\t\t\t{{#t date=(toCalendarDateOrNamedDayShort invite.date_create)}}Invitado(a) {date}{{\/t}}{{#if invite.inviter}}<br>{{#t}}a trav\u00e9s de {inviter_link}{{\/t}}{{\/if}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t date=(toCalendarDateOrNamedDayShort invite.date_resent)}}Reenviada {date}{{\/t}}\n\t\t\t\t\t\t{{#if invite.inviter}}\n\t\t\t\t\t\t\t<br><span class=\"admin_invite_invited_by\">{{#t}}Invitado por {inviter_link}{{\/t}}<\/span>\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t date=(toCalendarDateOrNamedDayShort invite.date_create)}}Se uni\u00f3 {date}{{\/t}}\n\t\t\t\t\t{{#if invite.inviter}}\n\t\t\t\t\t\t<br><span class=\"admin_invite_invited_by\">{{#t}}Invitado por {inviter_link}{{\/t}}<\/span>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/span>\n\n\t\t\t{{#if invite.is_pending}}\n\t\t\t\t<i class=\"admin_member_caret ts_icon ts_icon_caret_right\"><\/i>\n\t\t\t\t<i class=\"admin_member_caret ts_icon ts_icon_caret_down\"><\/i>\n\t\t\t{{\/if}}\n\t\t<\/div>\n\n\t\t{{#if invite.is_pending}}\n\t\t\t<div class=\"admin_list_item_invite_actions member_actions\">\n\t\t\t\t<a href=\"\/admin\/invites?revoke={{invite.id}}&{{crumb_key}}\" class=\"btn btn_outline btn_small\">{{#t}}Anular invitaci\u00f3n{{\/t}}<\/a>\n\t\t\t\t<a href=\"\/admin\/invites?resend={{invite.id}}&{{crumb_key}}\" class=\"btn btn_outline btn_small\">{{#t}}Reenviar invitaci\u00f3n{{\/t}}<\/a>\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t<\/div>\n";
