}<\/span>\n\t\t\t\t\t\t<a id=\"admin_invites_show_date_picker\" class=\"greigh underline position_relative\">{{#t note=\"button to change expiration date\"}}Configurar l\u00edmite de tiempo{{\/t}}<\/a>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\n\t\t\t\t{{#if show_custom_message}}\n\t\t\t\t\t<div class=\"admin_invites_hide_custom_message invite_modal_options_message greigh large_bottom_margin large_right_margin\">\n\t\t\t\t\t\t{{#t}}<a class=\"underline greigh\" data-action=\"admin_invites_show_custom_message\" tabindex=\"0\">Redacta un mensaje personalizado<\/a> para dar a tus invitaciones un toque original.{{\/t}}\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/if}}\n\n\t\t\t\t<div class=\"admin_invites_custom_message_container\">\n\t\t\t\t\t<div class=\"admin_invites_show_custom_message hidden medium_bottom_margin\">\n\t\t\t\t\t\t<label for=\"admin_invite_custom_message\">{{#t note=\"label for a custom message\"}}Mensaje personalizado{{\/t}}<\/label>\n\t\t\t\t\t\t<textarea id=\"admin_invite_custom_message\" name=\"admin_invite_custom_message\" maxlength=\"560\" placeholder=\"{{#t}}A\u00f1ade un mensaje personalizado a tus invitaciones{{\/t}}\" {{#unless team_in_org}}data-validation=\"hasnourl\"{{\/unless}}><\/textarea>\n\t\t\t\t\t\t<a class=\"hide_custom_message\" data-action=\"admin_invites_hide_custom_message\"><i class=\"ts_icon ts_icon_times\"><\/i><\/a>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"invite_modal_options large_bottom_margin\">\n\t\t\t\t\t<div class=\"invite_modal_options_left\">\n\n\t\t\t\t\t\t{{#if team_should_see_invite_link}}\n\t\t\t\t\t\t{{#if can_use_shared_invite_links}}\n\t\t\t\t\t\t\t<div class=\"share_invite_link_container\">\n\t\t\t\t\t\t\t\t<a id=\"create_or_share_invite_link\" href=\"#\" data-action=\"create_or_share_invite_link\">\n\t\t\t\t\t\t\t\t\t<i id=\"create_or_share_invite_link_icon\" class=\"c-deprecated-icon c-icon--link\"><\/i>\n\t\t\t\t\t\t\t\t\t<span id=\"create_or_share_invite_link_text\">{{#t}}Obtener un enlace de invitaci\u00f3n para compartir{{\/t}}<\/span>\n\t\t\t\t\t\t\t\t<\/a>\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t{{\/if}}\n\n\t\t\t\t\t\t{{#currentUserIsAdmin}}<a id=\"invite_restricted_view_pending\" href=\"\/admin\/invites\" class=\"greigh underline pending_updates hidden\" target=\"{{newWindowName}}\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=view_pending_and_accepted,trigger=click_cta_pending_and_accepted\">{{#t}}Ver invitaciones pendientes y aceptadas{{\/t}}<\/a>{{\/currentUserIsAdmin}}\n\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"invite_modal_options_right\">\n\t\t\t\t\t\t<button type=\"submit\" id=\"admin_invites_submit_btn\" class=\"btn btn_large ladda-button\" data-action=\"api_send_invites\" data-style=\"expand-right\">\n\t\t\t\t\t\t\t<span class=\"ladda-label\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=invite,trigger=click_cta_submit_btn\">{{#t}}Invitar a otros{{\/t}}<\/span>\n\t\t\t\t\t\t<\/button>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"invite_modal_footer_container large_top_padding large_top_margin greigh {{#if footer_border}}has_border{{\/if}}\">\n\n\t\t\t\t\t<p id=\"sso_notice_container\" class=\"small greigh\">\n\t\t\t\t\t\t<span id=\"sso_signup_notice\" class=\"block small_top_margin hidden\"><\/span>\n\t\t\t\t\t\t<span id=\"google_auth_email_domain_notice\" class=\"hidden\">\n\t\t\t\t\t\t\t\t{{#t email_domains=(listify email_domains)}}Puedes invitar a otros miembros con correos terminados en {email_domains}{{\/t}}\n\t\t\t\t\t\t\t<a href=\"\/admin\/auth\/google\" target=\"{{newWindowName}}\" class=\"greigh small_left_margin underline\">{{#t}}cambiar ajustes de inicio de sesi\u00f3n \u00fanico{{\/t}}<\/a>\n\t\t\t\t\t\t<\/span>\n\t\t\t\t\t<\/p>\n\n\t\t\t\t\t{{#if is_paid_team}}\n\t\t\t\t\t\t<div class=\"invite_modal_footer \">\n\n\t\t\t\t\t\t\t{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}\n\t\t\t\t\t\t\t\t<p>\n\t\t\t\t\t\t\t\t\t<span id=\"admin_invites_billing_notice\" class=\"no_bottom_margin\">Se te cobrar\u00e1 una cantidad prorrateada por cada nuevo miembro.<\/span>\n\t\t\t\t\t\t\t\t\t<span id=\"admin_guide_to_billing_at_slack\" class=\"no_bottom_margin\">Consulta nuestra <a href=\"https:\/\/get.slack.help\/hc\/{locale}\/articles\/201723133-Billing-FAQ?{hcTrackingToken}\"  class=\"greigh underline\" target=\"new\">Gu\u00eda para la facturaci\u00f3n de Slack<\/a>.<\/span>\n\t\t\t\t\t\t\t\t<\/p>\n\t\t\t\t\t\t\t{{\/t}}\n\n\t\t\t\t\t\t\t<p id=\"ura_warning\">{{#t}}Recuerda que las cuentas de invitado pueden acceder a tu directorio con la <a href=\"https:\/\/api.slack.com\/methods\/users.list\" target=\"new\" class=\"greigh underline\">API de Slack<\/a>.{{\/t}}<\/p>\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t{{\/if}}\n\n\t\t\t\t\t{{#currentUserIsAdmin}}<a id=\"invite_member_view_pending\" href=\"\/admin\/invites\" class=\"greigh underline pending_updates hidden\" target=\"{{newWindowName}}\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=view_pending_and_accepted,trigger=click_cta_pending_and_accepted\">{{#t}}Ver invitaciones pendientes y aceptadas{{\/t}}<\/a>{{\/currentUserIsAdmin}}\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\n\t\t<\/div>\n\n\t\t<form id=\"bulk_invites\" class=\"hidden stacked top_margin\">\n\n\t\t\t<p class=\"alert alert_warning hidden\" id=\"bulk_notice\"><\/p>\n\n\t\t\t<label class=\"full_width\">\n\t\t\t\t{{#t}}A\u00f1adir m\u00faltiples correos{{\/t}}\n\t\t\t\t<textarea wrap=\"virtual\" name=\"emails\" id=\"bulk_emails\" class=\"no_bottom_margin full_width\"><\/textarea>\n\t\t\t<\/label>\n\n\t\t\t{{#if invites_limit}}\n\t\t\t<p class=\"input_note\">{{#t locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}Separa las distintas direcciones con comas. <strong>Ten en cuenta que Slack limitar\u00e1 el n\u00famero de invitaciones que puedes enviar si tu espacio de trabajo tiene un bajo \u00edndice de aceptaci\u00f3n.<\/strong> En nuestro Centro de Ayuda <a href='https:\/\/get.slack.help\/hc\/{locale}\/articles\/201330256?{hcTrackingToken}#invitation_limits'>puedes informarte sobre los l\u00edmites de invitaciones<\/a>.{{\/t}}<\/p>\n\t\t\t{{else}}\n\t\t\t<p class=\"input_note\">{{#t}}<strong>Consejo:<\/strong> Copia y pega una lista de contactos desde tu correo. Separa las distintas direcciones con\u00a0comas, por favor.{{\/t}}<\/p>\n\t\t\t{{\/if}}\n\n\t\t\t<button type=\"submit\" class=\"btn small_right_margin ladda-button\" data-action=\"api_parse_emails\" data-style=\"expand-right\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=invite_bulk,trigger=click_cta_submit_bulk_btn\">{{#t}}A\u00f1adir invitados{{\/t}}<\/button>\n\t\t\t<a class=\"btn btn_outline\" data-action=\"admin_invites_switch_view\" data-view=\"individual\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=switch_view_to_individual,trigger=click_cta_switch_view_to_individual\">{{#t}}Cancelar{{\/t}}<\/a>\n\t\t<\/form>\n\n\t\t{{#if can_use_shared_invite_links}}\n\t\t\t<div id=\"invite_link_container\" class=\"hidden\">\n\n\t\t\t<\/div>\n\t\t{{\/if}}\n\n\t<\/div>\n\n\t<div id=\"admin_invites_success\" class=\"hidden\">\n\t\t{{> admin_invite_summary}}\n\t<\/div>\n\n<\/div>\n";
