TS.raw_templates['admin_invite_summary'] = "{{i18n_ns \"invite\"}}\n\n<h1 class=\"light align_center\">\n\t{{#if error_invites}}\n\t\t{{#if success_invites}}\n\t\t\t{{#t}}No ha sido del todo exitoso.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}\u00a1No ha funcionado!{{\/t}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#if_gt success_invites.length compare=1}}\n\t\t\t{{#t}}\u00a1Se han enviado tus invitaciones!{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}\u00a1Se ha enviado tu invitaci\u00f3n!{{\/t}}\n\t\t{{\/if_gt}}\n\t{{\/if}}\n<\/h1>\n\n<p class=\"align_center large_bottom_margin\">\n\t{{#if error_invites}}\n\t\t{{#if success_invites}}\n\t\t\t{{#t success=(dangerouslyRenderHTML success_invites_html)}}Has invitado a {success}, pero no has enviado <span class=\"bold\">{error_invites.length, plural, =1 {# invitaci\u00f3n} other {# invitaciones}}.<\/span>. Revisa los errores que te indicamos a continuaci\u00f3n.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}<span class=\"bold\">no has enviado {error_invites.length, plural, =1 {# invitaci\u00f3n} other {# invitaciones}} <\/span>. Revisa los siguientes errores.{{\/t}}\n\t\t{{\/if}}\n\t{{else}}\n\t\t{{#t success=(dangerouslyRenderHTML success_invites_html)}}Has invitado a {success} a {team_name}.{{\/t}}\n\t\t{{#if expiration_msg}}\n\t\t\t<br\/>\n\t\t\t{{expiration_msg}}\n\t\t{{\/if}}\n\t{{\/if}}\n<\/p>\n\n{{#if success_invites}}\n\t<table class=\"addresses large_bottom_margin align_left full_width\">\n\t\t<tr>\n\t\t\t<th class=\"span_1_of_2\">{{#t}}Direcci\u00f3n de correo{{\/t}}<\/th>\n\t\t\t<th class=\"span_1_of_2\">{{#t}}Nombre completo{{\/t}}<\/th>\n\t\t<\/tr>\n\t\t{{#each success_invites}}\n\t\t\t<tr>\n\t\t\t\t<td class=\"align_top\">{{this.email}}<\/td>\n\t\t\t\t<td>{{this.real_name}}<\/td>\n\t\t\t<\/tr>\n\t\t{{\/each}}\n\t<\/table>\n{{\/if}}\n\n{{#if error_invites}}\n\t<table class=\"addresses error large_bottom_margin align_left full_width\">\n\t\t<tr>\n\t\t\t<th class=\"span_1_of_2\">{{#t}}Direcci\u00f3n de correo{{\/t}}<\/th>\n\t\t\t<th class=\"span_1_of_2\">{{#t}}Qu\u00e9 ha salido mal{{\/t}}<\/th>\n\t\t<\/tr>\n\t\t{{#each error_invites}}\n\t\t\t<tr>\n\t\t\t\t<td class=\"align_top\">{{this.email}}<\/td>\n\t\t\t\t<td>{{dangerouslyRenderHTML this.error_msg}}<\/td>\n\t\t\t<\/tr>\n\t\t{{\/each}}\n\t<\/table>\n{{\/if}}\n\n{{#if custom_message}}\n\t<table class=\"large_bottom_margin align_left full_width\">\n\t\t<tr>\n\t\t\t<th class=\"span_1_of_1\">{{#t}}Mensaje personalizado{{\/t}}<\/th>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td class=\"align_top break_word\">{{custom_message}}<\/td>\n\t\t<\/tr>\n\t<\/table>\n{{\/if}}\n\n{{#if domains}}\n\t<div class=\"alert alert_success no_bottom_margin clearfix\">\n\t\t<i class=\"ts_icon ts_icon_check_circle_o\"><\/i>\n\t\t<p class=\"value_proposition\">{{#t}}Puedes configurar <strong>{team_name}<\/strong> de modo que permitas que se registre autom\u00e1ticamente cualquiera que tenga un correo confirmado.{{\/t}}<\/p>\n\t\t{{#if paid_team}}<p class=\"value_proposition\">{{#t}}Slack efectuar\u00e1 autom\u00e1ticamente el cargo o abono en tu cuenta cuando a\u00f1adas miembros activos a tu equipo o los elimines.{{\/t}}<\/p>{{\/if}}\n\t\t<p class=\"top_margin\">\n\t\t\t<span class=\"col span_3_of_4 no_right_padding small_bottom_margin\">\n\t\t\t\t<input type=\"text\" id=\"invite_signup_domains\" class=\"no_bottom_margin small\" value=\"{{domains}}\" \/>\n\t\t\t<\/span>\n\t\t\t<button class=\"btn ladda-button col span_1_of_4 admin_invites_btn\" data-style=\"expand-right\" data-action=\"add_signup_domains\">{{#t}}Configurar{{\/t}}<\/button>\n\t\t\t<span class=\"input_note col span_1_of_1 no_margin\">{{#t}}Para permitir direcciones de correo de distintos dominios, sep\u00e1ralas con comas.{{\/t}}<\/span>\n\t\t<\/p>\n\t<\/div>\n{{\/if}}\n\n<p class=\"large_top_padding display_flex justify_content_between\">\n\t<span>\n\t\t{{#if is_admin}}\n\t\t\t<a class=\"btn btn_large btn_outline admin_invites_btn\" href=\"\/admin\/invites\" {{#isClient}}target=\"admin_invites\"{{\/isClient}}>{{#t}}Ver invitaciones pendientes{{\/t}}<\/a>\n\t\t{{\/if}}\n\t\t{{#if error_invites}}\n\t\t\t<button class=\"btn btn_large btn_outline admin_invites_btn\" data-action=\"admin_invites_try_again\">{{#t}}Volver a intentar{{\/t}}<\/button>\n\t\t{{else}}\n\t\t\t<button class=\"btn btn_large btn_outline admin_invites_btn\" data-action=\"admin_invites_reset\">{{#t}}Invitar a m\u00e1s miembros{{\/t}}<\/button>\n\t\t{{\/if}}\n\t<\/span>\n\t<button class=\"btn btn_large float_right dialog_cancel admin_invites_btn\">{{#t}}Listo{{\/t}}<\/button>\n<\/p>";
TS.raw_templates['admin_invite_switcher'] = "{{i18n_ns 'invite'}}\n\n{{#feature flag=\"feature_guest_awareness_i18n\"}}\n{{#t}}Los miembros pueden acceder a mensajes y archivos en cualquier canal abierto y a todo el directorio del equipo.{{\/t}}\n{{\/feature}}\n\n<hr id=\"admin_invites_header_divider\" class=\"hide_on_mobile\" \/>\n<div class=\"admin_invites_account_type_option {{#if hide_full_member_option}}disabled{{\/if}} {{#if team_in_org}}no_hover{{\/if}}\" data-action=\"switch_type\" data-account-type=\"full\">\n\t{{#if guest_is_in_treatment_group}}\n\t\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"admin_invites_account_type_header normal small_bottom_margin\">{{#t note=\"type of invitee who can access any public channel\"}}Miembros{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\t\t<p>{{#t fallback_hash=\"733314ff19503169e9c490463062f18cd38ee6b3\" fallback_hash_ns=\"invite\"}}Los miembros pueden acceder a mensajes y archivos en cualquier canal abierto y a todo el directorio del equipo.{{\/t}}<\/p>\n\t{{else}}\n\t\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"normal small_bottom_margin\">{{#t note=\"type of invitee who can access any public channel\"}}Miembros{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\t\t<p>{{#t}}Los miembros podr\u00e1n acceder a mensajes y archivos de cualquier canal p\u00fablico, adem\u00e1s del directorio completo.{{\/t}}<\/p>\n\t{{\/if}}\n\t{{#unless hide_full_member_option}}\n\t\t<i class=\"option_arrow ts_icon ts_icon_arrow_right ts_icon_inherit\"><\/i>\n\t{{else}}\n\t\t{{#unless team_in_org}}\n\t\t\t{{#currentUserIsAdmin}}\n\t\t\t\t<div class=\"account_type_disabled_hover\">\n\t\t\t\t\t<p class=\"bottom_margin\">{{#t}}Los miembros podr\u00e1n registrarse en <strong>{team_signup_url}<\/strong>{{\/t}}<\/p>\n\t\t\t\t\t<a href=\"\/admin\/auth\/saml\" {{#isClient}}target=\"auth\"{{\/isClient}} class=\"btn btn_outline\">{{#t}}Cambiar ajustes de inicio de sesi\u00f3n \u00fanico{{\/t}}<\/a>\n\t\t\t\t<\/div>\n\t\t\t{{\/currentUserIsAdmin}}\n\t\t{{\/unless}}\n\t{{\/unless}}\n<\/div>\n<div class=\"admin_invites_account_type_option {{#unless is_paid_team}}locked{{\/unless}}\" data-action=\"switch_type\" data-account-type=\"restricted\">\n\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"admin_invites_account_type_header normal small_bottom_margin\">{{#unless is_paid_team}}<i class=\"c-icon c-icon--inline c-icon--lock\"><\/i>{{\/unless}}{{#t}}Invitados multicanal{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\t{{#if is_paid_team}}\n\t\t{{#if guest_is_in_treatment_group}}\n\t\t\t<p>{{#t}}Los invitados multicanal pueden acceder a mensajes y archivos de canales espec\u00edficos y cuentan con una visi\u00f3n parcial del directorio del equipo.{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ?{{hcTrackingToken}}\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"link_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_invites\" data-clog-ui-component=\"guest_multi\" target=\"zendesk\" class=\"subtle_silver underline\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a><\/p>\n\t\t{{else}}\n\t\t\t<p>{{#t}}Los invitados multicanal solo pueden ver parte del directorio y \u00fanicamente tienen acceso a mensajes y archivos de algunos canales.{{\/t}}<\/p>\n\t\t{{\/if}}\n\n\t\t<i class=\"option_arrow ts_icon ts_icon_arrow_right ts_icon_inherit\"><\/i>\n\t{{else}}\n\t\t<p>{{#t}}Los equipos de pago pueden invitar a invitados multicanal (los invitados multicanal pueden acceder a mensajes y archivos de canales espec\u00edficos y cuentan con una visi\u00f3n parcial del directorio del equipo).{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ?{{hcTrackingToken}}\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"link_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_invites\" data-clog-ui-component=\"guest_multi\" target=\"zendesk\" class=\"subtle_silver underline\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a><\/p>\n\t{{\/if}}\n<\/div>\n<div class=\"admin_invites_account_type_option {{#if is_paid_team}}{{#unless can_add_ura}}disabled{{\/unless}}{{else}}locked{{\/if}}\" data-action=\"switch_type\" data-account-type=\"ultra_restricted\">\n\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"admin_invites_account_type_header normal small_bottom_margin\">{{#unless is_paid_team}}<i class=\"c-icon c-icon--inline c-icon--lock\"><\/i>{{\/unless}}{{#t note=\"guests who will only be able to access one channel\"}}Invitados monocanal{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\n\t{{#if is_paid_team}}\n\t\t{{#if guest_is_in_treatment_group}}\n\t\t\t<p>{{#t}}Los invitados monocanal solo pueden acceder a mensajes y archivos de un solo canal.{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ?{{hcTrackingToken}}\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"link_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_invites\" data-clog-ui-component=\"guest_single\" target=\"zendesk\" class=\"subtle_silver underline\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a><\/p>\n\t\t{{else}}\n\t\t\t<p>{{#t}}Los invitados monocanal solo pueden acceder a mensajes y archivos de un solo canal. Este tipo de cuenta es gratuito.{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ?{{hcTrackingToken}}\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"link_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_invites\" data-clog-ui-component=\"guest_single\" target=\"zendesk\" class=\"subtle_silver underline\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a><\/p>\n\t\t{{\/if}}\n\n\t\t<div class=\"account_type_disabled_hover hidden\">\n\t\t\t{{#if guest_is_in_treatment_group}}\n\t\t\t\t<p class=\"bottom_margin\">{{#t}}Has alcanzado el l\u00edmite de invitados monocanal de tu espacio de trabajo.{{\/t}}<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p class=\"bottom_margin\">{{#t}}Has alcanzado el l\u00edmite de <strong>invitados monocanal<\/strong> de tu espacio de trabajo.{{\/t}}<\/p>\n\t\t\t{{\/if}}\n\t\t\t<a href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ?{{hcTrackingToken}}\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"link_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_invites\" data-clog-ui-component=\"guest_single\" target=\"zendesk\" class=\"btn btn_outline\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a>\n\t\t<\/div>\n\t\t<i class=\"option_arrow ts_icon ts_icon_arrow_right ts_icon_inherit\"><\/i>\n\t{{else}}\n\t\t<p>{{#t}}Los equipos suscritos a un plan de pago pueden a\u00f1adir invitados monocanal (los invitados monocanal pueden acceder a un solo canal de Slack).{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ?{{hcTrackingToken}}\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"link_help_center\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_invites\" data-clog-ui-component=\"guest_single\" target=\"zendesk\" class=\"subtle_silver underline\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a><\/p>\n\t{{\/if}}\n<\/div>\n{{#currentUserIsAdmin}}\n\t<p class=\"align_center large_top_margin\">\n\t\t<a href=\"\/admin\/invites\" target=\"{{newWindowName}}\">{{#t}}Ver invitaciones pendientes y aceptadas de tu espacio de trabajo{{\/t}}<\/a>\n\t<\/p>\n{{\/currentUserIsAdmin}}\n";
TS.raw_templates['admin_invite_header_text'] = "{{i18n_ns 'invite'}}\n<i class=\"ts_icon ts_icon_paper_plane blue_fill float_none small_right_margin hide_on_mobile\"><\/i>\n\n<div id=\"admin_invites_header_type_complete {{#unless bolded}}normal{{\/unless}}\">\n\t{{#if simple}}<span class=\"variant variant--simple\">{{#t noun=noun}}Invitar a <span class=\"normal\">{noun}<\/span>{{\/t}}<\/span>{{\/if}}\n\t{{#if alternate}}<span class=\"variant variant--simple--alternate normal\">{{#t noun=noun}}Invitar a cualquier persona, al instante.{{\/t}}<\/span>{{\/if}}\n\t{{#if full}}<span class=\"variant variant--full\">{{#t noun=noun team_name=team_name}}Invitar a {noun} a <span class=\"normal\">{team_name}<\/b>{{\/t}}<\/span>{{\/if}}\n<\/div>";
TS.raw_templates['admin_invite_filter_select_contact'] = "<div class=\"clearfix\">\n\t{{#if contact.photo}}<span class=\"member_preview_link member_image thumb_36\" data-thumb-size=\"36\" style=\"background-image: url('{{contact.photo}}')\" aria-hidden=\"true\"><\/span>{{\/if}}\n\t<div class=\"overflow_ellipsis\">\n\t\t{{!-- This comes from Google contact search, so the `full_name` here is ok. --}}\n\t\t<div class=\"bold\">{{contact.full_name}}<\/div>\n\t\t<div>{{contact.email}}<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['admin_restricted_info'] = "{{i18n_ns \"restricted_accounts\"}}\n\n<div class=\"restricted_info\">\n\n    <p class=\"large_bottom_margin emphasized align_center\">{{#t}}Da acceso limitado a tu equipo de Slack a contratistas, clientes o amigos.{{\/t}}<\/p>\n\n    <div class=\"account_type\">\n        <div class=\"restricted_account_icon\"><\/div>\n        <div class=\"account_type_copy\">\n            <h3 class=\"no_bottom_margin\">{{#t}}Invitados multicanal{{\/t}}<\/h3>\n            <p class=\"no_bottom_margin\">{{#t}}Una cuenta con acceso a los canales que especifiques.{{\/t}}<\/p>\n            {{#if paid_team}}\n                <p>\n                    <a data-action=\"admin_invites_modal\" data-account-type=\"restricted\"><i class=\"ts_icon ts_icon_share_email\"><\/i> {{#t}}A\u00f1adir m\u00e1s invitados multicanal{{\/t}}<\/a>\n                <\/p>\n            {{\/if}}\n        <\/div>\n    <\/div>\n    <div class=\"account_type\">\n        <div class=\"guest_account_icon\"><\/div>\n        <div class=\"account_type_copy\">\n            <h3 class=\"no_bottom_margin\">{{#t}}Invitados monocanal{{\/t}}<\/h3>\n            <p class=\"no_bottom_margin\">{{#t}}Una cuenta gratu\u00edta con acceso a un solo canal.{{\/t}}<\/p>\n            {{#if paid_team}}\n                <p>\n                    <a data-action=\"admin_invites_modal\" data-account-type=\"ultra_restricted\"><i class=\"ts_icon ts_icon_share_email\"><\/i> {{#t}}A\u00f1adir m\u00e1s invitados monocanal{{\/t}}<\/a>\n                <\/p>\n            {{\/if}}\n        <\/div>\n    <\/div>\n\n    {{#unless paid_team}}\n        {{#t fallback_hash='c208b41dd0b4b8bc0084747aac07a4b1246175ca'}}\n        <div class=\"admin_banner\">\n            <h3>Ambos disponibles en nuestro plan Est\u00e1ndar.<\/h3>\n            <p class=\"no_bottom_margin\">M\u00e1s informaci\u00f3n sobre las <a href=\"\/pricing?ui_element=5&ui_step=52\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"pricing_link\" data-clog-ui-action=\"click\" data-clog-ui-step=\"admin_restricted\">opciones de ascenso de servicio<\/a>.<\/p>\n        <\/div>\n        {{\/t}}\n    {{\/unless}}\n\n<\/div>\n";
TS.raw_templates['admin_restricted_info_sso'] = "{{i18n_ns \"restricted_accounts\"}}\n\n<div class=\"restricted_info_sso\">\n    {{#if enterprise_id}}\n    <p class=\"emphasized align_center\">{{#t}}\u00bfNecesitas a\u00f1adir un nuevo invitado a {currentTeamName}? Contacta con un administrador de la organizaci\u00f3n para que te ayude a gestionar su cuenta e incorporarlo al equipo.{{\/t}}<\/p>\n    {{else}}\n    <p class=\"emphasized align_center\">{{#t}}Como tienes activado el inicio de sesi\u00f3n \u00fanico obligatorio para todos los usuarios, no es necesario que los invites a tu equipo. Si tienen una cuenta con tu proveedor de inicio de sesi\u00f3n \u00fanico, pueden conectarse a tu equipo Slack.{{\/t}}<\/p>\n    <p class=\"no_bottom_margin align_center\"><a href=\"\/admin\/auth\" class=\"btn\">{{#t}}Gestionar ajustes de autenticaci\u00f3n{{\/t}}<\/a><\/p>\n    {{\/if}}\n<\/div>";
TS.raw_templates['admin_restrict_account'] = "{{i18n_ns \"restricted_accounts\"}}\n\n<div class=\"col span_3_of_6\">\n\n    <h4>{{#t}}Acerca de los colaboradores invitados{{\/t}}<\/h4>\n\n    <p class=\"small_bottom_margin\">\n        {{#t}}Las cuentas de invitados son perfectas para colaboradores que solo necesitan acceder a canales espec\u00edficos, como contratistas, becarios o clientes. Los colaboradores invitados pueden hacer pr\u00e1cticamente lo mismo que los miembros plenos del espacio de trabajo, con unas pocas restricciones. <a href='https:\/\/get.slack.help\/hc\/articles\/202518103-Multi-Channel-and-Single-Channel-Guests'>Obt\u00e9n m\u00e1s informaci\u00f3n sobre las cuentas de colaboradores invitados<\/a>.{{\/t}}\n    <\/p>\n\n    <p>{{#t}}Hay dos tipos de cuentas de invitado: multicanal y monocanal.{{\/t}}<\/p>\n\n    <p class=\"small_bottom_margin\"><strong>{{#t}}Invitados multicanal{{\/t}}<\/strong><\/p>\n\n    <p>{{#t}}A los invitados multicanal se les factura igual que a los miembros regulares. Pueden ser incorporados a un n\u00famero ilimitado de canales.{{\/t}}<\/p>\n\n    <p class=\"small_bottom_margin\"><strong>{{#t}}Invitados monocanal{{\/t}}<\/strong><\/p>\n\n    <p>{{#t}}Los invitados monocanal son gratuitos. Puedes a\u00f1adir hasta 5 invitados monocanal por cada miembro de tu espacio de trabajo{{\/t}}<\/p>\n<\/div>\n\n<div class=\"col span_3_of_6 invite_form_column\">\n\n    <div id=\"step1\" class=\"align_center\">\n\n        {{makeMemberPreviewLinkImage member.id 192}}\n\n        <h3 class=\"top_margin\">\n            {{#if enabling}}\n                {{#if member.profile.real_name}}\n                    {{#t}}Activar {member.profile.real_name} como:{{\/t}}\n                {{else}}\n                    {{#t}}Activar {member.name} como:{{\/t}}\n                {{\/if}}\n            {{else}}\n                {{#if member.profile.real_name}}\n                    {{#t}}Convertir {member.profile.real_name} a:{{\/t}}\n                {{else}}\n                    {{#t}}Convertir {member.name} a:{{\/t}}\n                {{\/if}}\n            {{\/if}}\n        <\/h3>\n\n            {{#t note=\"Space before 'Multi-Channel Guest' and 'Single-Channel Guest' should be preserved\"}}\n            <a class=\"restriction_option\" id=\"restricted_user\">\n                <i class=\"ts_icon ts_icon_restricted_user presence active\"><\/i> Invitado multicanal <i class=\"ts_icon ts_icon_arrow_right\"><\/i>\n            <\/a>\n            <a class=\"restriction_option\" id=\"guest_user\">\n                <i class=\"ts_icon ts_icon_single_channel_guest presence active\"><\/i> Invitado monocanal <i class=\"ts_icon ts_icon_arrow_right\"><\/i>\n            <\/a>\n\n            <p class=\"subtle_silver large_top_margin\">o <a class=\"cancel_admin_restrict_workflow subtle_silver\">volver a Administraci\u00f3n del espacio de trabajo<\/a><\/p>\n            {{\/t}}\n    <\/div>\n\n    <div id=\"step2_restricted\" class=\"hidden align_center\">\n\n        {{makeMemberPreviewLinkImage member.id 192}}\n\n        <h3 class=\"top_margin\">\n            {{#if enabling}}\n                {{#if member.profile.real_name}}\n                    {{#t}}Activar {member.profile.real_name} como invitado multicanal{{\/t}}\n                {{else}}\n                    {{#t}}Activar {member.name} como invitado multicanal{{\/t}}\n                {{\/if}}\n            {{else}}\n                {{#if member.profile.real_name}}\n                    {{#t}}Convertir {member.profile.real_name} a invitado multicanal{{\/t}}\n                {{else}}\n                    {{#t}}Convertir {member.name} a invitado multicanal{{\/t}}\n                {{\/if}}\n            {{\/if}}\n        <\/h3>\n\n        <p>\n            {{#if show_ra_channel_picker}}\n                {{#t}}Debes seleccionar el canal al que se unir\u00e1 este invitado multicanal.\n                (En el siguiente paso puedes establecer m\u00e1s canales.){{\/t}}\n            {{else}}\n                {{#t}}En el siguiente paso puedes establecer los canales para este invitado multicanal.{{\/t}}\n        {{\/if}}\n                {{#if enabling}}\n                {{else}}\n                        <p>\n                                {{#t}}Convertir a un usuario en un invitado desactivar\u00e1 todas las aplicaciones\/integraciones que han configurado.{{\/t}}\n                \t\t{{#t}}El cambio se har\u00e1 efectivo inmediatamente.{{\/t}}\n        \t\t<\/p>\n                {{\/if}}\n        <\/p>\n\n        {{#if show_ra_channel_picker}}\n        <p class=\"align_left small_top_margin\">\n            <select id=\"restricted_channel_picker\" class=\"hidden\"><\/select>\n        <\/p>\n        {{\/if}}\n\n        <p class=\"error_message moscow_red hidden\">{{#t}}\u00a1Uy! Se ha producido un error al realizar la acci\u00f3n.{{\/t}}<\/p>\n        <p id=\"convert_to_ra_confirmation\">\n            <a class=\"btn api_set_restricted btn_success\">{{#t}}Confirmar{{\/t}}<\/a>\n            <a class=\"cancel_admin_restrict_workflow btn btn_outline small_left_margin\">{{#t}}Cancelar{{\/t}}<\/a>\n        <\/p>\n\n    <\/div>\n\n    <div id=\"step2_guest\" class=\"hidden align_center\">\n\n        {{makeMemberPreviewLinkImage member.id 192}}\n\n        <h3 class=\"top_margin\">\n            {{#if enabling}}\n                {{#if member.profile.real_name}}\n                    {{#t}}Activar {member.profile.real_name} como invitado monocanal{{\/t}}\n                {{else}}\n                    {{#t}}Activar {member.name} como invitado monocanal{{\/t}}\n                {{\/if}}\n            {{else}}\n                {{#if member.profile.real_name}}\n                    {{#t}}Convertir {member.profile.real_name} en invitado monocanal{{\/t}}\n                {{else}}\n                    {{#t}}Convertir {member.name} a invitado monocanal{{\/t}}\n                {{\/if}}\n            {{\/if}}\n        <\/h3>\n\n        <p class=\"no_bottom_margin\">{{#t note=\"Preceded with '...Single-Channel Guest'\"}}Con acceso a este canal:{{\/t}}<\/p>\n\n        <p class=\"align_left small_top_margin\">\n            <select id=\"ultra_restricted_channel_picker\" class=\"hidden\"><\/select>\n        <\/p>\n\n        {{#if enabling}}\n        {{else}}\n                <p>\n\t                {{#t}}Convertir a un usuario en un invitado desactivar\u00e1 todas las aplicaciones\/integraciones que han configurado.{{\/t}}\n\t                {{#t}}El cambio se har\u00e1 efectivo inmediatamente.{{\/t}}\n                <\/p>\n        {{\/if}}\n\n        <p class=\"error_message moscow_red hidden\">{{#t}}\u00a1Uy! Se ha producido un error al realizar la acci\u00f3n.{{\/t}}<\/p>\n\n        <p id=\"convert_to_ura_confirmation\">\n            <a class=\"btn api_set_ultra_restricted btn_success\">{{#t}}Confirmar{{\/t}}<\/a>\n            <a class=\"cancel_admin_restrict_workflow btn btn_outline small_left_margin\">{{#t}}Cancelar{{\/t}}<\/a>\n        <\/p>\n\n    <\/div>\n\n<\/div>\n";
TS.raw_templates['admin_edit_team_profile_modal'] = "{{i18n_ns \"team_profile\"}}\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n<div id=\"edit_team_profile_container\">\n\n\t<h1 id=\"edit_team_profile_header\" class=\"hidden\"><\/h1>\n\t<p id=\"edit_team_profile_value_note\" class=\"small hidden\">{{#t}}Ampl\u00eda los perfiles de tu equipo a\u00f1adiendo m\u00e1s campos a continuaci\u00f3n{{\/t}}<\/p>\n\n\t<section id=\"edit_team_profile_loading\">{{{loadingHTML}}}<\/section>\n\n\t<section id=\"edit_team_profile_list\" class=\"display_flex flex_direction_column large_top_margin very_large_bottom_margin hidden\"><\/section>\n\n\t<section id=\"edit_team_profile_add\" class=\"display_flex flex_direction_column large_top_margin very_large_bottom_margin hidden\"><\/section>\n\n\t<section id=\"edit_team_profile_custom\" class=\"display_flex flex_direction_column large_top_margin very_large_bottom_margin hidden\"><\/section>\n\n\t<section id=\"edit_team_profile_edit\" class=\"display_flex flex_direction_column large_top_margin very_large_bottom_margin hidden\"><\/section>\n\n\t<section id=\"edit_team_profile_hide\" class=\"hidden\"><\/section>\n\n\t<section id=\"edit_team_profile_delete\" class=\"hidden\"><\/section>\n\n<\/div>";
