ff_white_bg sk_dark_gray\" data-action=\"edit_team_profile_to_edit\" data-id=\"{{this.id}}\" data-qa=\"{{this.label}}\" data-is-scim={{#if this.options.is_scim}}true{{else}}false{{\/if}}>\n\t\t\t\t<div class=\"col no_bottom_margin span_2_of_6 {{#if this.options.is_scim}}ent_profile_field--scim_provisioned{{\/if}}\">\n\t\t\t\t\t{{#if this.options.is_scim}}\n\t\t\t\t\t\t<ts-icon class=\"ts_icon_lock sk_light_grey ts_tip ts_tip_top ts_tip_multiline no_margin\">\n\t\t\t\t\t\t\t<span class=\"ts_tip_tip ts_tip_multiline_inner\">{{#t}}Tu organizaci\u00f3n sincroniza autom\u00e1ticamente este campo.{{\/t}}<\/span>\n\t\t\t\t\t\t<\/ts-icon>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t\t<span class=\"no_margin subtle_silver\">{{this.label}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"col no_bottom_margin {{#if this.options.is_scim}}span_2_of_6{{else}}span_3_of_6{{\/if}}\">\n\t\t\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{this.hint}}<\/p>\n\t\t\t\t\t{{#if_equal this.type compare=\"options_list\"}}\n\t\t\t\t\t\t{{#if this.possible_values}}\n                            <p class=\"subtle_silver no_bottom_margin\">{{#t}}{possible_values.length, plural, =1{# opci\u00f3n}other{# opciones}}{{\/t}}<\/p>\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"edit_team_profile_list_controls\">\n\t\t\t\t\t<i class=\"ts_icon ts_icon_cog_o\" data-action=\"edit_team_profile_list_menu\"><\/i>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t{{\/each}}\n\t{{\/if}}\n\t<div class=\"row clearfix\"><\/div>\n\t<p class=\"align_left large_top_margin display_flex flex_wrap\">\n\t\t<button id=\"edit_team_profile_add_new_btn\" class=\"col span_1_of_2 btn btn_large btn_outline\" data-action=\"edit_team_profile_to_custom\">{{#t}}Crear un campo personalizado{{\/t}}<\/button>\n\t\t<button id=\"edit_team_profile_add_existing_btn\" class=\"col span_1_of_2 btn btn_large{{#unless default_team_profile_fields}} disabled{{\/unless}}\" data-action=\"edit_team_profile_to_add\">{{#unless default_team