TS.raw_templates['admin_edit_team_profile_custom'] = "{{i18n_ns \"team_profile\"}}\n\n<div class=\"row clearfix\">\n\t<div class=\"col profile_field_preview_protector\" data-action=\"edit_team_profile_to_edit\" data-type=\"text\">\n\t\t<div class=\"profile_field_preview\">\n\t\t\t<p class=\"align_center no_bottom_margin\">\n\t\t\t\t<span class=\"bottom_margin\">{{#t}}Texto{{\/t}}<\/span>\n\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t{{!-- We don't need to wrap this. --}}\n\t\t\t\t<input type=\"text\" class=\"no_bottom_margin ts_icon_placeholder\" placeholder=\"&#xe136;\" readonly=\"true\">\n\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n\t<div class=\"col profile_field_preview_protector\" data-action=\"edit_team_profile_to_edit\" data-type=\"options_list\">\n\t\t<div class=\"profile_field_preview\">\n\t\t\t<p class=\"align_center no_bottom_margin\">\n\t\t\t\t<span class=\"bottom_margin\">{{#t}}Lista de opciones{{\/t}}<\/span>\n\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" placeholder=\"{{#t fallback_hash=\"af0b7f57b814e06fc2c7bddb04b50655bf60edc2\"}}Seleccionar\u2026{{\/t}}\" readonly=\"true\">\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n<\/div>\n<div class=\"row clearfix\">\n\t<div class=\"col profile_field_preview_protector\" data-action=\"edit_team_profile_to_edit\" data-type=\"date\">\n\t\t<div class=\"profile_field_preview\">\n\t\t\t<p class=\"align_center no_bottom_margin\">\n\t\t\t\t<span class=\"bottom_margin\">{{#t}}Selector de fechas{{\/t}}<\/span>\n\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t{{!-- We don't need to wrap this. --}}\n\t\t\t\t<input type=\"text\" class=\"no_bottom_margin ts_icon_placeholder\" placeholder=\"&#xe023;\" readonly=\"true\">\n\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n\t<div class=\"col profile_field_preview_protector\" data-action=\"edit_team_profile_to_edit\" data-type=\"link\">\n\t\t<div class=\"profile_field_preview\">\n\t\t\t<p class=\"align_center no_bottom_margin\">\n\t\t\t\t<span class=\"bottom_margin\">{{#t}}Enlace{{\/t}}<\/span>\n\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t{{!-- We don't need to wrap this. --}}\n\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" placeholder=\"https:\/\/\" readonly=\"true\">\n\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n<\/div>\n<div class=\"row clearfix\">\n\t<div class=\"col profile_field_preview_protector\" data-action=\"edit_team_profile_to_edit\" data-type=\"user\">\n\t\t<div class=\"profile_field_preview\">\n\t\t\t<p class=\"align_center no_bottom_margin\">\n\t\t\t\t<span class=\"bottom_margin\">{{#t}}Selector de personas{{\/t}}<\/span>\n\t\t\t\t<span class=\"edit_team_profile_lazy_filter_select align_left\"><\/span>\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['admin_edit_team_profile_edit'] = "{{i18n_ns \"team_profile\"}}\n\n<div class=\"row clearfix\">\n\t<div class=\"col span_6_of_6 no_bottom_margin\">\n\t\t<div class=\"profile_field_preview_protector small_bottom_margin\">\n\t\t\t<div class=\"profile_field_preview\">\n\t\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t\t<label data-id=\"preview_label\"{{#if_equal type compare=\"options_list\"}} class=\"no_bottom_margin\"{{\/if_equal}}>{{#if label}}{{label}}{{else}}{{#t}}Etiqueta{{\/t}}{{\/if}}<\/label>\n\t\t\t\t\t{{#if_equal type compare=\"text\"}}\n\t\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" disabled>\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t{{#if_equal type compare=\"options_list\"}}\n\t\t\t\t\t\t<label class=\"select no_bottom_margin with_hint\">\n\t\t\t\t\t\t\t<select class=\"no_bottom_margin\" disabled>\n\t\t\t\t\t\t\t\t<option selected data-id=\"preview_option\">{{#t}}Seleccionar{{\/t}}&hellip;<\/option>\n\t\t\t\t\t\t\t<\/select>\n\t\t\t\t\t\t<\/label>\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t{{#if_equal type compare=\"date\"}}\n\t\t\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t\t\t{{!-- We don't need to wrap this. --}}\n\t\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin ts_icon_placeholder\" placeholder=\"&#xe023;\" disabled>\n\t\t\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t{{#if_equal type compare=\"link\"}}\n\t\t\t\t\t\t<input type=\"text\" class=\"no_bottom_margin\" disabled>\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t{{#if_equal type compare=\"user\"}}\n\t\t\t\t\t\t<span class=\"edit_team_profile_lazy_filter_select align_left\"><\/span>\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t<span class=\"input_note\" data-id=\"preview_hint\">{{#if hint}}{{hint}}{{else}}{{#t}}Texto de la sugerencia{{\/t}}{{\/if}}<\/span>\n\t\t\t\t<\/p>\n\t\t\t\t<span class=\"profile_field_preview_ribbon cloud_silver_bg neutral_white\"><strong class=\"uppercase\">{{#t}}Vista previa{{\/t}}<\/strong><\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<p class=\"yolk_orange align_center no_bottom_margin small\">{{#t}}Esta es solo una vista previa del campo. Utiliza el siguiente formulario para editarlo.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n<div class=\"row clearfix\">\n\t<div class=\"col span_6_of_6\">\n\t\t<p class=\"no_bottom_margin\">\n\t\t\t<label for=\"label\">{{#t}}Etiqueta{{\/t}}<\/label>\n\t\t\t<input type=\"text\" class=\"no_bottom_margin\" placeholder=\"{{#t}}Etiqueta (obligatoria){{\/t}}\" value=\"{{#if label}}{{label}}{{\/if}}\" name=\"label\" data-validation=\"required maxlength=19\" data-action=\"edit_team_profile_update_preview_label\" data-target=\"preview_label\" data-default=\"{{#t}}Etiqueta{{\/t}}\">\n\t\t\t<span class=\"input_note\">{{#t}}Escribe una etiqueta para este campo.{{\/t}}<\/span>\n\t\t<\/p>\n\t<\/div>\n<\/div>\n<div class=\"row clearfix\">\n\t<div class=\"col span_6_of_6\">\n\t\t<p class=\"no_bottom_margin\">\n\t\t\t<label for=\"hint\">{{#t}}Sugerencia{{\/t}}<\/label>\n\t\t\t<input type=\"text\" class=\"no_bottom_margin\" placeholder=\"{{#t}}Texto de la sugerencia{{\/t}}\" value=\"{{#if hint}}{{hint}}{{\/if}}\" name=\"hint\" data-validation=\"maxlength=78\" data-action=\"edit_team_profile_update_preview_hint\" data-target=\"preview_hint\" data-default=\"{{#t}}Texto de la sugerencia{{\/t}}\">\n\t\t\t<span class=\"input_note\">{{#t}}Escribe una sugerencia para este campo.{{\/t}}<\/span>\n\t\t<\/p>\n\t<\/div>\n<\/div>\n{{#if_equal type compare=\"options_list\"}}\n\t<div class=\"row clearfix option_header_row\">\n\t\t<div class=\"col span_6_of_6 no_bottom_margin\">\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t<label class=\"no_bottom_margin\">{{#t}}Opciones{{\/t}}<\/label>\n\t\t\t\t<span class=\"input_note\">{{#t}}Introduce las opciones disponibles entre las que podr\u00e1n elegir.{{\/t}}<\/span>\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"option_rows\">\n\t\t{{#if possible_values}}\n\t\t\t{{#each possible_values}}\n\t\t\t\t{{> admin_edit_team_profile_option_row value=this index=@index}}\n\t\t\t{{\/each}}\n\t\t{{else}}\n\t\t\t{{> admin_edit_team_profile_option_row index=0}}\n\t\t\t{{> admin_edit_team_profile_option_row index=1}}\n\t\t{{\/if}}\n\t<\/div>\n\t<div class=\"row clearfix\">\n\t\t<div class=\"col span_6_of_6\">\n\t\t\t<p class=\"no_bottom_margin small\">\n\t\t\t\t<a class=\"input_note blue_link\" data-action=\"edit_team_profile_add_option\">{{#t}}A\u00f1ade otra opci\u00f3n.{{\/t}}<\/a>\n\t\t\t\t<span class=\"input_note hidden\">{{#t}}Has alcanzado el n\u00famero m\u00e1ximo de opciones.{{\/t}}<\/span>\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n{{\/if_equal}}\n<p class=\"clearfix bottom_margin large_top_margin display_flex justify_content_end flex_wrap\">\n\t<button id=\"edit_team_profile_cancel_edit_btn\" class=\"col btn btn_large btn_outline\" data-action=\"edit_team_profile_cancel\">{{#t}}Cancelar{{\/t}}<\/button>\n\t<button id=\"edit_team_profile_confirm_edit_btn\" type=\"submit\" class=\"col btn btn_large ladda-button disabled\" data-style=\"expand-right\" data-action=\"edit_team_profile_confirm_edit\"{{#if id}} data-id=\"{{id}}\"{{\/if}} data-type=\"{{type}}\">{{#if id}}{{#t}}Guardar{{\/t}}{{else}}{{#t}}Crear{{\/t}}{{\/if}}<\/button>\n<\/p>\n{{#unless is_hidden}}{{#if id}}\n\t<p class=\"align_right small\">{{#t}}Tambi\u00e9n puedes <a data-action=\"edit_team_profile_to_hide\" data-id=\"{id}\">ocultar este campo.<\/a>{{\/t}}<\/p>\n{{\/if}}{{\/unless}}\n";
TS.raw_templates['admin_edit_team_profile_hide'] = "{{i18n_ns \"team_profile\"}}\n\n<div class=\"clearfix bottom_margin large_top_margin display_flex justify_content_center flex_wrap\">\n\t<button id=\"edit_team_profile_cancel_hide_btn\" class=\"col btn btn_large btn_outline\" data-action=\"edit_team_profile_cancel\">{{#t}}Cancelar{{\/t}}<\/button>\n\t<button id=\"edit_team_profile_confirm_hide_btn\" type=\"submit\" class=\"col btn btn_large ladda-button\" data-style=\"expand-right\" data-action=\"edit_team_profile_confirm_hide\" data-id=\"{{id}}\">{{#t}}Ocultar campo{{\/t}}<\/button>\n<\/div>\n\n{{#if can_delete}}\n\t<p class=\"align_center small\">{{#t}}Tambi\u00e9n puedes <a id=\"edit_team_profile_to_delete_link\" data-action=\"edit_team_profile_to_delete\" data-id=\"{id}\">eliminar de forma permanente este campo.<\/a>{{\/t}}<\/p>\n{{\/if}}";
TS.raw_templates['admin_edit_team_profile_delete'] = "{{i18n_ns \"team_profile\"}}\n\n<div class=\"clearfix bottom_margin large_top_margin display_flex justify_content_center flex_wrap\">\n\t<button id=\"edit_team_profile_cancel_delete_btn\" class=\"col btn btn_large btn_outline\" data-action=\"edit_team_profile_cancel\">{{#t}}Cancelar{{\/t}}<\/button>\n\t<button id=\"edit_team_profile_confirm_delete_btn\" type=\"submit\" class=\"col btn btn_large btn_danger ladda-button\" data-style=\"expand-right\" data-action=\"edit_team_profile_confirm_delete\" data-id=\"{{id}}\">{{#t}}Eliminar campo{{\/t}}<\/button>\n<\/div>\n{{#unless is_hidden}}\n\t<p class=\"align_center small\">{{#t}}Tambi\u00e9n puedes <a id=\"edit_team_profile_to_hide_link\" data-action=\"edit_team_profile_to_hide\" data-id=\"{id}\">ocultar este campo.<\/a>{{\/t}}<\/p>\n{{\/unless}}";
TS.raw_templates['admin_edit_team_profile_option_row'] = "{{i18n_ns \"team_profile\"}}\n\n<div class=\"row clearfix option_row\">\n\t<div class=\"col span_6_of_6\">\n\t\t<p class=\"no_bottom_margin position_relative\">\n\t\t\t<label class=\"validation_count\" for=\"option_{{index}}\"><\/label>\n\t\t\t<input type=\"text\" class=\"no_bottom_margin\" {{#if value}}value=\"{{value}}\" {{\/if}}placeholder=\"{{#t}}Opci\u00f3n (obligatoria){{\/t}}\" name=\"option_{{index}}\" data-validation=\"required maxlength=49\" data-action=\"edit_team_profile_update_preview_option\" data-target=\"preview_option\"><i class=\"ts_icon ts_icon_times\" data-action=\"edit_team_profile_remove_option\"><\/i>\n\t\t<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['admin_menu_edit_team_profile_list_action_items'] = "{{i18n_ns \"team_profile\"}}\n\n{{#if hidden}}\n\t<li data-action=\"edit_team_profile_to_show\" data-id=\"{{id}}\"><a>{{#t}}No ocultar{{\/t}}<\/a><\/li>\n{{else}}\n\t<li data-action=\"edit_team_profile_to_hide\" data-id=\"{{id}}\"><a>{{#t}}Ocultar{{\/t}}<\/a><\/li>\n{{\/if}}\n{{#unless is_scim}}\n\t<li data-action=\"edit_team_profile_to_delete\" class=\"danger\" data-id=\"{{id}}\"><a>{{#t}}Eliminar{{\/t}}<\/a><\/li>\n{{\/unless}}";
TS.raw_templates['admin_loading_msg_row'] = "{{i18n_ns \"loading_messages\"}}\n\n<tr class=\"align_top\" id=\"msg_{{id}}\">\n\t<td class=\"message_cell\">\n\t\t{{message}}\n\t\t<span class=\"show_on_mobile small_top_margin\">{{> member_preview_link_image (getMemberPreviewLinkImageArgs user 24)}}\n\n\t\t<a href=\"\/team\/{{user.id}}\" class=\"align_top very_small_left_margin break_word bold\">\n\t\t\t{{getPrefCompliantMemberName user}}\n\t\t<\/a>\n\t\t<\/span>\n\t<\/td>\n\t<td class=\"author_cell hide_on_mobile\">\n\t\t<span class=\"small_top_margin\">{{makeProfileImage user size=\"24\"}}\n\t\t<a href=\"\/team\/{{user.id}}\" class=\"align_top very_small_left_margin break_word bold\">\n\t\t\t{{getPrefCompliantMemberName user}}\n\t\t<\/a>\n\t\t<\/span>\n\t<\/td>\n\t<td class=\"align_right\">\n\t\t<ts-icon class=\"ts_icon_times_circle subtle_silver delete_link ts_tip ts_tip_top\" data-id=\"{{id}}\" data-action=\"delete_msg\"><span class=\"ts_tip_tip\">{{#t}}Eliminar este mensaje{{\/t}}<\/span><\/ts-icon>\n\t<\/td>\n<\/tr>";
TS.raw_templates['admin_cant_deactivate_modal'] = "{{i18n_ns \"cant_deactivate_modal\"}}\n\n<span class=\"modal-header-image modal-header-image--oops\"><\/span>\n<h3>{{#t}}Imposible eliminar a {full_member_name}{{\/t}}<\/h3>\n<p>{{#t group_list=(listify groups strong=true)}}{full_member_name} forma parte de {groups.length, plural, =1{# grupo}other{# grupos}} asignados a este equipo: {group_list}.{{\/t}}<\/p>\n<p>{{#t}}Para eliminar a {member_name}, es necesario que el administrador de una organizaci\u00f3n lo saque de los grupos de {idp_label} o desvincule los grupos de {team_name}.{{\/t}}<\/p>\n";
TS.raw_templates['admin_cancel_survey_dialog'] = "{{i18n_ns \"admin_billing_item\"}}\n\n<label class=\"normal p-cancel_survey__gray\">{{#t note='Prompt for users who just downgraded from a paid to unpaid plan'}}Si tienes un momento, nos encantar\u00eda saber por qu\u00e9 decidiste cambiar al plan gratuito.{{\/t}}<\/label>\n\n<form action=\"\" id=\"admin_cancel_survey\" name=\"admin_cancel_survey\">\n\t<fieldset class=\"c-radiogroup\">\n\t\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"radio-1\">\n\t\t\t<input type=\"radio\" name=\"cancel_survey\" value=\"switched\" class=\"c-input_radio\" id=\"radio-1\"\/>\n\t\t\t<span class=\"c-label__text normal lato\">{{#t}}Nos hemos cambiado a otra aplicaci\u00f3n de mensajer\u00eda{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"radio-2\">\n\t\t\t<input type=\"radio\" name=\"cancel_survey\" value=\"paid_features_useless\" class=\"c-input_radio\" id=\"radio-2\"\/>\n\t\t\t<span class=\"c-label__text normal lato\">{{#t}}No hemos usado las funciones de pago{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"radio-3\">\n\t\t\t<input type=\"radio\" name=\"cancel_survey\" value=\"expensive\" class=\"c-input_radio\" id=\"radio-3\"\/>\n\t\t\t<span class=\"c-label__text normal lato\">{{#t}}Es demasiado caro{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"radio-4\">\n\t\t\t<input type=\"radio\" name=\"cancel_survey\" value=\"did_not_use\" class=\"c-input_radio\" id=\"radio-4\"\/>\n\t\t<span class=\"c-label__text normal lato\">{{#t}}No hemos usado Slack lo suficiente{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"radio-5\">\n\t\t\t<input type=\"radio\" name=\"cancel_survey\" value=\"no_longer_need\" class=\"c-input_radio\" id=\"radio-5\"\/>\n\t\t\t<span class=\"c-label__text normal lato\">{{#t}}Ya no necesitamos Slack{{\/t}}&nbsp;<\/span>\n\t\t\t<span class=\"c-label__text normal lato p-cancel_survey__gray\">{{#t}}(p. ej. finaliz\u00f3 el proyecto o se cerr\u00f3 la empresa){{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"radio-6\">\n\t\t\t<input type=\"radio\" name=\"cancel_survey\" value=\"other\" class=\"c-input_radio\" id=\"radio-6\"\/>\n\t\t\t<span class=\"c-label__text normal lato\">{{#t}}Otro{{\/t}}<\/span>\n\t\t<\/label>\n\t<\/fieldset>\n\n\t<label class=\"c-label c-label--block\" for=\"cancel_survey_textarea\">\n\t\t<textarea class=\"c-input_textarea\" id=\"cancel_survey_textarea\" maxlength=\"500\" placeholder=\"{{#t note='Placeholder text for a form asking why users downgraded from a paid to unpaid plan'}}A\u00f1adir un comentario...{{\/t}}\"><\/textarea>\n\t<\/label>\n<\/form>\n";
TS.raw_templates['admin_enterprise_reject_confirm'] = "{{i18n_ns \"admin_enterprise\"}}\n\n{{#feature flag=\"feature_admin_enterprise_reject_i18n\"}}\n<h2>{{#t note=\"Declining an invitation to join an Enterprise organization\"}}Are you sure you want to decline this request?{{\/t}}<\/h2>\n<p class=\"large_bottom_margin\">\n\t{{#t}}We\u2019ll send <strong>{name}<\/strong> (<a href=\"mailto:{email}\">{email}<\/a>) a message that\n\tyour team has declined the invitation to join <b>{enterprise}<\/b>. You can add a message below if you\u2019d like.{{\/t}}\n<\/p>\n<p>\n\t{{#t}}<b>Send a Comment to {name}<\/b> <i class=\"subtle_silver\">(Optional)<\/i>{{\/t}}\n<\/p>\n<form>\n\t<textarea id=\"eo_msg\" cols=\"25\" rows=\"5\" placeholder=\"{{#t note=\"Declining an invitation to join an Enterprise organization\"}}Let them know why you\u2019ve declined...{{\/t}}\"><\/textarea>\n<\/form>\n{{\/feature}}\n";
TS.raw_templates['message_retention_warnings'] = "{{i18n_ns 'web_admin'}}\n\n<p class=\"data_retention_warning--long c-alert c-alert--multiline c-alert--boxed c-alert--level_warning display_none\">\n\t<i class=\"c-alert__icon c-deprecated-icon c-icon--warning c-deprecated-icon--vertical-align-baseline\"><\/i>\n\t<span class=\"c-alert__message\">{{#t}}<strong>Solo un aviso<\/strong>: si deseas conservar tus mensajes para siempre, puedes elegir \u201c<strong>Conservar todo<\/strong>\u201d en el men\u00fa desplegable de m\u00e1s arriba.{{\/t}}\n\t<\/span>\n<\/p>\n\n<p class=\"data_retention_warning--short c-alert c-alert--multiline c-alert--boxed c-alert--level_warning display_none\">\n\t<i class=\"c-alert__icon c-deprecated-icon c-icon--warning c-deprecated-icon--vertical-align-baseline\"><\/i>\n\t<span class=\"c-alert__message\">{{#t note=\"data_retention_warning_value will be populated by code with the input duration, i.e. '100 days'\"}}<strong>Esto eliminar\u00e1 todos los mensajes publicados m\u00e1s de <span class=\"data_retention_warning_value\"><\/span>atr\u00e1s<\/strong>. Te aconsejamos que consultes con tu equipo antes de establecer un periodo de retenci\u00f3n tan breve.<\/span>{{\/t}}\n<\/p>\n\n<p class=\"data_retention_warning--not_valid c-alert c-alert--multiline c-alert--boxed c-alert--level_warning display_none\">\n\t<i class=\"c-alert__icon c-deprecated-icon c-icon--warning c-deprecated-icon--vertical-align-baseline\"><\/i>\n\t<span class=\"c-alert__message\">{{#t}}Para eliminar mensajes despu\u00e9s de un periodo de tiempo, introduce un valor superior a cero.<\/span>{{\/t}}\n<\/p>\n\n<p class=\"data_retention_warning--max c-alert c-alert--multiline c-alert--boxed c-alert--level_warning display_none\">\n\t<i class=\"c-alert__icon c-deprecated-icon c-icon--warning c-deprecated-icon--vertical-align-baseline\"><\/i>\n\t<span class=\"c-alert__message\">{{#t}}Cuando configures el periodo de tiempo de eliminaci\u00f3n de mensajes, selecciona una duraci\u00f3n que no supere los 100 a\u00f1os.<\/span>{{\/t}}\n<\/p>\n";
TS.raw_templates['message_retention_dialog'] = "{{i18n_ns 'web_admin'}}\n\n{{#if show_warning}}\n\t<p class=\"c-alert c-alert--boxed c-alert--level_error\">\n\t\t<i class=\"c-alert__icon c-deprecated-icon c-icon--warning c-deprecated-icon--vertical-align-baseline\"><\/i>\n\t\t<span class=\"c-alert__message\">{{#t}}<strong>Aviso:<\/strong> Los mensajes que se eliminan seg\u00fan los ajustes de retenci\u00f3n se borran para siempre. Ya no se podr\u00e1n restaurar ni recuperar, ni siquiera desde Slack.{{\/t}}<\/span>\n\t<\/p>\n{{\/if}}\n<strong>{{#t}}As\u00ed queda tu nueva configuraci\u00f3n:{{\/t}}<\/strong>\n<ul class=\"margin_top_100\">\n\t<li>{{#t note=\"The channel retention setting that was selected for public channels, i.e. Public channels - Keep messages, but don't track revisions\"}}Canales abiertos: {public_channel_retention_setting}{{\/t}}<\/li>\n\t<li>{{#t note=\"The channel retention setting that was selected for private channels, i.e. Private channels - Keep messages, but don't track revisions\"}}Canales cerrados: {private_channel_retention_setting}{{\/t}}<\/li>\n\t{{#pageNeedsEnterprise}}\n\t{{else}}\n\t\t<li>{{#t note=\"The channel retention setting that was selected for direct messages, i.e. Direct messages - Keep messages, but don't track revisions\"}}Mensajes directos: {dm_retention_setting}{{\/t}}<\/li>\n\t{{\/pageNeedsEnterprise}}\n\t<li>\n\t\t{{#if allow_override}}\n\t\t\t{{#t}}Los miembros del espacio pueden anular estos ajustes{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Los miembros del espacio no pueden anular estos ajustes{{\/t}}\n\t\t{{\/if}}\n\t<\/li>\n<\/ul>\n";
