TS.raw_templates['apps_restrict_app_modal_body'] = "{{i18n_ns \"apps\"}}\n{{#if is_api_tester}}\n\t<p class=\"no_margin\">\n\t\t{{#if user_name}}\n\t\t\t{{#t}}Le enviaremos a <b>{user_name}<\/b> un mensaje que diga que has rechazado su solicitud.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Le enviaremos a este usuario un mensaje que diga que has rechazado su solicitud.{{\/t}}\n\t\t{{\/if}}\n\t<\/p>\n{{else if is_custom_integration}}\n\t<p class=\"no_margin\">\n\t\t{{#if user_name}}\n\t\t\t{{#if app_name}}\n\t\t\t\t{{#t}}<b>{user_name}<\/b> no podr\u00e1 a\u00f1adir una configuraci\u00f3n para {app_name}.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}<b>{user_name}<\/b> no podr\u00e1 a\u00f1adir una configuraci\u00f3n para esta app.{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t{{#if app_name}}\n\t\t\t\t{{#t}}Este usuario no podr\u00e1 a\u00f1adir una configuraci\u00f3n para {app_name}.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Este usuario no podr\u00e1 a\u00f1adir una configuraci\u00f3n para esta aplicaci\u00f3n.{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/p>\n{{else}}\n\t<p>\n\t\t{{#if request_id}}\n\t\t\t{{#if app_name}}\n\t\t\t\t{{#t}}No se permitir\u00e1 que los miembros a\u00f1adan o editen configuraciones de {app_name}.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Los miembros no podr\u00e1n a\u00f1adir ni modificar las configuraciones de esta aplicaci\u00f3n.{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t{{#if app_name}}\n\t\t\t\t{{#t}}Los miembros no podr\u00e1n a\u00f1adir o editar configuraciones de {app_name}.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Los miembros no podr\u00e1n a\u00f1adir o editar las configuraciones de esta aplicaci\u00f3n.{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/p>\n\t<p class=\"no_margin\">\n\t\t{{#if config_count}}\n\t\t\t\t{{#t}}\n\t\t\t\t\t<b>{config_count, plural, =1 {# configuraci\u00f3n existente} other {# configuraciones existentes}}<\/b> se mantendr\u00e1(n) en funcionamiento hasta que se elimine(n) de las aplicaciones del espacio.\n\t\t\t\t{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}No existe ninguna configuraci\u00f3n.{{\/t}}\n\t\t{{\/if}}\n\t<\/p>\n{{\/if}}\n";
TS.raw_templates['apps_request_app_modal_body'] = "{{i18n_ns \"app_request\"}}\n{{#if require_comment}}\n    <textarea id=\"whitelist_request_msg\" class=\"no_bottom_margin\" placeholder=\"{{#t}}Incluye un mensaje para tus administradores{{\/t}}\"><\/textarea>\n{{else}}\n    <textarea id=\"whitelist_request_msg\" class=\"no_bottom_margin\" placeholder=\"{{#t}}A\u00f1ade un mensaje optativo para tus administradores{{\/t}}\"><\/textarea>\n{{\/if}}\n<span id=\"whitelist_request_comment_required\" class=\"modal_input_note mustard_yellow hidden margin_auto block\">\n    {{#t note=\"Validation error message if 'note' field was required but not provided\"}}Tienes que incluir una nota para tus administradores{{\/t}}\n<\/span>\n";
