TS.raw_templates['developer_apps_collaborator_row'] = "{{i18n_ns \"developer_apps\"}}\n<div class=\"collaborator_row\" data-id={{id}}>\n\t{{#if team_url}}<a href=\"{{team_url}}team\/{{id}}\" class=\"indifferent_grey\">{{\/if}}\n\t\t<img class=\"small_border_radius constrain_24\" src=\"{{image}}\"><!-- ignore whitespace\n\t     --><span class=\"bold left_padding align_middle\">{{name}}<\/span><!--\n     -->{{#if team_url}}<\/a>{{\/if}}\n\t{{#if subtext}}\n\t\t<span class=\"align_middle\">({{subtext}})<\/span>\n\t{{\/if}}\n\t<div class=\"float_right\">\n\t\t{{#if button}}\n\t\t\t<div class=\"ts_tip ts_tip_left ts_tip_multiline ts_tip_float\">\n\t\t\t\t<button class=\"btn btn_small btn_outline align_middle{{#if only_row}} disabled{{\/if}}\" type=\"button\" data-action={{button_action}} data-id={{id}}>\n\t\t\t\t\t{{button}}\n\t\t\t\t<\/button>\n\t\t\t\t<span id=\"disable_leave_tooltip\" class=\"ts_tip_tip{{#unless only_row}} hidden{{\/unless}}\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">\n\t\t\t\t\t\t{{#t}}Antes de que puedas salir, tienes que a\u00f1adir a otro colaborador.{{\/t}}\n\t\t\t\t\t<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t\t<div id=\"saver_hook\" class=\"inline\"><\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['developer_apps_collaborator_list'] = "{{i18n_ns 'developer_apps'}}\n<table class=\"full_width middle_border\">\n\t<tbody id=\"collaborators_tbody\">\n\t\t{{#each app_collaborators as |collaborator|}}\n\t\t\t<tr><td>\n\t\t\t\t{{#if_equal ..\/user_id compare=collaborator.id}}\n\t\t\t\t\t{{#if_equal ..\/app_collaborators.length compare=1}}\n\t\t\t\t\t\t{{> developer_apps_collaborator_row collaborator subtext=(t \"t\u00fa\") button=(t \"Salir\") button_action='collaborator_remove' team_url=..\/team_url only_row=true}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{> developer_apps_collaborator_row collaborator subtext=(t \"t\u00fa\") button=(t \"Salir\") button_action='collaborator_remove' team_url=..\/team_url}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#if ..\/user_is_guest}}\n\t\t\t\t\t\t{{> developer_apps_collaborator_row collaborator team_url=..\/team_url}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{> developer_apps_collaborator_row collaborator button=(t \"Eliminar\") button_action='collaborator_remove' team_url=..\/team_url}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if_equal}}\n\t\t\t<\/td><\/tr>\n\t\t{{\/each}}\n\t<\/tbody>\n<\/table>\n<select id=\"lfs_new_collaborator\" class=\"hidden\"><\/select>\n";
TS.raw_templates['developer_apps_event_table'] = "{{i18n_ns \"developer_apps\"}}\n<div class=\"{{type}}_events_table_container\">\n\t<table id=\"{{type}}_events_table\" class=\"events_table full_width no_bottom_border no_bottom_margin {{#unless events}} hidden{{\/unless}}\">\n\t\t<thead>\n\t\t\t<tr>\n\t\t\t\t<th class=\"no_bottom_margin no_border\">\n\t\t\t\t\t{{#t note=\"heading descriptions for Events API events\"}}Nombre del evento{{\/t}}\n\t\t\t\t<\/th>\n\t\t\t\t<th class=\"no_bottom_margin no_border\">\n\t\t\t\t\t{{#t note=\"heading descriptions for Events API events\"}}Descripci\u00f3n{{\/t}}\n\t\t\t\t<\/th>\n\t\t\t\t{{#unless is_bot}}\n\t\t\t\t\t<th class=\"no_bottom_margin no_border\">\n\t\t\t\t\t\t{{#t note=\"heading descriptions for Events API events\"}}\u00c1mbito requerido{{\/t}}\n\t\t\t\t\t<\/th>\n\t\t\t\t{{\/unless}}\n\t\t\t<\/tr>\n\t\t<\/thead>\n\t\t\t{{#each events as |event|}}\n\t\t\t<tbody>\n\t\t\t\t\t<tr class=\"no_padding\"\n\t\t\t\t\t\t{{#unless event.current}}data-pending{{\/unless}}\n\t\t\t\t\t\tdata-event-type=\"{{@key}}\" data-event-scope=\"{{event.scope}}\"\n\t\t\t\t\t\tdata-event-description=\"{{event.description}}\" data-table=\"{{..\/type}}\"\n\t\t\t\t\t>\n\t\t\t\t\t\t<td class=\"no_bottom_padding\">\n\t\t\t\t\t\t\t<a class=\"overflow_ellipsis small {{#if event.pending_removal}}pending_removal{{\/if}} {{#if event.current}}current_{{else}}pending_{{\/if}}event_subscription_name\"\n\t\t\t\t\t\t\t\thref=\"\/events\/{{@key}}\" target=\"_blank\" data-is-pending-removal=\"{{#if pending_removal}}true{{else}}false{{\/if}}\">\n\t\t\t\t\t\t\t\t{{@key}}\n\t\t\t\t\t\t\t<\/a>\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t\t<td class=\"no_bottom_padding medium_right_padding {{#if event.pending_removal}}pending_removal{{\/if}}\">\n\t\t\t\t\t\t\t<p class=\"event_description small\">{{event.description}}<\/p>\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t\t{{#unless ..\/is_bot}}\n\t\t\t\t\t\t\t<td class=\"no_bottom_padding {{#if event.pending_removal}}pending_removal{{\/if}}\">\n\t\t\t\t\t\t\t\t<p class=\"event_scope small\">{{#if event.scope}}{{event.scope}}{{else}}<span class=\"subtle_silver\">{{#t note=\"text for no scopes needed\"}}ninguno{{\/t}}<\/span>{{\/if}}<\/p>\n\t\t\t\t\t\t\t<\/td>\n\t\t\t\t\t\t{{\/unless}}\n\t\t\t\t\t\t<td class=\"no_bottom_padding\">\n\t\t\t\t\t\t\t{{!-- We set the flex direction to row_reverse so that if no description exists, the icons still appear on the right hand side  --}}\n\t\t\t\t\t\t\t<div class=\"display_flex flex_direction_row_reverse no_wrap\">\n\t\t\t\t\t\t\t\t\t<ts_icon class=\"{{#if event.current}}delete_event{{else}}remove_event{{\/if}} {{#if event.pending_removal}}ts_icon_undo{{else}}ts_icon_trash{{\/if}} btn_icon ts_icon cursor_pointer\"\n\t\t\t\t\t\t\t\t\t\taria-label=\"{{#t}}Eliminar{{\/t}}\">\n\t\t\t\t\t\t\t\t\t<\/ts_icon>\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t<\/tbody>\n\t\t\t{{else}}\n\t\t\t\t<tbody class=\"no_border\">\n\t\t\t\t\t<tr class=\"no_bottom_border\">\n\t\t\t\t\t\t<td class=\"subtle_silver small\">{{#t note=\"no Events API events added yet\"}}A\u00fan no se han a\u00f1adido eventos.{{\/t}}<\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t<\/tbody>\n\t\t\t{{\/each}}\n\t<\/table>\n<\/div>\n";
TS.raw_templates['developer_apps_new_modal'] = "{{i18n_ns \"developer_apps\"}}\n{{!-- Possible Error --}}\n<p class=\"alert alert_error hidden\" id=\"developer_apps_new_error\">\n\t<ts-icon class=\"ts_icon ts_icon_warning\"><\/ts-icon>\n\t<span class=\"error_message\">{{#t note=\"Generic error message when something goes wrong when a third party developer fills in a form to create an app\"}}\u00a1Uy!, algo ha fallado. \u00bfIntentarlo de nuevo?{{\/t}}<\/span>\n<\/p>\n\n<form action=\"\/apps\/create_new\" enctype=\"multipart\/form-data\" method=\"post\" id=\"developer_apps_new_form\" class=\"p-new_app_creation__form\" data-qa=\"new_app_dialog{{#if_equal token_type compare=\"xoxa\"}}_wta{{\/if_equal}}\">\n\t<input type=\"hidden\" name=\"done\" value=\"1\">\n\t<input type=\"hidden\" name=\"crumb\" value=\"{{crumb}}\">\n\n\t{{#feature flag=\"feature_wta_stop_creation\"}}\n\t{{else}}\n\t{{#if_equal token_type compare=\"xoxp\"}}\n\t<a href=\"\/slack-apps-preview\" target=\"_blank\" class=\"p-app_creation_banner__anchor\">\n\t\t<div class=\"p-app_creation_banner {{#if env_is_dev}}p-app_creation_banner--is-dev{{\/if}}\">\n\n\t\t\t{{> developer_apps_new_modal_flask_svg}}\n\n\t\t\t<div class=\"p-app_creation_banner__content\">\n\t\t\t\t<h2 class=\"p-app_creation_banner__header\">{{#t note=\"Title text of a call to action to a blog post\"}}\u00bfTe interesa la pr\u00f3xima generaci\u00f3n de aplicaciones?{{\/t}}<\/h2>\n\t\t\t\t<p class=\"p-app_creation_banner__para\">{{#t note=\"call to action text\"}}Estamos mejorando el desarrollo y distribuci\u00f3n de aplicaciones. \u00danete al periodo Versi\u00f3n preliminar de la API y prueba los tokens de espacio de trabajo y la API Permisos.{{\/t}}<\/p>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/a>\n\t{{\/if_equal}}\n\t{{\/feature}}\n\n\t{{!-- App Name --}}\n\t<label for=\"name\">{{#t note=\"Title of the form which shows up in a modal when a third party developer wishes to create an app\"}}Nombre de la aplicaci\u00f3n{{\/t}}<\/label>\n\t<input type=\"text\" name=\"name\" data-qa=\"app_name\" placeholder=\"{{#t note=\"Placeholder text for a name of an app\"}}p. ej. Super Service{{\/t}}\" class=\"no_bottom_margin overflow_ellipsis\" value=\"\" autocomplete=\"off\"\n\t\tdata-validation=\"required keywords maxlength=35\">\n\t<aside class=\"p-new_app_creation__aside medium_bottom_margin\">{{#t note=\"Helper text reassuring a third party developer that the name they chose for their app can be changed at a later date\"}}No te preocupes, podr\u00e1s cambiarlo m\u00e1s tarde.{{\/t}}<\/aside>\n\n\t{{!-- Team Selector --}}\n\t<label for=\"team_id\">{{#t note=\"Label for a dropdown where a third party developer chooses Slack Team their proposed app will belong to\"}}Espacio de desarrollo de Slack{{\/t}}<\/label>\n\t<div id=\"team_id_picker\" data-qa=\"team_picker\"><\/div>\n\t{{!-- Hidden input for id of team selected, since the team selector is actually a menu --}}\n\t<input name=\"team_id\" class=\"hidden\" value=\"\" data-validation=\"required\" \/>\n\t<aside class=\"p-new_app_creation__aside medium_bottom_margin\">\n\t\t{{#t note=\"helper text letting the third party developer know what happens to the app they're creating if they leave their team\"}}Tu aplicaci\u00f3n pertenece a este espacio. Si abandonas el espacio, perder\u00e1s la capacidad de gestionar esta aplicaci\u00f3n. Lamentablemente este cambio no se puede deshacer m\u00e1s adelante.{{\/t}}\n\t<\/aside>\n\n\t<input type=\"hidden\" name=\"app_type\" value=\"{{token_type}}\">\n\n\t{{!-- ToS Agreement --}}\n\t<div class=\"small\">{{#t note=\"Legal copy targetted towards a third party developer creating an app using our api\"}}Al crear una aplicaci\u00f3n web API, aceptas las <a target=\"_blank\" href=\"\/terms-of-service\/api\">Condiciones de Servicio de la API de Slack<\/a>.{{\/t}}<\/div>\n<\/form>\n";
