TS.raw_templates['developer_apps_submit_confirmation_modal'] = "{{i18n_ns \"developer_apps\"}}\n<table class=\"full_width small top_margin\">\n\t<tbody>\n\t\t{{#if has_display_info}}\n\t\t\t<tr class=\"no_border\">\n\t\t\t\t<td colspan=\"2\">\n\t\t\t\t\t<h4 class=\"no_bottom_margin\">{{#t}}Informaci\u00f3n mostrada{{\/t}}<\/h4>\n\t\t\t\t<\/td>\n\t\t\t<\/tr>\n\t\t\t{{#or name icon_src}}\n\t\t\t\t<tr {{#if icon_src}}class=\"align_middle\"{{\/if}}>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}Nombre e icono de app{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">\n\t\t\t\t\t\t{{#if icon_src}}<img src=\"{{icon_src}}\" class=\"rounded constrain_48 right_margin\"\/>{{\/if}}\n\t\t\t\t\t\t{{#if name}}{{name}}{{\/if}}\n\t\t\t\t\t<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/or}}\n\t\t\t{{#if desc}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}Descripci\u00f3n corta{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">{{desc}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/if}}\n\t\t\t{{#if long_desc_formatted}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}Descripci\u00f3n larga{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">{{dangerouslyRenderHTML long_desc_formatted}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/if}}\n            {{#if app_card_color}}\n                <tr>\n                    <td class=\"submission_modal_row_title\">{{#t}}Color de fondo{{\/t}}<\/td>\n                    <td class=\"submission_modal_cell\">\n                        <div class=\"app_card_color_bg constrain_24 inline_block rounded align_middle\" style=\"background-color: {{app_card_color}};\"><\/div>\n                        <div class=\"very_small_left_margin inline_block align_middle\">{{app_card_color}}<\/div>\n                    <\/td>\n                <\/tr>\n            {{\/if}}\n            {{#if youtube_url}}\n                <tr>\n                    <td class=\"submission_modal_row_title\">{{#t}}URL de YouTube{{\/t}}<\/td>\n                    <td class=\"submission_modal_cell\">{{youtube_url}}<\/td>\n                <\/tr>\n            {{\/if}}\n            {{#if screenshots}}\n                <tr>\n                    <td class=\"submission_modal_row_title\">{{#t}}Im\u00e1genes de la aplicaci\u00f3n{{\/t}}<\/td>\n                    <td class=\"submission_modal_cell submission_modal_cell_screenshots\">\n                        {{#each screenshots}}\n                            <img src=\"{{this.image_440}}\" class=\"submission_screenshot\" \/>\n                        {{\/each}}\n                    <\/td>\n                <\/tr>\n            {{\/if}}\n\t\t\t{{#if url}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}P\u00e1gina de presentaci\u00f3n{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">{{url}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/if}}\n\t\t\t{{#if privacy_link}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}URL de la Pol\u00edtica de Privacidad{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">{{privacy_link}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/if}}\n\t\t\t{{#if support_url}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}URL de asistencia t\u00e9cnica{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">{{support_url}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/if}}\n\t\t\t{{#if support_email}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}Correo de asistencia t\u00e9cnica{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"submission_modal_cell\">{{support_email}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\n\t\t{{#if has_oauth_info}}\n\t\t\t<tr class=\"no_border\">\n\t\t\t\t<td colspan=\"2\">\n\t\t\t\t\t<h4 class=\"very_large_top_margin no_bottom_margin\">{{#t}}OAuth y permisos{{\/t}}<\/h4>\n\t\t\t\t<\/td>\n\t\t\t<\/tr>\n\t\t\t{{#or redirect_uris.length deleted.redirect_uris.length}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"submission_modal_row_title\">{{#t}}URL de