TS.raw_templates['developer_apps_url_table_editor_row'] = "<div data-row=\"{{ index }}\" class=\"clearfix very_small_bottom_padding small_top_padding p-url_table_editor__container\">\n\t<div class=\"float_left p-url_table_editor__fields\">\n\t\t{{#if is_delete_mode}}\n\t\t\t<input type=\"url\" name=\"urls[{{ index }}]{{#if id}}_{{id}}{{\/if}}\" class=\"p-url_table_editor__deleted_state small no_margin c-url_table_editor__input\" data-url-table-editor-row value=\"{{ url }} was deleted\" disabled>\n\t\t{{else}}\n\t\t\t<input type=\"url\" name=\"urls[{{ index }}]{{#if id}}_{{id}}{{\/if}}\" class=\"small no_margin p-url_table_editor__input\" data-qa=\"app_unfurl_domain\" value=\"{{ url }}\" {{#if is_read_mode}}disabled{{\/if}} data-url-table-editor-input data-validation=\"{{ validation }}\"{{#if placeholder}} placeholder=\"{{placeholder}}\"{{\/if}}>\n\t\t\t<label for=\"urls[{{ index }}]{{#if id}}_{{id}}{{\/if}}\" class=\"no_margin\"><\/label>\n\t\t\t<span class=\"validation_message\"><\/span>\n\t\t\t{{#feature flag=\"feature_token_ip_whitelist\"}}\n\t\t\t\t<span class=\"subtle_silver p-url_table_editor__annotation\" data-annotation-row=\"{{index}}\">{{#if annotation}}{{annotation}}{{\/if}}<\/span>\n\t\t\t{{\/feature}}\n\t\t{{\/if}}\n\t<\/div>\n\t<div class=\"float_left p-url_table_editor__actions\">\n\t\t{{#if is_create_mode}}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"cancel-create\" button_class=\"btn btn_outline small_left_margin float_left\" button_text=cancel_button_text }}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"save-create\" button_class=\"btn small_left_margin float_left\" data-qa=\"activate_enable_events_toggle\" button_text=save_button_text }}\n\t\t{{\/if}}\n\t\t{{#if is_read_mode}}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"edit\" button_class=\"btn_icon btn_outline btn p-url_table_editor__buttons ts_icon ts_icon_pencil\" }}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"delete\" button_class=\"btn_icon btn_outline btn p-url_table_editor__buttons ts_icon ts_icon_trash\" }}\n\t\t{{\/if}}\n\t\t{{#if is_edit_mode}}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"cancel-update\" button_class=\"btn btn_outline small_left_margin float_left\" button_text=cancel_button_text }}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"save-update\" button_class=\"btn small_left_margin float_left\" data-qa=\"activate_enable_events_toggle\" button_text=edit_button_text }}\n\t\t{{\/if}}\n\t\t{{#if is_delete_mode}}\n\t\t\t{{> developer_apps_url_table_editor_button action=\"restore\" button_class=\"btn_icon p-url_table_editor__buttons btn_outline btn ts_icon ts_icon_undo\"}}\n\t\t{{\/if}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['developer_apps_url_table_editor_button'] = "<button data-qa=\"url_{{action}}\" data-js-url-editor=\"{{ action }}\" class=\"editor-button {{ button_class }}\">{{ button_text }}<\/button>";
TS.raw_templates['gdrive_coachmark'] = "{{i18n_ns 'google_drive'}}\n\n<div id=\"gdrive_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t\t<h2 class=\"black\">{{#t}}Google Drive, ahora a un clic{{\/t}}<\/h2>\n\t\t\t<p>\n\t\t\t\t{{#t}}Importa archivos Google Drive con este pr\u00e1ctico bot\u00f3n. O bien, crea nuevos Documentos, Presentaciones y Hojas de c\u00e1lculo de Google sin salir de Slack.{{\/t}}\n\t\t\t<\/p>\n\t<\/div>\n<\/div>";
TS.raw_templates['developer_apps_permission_scopes_table'] = "{{i18n_ns \"developer_apps\"}}\n{{#each groups}}\n\t<table class=\"full_width no_bottom_margin{{#if ..\/show_reasons}} permission_scopes_group_table{{\/if}}\">\n\t\t<thead>\n\t\t\t<tr class=\"off_white_bg tiny permission_scopes_table_row\">\n\t\t\t\t<th class=\"small_left_padding very_small_top_padding very_small_bottom_padding no_border\">{{this.group_name}}<\/th>\n\t\t\t\t<th class=\"very_small_top_padding very_small_bottom_padding no_border\">{{#if ..\/show_reasons}}{{#t note=\"Heading in table column where user inputs their reason for using a scope\"}}RAZON PARA UTILIZAR \u00c1MBITO{{\/t}}{{\/if}}<\/th>\n\t\t\t<\/tr>\n\t\t<\/thead>\n\t\t<tbody>\n\t\t\t{{#each this.children}}\n\t\t\t\t<tr class=\"permission_scopes_table_row\">\n\t\t\t\t\t<td class=\"small_left_padding top_padding bottom_padding\">\n\t\t\t\t\t\t<p class=\"bold no_margin\">{{this.description}}<\/p>\n\t\t\t\t\t\t<span class=\"subtle_silver\">\n\t\t\t\t\t\t\t{{this.name}}\n\t\t\t\t\t\t<\/span>\n\t\t\t\t\t<\/td>\n\t\t\t\t\t<td class=\"top_padding bottom_padding no_right_padding display_flex align_items_center{{#if ..\/..\/show_reasons}}{{else}} justify_content_end{{\/if}}\">\n\t\t\t\t\t\t{{#if ..\/..\/show_reasons}}<textarea rows=\"1\" data-scope-reason=\"{{this.name}}\" class=\"no_bottom_margin small_padding permission_scopes_table_reason\" placeholder=\"{{#t note='Placeholder text where user input reason for using scope'}}Raz\u00f3n para utilizar \u00e1mbito...{{\/t}}\">{{this.reason}}<\/textarea>{{\/if}}\n\t\t\t\t\t\t<ts-icon{{#unless this.required}} data-remove-scope=\"{{this.name}}\"{{\/unless}} class=\"ts_icon_trash cursor_pointer left_margin{{#if this.required}} subtle_silver ts_tip ts_tip_top ts_tip_multiline ts_tip_float{{\/if}}{{#if ..\/..\/show_reasons}}{{else}} small_top_margin{{\/if}}\">\n\t\t\t\t\t\t\t{{#if this.required}}\n\t\t\t\t\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t note=\"Text in tooltip for a required scope\"}}El funcionamiento de tu aplicaci\u00f3n requiere este \u00e1mbito y no puede eliminarse.{{\/t}}<\/span>\n\t\t\t\t\t\t\t\t<\/span>\n\t\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t<\/ts-icon>\n\t\t\t\t\t<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/each}}\n\t\t<\/tbody>\n\t<\/table>\n{{\/each}}\n";
TS.raw_templates['developer_apps_permission_scopes_lfs_item'] = "{{i18n_ns \"developer_apps\"}}\n\n<span class=\"permission_scopes_filter_select_description float_left overflow_ellipsis inline_block{{#if chosen}} subtle_silver{{\/if}}\">{{description}}{{#if chosen}} {{#t}}(Ya se ha a\u00f1adido){{\/t}}{{\/if}}<\/span>\n<span class=\"float_right subtle_silver\">{{name}}<\/span>\n";
TS.raw_templates['developer_apps_distribute_deactivate_modal'] = "{{i18n_ns 'apps'}}\n\n<div>\n\n\t<div class=\"alert alert_error\">\n\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t\t{{#t}}\n\t\t\t\t<p>\u00bfDe verdad que quieres desactivar la distribuci\u00f3n p\u00fablica? \u00danicamente tu espacio podr\u00e1 instalar esta aplicaci\u00f3n.<\/p>\n\t\t\t<p class=\"no_margin\">Con ello, tu aplicaci\u00f3n se eliminar\u00e1 de los espacios que la hayan instalado. Si vuelves a activar la distribuci\u00f3n, tendr\u00e1n que reinstalarla en otros espacios.<\/p>\n\t\t\t{{\/t}}\n\t<\/div>\n<\/div>\n<div>\n\t<label for=\"app_name\">{{#t note=\"Label for input where developer needs to input app name to confirm deactivation of distribution\"}}Introduce el nombre de tu aplicaci\u00f3n para desactivar la distribuci\u00f3n p\u00fablica{{\/t}}<\/label>\n\t<input type=\"text\" class=\"small\" name=\"app_name\" placeholder=\"{{app_name}}\" data-validation=\"matches_placeholder\">\n<\/div>\n";
TS.raw_templates['file_header'] = "{{i18n_ns \"files\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n\n\t<div class=\"flexpane_file_title\"\n\t\t{{#if member.is_bot}}\n\t\t\tdata-app-id=\"{{member.app_id}}\" data-bot-id=\"{{member.id}}\"\n\t\t{{\/if}}\n\t>\n\t\t{{#if member.is_bot}}\n\t\t\t{{makeProfileImage member size=\"36\"}}\n\t\t{{else}}\n\t\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs member 36)}}\n\t\t{{\/if}}\n\n\t\t<span class=\"{{getMemberColorClassById member.id}}\">{{{makeMemberPreviewLink member}}}<\/span>\n\n\t\t{{#or member.profile.status_emoji member.profile.status_text}}\n\t\t\t{{> current_status for_message=true}}\n\t\t{{\/or}}\n\n\t\t<span class=\"title break_word\">\n\t\t\t{{#if is_post}}\n\t\t\t\t{{#if preview}}\n\t\t\t\t\t<a href=\"{{file.permalink}}\" {{#isClient}}target=\"{{file.id}}\"{{\/isClient}} data-file-id=\"{{file.id}}\" class=\"file_new_window_link\">{{#t privacy_label=(makeFilePrivacyLabel file) note=\"Can be 'draft', 'shared', or 'private'\"}}nota {privacy_label}{{\/t}}<\/a>\n\t\t\t\t{{else}}\n\t\t\t\t\t<a href=\"{{file.permalink}}\" {{#isClient}}target=\"{{file.id}}\"{{\/isClient}} data-file-id=\"{{file.id}}\" class=\"file_new_window_link\">{{{highlightSearchMatchesInFileTitle file.title}}}<\/a>\n\t\t\t\t{{\/if}}\n\t\t\t{{else}}\n\t\t\t\t<a href=\"{{file.permalink}}\" {{#isClient}}target=\"{{file.id}}\"{{\/isClient}} data-file-id=\"{{file.id}}\" class=\"{{#unless preview}}file_preview_link {{\/unless}}{{#fileIsImage id=file.id}}file_viewer_channel_link file_viewer_link{{\/fileIsImage}}\">{{{highlightSearchMatchesInFileTitle file.title}}}<\/a>\n\t\t\t{{\/if}}\n\n\t\t\t<span class=\"no_wrap\">\n\t\t\t\t{{starWithTip 'file' file null}}\n\t\t\t<\/span>\n\t\t<\/span>\n\n\t\t{{#isClient}}\n\t\t<ul class=\"file_action_list no_bullets no_bottom_margin float_right\">\n\n\t\t\t{{#if download}}\n\t\t\t\t<li class=\"file_action_item inline_block\">\n\t\t\t\t\t<a class=\"ts_tip ts_tip_bottom file_ssb_download_link\" data-file-id=\"{{file.id}}\" href=\"{{file.url_private_download}}\" target=\"{{newWindowName}}\">\n\t\t\t\t\t\t<span class=\"ts_tip_btn ts_icon ts_icon_cloud_download\"><\/span>\n\t\t\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Descargar{{\/t}}<\/span>\n\t\t\t\t\t<\/a>\n\t\t\t\t<\/li>\n\t\t\t{{\/if}}\n\n\t\t\t{{#if edit}}\n\t\t\t\t<li class=\"file_action_item inline_block\">\n\t\t\t\t\t<a data-file-id=\"{{file.id}}\" class=\"ts_tip ts_tip_bottom file file_new_window_link{{#if is_snippet}} snippet_edit_dialog_link{{else}} ts_tip_rightish{{\/if}}\"\n\t\t\t\t\t\t{{#if is_snippet}}\n\t\t\t\t\t\t\thref=\"{{file.edit_link}}\" target=\"{{file.edit_link}}\"\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\thref=\"{{edit_link}}\" target=\"{{edit_link}}\"\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t>\n\t\t\t\t\t\t<span class=\"ts_tip_btn ts_icon {{#if is_snippet}}ts_icon_pencil{{else}}ts_icon_external_link{{\/if}}\"><\/span>\n\t\t\t\t\t\t<span class=\"ts_tip_tip\">{{#if is_snippet}}{{#t}}Editar{{\/t}}{{else}}{{#t}}Editar en nueva ventana{{\/t}}{{\/if}}<\/span>\n\t\t\t\t\t<\/a>\n\t\t\t\t<\/li>\n\t\t\t{{else}}\n\n\t\t\t\t<li class=\"file_action_item inline_block\">\n\t\t\t\t\t{{#if file.is_external}}\n\t\t\t\t\t\t<a class=\"ts_tip ts_tip_bottom ts_tip_rightish\" href=\"{{file.url_private}}\" target=\"{{newWindowName}}\">\n\t\t\t\t\t\t\t<span class=\"ts_tip_btn ts_icon ts_icon_external_link\"><\/span>\n\t\t\t\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t\t\t\t{{#if_equal file.external_type compare=\"gdrive\"}}\n\t\t\t\t\t\t\t\t\t{{#t}}Abrir archivo en Google\u00a0Drive{{\/t}}\n\t\t\t\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t\t\t\t{{#if_equal file.external_type compare=\"dropbox\"}}\n\t\t\t\t\t\t\t\t\t{{#t}}Abrir archivo en Dropbox{{\/t}}\n\t\t\t\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t\t\t\t{{#if_equal file.external_type compare=\"box\"}}\n\t\t\t\t\t\t\t\t\t{{#t}}Abrir archivo en Box{{\/t}}\n\t\t\t\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t\t\t\t{{#if_equal file.external_type compare=\"onedrive\"}}\n\t\t\t\t\t\t\t\t\t{{#t}}Abrir el archivo en OneDrive{{\/t}}\n\t\t\t\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t\t\t\t{{#if_equal file.external_type compare=\"unknown\"}}\n\t\t\t\t\t\t\t\t\t{{#t}}Abrir el archivo en una p\u00e1gina web{{\/t}}\n\t\t\t\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t\t\t<\/span>\n\t\t\t\t\t\t<\/a>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#fileIsImage id=file.id}}\n\t\t\t\t\t\t\t<a class=\"ts_tip ts_tip_bottom ts_tip_rightish\" href=\"{{file.url_private}}\" target=\"{{file.id}}\">\n\t\t\t\t\t\t\t\t<span class=\"ts_tip_btn ts_icon ts_icon_external_link\"><\/span>\n\t\t\t\t\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Abrir el original{{\/t}}<\/span>\n\t\t\t\t\t\t\t<\/a>\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t{{#fileOpensOnTeamSite id=file.id}}\n\t\t\t\t\t\t\t\t<a class=\"ts_tip ts_tip_bottom ts_tip_rightish file_new_window_link\" href=\"{{file.permalink}}\" target=\"{{file.permalink}}\" data-file-id=\"{{file.id}}\">\n\t\t\t\t\t\t\t\t\t<span class=\"ts_tip_btn ts_icon ts_icon_external_link\"><\/span>\n\t\t\t\t\t\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Abrir en nueva ventana{{\/t}}<\/span>\n\t\t\t\t\t\t\t\t<\/a>\n\t\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t\t<a class=\"ts_tip ts_tip_bottom ts_tip_rightish\" href=\"{{file.url_private}}\" target=\"{{file.id}}\">\n\t\t\t\t\t\t\t\t\t<span class=\"ts_tip_btn ts_icon ts_icon_external_link\"><\/span>\n\t\t\t\t\t\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Abrir el original{{\/t}}<\/span>\n\t\t\t\t\t\t\t\t<\/a>\n\t\t\t\t\t\t\t{{\/fileOpensOnTeamSite}}\n\t\t\t\t\t\t{{\/fileIsImage}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t\t<\/a>\n\t\t\t\t<\/li>\n\t\t\t{{\/if}}\n\n\t\t\t<li class=\"file_action_item inline_block\">\n\t\t\t\t<button type=\"button\" class=\"btn_unstyle ts_tip ts_tip_bottom ts_tip_right file_actions\" data-file-id=\"{{file.id}}\"\n\t\t\t\t\tdata-exclude-pin=\"true\"\n\t\t\t\t\tdata-exclude-comment=\"true\"\n\t\t\t\t\tdata-include-view-public-link=\"true\"\n\t\t\t\t\t{{#if download}}data-exclude-download=\"true\"{{\/i