TS.raw_templates['file_sharing'] = "{{i18n_ns 'files'}}\n\n<div id=\"file_sharing_div\">\n\n\t<div class=\"small_bottom_margin clear_both\">\n\t\t<input type=\"hidden\" id=\"share_model_ob_id\" value=\"{{#if selection}}{{selection}}{{else}}{{#if model_ob.is_im}}{{model_ob.user}}{{else}}{{model_ob.id}}{{\/if}}{{\/if}}\">\n\t\t<label for=\"share_cb\" class=\"{{#isWeb}}block{{\/isWeb}} small_bottom_margin\">\n\t\t\t<input id=\"share_cb\" checked=\"checked\" name=\"share_cb\" type=\"checkbox\" class=\"no_top_margin small_right_margin {{#if hide_checkbox}}hidden{{\/if}}\" tabindex=\"2\">\n\t\t\t{{#or model_ob.is_im model_ob.is_mpim}}\n\t\t\t\t<span id=\"share_context_label\">{{#t}}Compartir con{{\/t}}<\/span>\n\t\t\t{{else}}\n\t\t\t\t<span id=\"share_context_label\">{{#t}}Compartir en{{\/t}}<\/span>\n\n\t\t\t{{\/or}}\n\t\t<\/label>\n\n\t\t<div id=\"select_share_channels\" class=\"file_share_select inline_block no_margin\"><\/div>\n\n\t\t{{#isWeb}}<br \/>{{\/isWeb}}\n\n\t\t<div id=\"select_share_channel_warning\" class=\"modal_alert_sharing {{#unless shared_channel_warning}}hidden{{\/unless}}\">\n\t\t\t<span id=\"select_share_channel_warning_text\">{{shared_channel_warning}}<\/span>\n\t\t<\/div>\n\n\t\t{{#if owner_team}}\n\t\t\t<div id=\"select_share_external_member_note\" class=\"modal_alert_sharing\">\n\t\t\t\t{{#t}}Originalmente, este archivo fue subido por un miembro del equipo <strong>{owner_team}<\/strong>. Aseg\u00farate de que tienes autorizaci\u00f3n para compartirlo.{{\/t}}\n\t\t{{else if reshare_private_file}}\n\t\t\t<div id=\"reshare_private_file_alert\" class=\"modal_alert_sharing\">{{reshare_private_file}}<\/div>\n\t\t{{\/if}}\n\n\t\t{{#if file_sharing_notice}}\n\t\t\t<span id=\"select_share_channels_note\" class=\"modal_input_note\">\n\t\t\t\t{{file_sharing_notice}}\n\t\t\t<\/span>\n\t\t{{\/if}}\n\n\t\t<span id=\"select_share_channels_join_note\" class=\"{{#unless show_channel_join_note}}hidden{{\/unless}}\"><br>{{#t}}<strong>NOTA:<\/strong> al compartir el