rio <span class=\"input_note normal\">(optativo)<\/span>{{\/t}}\n\t\t\t\t{{\/feature}}\n\t\t\t{{\/isClient}}\n\t\t<\/label>\n\t\t<div id=\"file_comment_textarea\" class=\"texty_comment_input comment_input no_bottom_margin\" name=\"comment\" tabindex=\"1\" wrap=\"virtual\"{{#if disable_file_sharing_dialog_comment}} disabled=\"disabled\"{{\/if}}><\/div>\n\t\t<span id=\"select_share_at_channel_blocked_note\" class=\"modal_input_note indifferent_grey hidden\"><\/span>\n\t\t<span id=\"select_share_at_channel_note\" class=\"modal_input_note indifferent_grey hidden\"><\/span>\n\t\t<span id=\"select_share_at_channel_list\" class=\"modal_input_note indifferent_grey{{#if disable_file_sharing_dialog_comment}} subtle_silver{{\/if}}\">{{makeFileCommentHelpHTML file}}<\/span>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['file_public_link'] = "{{i18n_ns \"files\"}}\n\n\t{{#if show_open_public_link}}\n\t\t{{#feature flag=\"feature_external_files\"}}\n\t\t\t<a class=\"file_public_link file_public_link_{{file.id}}\" href=\"{{file.permalink_public}}\" target=\"{{file.permalink_public}}\">{{#t}}Abrir el enlace externo{{\/t}}<\/a>\n\t\t{{else}}\n\t\t\t<a class=\"file_public_link file_public_link_{{file.id}}\" href=\"{{file.permalink_public}}\" target=\"{{file.permalink_public}}\">{{#t}}Abrir enlace externo{{\/t}}<\/a>\n\t\t{{\/feature}}\n\t{{\/if}}\n\t{{#if show_revoke_public_link}}\n\t\t<a id=\"file_public_link_revoker\" class=\"delete_link ts_tip ts_tip_top ts_tip_float\" onclick=\"TS.ui && TS.ui.file_share && TS.ui.file_share.fileRevokePublicLink('{{file.id}}');\" data-file-id=\"{{file.id}}\"><span class=\"ts_tip_tip\">{{#feature flag=\"feature_external_files\"}}{{#t}}Anular enlace externo{{\/t}}{{else}}{{#t}}Anular enlace externo{{\/t}}{{\/feature}}<\/span><i class=\"ts_icon ts_icon_times_circle_small\"><\/i><\/a>\n\t{{\/if}}\n\t\t\n";
TS.raw_templates['file_snippet'] = "{{i18n_ns \"files\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n\n<div data-file-id=\"{{file.id}}\" class=\"file_container snippet_container\n\t{{#if is_message}}\n\t\t{{#shouldTruncateInlineFilePreview file}}\n\t\t\t{{#isInlineFilePreviewTruncated msg_dom_id file}}\n\t\t\t\tinline_collapsed\n\t\t\t{{else}}\n\t\t\t\tinline_expanded\n\t\t\t{{\/isInlineFilePreviewTruncated}}\n\t\t{{\/shouldTruncateInlineFilePreview}}\n\t{{else}}\n\t\t{{#if file.is_truncated}}truncated{{\/if}}\n\t{{\/if}}\n\">\n\n\t<div class=\"file_body snippet_body\">\n\t\t{{#if file.content_highlight_html}}\n\t\t\t{{{file.content_highlight_html}}}\n\t\t{{else}}\n\t\t\t{{{file.preview_highlight}}}\n\t\t{{\/if}}\n\t<\/div>\n\n\t{{#if is_message}}\n\t\t{{> message_file_preview_actions collapse=true download=true external_file_author=(isFileAuthorExternal file) render_file_thread=render_file_thread}}\n\t\t{{> message_file_preview_footer collapse=true}}\n\t{{\/if}}\n\n<\/div>{{!--\/file_container--}}\n\n{{#if file.is_truncated}}\n\t<p class=\"file_meta inline_block {{#if is_message}}mini{{\/if}}\"><i class=\"ts_icon ts_icon_inherit ts_icon_info_circle\"><\/i> {{#t}}Este fragmento se trunc\u00f3 y no puede mostrarse:<a href=\"{file.permalink}\" target=\"{file.permalink}\">verlo en su totalidad<\/a>{{\/t}}.<\/p>\n{{\/if}}\n\n\n";
TS.raw_templates['file_post'] = "{{i18n_ns 'files'}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n\n<div data-file-id=\"{{file.id}}\" class=\"file_container post_container\n\t{{#if is_message}}\n\t\t{{#shouldTruncateInlineFilePreview file}}\n\t\t\t{{#isInlineFilePreviewTruncated msg_dom_id file}}\n\t\t\t\tinline_collapsed\n\t\t\t{{else}}\n\t\t\t\tinline_expanded\n\t\t\t{{\/isInlineFilePreviewTruncated}}\n\t\t{{\/shouldTruncateInlineFilePreview}}\n\t{{\/if}}\n\">\n\n\t<div class=\"file_header post_header\">\n\t\t<i class=\"file_header_icon post_header_icon ts_icon {{#if is_message}}ts_icon_file_text_post{{else}}ts_icon_file_text_post_small{{\/if}}\"><\/i>\n\t\t<h4 class=\"file_header_title post_header_title overflow_ellipsis\">{{#if file.title}}{{{formatFileTitle file}}}{{else}}{{file.name}}{{\/if}}<\/h4>\n\t\t<p class=\"file_header_meta post_header_meta\">\n\t\t\t{{#if file.updated}}\n\t\t\t\t{{#t note='Followed by a timestamp like \"2 minutes ago\"'}}Se edit\u00f3 por \u00faltima vez{{\/t}} <span class=\"file_time_ago\" data-file-id=\"{{file.id}}\">{{toTimeAgo file.updated}}<\/span>\n\t\t\t{{else}}\n\t\t\t\t{{#if file.timestamp}}\n\t\t\t\t\t{{#t date=(toCalendarDateOrNamedDayShort file.timestamp) time=(toTime file.timestamp)}}A\u00f1adido {date} a las {time}{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t<\/div>\n\n\t<div class=\"file_body post_body\">{{#if file.content_html}}{{{formatSpaceHtml file.content_html}}}{{else}}{{{formatSpaceHtml file.preview}}}{{\/if}}<\/div>\n\n\t{{#if is_message}}\n\t\t{{> message_file_preview_actions collapse=true external_file_author=(isFileAuthorExternal file) render_file_thread=render_file_thread}}\n\t\t{{> message_file_preview_footer collapse=true}}\n\t{{\/if}}\n\n<\/div>{{!--\/file_container--}}\n";
