TS.raw_templates['slack_menu_logout_cta'] = "{{i18n_ns \"menu\"}}\n\n{{! add logout_url here if user is either: }}\n{{! 1. Not currently logged into any orgs }}\n{{! 2. Currently veiwing an org team but not logged into any other teams of that same org}}\n{{#if current_team_gets_logout_url}}\n\t{{#if logout_url}}\n\t\t<li id=\"logout\" role=\"menuitem\" class=\"logout_url\" data-qa=\"logout\">\n\t\t\t<a class=\"menu_list_link overflow_ellipsis\" href=\"{{logout_url}}\" target=\"_self\"><span class=\"menu_item_label\">{{#t}}Desconectarse de <strong>{team_name}<\/strong>{{\/t}}<\/span><\/a>\n\t\t<\/li>\n\t{{\/if}}\n{{else}}\n\t{{#if enterprise_logout_url}}\n\t\t<li class=\"divider subdivider\"><\/li>\n\t\t{{#unless this.user.is_restricted}}\n\t\t\t<li id=\"workspaces\" role=\"menuitem\">\n\t\t\t\t<a class=\"overflow_ellipsis\" tabindex=\"0\"><span class=\"menu_item_label\">{{#t}}Encontrar m\u00e1s espacios de trabajo{{\/t}}<\/span><\/a>\n\t\t\t<\/li>\n\t\t{{\/unless}}\n\t\t<li id=\"enterprise_logout\" role=\"menuitem\" class=\"enterprise_logout_url\">\n\t\t\t<a class=\"overflow_ellipsis\" href=\"{{enterprise_logout_url}}\" target=\"_self\"><span class=\"menu_item_label\">{{#t team_name=(currentEnterpriseName)}}Desconectarse de <strong>{team_name}<\/strong>{{\/t}}<\/span><\/a>\n\t\t<\/li>\n\t{{\/if}}\n{{\/if}}";
TS.raw_templates['slack_menu_you_header'] = "{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n<h2 class=\"slack_menu_header\">\n\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs this.id 36)}}\n\t<span class=\"current_user_name slack_menu_header_primary overflow_ellipsis{{#unlessMemberHasSecondaryName this}} vertically_center_full_name{{\/unlessMemberHasSecondaryName}}\"><\/span>\n\t{{#memberHasSecondaryName this}}<span class=\"current_user_preferred_name slack_menu_header_secondary overflow_ellipsis\">{{getMemberSecondaryName this}}<\/span>{{\/memberHasSecondaryName}}\n<\/h2>\n";
TS.raw_templates['slack_menu_team_header'] = "<h2 class=\"slack_menu_header\">\n\t{{#if this.icon.image_default}}\n\t\t<ts-icon class=\"team_icon small default\" {{#if this.color}}style=\"background: {{this.color}};\"{{\/if}} aria-hidden=\"true\">{{initialsSafe this.name}}<\/ts-icon>\n\t{{else}}\n\t\t<ts-icon class=\"team_icon small\" style=\"background-image: url('{{this.icon.image_88}}');\" aria-hidden=\"true\"><\/ts-icon>\n\t{{\/if}}\n\t<span class=\"slack_menu_header_primary overflow_ellipsis\">{{this.name}}<\/span>\n\t<span class=\"current_team_name slack_menu_header_secondary overflow_ellipsis\">{{#isEnterpriseTeam}}{{currentEnterpriseName}}{{else}}{{currentTeamHostSafe}}{{\/isEnterpriseTeam}}<\/span>\n<\/h2>\n";
TS.raw_templates['menu_emoticons'] = "{{i18n_ns 'menu'}}\n\n<input id=\"emoji_input\" type=\"text\" placeholder=\"{{#t note='Placeholder label for emoji picker search'}}B\u00fasqueda{{\/t}}\"><i class=\"ts_icon ts_icon_search icon_search subtle_silver\"><\/i>\n<h3 id=\"emoji_search_results_h3\" class=\"hidden clear_both\">{{#t note=\"Heading for emoji picker search results\"}}Resultados de la b\u00fasqueda{{\/t}}<\/h3>\n\n{{!<div id=\"emoji_rxns_section_div\" class=\"emoji_section_div\">\n\t<h3 id=\"emoji_rxns_h3\" class=\"clear_both\">This guy<\/h3>\n\t<div id=\"emoji_rxns_panel_container\"><\/div>\n<\/div>}}\n\n{{! NOTE: white space is important here because we display these div inline when searching, so leave as is, though ugly }}\n{{~#each emoji_groups~}}<div class=\"emoji_section_div\"><h3 id=\"emoji_h3_{{this.name}}\" class=\"clear_both {{this.name}}\" data-group-name=\"{{this.name}}\">{{this.display_name}}<\/h3><div class=\"emoji_ul\" id=\"emoji_ul_{{this.name}}\" data-group-name=\"{{this.name}}\">\n\t{{~#each this.items~}}\n\t\t<a class=\"emoji_li {{#if this.is_skin}}skin_tone skin_tone_{{this.skin_tone_id}}{{\/if}}\"\n\t\t\tdata-row=\"{{this.row_index}}\"\n\t\t\tdata-col=\"{{this.col_index}}\"\n\t\t\tdata-color-index=\"{{this.color_index}}\"\n\t\t\tdata-name=\"{{this.name}}\"\n\t\t\tdata-names=\"{{this.names}}\">{{dangerouslyRenderHTML this.html}}<\/a>\n\t{{~\/each~}}\n<\/div><\/div>{{~\/each~}}\n\n<div id=\"emoji_zero_results\" class=\"hidden\"><i class=\"fa fa-ban\"><\/i> &nbsp;{{#t note=\"No emoji found after searching in emoji picker\"}}No se encontr\u00f3 ning\u00fan emoji{{\/t}}<br><\/div>\n\t\n<div id=\"emoji_tip\"><i class=\"fa fa-info-circle\"><\/i> &nbsp;{{#t note=\"Instructions for typing emoji shortcuts\"}}Escribe <b>&quot;:&quot;<\/b> y pulsa TAB para autocompletar{{\/t}}<br>\n{{~#if can_add_emoji~}}\n<i class=\"ts_icon ts_icon_plus ts_icon_inherit\"><\/i> &nbsp;{{#t note=\"Shown in the emoji picker\"}}Puedes <a href=\"\/admin\/emoji\" target=\"_blank\">a\u00f1adir un emoji personalizado{{\/t}}<\/a>\n{{~\/if~}}\n<\/div>\n";
TS.raw_templates['menu_call_button'] = "{{#if is_platform_call_loading}}\n\t<div class=\"channel_header_icon channel_calls_loading\">\n\t\t<div class=\"call_loading_container\">\n\t\t\t{{> loading_indicator }}\n\t\t<\/div>\n\t<\/div>\n{{else}}\n\t<button class=\"channel_header_icon channel_calls_button {{button_classes}} btn_unstyle ts_tip ts_tip_bottom ts_tip_multiline ts_tip_delay_300\">\n\t\t<span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\">\n\t\t\t{{tip_text}}\n\t\t<\/span><\/span>\n\t\t{{> ts_icon class=icon_classes }}\n\t<\/button>\n{{\/if}}\n";
TS.raw_templates['menu_file_filter_items'] = "{{i18n_ns 'menu'}}\n\n<li data-filetype=\"all\" {{#if_equal active_type compare='all'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_all_files_alt\"><\/i> {{#t note=\"For removing all file search filters\"}}Todos los tipos de archivos{{\/t}}<\/a>\n<\/li>\n<li data-filetype=\"spaces\" {{#if_equal active_type compare='spaces'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_create_post\"><\/i> {{#t note=\"Filter files by posts\"}}Notas{{\/t}}<\/a>\n<\/li>\n\n{{#feature flag=\"feature_docs\"}}\n\t{{!-- hbslint-disable unwrapped --}}\n\t{{!-- We don't need to translate this --}}\n\t<li data-filetype=\"docs\" {{#if_equal active_type compare='docs'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t\t<a><i class=\"ts_icon ts_icon_create_post\"><\/i> Arugula<\/a>\n\t<\/li>\n\t{{!-- hbslint-enable unwrapped --}}\n{{\/feature}}\n\n<li data-filetype=\"snippets\" {{#if_equal active_type compare='snippets'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_create_snippet\"><\/i> {{#t note=\"Filter files by snippets\"}}Extractos{{\/t}}<\/a>\n<\/li>\n{{#if show_email_item}}\n\t<li data-filetype=\"emails\" {{#if_equal active_type compare='emails'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t\t<a><i class=\"ts_icon ts_icon_share_email\"><\/i> {{#t note=\"Filter files by emails\"}}Correos{{\/t}}<\/a>\n\t<\/li>\n{{\/if}}\n<li data-filetype=\"images\" {{#if_equal active_type compare='images'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_image\"><\/i> {{#t note=\"Filter files by images\"}}Im\u00e1genes{{\/t}}<\/a>\n<\/li>\n<li data-filetype=\"videos\" {{#if_equal active_type compare='videos'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_play\"><\/i> {{#t note=\"Filter files by videos\"}}Videos{{\/t}}<\/a>\n<\/li>\n<li data-filetype=\"pdfs\" {{#if_equal active_type compare='pdfs'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_book\"><\/i> {{#t note=\"Filter files by PDF files\"}}Archivos PDF{{\/t}}<\/a>\n<\/li>\n<li data-filetype=\"spreadsheets\" {{#if_equal active_type compare='spreadsheets'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_create_post\"><\/i> {{#t note=\"Filter files by spreadsheet files\"}}Hojas de c\u00e1lculo{{\/t}}<\/a>\n<\/li>\n<li data-filetype=\"gdocs\" {{#if_equal active_type compare='gdocs'}}class=\"active\"{{\/if_equal}} role=\"menuitem\">\n\t<a><i class=\"ts_icon ts_icon_google_drive\"><\/i> {{#t note=\"Filter files by Google docs\"}}Google Docs{{\/t}}<\/a>\n<\/li>\n";
