TS.raw_templates['menu_file_cloud_service_items'] = "{{i18n_ns \"files\"}}\n\n{{#if should_show_box}}\n\t<li role=\"menuitem\" data-which=\"box\" data-qa=\"box\" class=\"file_menu_item\"><a><i class=\"file_menu_icon ts_icon ts_icon_box\"><\/i> {{#t note=\"Box, the cloud service\"}}Box{{\/t}}<\/a><\/li>\n{{\/if}}\n\n{{#if should_show_dropbox}}\n\t<li role=\"menuitem\" data-which=\"dropbox\" data-qa=\"dropbox\" class=\"file_menu_item\"><a><i class=\"file_menu_icon ts_icon ts_icon_dropbox\"><\/i> {{#t note=\"Dropbox, the cloud service\"}}Dropbox{{\/t}}<\/a><\/li>\n{{\/if}}\n\n{{#if should_show_gdrive}}\n\t<li role=\"menuitem\" data-which=\"gdrive_import\" data-qa=\"gdrive_import\"><a><i class=\"file_menu_icon ts_icon ts_icon_google_drive\"><\/i> {{#t note=\"Google Drive, the cloud service\"}}Google Drive{{\/t}}<\/a><\/li>\n{{\/if}}\n\n{{#feature flag=\"feature_onedrive_picker\"}}\n\t{{#if should_show_onedrive}}\n\t\t<li role=\"menuitem\" data-which=\"onedrive_import\"><a><i class=\"file_menu_icon ts_icon ts_icon_onedrive\"><\/i> {{#t note=\"OneDrive, the cloud service\"}}OneDrive{{\/t}}<\/a><\/li>\n\t{{\/if}}\n{{\/feature}}\n";
