TS.raw_templates['fs_modal'] = "{{i18n_ns \"fs_modal\"}}\n\n<div id=\"fs_modal_bg\"><\/div>\n<div id=\"fs_modal\" role=\"dialog\" tabindex=\"-1\" data-qa=\"full_screen_modal\">\n\n\t{{#unless disable_default_controls}}\n\t\t{{!-- Back and Close buttons --}}\n\t\t<button type=\"button\" id=\"fs_modal_back_btn\" class=\"fs_modal_btn btn_unstyle hidden\">\n\t\t\t<i class=\"ts_icon ts_icon_arrow_large_left\"><\/i>\n\t\t\t<span class=\"key_label\">{{#t note=\"In a fullscreen modal, this is the back button's label\"}}atr\u00e1s{{\/t}}<\/span>\n\t\t<\/button>\n\t\t<button type=\"button\" id=\"fs_modal_close_btn\" class=\"fs_modal_btn btn_unstyle\"{{#if settings.clog_name}} data-clog-click=\"true\" data-clog-event=\"{{settings.clog_name}}_ACTION\" data-clog-params=\"action=close_modal,trigger=click_fs_modal_close_btn\"{{\/if}}>\n\t\t\t<i class=\"ts_icon ts_icon_times\"><\/i>\n\t\t\t<span class=\"key_label\">{{#t note=\"In a fullscreen modal, this is the escape button's label\"}}esc{{\/t}}<\/span>\n\t\t<\/button>\n\t{{\/unless}}\n\n\t{{!-- Elements that appear before the body of the modal (eg. header) --}}\n\t{{#if fs_modal_header}}\n\t\t{{> fs_modal_header title=settings.title}}\n\t{{\/if}}\n\n\n\t{{!-- Modal Content --}}\n\t<div class=\"contents_container\">\n\t\t{{#if fs_modal_sidebar}}{{> fs_modal_sidebar}}{{\/if}}\n\t\t<div class=\"contents{{#if settings.full_height_contents}} full_height{{\/if}}\"><\/div>\n\t<\/div>\n\n\t{{!-- Elements that appear after the body of the modal (eg. footer) --}}\n\t{{#if fs_modal_footer}}\n\t\t<div id=\"fs_modal_footer\">\n\t\t\t<div id=\"fs_modal_footer_content\" {{#unless settings.footer_html}}class=\"hidden\"{{\/unless}}><\/div>\n\t\t\t<button class=\"btn btn_outline dialog_cancel {{#unless settings.show_cancel_button}}hidden{{\/unless}}\">{{settings.cancel_button_text}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn dialog_secondary_go {{#if settings.secondary_go_button_class}}{{settings.secondary_go_button_class}}{{\/if}} {{#unless settings.show_secondary_go_button}}hidden{{\/unless}}\">{{settings.secondary_go_button_text}}<\/button>\n\t\t\t<button class=\"btn left_margin dialog_go {{#if settings.go_button_class}}{{settings.go_button_class}}{{\/if}} {{#unless settings.show_go_button}}hidden{{\/unless}}\" data-qa=\"save_button\" data-style=\"expand-right\">{{settings.go_button_text}}<\/button>\n\t\t<\/div>\n\t{{\/if}}\n<\/div>\n";
