TS.raw_templates['fs_modal_generic_contents'] = "{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n{{#unless fs_modal_header}}\n\t{{#if settings.title}}<h1>{{settings.title}}<\/h1>{{\/if}}\n{{\/unless}}\n{{#if settings.body}}\n\t{{{settings.body}}}\n{{\/if}}\n{{#unless fs_modal_footer}}\n\t<div class=\"actions\">\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel {{#unless settings.show_cancel_button}}hidden{{\/unless}}\">{{{settings.cancel_button_text}}}<\/button>\n\t\t<button type=\"button\" class=\"btn btn dialog_secondary_go {{#if settings.secondary_go_button_class}}{{settings.secondary_go_button_class}}{{\/if}} {{#unless settings.show_secondary_go_button}}hidden{{\/unless}}\">{{{settings.secondary_go_button_text}}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go {{#if settings.go_button_class}}{{settings.go_button_class}}{{\/if}} {{#unless settings.show_go_button}}hidden{{\/unless}}\">{{{settings.go_button_text}}}<\/button>\n\t<\/div>\n{{\/unless}}";
