TS.raw_templates['fs_modal_file_viewer'] = "{{i18n_ns \"fs_modal_file_viewer\"}}\n{{> fs_modal_file_viewer_header}}\n\n<div class=\"viewer\">\n\t{{#if file_is_pdf}}\n\t\t{{> fs_modal_file_viewer_content_pdf}}\n\t{{else}}\n\t\t{{#if use_react_image_viewer }}\n\t\t\t<div class=\"p-image_viewer_container\"><\/div>\n\t\t{{else}}\n\t\t\t{{> fs_modal_file_viewer_content_image}}\n\t\t{{\/if}}\n\t{{\/if}}\n\n\t{{#if control_btns}}\n\t\t<div class=\"control_btns\">\n\t\t\t<button class=\"previous_btn\" aria-label=\"{{#t note=\"Indicates a link that will take the user to the previous page\"}}anterior{{\/t}}\"><ts-icon class=\"ts_icon_arrow_large_left\"><\/ts-icon><\/button>\n\t\t\t<button class=\"next_btn\" aria-label=\"{{#t note=\"Indicates a link that will take the user to the next page\"}}siguiente{{\/t}}\"><ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon><\/button>\n\t\t<\/div>{{!--\/control_btns--}}\n\t{{\/if}}\n\n<\/div>{{!--\/viewer--}}\n\n{{> fs_modal_file_viewer_aside}}\n";
TS.raw_templates['fs_modal_file_viewer_header'] = "{{i18n_ns \"file_viewer\"}}\n<header class=\"fs_modal_file_viewer_header{{#if link_url}} external{{\/if}}\">\n\t{{#if member}}\n\t\t<div class=\"star_btn btn_icon btn star_file\">\n\t\t\t{{starWithTip star_type star_ob star_parent_ob}}\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{> file_header_detailed}}\n\n\t<div class=\"controls\">\n\n\t\t{{#if actions.download}}\n\t\t\t<a href=\"{{file.url_private_download}}\" target=\"{{newWindowName}}\" data-file-id=\"{{file.id}}\" class=\"download_btn control_btn btn_icon btn ts_icon ts_icon_cloud_download ts_tip ts_tip_bottom file_ssb_download_link\">\n\t\t\t\t<div class=\"ts_tip_tip\">{{#t}}Descargar{{\/t}}\n\t\t\t\t\t<div class=\"muted_tooltip_info\">{{makeFileSize file}}<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"flex_menu_download_circle\"><\/div>\n\t\t\t<\/a>\n\t\t{{\/if}}\n\n\t\t{{#if link_url}}\n\t\t\t<a {{makeRefererSafeLink url=link_url}} target=\"_blank\" class=\"open_btn control_btn btn_icon btn ts_icon ts_icon_external_link ts_tip ts_tip_bottom\">\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Abrir original{{\/t}}<\/span>\n\t\t\t<\/a>\n\t\t{{\/if}}\n\n\t\t{{#if actions.more}}\n\t\t\t<button data-file-id=\"{{file.id}}\"\n\t\t\t\tclass=\"more_btn control_btn btn_icon btn ts_icon ts_icon_ellipsis_o ts_tip ts_tip_bottom file_actions\"\n\t\t\t\tdata-include-view-public-link=\"true\"\n\t\t\t\tdata-exclude-rxn=\"true\"{{! no way to update reactions in this fs modal :( }}\n\t\t\t\tdata-exclude-edit-title=\"true\"{{! don\u2019t show rename changing in flexpane, it\u2019s behind the fs modal }}\n\t\t\t\tdata-exclude-download=\"true\"{{! download is outside menu above \u2191 }}\n\t\t\t\tdata-exclude-comment=\"true\"{{! comments are below \u2193 }}\n\t\t\t>\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}M\u00e1s acciones{{\/t}}<\/span>\n\t\t\t<\/button>\n\t\t{{\/if}}\n\n\t\t{{#if actions.comment}}\n\t\t\t<button class=\"comment_btn control_btn btn ts_tip ts_tip_bottom {{#if is_comment_panel_active}}active{{\/if}}\">\n\t\t\t\t<ts-icon class=\"ts_icon ts_icon_comment_o\"><\/ts-icon>\n\t\t\t\t<span class=\"comment_count\">{{comments_count}}<\/span>\n\t\t\t\t<span class=\"ts_tip_tip\" data-tip-toggle-auto=\"{{#t}}Ocultar comentarios{{\/t}}\">{{#t}}Ver comentarios{{\/t}}<\/span>\n\t\t\t<\/button>\n\t\t{{\/if}}\n\n\t\t<button id=\"fs_modal_close_btn\" class=\"close_btn control_btn btn_icon btn ts_icon ts_icon_times ts_tip ts_tip_bottom ts_tip_right\">\n\t\t\t<div class=\"ts_tip_tip\">{{#t}}Cerrar{{\/t}}\n\t\t\t\t<div class=\"muted_tooltip_info\">{{#t}}(esc){{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t<\/button>\n\n\t<\/div>\n<\/header>\n";
TS.raw_templates['fs_modal_file_viewer_aside'] = "<aside class=\"aside_panel\">\n\t<div class=\"comments_container\">\n\t\t{{> fs_modal_file_viewer_comments}}\n\t<\/div>\n\n\t<div class=\"file_comment_form_container{{#unless actions.comment}} hidden{{\/unless}}\"><\/div>\n<\/aside>\n";
TS.raw_templates['fs_modal_file_viewer_details'] = "{{i18n_ns \"file_viewer\"}}\n<header class=\"details_header\">\n\t<button class=\"aside_close_btn\">{{#t}}Cerrar{{\/t}}<\/button>\n\t<h4 class=\"details_label\">{{#t}}Conversaciones{{\/t}}<\/h4>\n<\/header>\n\n<div class=\"shared_to_conversations\"><\/div>\n";
TS.raw_templates['fs_modal_file_viewer_comments'] = "{{i18n_ns \"file_viewer\"}}\n{{#if actions.comment}}\n\n\t<header class=\"comment_header\">\n\t\t<button class=\"aside_close_btn\">{{#t}}Cerrar{{\/t}}<\/button>\n\t\t<h4 class=\"comment_label\">\n\t\t\t{{#feature flag=\"feature_share_mention_comment_cleanup\"}}\n\t\t\t\t{{#if name}}\n\t\t\t\t\t{{name}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Sugerencias{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Sugerencias{{\/t}}\n\t\t\t{{\/feature}}\n\t\t<\/h4>\n\t<\/header>\n\n\t<div class=\"file_comments_{{file.id}} comments\">{{comments file}}<\/div>\n\n\t<div class=\"no_comment\">{{#t}}S\u00e9 el primero en dejar un comentario{{\/t}}<\/div>\n\n{{\/if}}\n";
TS.raw_templates['fs_modal_file_viewer_content_image'] = "<div class=\"images\">\n\n\t<figure class=\"scaled\">\n\t\t<img src=\"{{scaled_src}}\" alt=\"\"\n\t\t\tclass=\"scaled_image{{#if scaled_rotation}} orientation_{{file.image_exif_rotation}}{{\/if}}\"\n\t\t\t{{#if scaled_rotation}}data-exif-orientation=\"{{file.image_exif_rotation}}\"{{\/if}}\n\t\t>\n\t<\/figure>\n\n\t{{#if actual_pixel_src}}\n\t\t<figure class=\"actual_pixel\">\n\t\t\t<div class=\"actual_pixel_center\">\n\t\t\t\t<img src=\"{{actual_pixel_src}}\" alt=\"\"\n\t\t\t\t\tclass=\"actual_pixel_image{{#if actual_pixel_rotation}} orientation_{{file.image_exif_rotation}}{{\/if}}\"\n\t\t\t\t\t{{#if actual_pixel_rotation}}data-exif-orientation=\"{{file.image_exif_rotation}}\"{{\/if}}\n\t\t\t\t>\n\t\t\t<\/div>\n\t\t<\/figure>\n\t{{\/if}}\n\n<\/div>{{!--\/images--}}\n";
TS.raw_templates['fs_modal_file_viewer_content_pdf'] = "{{i18n_ns \"fs_modal_file_viewer\"}}\n\n<div class=\"images\">\n\t<div id=\"pdf_loading_spinner\" class=\"hidden\" title=\"{{#t}}Cargando{{\/t}}\"><\/div>\n\t<iframe id=\"pdf_display\" src=\"{{pdf_viewer_url}}\" style=\"width: 100%; height: 100%; border: none;\"><\/iframe>\n<\/div>{{!--\/images--}}\n";
TS.raw_templates['help_modal'] = "{{i18n_ns \"help\"}}\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and enable safeString --}}\n<div id=\"help_modal_container\" class=\"display_flex flex_direction_column\">\n\t<div class=\"large_bottom_margin display_flex align_items_baseline justify_content_between\">\n<h1 class=\"no_bottom_margin\">{{#t}}\u00bfEn qu\u00e9 podemos ayudarte?{{\/t}}<\/h1>\n\t\t<a id=\"browse_all\" data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=browse_all,trigger=click_browse_all\" class=\"see_all\" href=\"https:\/\/get.slack.help\/hc\/{{zdLocale}}?{{hcTrackingToken}}\" target=\"{{newWindowName}}\">{{#t}}Explorar todas las respuestas{{\/t}}<ts-icon class=\"small_left_margin ts_icon_arrow_large_right\"><\/ts-icon><\/a>\n\t<\/div>\n\n\t<div class=\"small_bottom_margin help_modal_filter_container\">\n\t\t<ts-icon class=\"ts_icon_search cloud_silver search_icon\"><\/ts-icon>\n\t\t<ts-icon class=\"ts_icon_times_circle cloud_silver clear_filter_icon\"><\/ts-icon>\n\t\t<input type=\"text\" id=\"help_modal_filter\" class=\"small\" placeholder=\"{{#t}}Busca en el Centro de Ayuda{{\/t}}\">\n\t<\/div>\n\n\t<div id=\"help_modal_empty\" class=\"hidden align_center margin_auto display_flex align_items_center justify_content_center\">\n\t\t<span class=\"help_modal_empty_message\"><\/span>\n\t<\/div>\n\t<div id=\"help_modal_list_container\" class=\"help_modal_list\">\n\t\t{{{loadingHTML}}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['help_modal_header'] = "{{i18n_ns \"help\"}}\n\n<div id=\"help_modal_header\" class=\"help_modal_header\">\n\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=keyboard_shorcuts,trigger=click_keyboard_shorcuts\" class=\"keyboard_shortcuts\">\n\t\t<ts-icon class=\"ts_icon_keyboard small_right_margin\"><\/ts-icon>\n\t\t{{#t}}Atajos de teclado{{\/t}}\n\t<\/a>\n<\/div>\n";
TS.raw_templates['help_modal_article_row'] = "<div class=\"help_modal_article_row\">\n\n\t<span class=\"article_title\"><\/span>\n\n\t<div class=\"channel_browser_open\">\n\t\t<ts-icon class=\"ts_icon_enter\"><\/ts-icon>\n\t<\/div>\n<\/div>";
TS.raw_templates['help_modal_footer'] = "{{i18n_ns \"help\"}}\n\n<div class=\"help_modal_status\"><\/div>\n<span class=\"info_text\">{{#t}}\u00bfNo encuentras lo que necesitas o quieres hacer alg\u00fan comentario?{{\/t}}<\/span>\n";
TS.raw_templates['help_modal_footer_status'] = "{{i18n_ns \"help\"}}\n\n{{#if settings.is_old_tickets}}\n<p id=\"no_open_issues\">\n\t{{#t}}No hay solicitudes pendientes.{{\/t}} <a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_request_history,trigger=click_view_request_history\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\">{{#t}}Ver tu historial de solicitudes{{\/t}}<\/a>.\n<\/p>\n{{\/if}}\n\n{{#if settings.is_unread}}\n<p id=\"unread_issues\">\n\t{{#if settings.is_unread_many}}\n\t<span id=\"unread_issues_many\">\n\t\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_new_replies,trigger=click_view_new_replies\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge candy_red_bg\" id=\"unread_issues_count_txt\">{{settings.unread_count}}<\/span>{{#t}}Has recibido nuevas respuestas a tu solicitud de ayuda.{{\/t}}<\/a>\n\t<\/span>\n\t{{else}}\n\t<span id=\"unread_issues_singular\">\n        <a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_new_replies,trigger=click_view_new_replies\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge candy_red_bg\">1<\/span>{{#t}}Tienes una nueva respuesta a tu solicitud.{{\/t}}<\/a>\n\t<\/span>\n\t{{\/if}}\n<\/p>\n{{\/if}}\n\n{{#if settings.is_open}}\n<p id=\"open_issues\" class=\"bottom_margin\">\n\t{{#if settings.is_open_many}}\n\t<span id=\"open_issues_many\">\n\t\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_open_requests,trigger=click_view_open_requests\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge seafoam_green_bg\" id=\"open_issues_count_txt\">{{settings.open_count}}<\/span>{{#t}}Tienes abiertas solicitudes de ayuda.{{\/t}}<\/a>\n\t<\/span>\n\t{{else}}\n\t<span id=\"open_issues_singular\">\n\t\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_open_requests,trigger=click_view_open_requests\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge seafoam_green_bg\">1<\/span>{{#t}}Tienes abierta una solicitud de ayuda.{{\/t}}<\/a>\n\t<\/span>\n\t{{\/if}}\n<\/p>\n{{\/if}}\n";
TS.raw_templates['fs_modal_simple_gallery'] = "{{i18n_ns \"fs_modal\"}}\n{{!--\n\tSimple Gallery Template for FS Modal\n\t---\n\tModeled after the file viewer modal, but less specific to file-viewer needs\n\n\t- To use:\n\t\t- Include this as `body_template_html` template when instantiating fs_modal\n\t\t- Requires: list of {items} - precompiled Handelbars templates for elements to cycle through\n\t\t- Optional: {modal_gallery_index} - where to begin the slideshow\n --}}\n<div class=\"p-modal_gallery__container\" data-current-index=\"{{modal_gallery_index}}\">\n\n\t<button\n\t\tclass=\"p-modal_gallery__nav\"\n\t\tdata-modal-gallery-direction=\"-1\"\n\t\taria-label=\"{{#t note=\"Indicates a link that will take the user to the previous modal view\"}}anterior{{\/t}}\"\n\t>\n\t\t<ts-icon class=\"ts_icon_arrow_large_left\"><\/ts-icon>\n\t<\/button>\n\n\t<div class=\"p-modal_gallery__items\" data-modal-items>\n\t\t{{#each items}}\n\t\t\t<div class=\"p-modal_gallery__item hidden\" data-modal-gallery-index=\"{{@index}}\">\n\t\t\t\t{{dangerouslyRenderHTML this}}\n\t\t\t<\/div>\n\t\t{{\/each}}\n\t<\/div>\n\n\t<button\n\t\tclass=\"p-modal_gallery__nav\"\n\t\tdata-modal-gallery-direction=\"1\"\n\t\taria-label=\"{{#t note=\"Indicates a link that will take the user to the next modal view\"}}siguiente{{\/t}}\"\n\t>\n\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t<\/button>\n\n<\/div>\n";
TS.raw_templates['fs_modal_app_header'] = "{{i18n_ns \"fs_modal\"}}\n{{!--\n\tCustom Fullscreen Modal Header for App Screenshots\n --}}\n<div id=\"fs_modal_header\" class=\"p-app_space_modal_header\">\n\t<div class=\"p-app_space_modal_header__avatar\">\n\t\t<img class=\"rounded\"\n\t\t\t{{#if avatar}}\n\t\t\t\tsrc=\"{{avatar}}\"\n\t\t\t{{else}}\n\t\t\t\tsrc=\"{{versioned_default_application_icon}}\"\n\t\t\t{{\/if}}\n\t\t>\n\t<\/div>\n\t<div class=\"p-app_space_modal_header__title\">\n\t\t<div class=\"p-app_space_modal_header__app_name\">{{name}}<\/div>\n\t\t<div class=\"p-app_space_modal_header__subtext\">\n\t\t\t{{#t note=\"App Space modal header featuring examples of how to use app\"}}V\u00eddeos y capturas de pantalla{{\/t}}\n\t\t\t(<span data-modal-slideshow-count>1<\/span>\/<span data-modal-slideshow-total>1<\/span>)\n\t\t<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['email_preview_send'] = "{{!-- hbslint-disable unwrapped --}}\n{{!-- because users won't ever see it, yo --}}\n<form id=\"send_email_preview_form\" action={{url}} method=\"POST\" target=\"dump\">\n\t<input type=\"hidden\" name=\"crumb\" value={{crumb}}><\/input>\n\t{{#if email_on_acid}}\n\t\tThis sends an email to Email On Acid, which will generate email previews on all the different email clients.\n\t\t<a href=\"https:\/\/www.emailonacid.com\/login\">Log in<\/a> to Slack's account to view the email previews.\n\t\tIf you need help using Email on Acid, instructions are pinned to the #emails channel.\n\t\t<input type=\"hidden\" name=\"send\" value=\"iamcal.runme.spam@previews.emailonacid.com\"><\/input>\n\t\t<input type=\"hidden\" name=\"subjectsuffix\" value=\"true\"><\/input>\n\t{{else}}\n\t\tList your recipients\u2019 e-mail addresses here, separating multiple addresses with commas.\n\t\t<br><br>\n\t\t<textarea id=\"recipients\" name=\"send\"><\/textarea>\n\t{{\/if}}\n<\/form>";
TS.raw_templates['onboarding_dialog_welcome_and_completion'] = "{{i18n_ns \"dialogs_onboarding\"}}\n{{#feature flag=\"feature_lesson_onboarding\"}}\n<div class=\"c-modal__media_container--onboarding_dialog full_width position_relative\">\n\t<div id=\"onboarding_media_infinite_spinner\" class=\"infinite_spinner infinite_spinner_medium no_margin position_absolute\">\n\t\t<svg class=\"infinite_spinner_spinner\" viewBox=\"0 0 100 100\">\n\t\t\t<circle class=\"infinite_spinner_bg\" cx=\"50%\" cy=\"50%\" r=\"35\" \/>\n\t\t\t<circle class=\"infinite_spinner_path infinite_spinner_blue\" cx=\"50%\" cy=\"50%\" r=\"35\"\/>\n\t\t<\/svg>\n\t\t<svg class=\"infinite_spinner_spinner infinite_spinner_tail\" viewBox=\"0 0 100 100\">\n\t\t\t<circle class=\"infinite_spinner_path infinite_spinner_blue\" cx=\"50%\" cy=\"50%\" r=\"35\"\/>\n\t\t<\/svg>\n\t<\/div>\n\t<img class=\"c-modal__media--onboarding_dialog full_max_width position_relative\" src=\"{{image_src}}\" \/>\n<\/div>\n<button type=\"button\" class=\"c-modal__close--onboarding_dialog no_padding no_margin no_border position_absolute\" data-dismiss=\"close\">&times;<\/button>\n<div class=\"c-modal__copy--onboarding_dialog align_center full_width\">\n\t<h2 class=\"align_center small_bottom_margin\">{{greeting}}<\/h2>\n\t<p class=\"align_center\">\n\t\t{{description}}\n\t<\/p>\n\t{{#if second_go_button_text}}\n\t\t<button id=\"onboarding_secondary_go_button\" class=\"btn btn_outline c-modal__button--onboarding c-modal__button--onboarding_completed\" type=\"button\">{{second_go_button_text}}<\/button>\n\t{{\/if}}\n\t<button id=\"onboarding_go_button\" class=\"btn c-modal__button--onboarding\" type=\"button\">{{go_button_text}}<\/button>\n<\/div>\n{{\/feature}}\n";
TS.raw_templates['onboarding_dialog_lesson'] = "{{i18n_ns \"dialogs_onboarding\"}}\n{{#feature flag=\"feature_lesson_onboarding\"}}\n\n<div class=\"c-modal__media_container--onboarding_dialog full_width {{modal_color_class}} position_relative\">\n\t<div id=\"onboarding_media_infinite_spinner\" class=\"infinite_spinner infinite_spinner_medium no_margin position_absolute\">\n\t\t<svg class=\"infinite_spinner_spinner\" viewBox=\"0 0 100 100\">\n\t\t\t<circle class=\"infinite_spinner_bg infinite_spinner_bg_white\" cx=\"50%\" cy=\"50%\" r=\"35\" \/>\n\t\t\t<circle class=\"infinite_spinner_path infinite_spinner_white\" cx=\"50%\" cy=\"50%\" r=\"35\"\/>\n\t\t<\/svg>\n\t\t<svg class=\"infinite_spinner_spinner infinite_spinner_tail\" viewBox=\"0 0 100 100\">\n\t\t\t<circle class=\"infinite_spinner_path infinite_spinner_white\" cx=\"50%\" cy=\"50%\" r=\"35\"\/>\n\t\t<\/svg>\n\t<\/div>\n\t<button class=\"c-modal__left_navigation--onboarding_dialog position_absolute no_border no_padding\">\n\t\t<ts-icon class=\"ts_icon_chevron_left c-modal__left_caret--onboarding_dialog position_absolute\"><\/ts-icon>\n\t<\/button>\n\t<button class=\"c-modal__right_navigation--onboarding_dialog position_absolute no_border no_padding\">\n\t\t<ts-icon class=\"ts_icon_chevron_right c-modal__right_caret--onboarding_dialog position_absolute\"><\/ts-icon>\n\t<\/button>\n<\/div>\n\n{{!-- this button must come after .c-modal__media_container--onboarding_dialog to appear on top and be visible --}}\n<button type=\"button\" class=\"c-modal__close--onboarding_dialog c-modal__close--onboarding_dialog_white no_padding no_margin no_border position_absolute\" data-dismiss=\"close\">&times;<\/button>\n\n<div class=\"c-modal__copy--onboarding_dialog full_width align_right\">\n\t<div class=\"c-modal__lesson_circle_buttons\">\n\t\t{{#each lesson_circle_classes}}\n\t\t\t<button class=\"c-modal__lesson_circle_button no_padding no_border\">\n\t\t\t\t<ts-icon class=\"{{this}}\"><\/ts-icon>\n\t\t\t<\/button>\n\t\t{{\/each}}\n\t<\/div>\n\t<h3 class=\"black small_bottom_margin align_left\">{{modal_title}}<\/h3>\n\t<p class=\"align_left\">\n\t\t{{modal_description}}\n\t<\/p>\n\t{{#if modal_button_show}}\n\t\t{{#if show_skip_button}}\n\t\t\t{{#if task_skipped}}\n\t\t\t\t<button class=\"btn btn_outline c-modal__button--onboarding js_onboarding_second_go disabled\" type=\"button\">{{second_modal_button_skipped_text}}<\/button>\n\t\t\t{{else}}\n\t\t\t\t<button class=\"btn btn_outline c-modal__button--onboarding js_onboarding_second_go\" type=\"button\">{{second_modal_button_text}}<\/button>\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t\t<button class=\"btn c-modal__button--onboarding js_onboarding_go\" type=\"button\">{{modal_button_text}}<\/button>\n\t{{\/if}}\n<\/div>\n{{\/feature}}\n";
TS.raw_templates['prefs_nav'] = "{{i18n_ns \"prefs\"}}\n\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"notifications\">{{#t}}Notificaciones{{\/t}}<\/button><\/li>\n{{#if show_win_ssb_prefs}}<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"win_ssb\">{{#t}}Aplicaci\u00f3n para Windows{{\/t}}<\/button><\/li>{{\/if}}\n{{#if show_lin_ssb_prefs}}<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"lin_ssb\">{{#t}}Aplicaci\u00f3n para Linux{{\/t}}<\/button><\/li>{{\/if}}\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"language_region\">{{#t}}Idioma y regi\u00f3n{{\/t}}<\/button><\/li>\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"messages_media\">{{#t}}Mensajes y medios{{\/t}}<\/button><\/li>\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"sidebar\">{{#t}}Barra lateral{{\/t}}<\/button><\/li>\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"search\">{{#t}}B\u00fasqueda{{\/t}}<\/button><\/li>\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"read_state_tracking\">{{#t}}Marcar como le\u00eddo{{\/t}}<\/button><\/li>\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"a11y\">{{#t}}Accesibilidad{{\/t}}<\/button><\/li>\n<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"advanced\">{{#t}}Avanzadas{{\/t}}<\/button><\/li>\n{{#if show_labs_prefs}}<li><button type=\"button\" class=\"btn_basic sidebar_menu_list_item\" data-section=\"labs\">{{#t}}Labs (solo TS){{\/t}}<\/button><\/li>{{\/if}}\n";
TS.raw_templates['prefs_notifications_summary'] = "{{i18n_ns \"prefs\"}}\n\n<span class=\"small_right_margin no_wrap\">\n\t{{#t}}\n\t\t<strong class=\"black\">Enviar notificaciones:<\/strong>\n\t\t{ send_notifications_for, select,\n\t\t\tall { Siempre }\n\t\t\tmentions { Solo para mensajes directos y palabras destacadas }\n\t\t\tother { Nunca }\n\t\t}\n\t{{\/t}}\n<\/span>\n\n<span class=\"small_right_margin no_wrap\">\n\t<strong class=\"black\">{{#t}}Sonido:{{\/t}}<\/strong>\n\t{{#if mute_sounds}}{{#t}}Off (silenciadas){{\/t}}{{else}}{{new_msg_snd}}{{\/if}}\n<\/span>\n\n<span class=\"small_right_margin no_wrap\">\n\t<strong class=\"black\">{{#t}}Visualizaci\u00f3n:{{\/t}}<\/strong>\n\t{{#if no_text_in_notifications}}{{#t}}Ocultar texto{{\/t}}{{else}}{{#t}}Mostrar texto{{\/t}}{{\/if}}\n<\/span>\n\n{{#if show_mac_ssb_prefs}}\n\t<span class=\"small_right_margin no_wrap\">\n\t\t<strong class=\"black\">{{#t}}Icono de la app del Dock:{{\/t}}<\/strong>\n\t\t{{#if show_mac_ssb_bullet}}\n\t\t\t{{#t}}\n\t\t\t\tMostrar icono {mac_ssb_bounce, select,\n\t\t\t\t\ttrue { & bounce { mac_ssb_bounce_short, select, true { una vez } other {} } }\n\t\t\t\t\tother {}\n\t\t\t\t}\n\t\t\t{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}\n\t\t\t\tOcultar icono {mac_ssb_bounce, select,\n\t\t\t\t\ttrue { & bounce { mac_ssb_bounce_short, select, true { una vez } other {} } }\n\t\t\t\t\tother {}\n\t\t\t\t}\n\t\t\t{{\/t}}\n\t\t{{\/if}}\n\t<\/span>\n{{\/if}}\n\n{{#if show_win_ssb_prefs}}\n\t<span class=\"small_right_margin\">\n\t\t{{#t}}\n\t\t\t<strong class=\"black\">Ventana intermitente:<\/strong>\n\t\t\t{ window_flash_behavior, select,\n\t\t\t\tnever { Nunca }\n\t\t\t\tidle { Cuando se deja inactivo }\n\t\t\t\tother { Siempre }\n\t\t\t}\n\t\t{{\/t}}\n\n\t\t{{#if show_notify_position}}\n\t\t\t{{#if_not_equal window_flash_behavior compare=\"never\"}}\n\t\t\t\t{{#t}}\n\t\t\t\t\t(mostrar notificaciones { winssb_notify_corner, select,\n\t\t\t\t\t\ttop_left { arriba a la izquierda }\n\t\t\t\t\t\ttop_right { arriba a la derecha }\n\t\t\t\t\t\tbottom_left { abajo a la izquierda }\n\t\t\t\t\t\tother { abajo a la derecha }\n\t\t\t\t\t} corner of the { winssb_notify_display, select,\n\t\t\t\t\t\tsame_as_app { en misma pantalla que app }\n\t\t\t\t\t\tother { en pantalla principal }\n\t\t\t\t\t})\n\t\t\t\t{{\/t}}\n\t\t\t{{\/if_not_equal}}\n\t\t{{\/if}}\n\t<\/span>\n{{\/if}}\n";
TS.raw_templates['prefs_dnd_summary'] = "{{i18n_ns 'dialogs'}}\n\n<span class=\"small_right_margin\">\n\t{{#if dnd_enabled}}\n\t\t{{#t}}\n\t\t<strong class=\"black\">No recibir\u00e1s notificaciones<\/strong>\n\t\tdesde {dnd_start_hour} hasta {dnd_end_hour} <span class=\"dnd_tz_label\">{timezone}<\/span>\n\t\t{{\/t}}\n\t{{else}}\n\t\t{{#t}}El modo no molestar no ha sido activado. Nos ce\u00f1iremos a tus ajustes de notificaciones.{{\/t}}\n\t{{\/if}}\n<\/span>\n";
TS.raw_templates['prefs_win_lin_ssb'] = "{{i18n_ns 'win_prefs'}}\n\n<h2 id=\"prefs_app_settings\" class=\"inline_block\">{{#t}}Ajustes de la aplicacion{{\/t}}<\/h2>\n<div>\n\t{{#if show_auto_launch_pref}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"winssb_launch_on_start_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t\t{{#t}}Iniciar la aplicaci\u00f3n al iniciar sesi\u00f3n{{\/t}}\n\t\t<\/label>\n\t{{\/if}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"winssb_run_from_tray_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t{{#t}}Dejar la aplicaci\u00f3n en ejecuci\u00f3n en la zona de notificaciones cuando est\u00e9 cerrada la ventana.{{\/t}}\n\t<\/label>\n\t<div id=\"winssb_flash_warning\" class=\"alert alert_warning\">\n\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t<p>{{#t}}A causa de tus ajustes de notificaciones, Slack permanecer\u00e1 en tu barra de tareas incluso cuando lo cierres.{{\/t}}<\/p>\n\t\t<p class=\"no_bottom_margin\">\n\t\t\t{{#t}}Para cambiar esto, ve a <strong>Notificaciones \u2192 Sonido y apariencia<\/strong>. All\u00ed podr\u00e1s realizar una de las siguientes acciones:\n\t\t\t<ul>\n\t\t\t\t<li>Desactivar el ajuste de parpadeo de la ventana de Slack cuando se recibe una notificaci\u00f3n.<\/li>\n\t\t\t\t<li>O dejar el ajuste activado, pero marcar la opci\u00f3n para que solo parpadee la ventana cuando no est\u00e9s usando el ordenador.<\/li>\n\t\t\t<\/ul>{{\/t}}\n\t\t<\/p>\n\t<\/div>\n\t<label class=\"checkbox\" id=\"winssb_disable_hw_acceleration_pref\">\n\t\t<input id=\"winssb_disable_hw_acceleration_cb\" checked=\"unchecked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t{{#t}}Desactivar aceleraci\u00f3n de hardware{{\/t}}<br>\n\t\t<span id=\"winssb_disable_hw_acceleration_note\" class=\"normal\">{{#unless show_lin_ssb_prefs}}{{#t}}Si utilizas un tema cl\u00e1sico de Windows, esto puede solucionar los problemas de representaci\u00f3n.  {{\/t}}{{\/unless}}{{#t}}Reinicia Slack para que esta preferencia entre en funcionamiento.{{\/t}}<\/span>\n\t<\/label>\n<\/div>\n";
TS.raw_templates['prefs_language_region'] = "{{i18n_ns \"prefs\"}}\n\n<h2>{{#t}}Idioma y regi\u00f3n{{\/t}}<\/h2>\n\n<label class=\"select\">\n\t<h4 class=\"prefs_lang inline_block\">{{#t}}Idioma{{\/t}}<\/h4>\n\t<select name=\"lang\" data-inline-saver='.prefs_lang'>\n\t\t{{#each languages}}\n\t\t\t<option value={{@key}} {{#if_equal @key compare=..\/user_locale}}selected=\"selected\" aria-selected=\"true\"{{\/if_equal}}>{{this}}<\/option>\n\t\t{{\/each}}\n\t<\/select>\n<\/label>\n\n<p class=\"normal greigh large_bottom_margin\">{{#t}}Elige el idioma en que quieres usar Slack.{{\/t}}<\/p>\n\n<label class=\"select bottom_margin\">\n\t<h4 class=\"prefs_tz inline_block\">{{#t}}Zona horaria{{\/t}}<\/h4>\n\t<select name=\"tz\" data-inline-saver='.prefs_tz'>\n\t\t{{#each timezones}}\n\t\t\t<option value={{this.[1]}} {{#if_equal this.[1] compare=..\/user_tz}}selected=\"selected\" aria-selected=\"true\"{{\/if_equal}}>{{this.[0]}}<\/option>\n\t\t{{\/each}}\n\t<\/select>\n<\/label>\n\n{{#if show_keyboard}}\n<label class=\"select\">\n\t<h4 class=\"prefs_keyboard inline_block\">{{#t}}Distribuci\u00f3n del teclado{{\/t}}<\/h4>\n\t<select name=\"keyboard\" data-inline-saver='.prefs_keyboard'>\n\t\t{{#each supported_keyboards}}\n\t\t\t<option value={{@key}} {{#if_equal @key compare=..\/user_keyboard}}selected=\"selected\" aria-selected=\"true\"{{\/if_equal}}>{{this}}<\/option>\n\t\t{{\/each}}\n\t<\/select>\n<\/label>\n\n<p class=\"normal greigh\">{{#t}}C\u00e1mbialo para que coincida con la distribuci\u00f3n del teclado.{{\/t}}<\/p>\n{{\/if}}\n";
TS.raw_templates['prefs_messages_media'] = "{{i18n_ns \"prefs\"}}\n\n<h2>{{#t}}Mensajes{{\/t}}<\/h2>\n\n<h4 id=\"prefs_message_theme\" class=\"inline_block\">{{#t}}Tema{{\/t}}<\/h4>\n<div class=\"bottom_margin display_flex\">\n\t<div class=\"message_theme_options\">\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"messages_theme_select\" type=\"radio\" value=\"light_with_avatars\" data-inline-saver=\"#prefs_message_theme\">\n\t\t\t{{#t}}N\u00edtido: <span class=\"normal\">claro, f\u00e1cil de leer y centrado.<\/span>{{\/t}}\n\t\t<\/label>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"messages_theme_select\" type=\"radio\" value=\"dense\" data-inline-saver=\"#prefs_message_theme\">\n\t\t\t{{#t}}Compacto: <span class=\"normal\">Todos los mensajes que quepan en pantalla.<\/span>{{\/t}}\n\t\t<\/label>\n\t<\/div>\n\t{{#unless hide_previews}}\n\t\t<div class=\"message_theme_preview\">\n\t\t\t{{#feature flag=\"feature_new_slackbot_icons\"}}\n\t\t\t\t{{> prefs_messages_media_message avatar=\"\/img\/slackbot_avatar_72.png\" name=\"slackbot\" message=slackbot_message}}\n\t\t\t{{else}}\n\t\t\t\t{{> prefs_messages_media_message avatar=\"\/img\/slackbot_72.png\" name=\"slackbot\" message=slackbot_message}}\n\t\t\t{{\/feature}}\n\t\t<\/div>\n\t{{\/unless}}\n<\/div>\n\n<h4 id=\"prefs_display_options\" class=\"inline_block\">{{#t}}Nombres{{\/t}}<\/h4>\n<div class=\"large_bottom_margin\">\n\t<div class=\"global_notification_block no_padding\">\n\t\t<div class=\"display_flex display_real_names_block\">\n\t\t\t<div class=\"small_right_margin\">\n\t\t\t\t<input type=\"radio\" name=\"display_real_names_override_cb\" value=\"real_names\" id=\"display_real_names_override_true\"  data-inline-saver=\"#prefs_display_options\">\n\t\t\t<\/div>\n\t\t\t<div class=\"very_small_top_margin\">\n\t\t\t\t<label for=\"display_real_names_override_true\"><strong>{{#t}}Nombres completos y nombres de Slack{{\/t}}<\/strong><\/label>\n\t\t\t\t<span>{{#t}}Usar los nombres de Slack para las conversaciones y los nombres completos para todo lo dem\u00e1s <span class=\"display_real_names_default bold\">(preferencia del espacio de trabajo)<\/span>{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t{{#unless hide_previews}}\n\t\t\t<div aria-hidden=\"true\" class=\"display_flex flex_one align_items_center left_margin display_real_names_block_sample\">\n\t\t\t\t{{> prefs_messages_media_message avatar=name_preview_avatar name=name_preview_full_name message=name_preview_message}}\n\t\t\t<\/div>\n\t\t{{\/unless}}\n\t<\/div>\n\t<div class=\"global_notification_block no_padding small_top_margin small_bottom_margin\">\n\t\t<div class=\"display_flex display_real_names_block\">\n\t\t\t<div class=\"small_right_margin\">\n\t\t\t\t<input type=\"radio\" name=\"display_real_names_override_cb\" value=\"display_names\" id=\"display_real_names_override_false\"  data-inline-saver=\"#prefs_display_options\">\n\t\t\t<\/div>\n\t\t\t<div class=\"very_small_top_margin\">\n\t\t\t\t<label for=\"display_real_names_override_false\"><strong>{{#t}}Solo nombres de Slack{{\/t}}<\/strong><\/label>\n\t\t\t\t<span>{{#t}}Usar siempre los nombres de Slack <span class=\"display_usernames_default bold\">(preferencia del espacio de trabajo)<\/span>{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t{{#unless hide_previews}}\n\t\t\t<div aria-hidden=\"true\" class=\"display_flex flex_one align_items_center left_margin display_real_names_block_sample\">\n\t\t\t\t{{> prefs_messages_media_message avatar=name_preview_avatar name=name_preview_display_name message=name_preview_message}}\n\t\t\t<\/div>\n\t\t{{\/unless}}\n\t<\/div>\n\t<p class=\"large_bottom_margin\">{{#t}}Para cambiar tu nombre completo o nombre de Slack, ve a <a data-action=\"edit_member_profile_modal\">tu perfil<\/a>.{{\/t}}<\/p>\n\n\t<h4 id=\"prefs_display_options_additional\" class=\"inline_block\">{{#t}}Opciones adicionales{{\/t}}<\/h4>\n\t<label class=\"checkbox\">\n\t\t<input id=\"show_typing_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t{{#t}}Mostrar el nombre de la persona que est\u00e1 escribiendo un mensaje{{\/t}}\n\t<\/label>\n\t{{#if show_time24_pref}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"time24_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t\t{{#t}}Mostrar sistema horario de 24 horas <span class=\"normal\">(16:00 en lugar de 4:00 p.\u00a0m.)<\/span>{{\/t}}\n\t\t<\/label>\n\t{{\/if}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"hide_hex_swatch_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t{{#t}}Ver muestrarios de colores junto a valores hexadecimales{{\/t}}\n\t<\/label>\n<\/div>\n\n<h4 id=\"prefs_emoji_style\" class=\"inline_block\">{{#t}}Estilo de los emojis{{\/t}}<\/h4>\n<br>\n\t<label class=\"checkbox\">\n\t\t<input id=\"plaintext_emoji_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_emoji_style\">\n\t\t{{#t}}Mostrar emojis como texto simple{{\/t}}<\/span>\n\t<\/label>\n\t<label id=\"jumbomoji_cb_label\" class=\"checkbox {{#if_equal messages_theme compare=\"dense\"}}jumbomoji_pref_disabled{{\/if_equal}}\">\n\t\t<input id=\"jumbomoji_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_emoji_style\" {{#if_equal messages_theme compare=\"dense\"}}disabled=\"disabled\" aria-disabled=\"true\"{{\/if_equal}}>\n\t\t{{#t}}Mostrar JUMBOMOJI<br>\n\t\t<span class=\"normal\">En mensajes sin texto, mostrar las versiones jumbo de los emojis (hasta 23 a la vez).<\/span>\n\t\t<span class=\"jumbomoji_disabled_note\"><strong>Nota:<\/strong> En modo compacto, todos los emojis poseen un tama\u00f1o m\u00e1s peque\u00f1o y adecuado.<\/span>{{\/t}}\n\t<\/label>\n\t<label id=\"convert_emoticons_label\" class=\"checkbox\">\n\t\t<input id=\"convert_emoticons_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_convert_emoticons\">\n\t\t{{#t smile_emoji=(emojiGraphicReplace \":smile:\")}}Convertir mis emoticonos a emojis (por ejemplo,\u00a0:D\u00a0se convierte en {smile_emoji}){{\/t}}\n\t<\/label>\n<hr>\n\n<h2 id=\"prefs_inline_media\" class=\"large_top_margin inline_block\">{{#t}}Medios y enlaces incorporados{{\/t}}<\/h2>\n<p>\n\t<label class=\"checkbox\">\n\t\t<input id=\"expand_internal_inline_imgs_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t}}Mostrar im\u00e1genes y archivos subidos a Slack{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"expand_inline_imgs_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t}}Mostrar im\u00e1genes y archivos de p\u00e1ginas web vinculadas{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox medium_left_margin\">\n\t\t<input id=\"dont_obey_inline_img_limit_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t file_size_limit=(convertFilesize inline_img_byte_limit)}}Aunque sean m\u00e1s grandes que {file_size_limit}{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"expand_non_media_attachments_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t}}Mostrar vista previa de p\u00e1ginas web vinculadas{{\/t}}\n\t<\/label>\n<\/p>\n\n{{#feature flag=\"feature_email_forwarding\"}}\n{{#if enable_email_forwarding}}\n\n\t<hr>\n\n\t<h2 id=\"prefs_email_forwarding\" class=\"large_top_margin inline_block\">{{#t}}Traer tus correos a Slack{{\/t}}<\/h2>\n\t{{> prefs_email_forwarding loading=\"true\"}}\n\n{{\/if}}\n{{\/feature}}\n";
TS.raw_templates['prefs_messages_media_message'] = "<ts-message class=\"first\">\n\t<div class=\"message_gutter\">\n\t\t<span class=\"timestamp\"><i class=\"copy_only\">[<\/i>{{toTime}}<i class=\"copy_only\">]<\/i><\/span>\n\t\t<div class=\"message_icon\">\n\t\t\t<div class=\"member_image thumb_36\" style=\"background-image: url({{avatar}})\" aria-hidden=\"true\"><\/div>\n\t\t<\/div>\n\t<\/div>\n\t<div class=\"message_content\">\n\t\t<div class=\"message_content_header\">\n\t\t\t<div class=\"message_content_header_left\">\n\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t{{!-- Don't need to translate slackbot --}}\n\t\t\t\t<span class=\"message_sender color_USLACKBOT color_757575 member\">{{name}}<\/span>\n\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t\t<span class=\"timestamp\"><i class=\"copy_only\">[<\/i>{{toTime}}<i class=\"copy_only\">]<\/i><\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<span class=\"message_body\">{{message}}<\/span>\n\t<\/div>\n<\/ts-message>\n";
TS.raw_templates['prefs_email_forwarding'] = "{{i18n_ns \"prefs\"}}\n\n{{#feature flag=\"feature_email_forwarding\"}}\n\n\t<div class=\"prefs_email_forwarding\">\n\t\t{{#if loading}}\n\n\t\t{{else}}\n\t\t\t{{#if existing_forwarding_email}}\n\t\t\t\t<p>\n\t\t\t\t\t{{#t}}Copia y pega esta direcci\u00f3n para reenviar cualquier correo importante o poner en copia\n\t\t\t\t\t a Slack. (Slackbot lo subir\u00e1 por ti).{{\/t}}\n\t\t\t\t<\/p>\n\t\t\t\t<p class=\"your_forwarding_address display_flex flex_wrap\">\n\t\t\t\t\t<label for=\"forwarding_address\">{{#t}}Tu direcci\u00f3n de reenv\u00edo{{\/t}}<\/label>\n\t\t\t\t\t<input type=\"text\" id=\"forwarding_address\" class=\"small flex_one small_right_margin\" value=\"{{existing_forwarding_email}}\" readonly>\n\t\t\t\t\t<button id=\"copy_forwarding_email_cb\" class=\"btn btn_outline ts_tip ts_tip_top\" type=\"button\" data-clog-click=\"true\" data-clog-event=\"EMAIL_INGESTION_ADDRESS_COPY\">\n\t\t\t\t\t\t{{#t note=\"Copy forwarding email address to clipboard\"}}Copiar{{\/t}}\n\t\t\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Copiar direcci\u00f3n de correo{{\/t}}<\/span>\n\t\t\t\t\t<\/button>\n\t\t\t\t<\/p>\n\t\t\t\t<p><a role=\"button\" href=\"#\" class=\"link_btn\" id=\"disable_forwarding_email_cb\" data-clog-click=\"true\" data-clog-event=\"EMAIL_INGESTION_ADDRESS_DISABLE\">{{#t}}Desactivar esta direcci\u00f3n{{\/t}}<\/a><\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>\n\t\t\t\t\t{{#t}}Puedes subir a Slack tus correos m\u00e1s importantes reenvi\u00e1ndolos a una direcci\u00f3n de correo.\n\t\t\t\t\t Slackbot se encargar\u00e1 de entreg\u00e1rtelos y t\u00fa decidir\u00e1s si los compartes o no\n\t\t\t\t\tcon tu equipo.{{\/t}}\n\t\t\t\t<\/p>\n\t\t\t\t<p class=\"prefs_email_forwarding_get\">\n\t\t\t\t\t<button id=\"get_forwarding_email_cb\" class=\"btn btn_outline ladda-button\" type=\"button\" data-style=\"expand-right\" data-clog-click=\"true\" data-clog-event=\"EMAIL_INGESTION_ADDRESS_CREATE\">{{#t}}Obtener una direcci\u00f3n de reenv\u00edo{{\/t}}<\/button>\n\t\t\t\t<\/p>\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/div>\n\n{{\/feature}}\n";
TS.raw_templates['prefs_sidebar'] = "{{i18n_ns \"prefs\"}}\n\n<div id=\"prefs_sidebar\">\n\n\t<h2 id=\"prefs_channel_list\" class=\"inline_block\">{{#t}}Ajustes de la barra lateral{{\/t}}<\/h2>\n\n\t<h4 class=\"margin_bottom_0\">{{#t}}Apariencia{{\/t}}<\/h4>\n\t<p>{{#t}}Elige qu\u00e9 quieres ver en tu barra lateral.{{\/t}}<\/p>\n\t<p {{#or show_sidebar_sort_pref show_separate_shared_channels_pref}}class=\"large_bottom_margin\"{{\/or}}>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"\" checked=\"checked\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t<strong>{{#t}}Todo{{\/t}}<\/strong><br>\n\t\t\t{{#if is_app_space_enabled}}\n\t\t\t\t<span class='normal greigh'>{{#t}}Todas tus conversaciones y aplicaciones.{{\/t}}<\/span>\n\t\t\t{{else}}\n\t\t\t\t<span class='normal greigh'>{{#t}}Todas tus conversaciones.{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t<\/label>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"hide_read_channels_unless_starred\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t<strong>{{#t}}Conversaciones no le\u00eddas y favoritas{{\/t}}<\/strong><br>\n\t\t\t<span class='normal greigh'>{{#t}}Las conversaciones no le\u00eddas y las que has a\u00f1adido a favoritos.{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"hide_read_channels\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t<strong>{{#t}}Solo las no le\u00eddas{{\/t}}<\/strong><br>\n\t\t\t{{#if is_app_space_enabled}}\n\t\t\t\t<span class='normal greigh'>{{#t}}Solo las aplicaciones y conversaciones no le\u00eddas.{{\/t}}<\/span>\n\t\t\t{{else}}\n\t\t\t\t<span class='normal greigh'>{{#t}}Solo las conversaciones no le\u00eddas.{{\/t}}<\/span>\n\t\t\t{{\/if}}\n\t\t<\/label>\n\t<\/p>\n\t{{#if show_sidebar_sort_pref}}\n\t\t<h4 class=\"margin_bottom_0\">{{#t}}Orden y agrupaci\u00f3n{{\/t}}<\/h4>\n\t\t<p class=\"margin_bottom_25\">{{#t}}Elige c\u00f3mo se ordenan las conversaciones en tu barra lateral.{{\/t}}<\/p>\n\t\t<p class=\"large_bottom_margin\">\n\t\t\t<label class=\"select small inline_block\">\n\t\t\t\t<select id=\"channel_sort_select\" class=\"small\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t\t\t{{! Options wil be added in by `TS.ui.prefs_dialog` }}\n\t\t\t\t<\/select>\n\t\t\t<\/label>\n\t{{else}}\n\t\t{{#if show_separate_shared_channels_pref}}\n\t\t\t<h4>{{#t}}Agrupar canales{{\/t}}<\/h4>\n\t\t{{\/if}}\n\t\t<p class=\"large_bottom_margin\">\n\t{{\/if}}\n\t\t<label for=\"separate_private_channels_cb\" class=\"checkbox no_margin\">\n\t\t\t<input id=\"separate_private_channels_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t{{#t}}Mostrar los canales cerrados en una lista aparte{{\/t}}\n\t\t<\/label>\n\t\t{{#if show_separate_shared_channels_pref}}\n\t\t\t<label for=\"separate_shared_channels_cb\" class=\"checkbox no_margin\">\n\t\t\t\t<input id=\"separate_shared_channels_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t\t{{#t}}Mostrar los canales compartidos en una lista aparte{{\/t}}\n\t\t\t<\/label>\n\t\t{{\/if}}\n\t\t{{#if show_separate_organization_channels_pref}}\n\t\t\t<label for=\"separate_organization_channels_cb\" class=\"checkbox\">\n\t\t\t\t<input id=\"separate_organization_channels_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t\t<span>{{#t note=\"This is for the channel sidebar, and is the pref to list public globally shared org channels in a separate section.\"}}Mostrar los canales de la organizaci\u00f3n en una lista aparte{{\/t}}<\/span>\n\t\t\t<\/label>\n\t\t{{\/if}}\n\t<\/p>\n\n\t<h4>{{#t}}Opciones adicionales{{\/t}}<\/h4>\n\t<p>\n\t\t<label class=\"checkbox nor_margin\">\n\t\t\t<input id=\"enable_unread_view\" checked=\"\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t{{#t}}Mostrar Mensajes sin leer{{\/t}}<br>\n\t\t\t<span class=\"normal greigh\">{{#t}}Para