TS.raw_templates['prefs_search'] = "{{i18n_ns \"dialogs_prefs_search\"}}\n\n<h2 id=\"prefs_search_exclusion\" class=\"inline_block\">{{#t note=\"heading for preferences related to searching in Slack\"}}B\u00fasqueda{{\/t}}<\/h2>\n<p>{{#t}}Por defecto, Slack busca en todos los canales, pero si deseas, puedes cambiar esta preferencia.{{\/t}}<\/p>\n<p>\n\t<label for=\"search_channel_exclusion\">{{#t}}No buscar en los siguientes canales:{{\/t}}<\/label>\n\t<select multiple=\"multiple\" id=\"search_channel_exclusion\" size=\"30\" data-inline-saver=\"#prefs_search_exclusion\" class=\"hidden\"><\/select>\n<\/p>";
TS.raw_templates['prefs_read_state_tracking'] = "{{i18n_ns \"dialogs_prefs_read_state_tracking\"}}\n\n<h2 id=\"prefs_read_state_tracking\" class=\"inline_block\">{{#t note=\"heading for read-state preferences\"}}Marcar como le\u00eddo{{\/t}}<\/h2>\n<p>{{#t}}Slack marca un canal como le\u00eddo en cuanto lo ves. Si deseas, puedes cambiar esta preferencia.{{\/t}}<\/p>\n\n<h4>{{#t}}Cuando veo un canal:{{\/t}}<\/h4>\n<p class=\"large_bottom_margin\">\n\t<label class=\"radio\">\n\t\t<input name=\"read_rd\" type=\"radio\" value=\"immediate_scroll\" data-inline-saver=\"#prefs_read_state_tracking\">\n\t\t{{#t}}Comenzar en el \u00faltimo mensaje que vi y marcar el canal como le\u00eddo{{\/t}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"read_rd\" type=\"radio\" value=\"immediate\" data-inline-saver=\"#prefs_read_state_tracking\">\n\t\t{{#t}}Comenzar en el mensaje m\u00e1s reciente y marcar el canal como le\u00eddo{{\/t}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"read_rd\" type=\"radio\" value=\"default\" data-inline-saver=\"#prefs_read_state_tracking\">\n\t\t{{#t}}Comenzar en el mensaje m\u00e1s reciente, pero dejar sin leer los no le\u00eddos{{\/t}}\n\t<\/label>\n<\/p>\n\n<h4>{{#t note=\"heading for read-state shortcuts\"}}Atajos de teclado{{\/t}}<\/h4>\n<p class=\"small_bottom_margin\">\n\t{{emojiGraphicReplace \":information_desk_person::skin-tone-2:\"}}\n\t{{#t}}Pulsa la tecla <b>Esc<\/b> para <span class=\"c-keyboard_key c-keyboard_key--slim\">marcar el canal como le\u00eddo<\/span>.{{\/t}}\n<\/p>\n<p class=\"small_bottom_margin\">\n\t{{emojiGraphicReplace \":ok_woman::skin-tone-4:\"}}\n\t{{#t}}<b>Marca todo como le\u00eddo<\/b> presionando <span class=\"c-keyboard_key c-keyboard_key--slim\">May\u00fasculas<\/span> <span class=\"c-keyboard_key c-keyboard_key--slim\">Esc<\/span>.{{\/t}}\n<\/p>\n<p>\n\t{{emojiGraphicReplace \":raising_hand::skin-tone-6:\"}}\n\t{{#t modifier_key_name=short_key_name}}Desde el men\u00fa, selecciona \u201cMarcar como no le\u00eddo\u201d <b>para marcar un mensaje como no le\u00eddo<\/b>. O bien, presiona <span class=\"c-keyboard_key c-keyboard_key--slim\">{modifier_key_name}<\/span> y haz clic sobre \u00e9l.{{\/t}}\n<\/p>\n";
