\t<div>\n\t\t\t\t<label class=\"radio normal\">\n\t\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"150\">\n\t\t\t\t\t{{#t note=\"setting for text size\"}}<strong>150 %<\/strong>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t<\/div>\n\n\t\t\t<p class=\"greigh top_margin\">\n\t\t\t\t{{#isMac}}\n\t\t\t\t\t{{#t}}Tambi\u00e9n puedes cambiar el nivel del zoom presionando Cmd +\/-{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Tambi\u00e9n puedes cambiar el nivel del zoom presionando Ctrl +\/-{{\/t}}\n\t\t\t\t{{\/isMac}}\n\t\t\t<\/p>\n\t\t<\/fieldset>\n\n\t\t<div class=\"preview_zoom\">\n\t\t\t<ts-message class=\"first\">\n\t\t\t\t<div class=\"message_gutter\">\n\t\t\t\t\t<div class=\"message_icon\">\n\t\t\t\t\t\t{{#feature flag=\"feature_new_slackbot_icons\"}}\n\t\t\t\t\t\t\t<div class=\"member_image thumb_36\" style=\"background-image: url(\/img\/slackbot_avatar_72.png)\" aria-hidden=\"true\"><\/div>\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t<div class=\"member_image thumb_36\" style=\"background-image: url(\/img\/slackbot_72.png)\" aria-hidden=\"true\"><\/div>\n\t\t\t\t\t\t{{\/feature}}\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"message_content\">\n\t\t\t\t\t<div class=\"message_content_header\">\n\t\t\t\t\t\t<div class=\"message_content_header_left\">\n\t\t\t\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t\t\t\t{{!-- Don't need to translate slackbot --}}\n\t\t\t\t\t\t\t<span class=\"message_sender color_USLACKBOT color_757575 member\">slackbot<\/span>\n\t\t\t\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t\t\t\t\t<span class=\"timestamp\"><i class=\"copy_only\">[<\/i>{{toTime}}<i class=\"copy_only\">]<\/i><\/span>\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<span class=\"message_body\">{{#t}}Los mensajes se ver\u00e1n as\u00ed. \u00bfTe gusta como queda?{{\/t}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t<\/ts-message>\n\t\t<\/div>\n\t<\/div>\n{{\/if}}\n\n<fieldset class=\"large_bottom_margin\">\n\t<legend><span id=\"prefs_a11y_animations\">{{#t}}Anima