TS.raw_templates['prefs_advanced'] = "{{i18n_ns 'prefs'}}\n\n<h2 id=\"prefs_input_options\" class=\"inline_block\">{{#t}}Opciones de entrada{{\/t}}<\/h2>\n<p>\n\t<label class=\"checkbox\">\n\t\t<input id=\"webapp_spellcheck_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}Activar corrector ortogr\u00e1fico en tus mensajes{{\/t}}\n\t<\/label>\n\t{{#if show_language_select}}\n\t<label class=\"select small bottom_margin no_left_margin half_width\">\n\t\t<select id=\"spellchecker_languages\" data-inline-saver=\"#prefs_input_options\" class=\"small\">\n\t\t\t<option value=\"automatic\"{{#unless selected_language}} selected{{\/unless}}>\n\t\t\t\t{{#t note=\"If selected, the spellchecker will attempt to automatically detect the language (and choose the right one accordingly)\"}}Autom\u00e1tico por idioma{{\/t}}\n\t\t\t<\/option>\n\t\t\t{{#each available_dictionaries}}\n\t\t\t\t<option value=\"{{this.key}}\"{{#if this.selected}} selected{{\/if}}>\n\t\t\t\t\t{{this.label}}\n\t\t\t\t<\/option>\n\t\t\t{{\/each}}\n\t\t<\/select>\n\t<\/label>\n\t{{\/if}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"enter_is_special_in_tbt_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}\n\t\tAl utilizar acentos abiertos ``` para escribir c\u00f3digo, <span class=\"c-keyboard_key c-keyboard_key--slim\">Intro<\/span> no enviar\u00e1 el mensaje<br \/>\n\t\t<span class=\"normal greigh\">Si marcas esta casilla, usa <span class=\"c-keyboard_key c-keyboard_key--slim\">May\u00fasculas<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">Intro<\/span> para enviar<\/span>.\n\t\t{{\/t}}\n\t<\/label>\n\t{{#feature flag=\"feature_sonic_inputs\"}}{{else}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"arrow_history_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}Utilizar <span class=\"c-keyboard_key c-keyboard_key--slim\">\u2191<\/span> y <span class=\"c-keyboard_key c-keyboard_key--slim\">\u2193<\/span> para desplazarte por el historial de mensajes<br>{{\/t}}\n\t\t<span class=\"normal greigh\">\n\t\t\t{{#isMac}}\n\t\t\t\t{{#t}}Con esta casilla marcada, usa <span class=\"c-keyboard_key c-keyboard_key--slim\">Cmd<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">\u2191<\/span>\u00a0para editar tu \u00faltimo mensaje{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Con esta casilla marcada, usa <span class=\"c-keyboard_key c-keyboard_key--slim\">Ctrl<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">\u2191<\/span>\u00a0para editar tu \u00faltimo mensaje{{\/t}}\n\t\t\t{{\/isMac}}\n\t\t<\/span>\n\t<\/label>\n\t{{\/feature}}\n\t<label id=\"msg_input_send_btn_label\" class=\"checkbox\">\n\t\t<input id=\"msg_input_send_btn_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\" \/>\n\t\t{{#t note=\"This is a preference for showing a send button next to the message input\"}}Mostrar el bot\u00f3n Enviar{{\/t}}<br \/>\n\t\t<span class=\"normal greigh\">{{#t note=\"This is related to the send button preference\"}}Presionar <span class=\"c-keyboard_key c-keyboard_key--slim\">Intro<\/span> para a\u00f1adir una nueva l\u00ednea{{\/t}}<\/span>\n\t<\/label>\n<\/p>\n\n{{#if show_app_download_path}}\n<hr>\n<div class=\"clearfix\">\n\t<h2 id=\"prefs_download_location\" class=\"inline_block small_bottom_margin\">{{#t}}Ubicaci\u00f3n de las descargas{{\/t}}<\/h2>\n\t<p class=\"small_bottom_margin\">{{#t}}Nota: este ajuste es solo para este ordenador y se aplica a todos tus espacios de trabajo.{{\/t}}<\/p>\n\t<div class=\"col span_3_of_4\"><input id=\"app_download_path_input\" type=\"text\" disabled=\"disabled\" value=\"{{app_download_path}}\" class=\"small\"><\/div>\n\t<div class=\"col span_1_of_4\"><button data-action=\"select_ssb_download_path\" class=\"btn btn_outline full_width btn_large\">{{#t fallback_hash=\"9346fb1f78ea29217744731bbf6997e6657755a3\"}}Cambiar\u2026{{\/t}}<\/button><\/div>\n<\/div>\n{{\/if}}\n\n<hr>\n\n<h2 id=\"prefs_other_options\" class=\"inline_block\">{{#t}}Otras opciones{{\/t}}<\/h2>\n<p>\n\n\t<label class=\"checkbox\">\n\t\t<input id=\"pagekeys_handled_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}Utilizar las teclas <span class=\"c-keyboard_key c-keyboard_key--slim\">Retroceder p\u00e1gina<\/span>, <span class=\"c-keyboard_key c-keyboard_key--slim\">Avanzar p\u00e1gina<\/span>, <span class=\"c-keyboard_key c-keyboard_key--slim\">Inicio<\/span> y <span class=\"c-keyboard_key c-keyboard_key--slim\">Fin<\/span> para desplazarte por los mensajes{{\/t}}\n\t<\/label>\n\n\t{{#isOurApp}}{{else}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"f_key_search_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t\t{{#isMac}}\n\t\t\t\t{{#t}}<span class=\"c-keyboard_key c-keyboard_key--slim\">Cmd<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">F<\/span> inicia una b\u00fasqueda en Slack<br>{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}<span class=\"c-keyboard_key c-keyboard_key--slim\">Ctrl<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">F<\/span> inicia una b\u00fasqueda en Slack<br>{{\/t}}\n\t\t\t{{\/isMac}}\n\t\t\t<span class=\"normal greigh\">{{#t}}Reemplaza el comportamiento normal de b\u00fasqueda del navegador{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"k_key_omnibox_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t\t{{#isMac}}\n\t\t\t\t{{#t}}<span class=\"c-keyboard_key c-keyboard_key--slim\">Cmd<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">K<\/span> inicia el Quick Switcher<br>{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}<span class=\"c-keyboard_key c-keyboard_key--slim\">Ctrl<\/span><span class=\"c-keyboard_key c-keyboard_key--slim\">K<\/span> inicia el Quick Switcher<br>{{\/t}}\n\t\t\t{{\/isMac}}\n\t\t\t<span class=\"normal greigh\">{{#t}}Reemplaza el comportamiento normal de algunos navegadores{{\/t}}<\/span>\n\t\t<\/label>\n\t{{\/isOurApp}}\n\n\t<label class=\"checkbox\">\n\t\t<input id=\"ask_after_away_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}Al iniciar sesi\u00f3n, preguntarme si quiero cambiar mi estado despu\u00e9s de haber seleccionado aparecer como ausente{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"enable_chan_suggestions\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}Permitir que Slackbot me env\u00ede sugerencias de canales de vez en cuando{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"allow_calls_to_set_current_status\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t telephone_receiver_emoji=(formatCurrentStatus ':telephone_receiver:')}}Establecer mi estado como \u201c{telephone_receiver_emoji} En una llamada\u201d cuando me una a una llamada de Slack{{\/t}}\n\t\t<span class=\"normal block greigh\">{{#t}}Si ya has establecido un estado, Slack no lo cambiar\u00e1.{{\/t}}<\/span>\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"surprise_me\" type=\"checkbox\">\n\t\t{{#t}}\u00a1Sorpr\u00e9ndeme!{{\/t}}\n\t<\/label>\n<\/p>\n\n<div id=\"surprise\" style=\"display: none;\">\n\t<img id=\"emo_bear\" src=\"\" style=\"width: 279px; height: 243px;\"><br>\n\t<h1 class=\"candy_red\">{{#t}}\u00a1Sorpresa!{{\/t}}<\/h1>\n<\/div>\n\n<hr>\n\n<h2 id=\"prefs_debug\" class=\"inline_block\">{{#t}}Opciones de depuraci\u00f3n{{\/t}}<\/h2>\n{{#if show_console_whitelist}}\n\t<p class=\"medium_bottom_margin\">\n\t\t<label for=\"client_logs_pri\">{{#t}}Registros de la consola{{\/t}}<\/label>\n\t\t<select multiple=\"multiple\" id=\"client_logs_pri\" size=\"30\" data-inline-saver=\"#prefs_debug\" class=\"bottom_margin\">\n\t\t\t<option value=\"all\"{{#if client_logs_pri_all_selected}} selected{{\/if}}>{{#t}}Todos{{\/t}}<\/option>\n\t\t\t{{#each user_facing_pris}}\n\t\t\t\t<option value=\"{{this.numbers}}\"{{#if this.selected}} selected{{\/if}}>{{#if this.name}}{{this.name}}{{else}}{{this.numbers}}{{\/if}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/select>\n\t\t<span class=\"normal tiny_top_margin block greigh\">{{#t}}Activar los registros de la consola permitir\u00e1 que nuestros ingenieros y agentes de atenci\u00f3n al usuario puedan realizar un seguimiento de las incidencias que se presenten.{{\/t}}<\/span>\n\t<\/p>\n{{\/if}}\n<p class=\"medium_bottom_margin\">\n\t<label class=\"checkbox\">\n\t\t<input id=\"show_jumper_scores\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_debug\">\n\t\t{{#t}}Mostrar puntuaciones en el Quick Switcher{{\/t}}\n\t<\/label>\n\t{{#feature flag=\"feature_macos_disable_hw\"}}\n\t\t{{#isOurApp}}\n\t\t\t<label class=\"checkbox bottom_margin\" id=\"winssb_disable_hw_acceleration_pref\">\n\t\t\t\t<input id=\"winssb_disable_hw_acceleration_cb\" checked=\"unchecked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t\t\t{{#t}}Desactivar aceleraci\u00f3n de hardware{{\/t}}<br>\n\t\t\t\t<span id=\"winssb_disable_hw_acceleration_note\" class=\"normal\">{{#t}}Reinicia Slack para que esta preferencia entre en funcionamiento.{{\/t}}<\/span>\n\t\t\t<\/label>\n\t\t{{\/isOurApp}}\n\t{{\/feature}}\n<\/p>\n<p class=\"bold\">{{#t}}Slack se volver\u00e1 a cargar si modificas cualquiera de las siguientes opciones.{{\/t}}<\/p>\n<p>\n\t<label class=\"checkbox bottom_margin\">\n\t\t<input id=\"ss_emojis_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_debug\">\n\t\t{{#t}}\n\t\tDesactivar hojas de Sprite de emojis<br>\n\t\t<span class=\"normal\">Esta opci\u00f3n demorar\u00e1 la carga de emojis, pero te podr\u00eda ser \u00fatil si experimentas problemas de lentitud en la interfaz de usuario de Slack.<\/span>\n\t\t{{\/t}}\n\t<\/label>\n\t{{#feature flag=\"feature_tinyspeck\"}}\n\t\t{{#feature flag=\"feature_flannel_always_use_canary\"}}{{else}}\n\t\t<label class=\"select bottom_margin no_left_margin half_width\">\n\t\t\t{{#t}}Grupo de servidores de Flannel{{\/t}}<br>\n\t\t\t<select id=\"flannel_server_pool\" data-inline-saver=\"#prefs_debug\">\n\t\t\t\t<option value=\"production\">{{#t}}Producci\u00f3n{{\/t}}<\/option>\n\t\t\t\t<option value=\"canary\">{{#t}}Valor controlado{{\/t}}<\/option>\n\t\t\t\t<option value=\"random\">{{#t}}Producci\u00f3n \/ valor controlado al azar{{\/t}}<\/option>\n\t\t\t<\/select>\n\t\t<\/label>\n\t\t{{\/feature}}\n\t{{\/feature}}\n<\/p>\n";
