TS.raw_templates['prefs_notifications_new'] = "{{i18n_ns \"prefs\"}}\n\n<div id=\"global_prefs_container\">\n\t<div class=\"notification_prefs_section\">\n\t\t{{#unless is_mc}}\n\t\t<div class=\"growls_stuff\" id=\"growls_permission_div\">\n\t\t\t{{> prefs_about_notifications}}\n\t\t\t{{#t}}<h4 class=\"desktop_notifications_title\">No has activado tus notificaciones en el ordenador<\/h4>\n\t\t\t<p>Te recomendamos que las actives para mantenerte al tanto de todo lo que pasa en tu espacio de trabajo de Slack.<\/p>{{\/t}}\n\t\t\t<p><a class=\"btn btn_success\" id=\"growls_permission_link\"><ts-icon class=\"ts_icon_bell ts_icon_inherit small_right_margin\"><\/ts-icon>{{#t}}Activar notificaciones para ordenador{{\/t}}<\/a><\/p>\n\t\t<\/div>\n\t\t<div class=\"growls_stuff\" id=\"growls_instructions_div\">\n\t\t\t{{> prefs_about_notifications}}\n\t\t\t<h4 class=\"desktop_notifications_title\">{{#t}}Notificaciones para ordenador{{\/t}}<\/h4>\n\t\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i>{{#t}}En la ventana emergente del navegador, haz clic en <strong>Permitir<\/strong> para activar las notificaciones.{{\/t}}<\/p>\n\t\t<\/div>\n\t\t<div class=\"growls_stuff\" id=\"growls_disallowed_div\">\n\t\t\t{{> prefs_about_notifications}}\n\t\t\t<h4 class=\"desktop_notifications_title\">{{#t}}Las notificaciones para el ordenador est\u00e1n desactivadas{{\/t}}<\/h4>\n\t\t\t<p class=\"alert alert_warning\"><i class=\"ts_icon ts_icon_warning\"><\/i>{{#t}}Has rechazado las notificaciones en el navegador. Tendr\u00e1s que abrir las preferencias del navegador para modificarlo.{{\/t}}<\/p>\n\t\t<\/div>\n\t\t<div class=\"growls_stuff\" id=\"growls_impossible_div\">\n\t\t\t{{> prefs_about_notifications}}\n\t\t\t<h4 class=\"desktop_notifications_title\">{{#t}}Las notificaciones para el ordenador est\u00e1n desactivadas{{\/t}}<\/h4>\n\t\t\t<p class=\"alert alert_warning\"><i class=\"ts_icon ts_icon_warning\"><\/i>{{#t}}Tu navegador no permite notificaciones par