TS.raw_templates['search_menu_unified_autocomplete_token_list'] = "{{!-- hbslint-disable syntax --}}\n<div class=\"truncate-left\">\n\t<span class=\"truncate-left__content\">\n\t\t<span class=\"truncate-left__size\">\n\t\t\t{{#each this}}\n\t\t\t\t{{#if is_type_string}}\n\t\t\t\t\t{{{html}}}\n\t\t\t\t{{else if is_type_phrase}}\n\t\t\t\t\t&ldquo;{{phrase}}&rdquo;\n\t\t\t\t{{else if is_type_member_filter}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_member_filter this}}\n\t\t\t\t{{else if is_type_in_filter}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_in_filter this}}\n\t\t\t\t{{else if is_type_has_filter}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_has_filter this}}\n\t\t\t\t{{else if is_type_type_filter}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_type_filter this}}\n\t\t\t\t{{else if is_type_custom_date_filter}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_custom_date_filter this}}\n\t\t\t\t{{else if is_type_date_filter}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_date_filter this}}\n\t\t\t\t{{else if is_type_member}}\n\t\t\t\t\t{{> search_menu_unified_autocomplete_token_member this}}\n\t\t\t\t{{\/if}}\n\t\t\t{{\/each}}\n\t\t<\/span>\n\t<\/span>\n<\/div>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_member_filter'] = "{{i18n_ns \"search\"}}\n<span class=\"token member_token {{getMemberTypeClass user}}{{#if user.is_external}} external_member{{\/if}}\" data-member-id=\"{{user.id}}\">\n\t{{makeMemberPreviewLinkImage user.id 24 false true true}}\n\t<span class=\"token_label\">\n\t\t<!-- fight the inline block space with a little duplication -->\n\t\t{{#if is_type_from_filter}}\n\t\t\t{{#t fallback_hash=\"df3e524fde6c9c3d0c65d66792ada4850311a53c\"}}de{{\/t}}:<b>@{{getPrefCompliantMemberName user}}<\/b>\n\t\t{{else if is_type_to_filter}}\n\t\t\t{{#t fallback_hash=\"ba1cfdcd865f3b87bcc9595dd395087b084ac080\"}}para{{\/t}}:<b>@{{getPrefCompliantMemberName user}}<\/b>\n\t\t{{\/if}}\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_member'] = "{{i18n_ns \"search\"}}\n<span class=\"token member_token {{getMemberTypeClass user}}{{#if user.is_external}} external_member{{\/if}}\" data-member-id=\"{{user.id}}\">\n\t{{makeMemberPreviewLinkImage user.id 24 false true true}}\n\t<span class=\"token_label\">\n\t\t<b>@{{getPrefCompliantMemberName user}}<\/b>\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_in_filter'] = "{{i18n_ns \"search\"}}\n<span class=\"token channel_token\">\n\t<span class=\"token_label\">\n\t\t{{#if user}}\n\t\t\t{{#t}}en:{{\/t}}<b>@{{getPrefCompliantMemberName user}}<\/b>\n\t\t{{else if channel}}\n\t\t\t{{#if channel.is_mpim}}\n\t\t\t\t{{#t}}en:{{\/t}}<b>{{mpimDisplayName channel}}<\/b>\n\t\t\t{{else if channel.is_private}}\n\t\t\t\t{{#t}}en:{{\/t}}<i class=\"ts_icon ts_icon_lock\"><\/i><b>{{channel.name}}<\/b>\n\t\t\t{{else if channel.isUnknown}}\n\t\t\t\t{{#t}}en:{{\/t}}<b>#{{fallbackChannelName}}<\/b>\n\t\t\t{{else if channel.isNonExistent}}\n\t\t\t\t{{#t}}en:{{\/t}}<b>#{{fallbackChannelName}}<\/b>\n\t\t\t{{else}}\n\t\t\t\t{{#t}}en:{{\/t}}<b>#{{channel.name}}<\/b>\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t{{string}}\n\t\t{{\/if}}\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_has_filter'] = "{{i18n_ns \"search\"}}\n{{!-- hbslint-disable syntax --}}\n<span class=\"token has_token\">\n\t<span class=\"token_label\">\n\t\t{{#t}}incluye{{\/t}}:<b>{{{thingHtml}}}<\/b>\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_type_filter'] = "{{i18n_ns \"search\"}}\n{{!-- hbslint-disable syntax --}}\n<span class=\"token type_token\">\n\t<span class=\"token_label\">\n\t\t{{#t}}tipo{{\/t}}:<b>{{file_type}}<\/b>\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_date_filter'] = "{{i18n_ns \"search\"}}\n<span class=\"token date_token\">\n\t<span class=\"token_label\">\n\t\t{{modifier_name}}:<b>\n\t\t\t{{#if is_today }}\n\t\t\t\t{{#t}}Hoy{{\/t}}\n\t\t\t{{else if is_yesterday }}\n\t\t\t\t{{#t}}Ayer{{\/t}}\n\t\t\t{{else if is_January }}\n\t\t\t\t{{#t}}enero{{\/t}}\n\t\t\t{{else if is_February }}\n\t\t\t\t{{#t}}febrero{{\/t}}\n\t\t\t{{else if is_March }}\n\t\t\t\t{{#t}}marzo{{\/t}}\n\t\t\t{{else if is_April }}\n\t\t\t\t{{#t}}abril{{\/t}}\n\t\t\t{{else if is_May }}\n\t\t\t\t{{#t}}mayo{{\/t}}\n\t\t\t{{else if is_June }}\n\t\t\t\t{{#t}}junio{{\/t}}\n\t\t\t{{else if is_July }}\n\t\t\t\t{{#t}}julio{{\/t}}\n\t\t\t{{else if is_August }}\n\t\t\t\t{{#t}}agosto{{\/t}}\n\t\t\t{{else if is_September }}\n\t\t\t\t{{#t}}septiembre{{\/t}}\n\t\t\t{{else if is_October }}\n\t\t\t\t{{#t}}octubre{{\/t}}\n\t\t\t{{else if is_November }}\n\t\t\t\t{{#t}}noviembre{{\/t}}\n\t\t\t{{else if is_December }}\n\t\t\t\t{{#t}}diciembre{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{date_string}}\n\t\t\t{{\/if}}<\/b>\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_token_custom_date_filter'] = "{{i18n_ns \"search\"}}\n<span class=\"token date_token\">\n\t<span class=\"token_label\">\n\t\t{{modifier}}:<b>{{#t}}Fecha personalizada{{\/t}}<\/b>\n\t\t<!--<ts-icon class=\" ts_icon_calendar no_margin\"><\/ts-icon>-->\n\t<\/span>\n<\/span>\n";
TS.raw_templates['search_menu_unified_autocomplete_jump_hint'] = "{{i18n_ns \"search\"}}\n<span class=\"description\">\n\t{{#t note=\"A label on a search autocomplete suggestion hinting to the user that choosing the suggestion will result in navigating to the selected item\"}}Ir a{{\/t}}\n<\/span>\n{{> ts_icon class=\"ts_icon_enter modifier_icon\"}}\n";
TS.raw_templates['account_secret_codes_modal'] = "{{i18n_ns 'account'}}\n\n<p class=\"alert alert_warning\">\n\t<i class=\"ts_icon ts_icon_exclamation_circle code_warning\"><\/i>{{#t}}Si pierdes el acceso a tu dispositivo de autenticaci\u00f3n, puedes usar uno de estos c\u00f3digos de seguridad para conectarte a tu cuenta. Solo puedes usar una vez cada c\u00f3digo. Haz una copia de los c\u00f3digos y gu\u00e1rdalos en un lugar seguro.{{\/t}}\n<\/p>\n<div class=\"align_center\">\n\t<div class=\"backup_codes_wrapper margin_auto curved_shadow\">\n\t\t<div class=\"backup_codes\">\n\t\t\t<ul class=\"clearfix\">\n\t\t\t\t{{#each codes}}<li>{{this}}<br><\/li>{{\/each}}\n\t\t\t<\/ul>\n\t\t<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['basic_share_dialog'] = "{{i18n_ns \"share_dialog\"}}\n\n<div id=\"share_dialog_input_container\"><\/div>\n\n<span id=\"select_share_at_channel_blocked_note\" class=\"modal_input_note indifferent_grey hidden\"><\/span>\n<span id=\"select_share_at_channel_note\" class=\"modal_input_note indifferent_grey hidden\"><\/span>\n<span id=\"select_share_pick_channel_note\" class=\"modal_input_note indifferent_grey hidden\"><i class=\"ts_icon ts_icon_warning ts_icon_inherit yolk_orange\"><\/i> {{#t}}Por favor selecciona un canal{{\/t}}<\/span>\n\n<div class=\"share_dialog_attachment_container\">\n\t{{attachment_html}}\n<\/div>\n\n<hr class=\"share_dialog_divider\">\n\n<div id=\"file_sharing_div\">\n\t<label for=\"select_share_channels\" class=\"share_prefix\">\n\t\t{{#t fallback_hash=\"5ec9927f96c558e3642b4d546543ae06daeb1d88\" fallback_hash_ns=\"file_share\"}}Compartir en:{{\/t}}\n\t<\/label>\n\t<div id=\"select_share_channels\"><\/div>\n<\/div>\n\n{{#if same_channel}}\n\t<span id=\"share_dialog_same_channel\">{{same_channel}}<\/span>\n{{\/if}}\n\n{{#if show_copy_link}}\n\t<button class=\"hidden btn btn_outline ts_icon ts_icon_link ts_tip ts_tip_top ts_tip_float ts_tip_align_left ts_tip_multiline\" data-action=\"copy_link\">\n\t\t<span class=\"ts_tip_tip\">\n\t\t\t<span class=\"ts_tip_multiline_inner\">{{copy_text}}<\/span>\n\t\t<\/span>\n\t<\/button>\n{{\/if}}\n\n<div id=\"share_dialog_warning\" class=\"hidden clear_both c-alert c-alert--inline c-alert--level_warning\">\n\t<span id=\"share_dialog_warning_msg\" class=\"c-alert__message\"><\/span>\n<\/div>\n";
TS.raw_templates['share_message_dialog_same_channel'] = "{{i18n_ns \"share_dialog\"}}\n\n{{#if from_private_channel}}\n\t{{> ts_icon class=\"ts_icon_lock\"}} {{#t}}Solo puede compartirse en el mismo canal.{{\/t}}\n{{else}}\n\t{{> ts_icon class=\"ts_icon_lock\"}} {{#t}}Solo puede compartirse en el mismo mensaje directo.{{\/t}}\n{{\/if}}\n";
TS.raw_templates['file_sharing_channel_row'] = "{{i18n_ns 'file_share'}}\n\n{{#if item.create_channel}}\n\t{{#t}}Crear un canal:{{\/t}} <i class=\"ts_icon ts_icon_channel\"><\/i><strong><span class=\"hash\">#<\/span>{{item.name}}<\/strong>\n{{else if item.is_mpim}}\n\t<i class=\"ts_icon multipary_dm_icon ts_icon_multiparty_dm_{{mpimMemberCount item}}\"><\/i>{{mpimDisplayName item}}\n{{else if item.is_group}}\n\t\t<i class=\"ts_icon ts_icon_lock\"><\/i>{{item.name}} {{#if item.is_org_shared}}{{> shared_channel_icon}}{{else}}{{#isModelObExtShared item}}{{> shared_channels_icon model_ob=item}}{{\/isModelObExtShared}}{{\/if}}\n{{else if item.is_channel}}\n\t{{#if item.is_private}}\n\t\t<i class=\"ts_icon ts_icon_lock\"><\/i>{{item.name}} {{#if item.is_org_shared}}{{> shared_channel_icon}}{{else}}{{#isModelObExtShared item}}{{> shared_channels_icon model_ob=item}}{{\/isModelObExtShared}}{{\/if}}\n\t{{else}}\n\t\t<i class=\"ts_icon ts_icon_channel_pane_hash\"><\/i>{{item.name}} {{#if item.is_org_shared}}{{> shared_channel_icon}}{{else}}{{#isModelObExtShared item}}{{> shared_channels_icon model_ob=item}}{{\/isModelObExtShared}}{{\/if}}\n\t{{\/if}}\n{{else}}\n\t{{> c-unified_member member=item size=\"small\" avatar=false short=true no_tip=true}}\n{{\/if}}\n";
TS.raw_templates['toast'] = "<div class=\"toast {{#if already_exists}}no_slide{{\/if}} alert_page alert_{{instance.type}} alert_{{instance.position}}\">\n\t{{instance.message}}\n\n\t<span class=\"toast_actions\">\n\t\t<span class=\"retry_toast {{#unless instance._retryable}}hidden{{\/unless}}\"><ts-icon class=\"ts_icon_repeat\"><\/ts-icon><\/span>\n\t\t<span class=\"dismiss_toast {{#unless instance.dismissable}}hidden{{\/unless}}\"><ts-icon class=\"ts_icon_times_circle\"><\/ts-icon><\/span>\n\t<\/span>\n<\/div>\n";
TS.raw_templates['shared_channels_leave_open_beta_dialog'] = "{{i18n_ns 'shared'}}\n\n\t{{#t note=\"confirm dialog outlining what will happen when your team leaves the shared channels open beta\"}}\n\t\t<p>Esto eliminar\u00e1 <strong>todo tu espacio de trabajo<\/strong> de los canales compartidos en beta.<\/p>\n\t\t<ul class=\"greigh\">\n\t\t\t<li><strong>Los administradores no podr\u00e1n crear m\u00e1s canales compartidos,<\/strong> ni aceptar invitaciones a canales compartidos.<\/li>\n\t\t\t<li><strong>Se mantendr\u00e1n los canales compartidos existentes.<\/strong> Si lo deseas, puedes desconectarlos individualmente.<\/li>\n\t\t<\/ul>\n\t{{\/t}}\n";
TS.raw_templates['shared_channels_open_beta_modal'] = "{{i18n_ns 'shared'}}\n\n<div class=\"shared_channels_open_beta_modal\">\n\t<div class=\"shared_channels_open_beta_modal_image\"><\/div>\n\n\t<h2 class=\"shared_channels_open_beta_modal_header\">\n\t\t{{#t}}Presentaci\u00f3n de los canales compartidos{{\/t}}\n\t<\/h2>\n\n\t<div class=\"shared_channels_open_beta_modal_body\">\n\t\t<p class=\"shared_channels_open_beta_modal_bullet\">\n\t\t\t<ts-icon class=\"ts_icon_check_small_bold\"><\/ts-icon>\n\t\t\t{{#t}}<strong>Una nueva forma de trabajar.<\/strong> Con los canales compartidos puedes trabajar con otras empresas y equipos desde Slack.{{\/t}}\n\t\t<\/p>\n\t\t<p class=\"shared_channels_open_beta_modal_bullet\">\n\t\t\t<ts-icon class=\"ts_icon_check_small_bold\"><\/ts-icon>\n\t\t\t{{#t}}<strong>Cada cosa en su lugar.<\/strong> Cuando intervienen varias empresas en un proyecto, los canales compartidos son una fuente fiable y consultable.{{\/t}}\n\t\t<\/p>\n\t\t<p class=\"shared_channels_open_beta_modal_bullet\">\n\t\t\t<ts-icon class=\"ts_icon_check_small_bold\"><\/ts-icon>\n\t\t\t{{#t}}<strong>Seguro y limitado.<\/strong> Solo los administradores pueden compartir un canal. El resto de tu espacio de trabajo sigue siendo privado.{{\/t}}\n\t\t<\/p>\n\t\t<p class=\"shared_channels_open_beta_modal_bullet\">\n\t\t\t<ts-icon class=\"ts_icon_exclamation_small\"><\/ts-icon>\n\t\t\t{{#t}}<strong>Actualmente en beta.<\/strong> De momento hay funciones \u2014 como los ajustes personalizados de retenci\u00f3n \u2014 que no afectan a los canales compartidos. <a href=\"https:\/\/get.slack.help\/hc\/articles\/115004152843\">M\u00e1s informaci\u00f3n<\/a>{{\/t}}\n\t\t<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['shared_channels_help_content'] = "{{i18n_ns 'shared'}}\n\n<div class=\"shared_channels_help_content\">\n\t<div class=\"shared_channels_help_content_icon\">\n\t\t<ts-icon class=\"ts_icon_book\"><\/ts-icon>\n\t<\/div>\n\t<div class=\"shared_channels_help_content_text\">\n\t\t<div>{{#t}}\u00bfDeseas m\u00e1s informaci\u00f3n sobre los canales compartidos?{{\/t}}<\/div>\n\t\t<div>{{#t}}Dir\u00edgete al <a class=\"no_underline\" href=\"https:\/\/get.slack.help\/hc\/articles\/115004151183\">Centro de Ayuda de Slack<\/a>.{{\/t}}<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['shared_channels_invites_modal'] = "{{i18n_ns \"shared_channels_invite\"}}\n<div id=\"sci_container\" class=\"channel_modal_with_list channel_modal {{#feature flag='feature_channel_browser_dropdown'}}feature_channel_browser_dropdown{{\/feature}}\">\n\n\t<div id=\"sci_header_wrapper\">\n\t\t<div class=\"sci_header_container large_bottom_margin display_flex align_items_center\">\n\t\t\t<h1 class=\"sci_header\">{{#t}}Canales compartidos{{\/t}}<\/h1>\n\n\t\t\t{{#if show_create_shared_channel_btn}}<button class=\"btn auto_left_margin\" data-action=\"sci_to_create\">{{#t}}Nuevo canal compartido{{\/t}}<\/button>{{\/if}}\n\t\t<\/div>\n\n\t\t<div class=\"small_bottom_margin display_flex align_items_center\">\n\t\t\t<div class=\"channel_browser_filter_container channel_modal_filter_container flex_one\">\n\t\t\t\t<i class=\"ts_icon ts_icon_search cloud_silver search_icon\"><\/i>\n\t\t\t\t<i class=\"ts_icon ts_icon_times_circle cloud_silver clear_filter_icon\"><\/i>\n\t\t\t\t<input type=\"text\" id=\"channel_browser_filter\" class=\"small\" placeholder=\"{{#t}}Buscar canales{{\/t}}\">\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<div class=\"small_bottom_margin display_flex align_items_center\">\n\t\t\t<div class=\"channel_browser_sort_container flex_one\">\n\t\t\t\t<select id=\"channel_browser_sort\" class=\"small display_none\">\n\t\t\t\t\t<option value=\"name\">{{#t}}Nombre del canal y pertenencia{{\/t}}<\/option>\n\t\t\t\t\t<option value=\"creator\">{{#t}}Nombre del creador{{\/t}}<\/option>\n\t\t\t\t\t<option value=\"created\">{{#t}}Fecha de creaci\u00f3n (m\u00e1s reciente){{\/t}}<\/option>\n\t\t\t\t\t<option value=\"members_high\">{{#t}}Miembros (de m\u00e1s a menos){{\/t}}<\/option>\n\t\t\t\t\t<option value=\"members_low\">{{#t}}Miembros (de menos a m\u00e1s){{\/t}}<\/option>\n\t\t\t\t<\/select>\n\t\t\t\t{{#feature flag=\"feature_channel_browser_dropdown\"}}\n\t\t\t\t\t<select id=\"temp_select_width\" class=\"display_none\">\n\t\t\t\t\t\t<option id=\"temp_option_width\"><\/option>\n\t\t\t\t\t<\/select>\n\t\t\t\t{{\/feature}}\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"sci_loading\">{{loadingHTML}}<\/div>\n\n\t<div id=\"sci_no_shared_channels\" class=\"display_flex justify_content_between align_items_center hidden\">\n\t\t<span class=\"sci_no_shared_note\">{{#t}}A\u00fan no tienes canales compartidos.{{\/t}}<\/span>\n\t<\/div>\n\n\t<div id=\"sci_channels_container\" class=\"display_flex hidden\">\n\t\t<div class=\"list_container\">\n\t\t\t<div class=\"list\"><\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"sci_channels_create\"><\/div>\n\n\t<div id=\"sci_send\"><\/div>\n\n\t<div id=\"sci_invites_container\"><\/div>\n<\/div>\n";
TS.raw_templates['shared_channels_invites_create'] = "{{i18n_ns \"shared_channels_invite\"}}\n<h1 class=\"sci_header\">{{#t}}Crear un canal compartido{{\/t}}<\/h1>\n\n<div class=\"channels_create_container\">\n\t<span class=\"sci_sub_header\">{{#if enterprise_info}}\n\t\t{{#t}}En un canal compartido, los miembros de los distintos espacios de trabajo de {enterprise_info.name} pueden enviarse mensajes y compartir archivos entre s\u00ed.{{\/t}}\n\t{{else}}\n\t\t{{#t}}Los miembros del otro espacio de trabajo solo podr\u00e1n ver los miembros y archivos de este canal compartido.{{\/t}}\n\t{{\/if}}<\/span>\n\n\t<label>{{#t note=\"This labels a slider for users to toggle who has access to join or view this channel\"}}Acceso para tus miembros{{\/t}}<\/label>\n\t<label for=\"access\"><input type=\"checkbox\" name=\"access\" checked><\/label>\n\n\t{{#if enterprise_info}}\n\t\t<label>{{#t note=\"labels a set of radio buttons to indicate which teams to share the channel with. Could be all org teams, only some org teams, or an external team\"}}Compartir este canal con{{\/t}}<\/label>\n\t\t<label class=\"sci_radio\"><input type=\"radio\" name=\"share_with\" value=\"all\" checked>{{#t}}Todos los espacios de trabajo de {enterprise_info.name}{{\/t}}<\/label>\n\t\t{{#feature flag=\"feature_shared_channels_enterprise\"}}\n\t\t\t<label class=\"sci_radio\"><input type=\"radio\" name=\"share_with\" value=\"specific\">{{#t}}Espacios de trabajo espec\u00edficos de {enterprise_info.name}{{\/t}}<\/label>\n\t\t\t<label class=\"sci_radio inline_block\"><input type=\"radio\" name=\"share_with\" value=\"external\">{{#t rough-draft=true}}External workspaces{{\/t}}<\/label><label for=\"share_with_specific\"><\/label><label for=\"share_with_external\"><\/label>\n\t\t{{else}}\n\t\t\t<label class=\"sci_radio inline_block\"><input type=\"radio\" name=\"share_with\" value=\"specific\">{{#t}}Espacios de trabajo espec\u00edficos de {enterprise_info.name}{{\/t}}<\/label><label for=\"share_with_specific\"><\/label>\n\t\t{{\/feature}}\n\n\t\t<div id=\"sci_specific_team\" class=\"hidden\">\n\t\t\t{{#feature flag=\"feature_react_lfs\"}}\n\t\t\t\t<div id=\"sci_teams_picker\"><\/div>\n\t\t\t\t<input class=\"hidden\" type=\"text\" name=\"domains\" placeholder=\"{{#t}}A\u00f1adir espacios de trabajo{{\/t}}\" data-validation=\"required\" data-validation-for=\"share_with_specific\">\n\t\t\t{{else}}\n\t\t\t\t<input type=\"text\" name=\"domains\" placeholder=\"{{#t}}A\u00f1adir espacios de trabajo{{\/t}}\" data-validation=\"required\" data-validation-for=\"share_with_specific\">\n\t\t\t{{\/feature}}\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#feature flag=\"feature_shared_channels_enterprise\"}}\n\t\t<div id=\"sci_external_team\"{{#if enterprise_info}} class=\"hidden\"{{\/if}}>\n\t\t\t<p class=\"position_relative no_margin\">\n\t\t\t\t{{#unless enterprise_info}}<label for=\"domain\">{{#t}}URL for the Slack workspace you are inviting{{\/t}}<\/label>{{\/unless}}\n\t\t\t\t<span class=\"placeholder_overlay\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"domain\" placeholder=\"{{#t}}teamurl{{\/t}}\" data-validation=\"required reservedwords={{reserved_domain}} valid_invite\"{{#if enterprise_info}} data-validation-for=\"share_with_external\"{{\/if}} autocapitalize=\"off\" autocorrect=\"off\" autocomplete=\"off\">\n\t\t\t<\/p>\n\t\t\t<span class=\"input_note\">{{#t new_win_name=(newWindowName) locale=(zdLocale) hcTrackingToken=(hcTrackingToken)}}Ask a member of the other workspace for their Workspace URL (<a href=\"https:\/\/get.slack.help\/hc\/{locale}\/articles\/212681477-Signing-in-to-Slack?{hcTrackingToken}\" target=\"{new_win_name}\">How they can find it<\/a>).{{\/t}}<\/span>\n\t\t<\/div>\n\t{{\/feature}}\n\n\t<label for=\"channel_name\">{{#t}}Nombrar este canal (para tu espacio de trabajo){{\/t}}<\/label>\n\t<div class=\"input_wrapper\">\n\t\t<span class=\"spinner subtle_silver hidden\">\n\t\t\t{{#t}}Comprobando  {{\/t}}{{> loading_indicator}}\n\t\t<\/span>\n\t\t<span class=\"available seafoam_green hidden\">\n\t\t\t{{#t}}Disponible  {{\/t}}<ts-icon class=\"ts_icon_check_circle_o_large\"><\/ts-icon>\n\t\t<\/span>\n\t\t<input\n\t\t\ttype=\"text\"\n\t\t\tname=\"channel_name\"\n\t\t\tplaceholder=\"{{#t}}Introducir nombre (p. ej. agencia de marketing){{\/t}}\"\n\t\t\tclass=\"lowercase\"\n\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\tautocapitalize=\"off\"\n\t\t\tautocorrect=\"off\"\n\t\t\tautocomplete=\"off\"\n\t\t\tdata-validation-success=\"\"\n\t\t\tmaxlength=\"21\"\n\t\t>\n\t\t<span class=\"input_note\">{{#feature flag=\"feature_longer_channel_names\"}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 81 caracteres.{{\/t}}{{else}}{{#t}}Los nombres deben ir en min\u00fascula, sin espacios ni puntos, y no exceder los 22 caracteres.{{\/t}}{{\/feature}}<\/span>\n\t<\/div>\n\n\t<label for=\"purpose\">{{#t}}Finalidad <span class=\"normal old_petunia_grey\">(Optativo){{\/t}}<\/span><\/label>\n\t<textarea name=\"purpose\" placeholder=\"{{#t}}Describe brevemente la finalidad de este canal{{\/t}}\" data-validation=\"maxlength=250\"><\/textarea>\n\n\t<button class=\"btn btn_large ladda-button\" data-style=\"expand-right\" data-action=\"sci_channels_create\">{{#t}}Crear canal compartido{{\/t}}<\/button>\n\t<button class=\"btn btn_large btn_outline\" data-action=\"sci_cancel\">{{#t}}Cancelar{{\/t}}<\/button>\n<\/div>\n";
TS.raw_templates['shared_channels_invites_send'] = "{{i18n_ns \"shared_channels_invite\"}}\n<h1 class=\"sci_header\">{{#t}}Enviar invitaci\u00f3n{{\/t}}<\/h1>\n<span class=\"sci_sub_header\">{{#t}}Invita al otro espacio de trabajo compartiendo el siguiente enlace o enviando un correo. Recibir\u00e1s una notificaci\u00f3n cuando la invitaci\u00f3n sea aceptada y est\u00e9 lista para activarse.{{\/t}}<\/span>\n\n<div class=\"sci_copy_link_container\" data-action=\"sci_show_action\">\n\t<div class=\"display_flex align_items_center charcoal_grey\">\n\t\t<span class=\"sci_image_bubble\"><\/span>\n\t\t<span>{{#t}}Compartir enlace{{\/t}}<\/span>\n\t\t<ts-icon class=\"ts_icon_chevron_medium_right auto_left_margin\"><\/ts-icon>\n\t<\/div>\n\n\t<div class=\"display_flex align_items_center flex_wrap\">\n\t\t<label for=\"copy_link_{{invite_id}}\" class=\"full_width\">{{#t}}Copiar el enlace{{\/t}}<span class=\"validation_message overflow_ellipsis old_petunia_grey inline hidden\" title=\"{{#t}}Haz clic con el bot\u00f3n secundario para copiar y compartir el enlace.{{\/t}}\"><\/span><\/label>\n\t\t<input type=\"text\" name=\"copy_link_{{invite_id}}\" class=\"input_inline small no_margin flex_one\" value=\"{{invite_url}}\" readonly data-invite-id=\"{{invite_id}}\">\n\t\t<button class=\"btn btn_outline ladda-button\" data-style=\"expand-right\" data-action=\"sci_copy\" data-invite-id=\"{{invite_id}}\">{{#t}}Copiar el enlace{{\/t}}<\/button>\n\t<\/div>\n<\/div>\n\n<div class=\"sci_send_email_container\" data-action=\"sci_show_action\">\n\t<div class=\"display_flex align_items_center charcoal_grey\">\n\t\t<span class=\"sci_image_bubble\"><\/span>\n\t\t<span>{{#t}}Enviar correo{{\/t}}<\/span>\n\t\t<ts-icon class=\"ts_icon_chevron_medium_right auto_left_margin\"><\/ts-icon>\n\t<\/div>\n\n\t<div class=\"display_flex align_items_center flex_wrap\">\n\t\t<label for=\"send_email_{{invite_id}}\" class=\"full_width\">{{#t}}Enviar correo{{\/t}}<\/label>\n\t\t<input type=\"text\" name=\"send_email_{{invite_id}}\" class=\"input_inline small no_margin flex_one\" placeholder=\"{{#t}}Introducir correos de invitados{{\/t}}\" data-validation=\"is_email\" data-invite-id=\"{{invite_id}}\" autocapitalize=\"off\" autocorrect=\"off\" autocomplete=\"off\">\n\t\t<button class=\"btn btn_outline\" data-action=\"sci_send\" data-invite-id=\"{{invite_id}}\">{{#t}}Enviar correo{{\/t}}<\/button>\n\t\t<div data-action=\"replace_sent_emails\" class=\"hidden\"><\/div>\n\t<\/div>\n<\/div>\n\n<button class=\"btn btn_large\" data-action=\"sci_cancel\">{{#t}}Listo{{\/t}}<\/button>\n";
TS.raw_templates['shared_channels_invites_invite'] = "{{i18n_ns \"shared_channels_invite\"}}\n<div id=\"sci_invite_container_{{invite_id}}\" class=\"sci_invite_container\" data-action=\"sci_toggle_contents\">\n\t<div class=\"sci_list_text display_flex align_items_center\">\n\t\t<img class=\"sci_rounded align_self_start\" src=\"{{team.icon.image_88}}\" srcset=\"{{team.icon.image_44}} 1x, {{team.icon.image_88}} 2x\"\/>\n\t\t<div>\n\t\t\t<span class=\"sci_list_team_name block bold\">{{getTeamDisplayName team}}<\/span>\n\t\t\t<span class=\"block\">{{#t user_display_name=(getPrefCompliantMemberNameById user) date_created=(toTimeAgo date_create)}}Invitado a <strong>{channel_name}<\/strong> por <strong>{user_display_name}<\/strong> \u00b7 {date_created}{{\/t}}<\/span>\n\t\t<\/div>\n\t\t<span class=\"sci_pending auto_left_margin\">{{#t}}Pendiente{{\/t}}<ts-icon class=\"sci_toggle_icon ts_icon_caret_right charcoal_grey left_margin\"><\/ts-icon><\/span>\n\t<\/div>\n\n\t<div class=\"sci_list_text\">\n\t\t{{#if purpose}}\n\t\t\t<span class=\"block bold top_margin\">{{#t}}Finalidad:{{\/t}}<\/span>\n\t\t\t<span class=\"block\">{{purpose}}<\/span>\n\t\t{{\/if}}\n\n\t\t{{> shared_channels_invites_emailed_invitations}}\n\n\t\t<span class=\"top_margin block\">\n\t\t\t<a class=\"sci_list_link\" data-action=\"sci_toggle_send_email\">{{#t}}Enviar otra invitaci\u00f3n por correo{{\/t}}<\/a>\n\t\t\t<a class=\"sci_list_link\" data-action=\"sci_toggle_copy_link\">{{#t}}Invitar enviando un enlace{{\/t}}<\/a>\n\t\t\t<a class=\"sci_list_link sci_danger_link\" data-action=\"sci_revoke\" data-invite-id=\"{{invite_id}}\">{{#t}}Cancelar canal compartido{{\/t}}<\/a>\n\t\t<\/span>\n\n\t\t<div class=\"sci_send_email_mini_container display_flex align_items_center flex_wrap hidden\">\n\t\t\t<input type=\"text\" name=\"invite_send_email_{{invite_id}}\" class=\"input_inline small flex_one\" placeholder=\"{{#t note=\"placeholder text used for a form input\"}}Introducir correos de invitados{{\/t}}\" data-validation=\"is_email\" data-invite-id=\"{{invite_id}}\" autocapitalize=\"off\" autocorrect=\"off\" autocomplete=\"off\">\n\t\t\t<button class=\"btn btn_outline\" data-action=\"sci_send\" data-invite-id=\"{{invite_id}}\">{{#t}}Enviar correo{{\/t}}<\/button>\n\t\t\t<label for=\"invite_send_email_{{invite_id}}\"><\/label>\n\t\t<\/div>\n\n\t\t<div class=\"sci_copy_link_mini_container display_flex align_items_center flex_wrap hidden\">\n\t\t\t<input type=\"text\" name=\"invite_copy_link_{{invite_id}}\" class=\"input_inline small flex_one\" value=\"{{invite_url}}\" readonly data-invite-id=\"{{invite_id}}\">\n\t\t\t<button class=\"btn btn_outline\" data-action=\"sci_copy\" data-invite-id=\"{{invite_id}}\">{{#t}}Copiar el enlace{{\/t}}<\/button>\n\t\t\t<label for=\"invite_copy_link_{{invite_id}}\"><span class=\"validation_message overflow_ellipsis old_petunia_grey inline hidden\" title=\"{{#t}}Haz clic con el bot\u00f3n secundario para copiar y compartir el enlace.{{\/t}}\"><\/span><\/label>\n\t\t<\/div>\n\t<\/div>\n<\/div>";
TS.raw_templates['shared_channels_invites_emailed_invitations'] = "{{i18n_ns \"shared_channels_invite\"}}\n<div data-action=\"replace_emailed_invites\"{{#unless sent}} class=\"hidden\"{{\/unless}}>\n\t{{#if sent}}\n\t\t<span class=\"block bold top_margin\">{{#t}}Invitaciones enviadas:{{\/t}}<\/span>\n\t\t{{#each sent}}\n\t\t\t<span class=\"block\">{{email}} &middot; {{toTimeAgo date_sent}}<\/span>\n\t\t{{\/each}}\n\t{{\/if}}\n<\/div>";
TS.raw_templates['shared_channels_invites_sent_emails'] = "{{i18n_ns \"shared_channels_invite\"}}\n<div data-action=\"replace_sent_emails\" {{#unless sent}}class=\"hidden\"{{\/unless}}>\n\t{{#if sent}}\n\t\t<span class=\"dusty_springfield_grey\"><ts-icon class=\"ts_icon_check_circle_o seafoam_green\"><\/ts-icon> {{#t}}{sent.length, plural, =1 {correo electr\u00f3nico enviado} other {correos electr\u00f3nicos enviados}} a{{\/t}}\n\t\t\t{{#each sent}}\n\t\t\t\t<strong>{{email}}<\/strong>{{#unless @last}}, {{\/unless}}\n\t\t\t{{\/each}}\n\t\t<\/span>\n\t{{\/if}}\n<\/div>";
TS.raw_templates['shared_channels_invites_channel'] = "{{i18n_ns \"shared_channels_invite\"}}\n<div class=\"sci_channel_container\" data-action=\"sci_toggle_contents\" data-channel-id=\"{{channel}}\">\n\t<div class=\"sci_list_text display_flex align_items_center\">\n\t\t<img class=\"sci_rounded align_self_start\" src=\"{{team.icon.image_88}}\" srcset=\"{{team.icon.image_44}} 1x, {{team.icon.image_88}} 2x\"\/>\n\t\t<div>\n\t\t\t<span class=\"sci_list_team_name block bold\">{{getTeamDisplayName team}}<\/span>\n\t\t\t<span class=\"block\">{{#t}}Comparte el canal <strong>{name}<\/strong>{{\/t}}<\/span>\n\t\t<\/div>\n\t\t<ts-icon class=\"sci_toggle_icon ts_icon_caret_right auto_left_margin\"><\/ts-icon>\n\t<\/div>\n\n\t<div class=\"sci_list_text\">\n\t\t<span class=\"block bold top_margin\">{{#t}}Compartido por:{{\/t}}<\/span>\n\t\t<span class=\"block\">\n\t\t{{#if accepted_user}}\n\t\t\t{{#t note=\"For context, this is info about who the channel is shared by and when\" inviter=(getPrefCompliantMemberNameById user) accepter=(getPrefCompliantMemberNameById accepted_user) created_date=(toCalendarDateShort date_create)}}<strong>{inviter}<\/strong> de {currentTeamName} y <strong>{accepter}<\/strong> de {team.name} el {created_date}{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t note=\"For context, this is info about who the channel is shared by and when\" inviter=(getPrefCompliantMemberNameById user) created_date=(toCalendarDateShort date_create)}}<strong>{inviter}<\/strong> de {currentTeamName} el {created_date}{{\/t}}\n\t\t{{\/if}}\n\t\t<\/span>\n\n\t\t{{#and purpose purpose.value}}\n\t\t\t<span class=\"block bold top_margin\">{{#t}}Finalidad:{{\/t}}<\/span>\n\t\t\t<span class=\"block\">{{purpose.value}}<\/span>\n\t\t{{\/and}}\n\n\t\t<span class=\"top_margin block\">\n\t\t\t<a class=\"sci_list_link\" data-action=\"sci_archive\" data-channel-id=\"{{channel}}\">{{#t}}Archivar canal compartido{{\/t}}<\/a>\n\t\t<\/span>\n\t<\/div>\n<\/div>";
TS.raw_templates['shared_channel_list_team_icon'] = "{{i18n_ns \"shared\"}}\n{{#if canceled}}\n\t<div class=\"channel_browser_shared_teams\"><i class=\"c-deprecated-icon c-icon--disable sk_warning_red\"><\/i><span class=\"channel_browser_teams_info small_left_margin\">\n\t\t{{#if target_team}}\n\t\t\t{{#t}}Se ha cancelado la invitaci\u00f3n a <strong>{target_team.name}<\/strong>.{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Se ha cancelado la invitaci\u00f3n.{{\/t}}\n\t\t{{\/if}}\n\t<\/span><\/div>\n\n{{else}}\n\t{{#if shared_team_ids.length}}\n\t\t{{#each shared_team_ids}}\n\t\t\t<div class=\"channel_browser_shared_teams ts_tip ts_tip_top ts_tip_float\">\n\t\t\t\t{{> team_icon team=(getTeamById this) size=16}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{getTeamNameById this}}<\/span>\n\t\t\t<\/div>\n\t\t{{\/each}}\n\t\t<span class=\"channel_browser_teams_info margin_left_25\">{{#t teams=(makeTeamNameList shared_team_ids strong=true)}}Compartido con {teams}{{\/t}}<\/span>\n\t\t{{#canDisconnectSharedChannels}}\n\t\t\t{{#if is_nonmember_private_shared_channel_rollup}}\n\t\t\t\t<span class=\"sk_light_gray margin_left_25 margin_right_25\">| <\/span><button type=\"button\" class=\"btn_link channel_browser_teams_disconnect_private_non_member_shared_channels\">{{#t note=\"disconnect your team from these private shared channels\"}}Dejar de compartir {num_private_channels, plural, =1 {este canal} other {estos canales}}{{\/t}}<\/button>\n\t\t\t{{else}}\n\t\t\t\t<span class=\"sk_light_gray margin_left_25 margin_right_25\">| <\/span><button type=\"button\" class=\"btn_link channel_browser_teams_disconnect_shared_channel\">{{#t note=\"disconnect your team from this shared channel\"}}Dejar de compartir este canal{{\/t}}<\/button>\n\t\t\t{{\/if}}\n\t\t{{\/canDisconnectSharedChannels}}\n\t{{else}}\n\t\t{{#each pending_shared_team_ids}}\n\t\t\t<div class=\"channel_browser_shared_teams ts_tip ts_tip_top ts_tip_float\">\n\t\t\t\t{{> team_icon team=(getTeamById this) size=16 is_pending_shared=true classes=\"p-shared_team_icons__team_image--pending\"}}\n\t\t\t\t<span class=\"ts_tip_tip\">{{getTeamNameById this}}<\/span>\n\t\t\t<\/div>\n\t\t{{\/each}}\n\t\t{{#if pending_shared_team_ids.length}}\n\t\t\t<span class=\"channel_browser_teams_info margin_left_25\">{{#t teams=(makeTeamNameList pending_shared_team_ids strong=true)}}Esperando a que lleguen {teams}{{\/t}}<\/span>\n\t\t{{else}}\n\t\t\t<span class=\"channel_browser_teams_info margin_left_25\">{{#t teams=(makeTeamNameList pending_shared_team_ids strong=true)}}Esperando a que se una otro equipo{{\/t}}<\/span>\n\t\t{{\/if}}\n\t\t{{#canDisconnectSharedChannels}}<span class=\"sk_light_gray margin_left_25 margin_right_25\">| <\/span><button type=\"button\" class=\"btn_link channel_browser_revoke_share_invite\">{{#t}}Cancelar la invitaci\u00f3n{{\/t}}<\/button>{{\/canDisconnectSharedChannels}}\n\t{{\/if}}\n{{\/if}}\n";
TS.raw_templates['shared_channel_invite_info'] = "{{i18n_ns \"shared_channels\"}}\n\n{{#if declined}}\n\t<div class=\"channel_browser_invite_declined margin_top_50\">\n\t\t<i class=\"c-deprecated-icon c-icon--disable sk_warning_red\"><\/i><span class=\"channel_browser_teams_info small_left_margin\">\n\t\t\t{{#t}}La invitaci\u00f3n de <strong>{inviting_team}<\/strong> ha sido rechazada.{{\/t}}\n\t\t<\/span>\n\t<\/div>\n{{else}}\n\t<div class=\"channel_browser_invite_buttons margin_top_50\">\n\t\t<button class=\"channel_browser_view_invitation_btn c-button c-button--primary c-button--small\">{{#t}}Ver invitaci\u00f3n{{\/t}}<\/button>\n\t\t<button class=\"channel_browser_decline_invitation_btn c-button c-button--outline c-button--small\">{{#t}}Rechazar{{\/t}}<\/button>\n\t<\/div>\n{{\/if}}\n";
TS.raw_templates['no_shared_channels'] = "{{i18n_ns 'enterprise_grid'}}\n\n<div class=\"no_matches align_center large_top_margin large_bottom_margin subtle_silver\">{{#t}}Al parecer no hay ning\u00fan canal compartido.{{\/t}}<\/div>\n";
TS.raw_templates['shared_channel_conversion_dialog'] = "{{i18n_ns 'channel_options'}}\n\n<div class=\"convert_to_shared\">\n\t<p>{{#t}}Convierte este canal en un canal compartido para que los miembros de los distintos espacios de trabajo de <span class=\"enterprise-name\">{enterprise_info.name}<\/span> se env\u00eden mensajes y compartan archivos entre s\u00ed.{{\/t}}<\/p>\n\n\t<p>{{#t}}Al convertir <strong>#{name}<\/strong> en un canal compartido, se conservar\u00e1 el historial del canal, su lista de miembros del canal y se har\u00e1 visible para todos.{{\/t}}<\/p>\n\n\t<div class=\"share_with_whom bottom_margin larger_top_margin\">\n\t\t<label>{{#t}}Compartir este canal con{{\/t}}<\/label>\n\n\t\t<label class=\"radio small_bottom_margin\"><input type=\"radio\" name=\"share_with\" value=\"all\" checked>{{#t}}Todos los espacios de trabajo de <span class=\"enterprise-name\">{enterprise_info.name}<\/span> .{{\/t}}<\/label>\n\t\t<label class=\"radio small_bottom_margin\"><input type=\"radio\" name=\"share_with\" value=\"specific\">{{#t}}Espacios de trabajo espec\u00edficos de <span class=\"enterprise-name\">{enterprise_info.name}<\/span> .{{\/t}}<\/label>\n\n\t\t<div class=\"specific_team hidden\">\n\t\t\t{{#feature flag=\"feature_react_lfs\"}}\n\t\t\t\t<div id=\"convert_to_shared_teams_picker\"><\/div>\n\t\t\t\t<input class=\"hidden\" type=\"text\" name=\"domains\" placeholder=\"{{#t}}A\u00f1adir espacios de trabajo{{\/t}}\" data-validation=\"required\" data-validation-for=\"share_with_specific\">\n\t\t\t{{else}}\n\t\t\t\t<input type=\"text\" name=\"domains\" placeholder=\"{{#t}}A\u00f1adir espacios de trabajo{{\/t}}\" data-validation=\"required\" data-validation-for=\"share_with_specific\">\n\t\t\t{{\/feature}}\n\t\t<\/div>\n\t<\/div>\n\n\t<label for=\"channel_name\">{{#t}}Nombre del canal{{\/t}}<\/label>\n\t<div class=\"current_channel_name\">\n\t\t<strong>{{#t}}#{name}{{\/t}}<\/strong> <a class=\"left_margin\">{{#t}}Cambiar{{\/t}}<\/a>\n\t<\/div>\n\t<div class=\"change_channel_name hidden\">\n\t\t<div class=\"input_wrapper\">\n\t\t\t<span class=\"spinner subtle_silver hidden\">\n\t\t\t\t{{#t}}Comprobando{{\/t}} {{> loading_indicator}}\n\t\t\t<\/span>\n\t\t\t<span class=\"available seafoam_green hidden\">\n\t\t\t\t{{#t}}Disponible{{\/t}} <ts-icon class=\"ts_icon_check_circle_o_large\"><\/ts-icon>\n\t\t\t<\/span>\n\t\t\t<input\n\t\t\t\ttype=\"text\"\n\t\t\t\tname=\"channel_name\"\n\t\t\t\tplaceholder=\"{{#t}}Introducir nombre (p. ej. agencia de marketing){{\/t}}\"\n\t\t\t\tclass=\"lowercase\"\n\t\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\t\tautocapitalize=\"off\"\n\t\t\t\tautocorrect=\"off\"\n\t\t\t\tautocomplete=\"off\"\n\t\t\t\tvalue=\"{{name}}\"\n\t\t\t\tdata-validation-success=\"\"\n\t\t\t\tmaxlength=\"21\"\n\t\t\t>\n\t\t\t<span class=\"input_note\">{{#t}}El nombre de un canal compartido debe ser exclusivo para toda la organizaci\u00f3n, tener 21 caracteres o menos, ir en may\u00fascula y no contener espacios ni puntos.{{\/t}}<\/span>\n\t\t<\/div>\n\t<\/div>\n\n\t<label for=\"purpose\" class=\"top_margin\">{{#t}}Finalidad del canal <span class=\"normal old_petunia_grey\">(optativo)<\/span>{{\/t}}<\/label>\n\t<div class=\"current_channel_purpose\">\n\t\t<p>{{#if_equal purpose compare=\"\"}}<span class=\"small\">{{#t}}(sin finalidad){{\/t}}<\/span>{{else}}{{purpose}}{{\/if_equal}} <a class=\"left_margin\">{{#t}}Cambiar{{\/t}}<\/a><\/p>\n\t<\/div>\n\t<div class=\"change_channel_purpose hidden\">\n\t\t<textarea class=\"bottom_margin\" name=\"purpose\" placeholder=\"{{#t}}Describe brevemente la finalidad de este canal{{\/t}}\" data-validation=\"maxlength=250\">{{purpose}}<\/textarea>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['shared_channels_disconnect_channel_expectations'] = "{{i18n_ns \"shared\"}}\n\n<ul>\n\t<li>{{#t team_names=(makeTeamNameList team_ids strong=true)}}{team_names} conservar\u00e1n copias independientes de este canal.{{\/t}}<\/li>\n\t<li>{{#t}}Cada espacio de trabajo podr\u00e1n seguir utilizando su copia.{{\/t}}<\/li>\n\t<li>{{#t}}Tampoco el espacio de trabajo podr\u00e1 volver a compartir este canal.{{\/t}}<\/li>\n<\/ul>\n";
TS.raw_templates['shared_channels_empty_state_for_channel_browser'] = "{{i18n_ns \"shared_channels_invite\"}}\n\n<div class=\"channel_browser_empty_state_for_shared_channels\">\n\t<p class=\"align_center\">\n\t\t{{#if show_pending_shared_channels}}\n\t\t\t{{#t}}<strong>No hay pendiente ning\u00fan canal compartido.<\/strong><br>Los canales compartidos facilitan una v\u00eda de colaboraci\u00f3n entre dos equipos Slack independientes. <a href=\"https:\/\/get.slack.help\/hc\/articles\/115004151183\">M\u00e1s informaci\u00f3n<\/a>{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Con los canales compartidos puedes trabajar con otras empresas y equipos desde Slack. <a href=\"https:\/\/get.slack.help\/hc\/articles\/115004151183\">M\u00e1s informaci\u00f3n<\/a>{{\/t}}\n\t\t{{\/if}}\n\t<\/p>\n\n\t<button class=\"btn btn_outline\" type=\"button\" onclick=\"TS.ui.channel_browser.endAndStartSharedChannelDialog();\">{{#if can_create_shared_channel}}{{#t}}Crear un canal compartido{{\/t}}{{else}}{{#t}}Solicitar un canal compartido{{\/t}}{{\/if}}<\/button>\n<\/div>\n";
TS.raw_templates['shared_channels_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"shared_channels_coachmark_div\" class=\"coachmark_div\">\n\t<div id=\"coachmark_contents\">\n\t\t<div id=\"shared_channels_coachmark_image\" class=\"bottom_margin {{#if without_animation}} shared_channels_coachmark_image_without_animation{{\/if}}\"><\/div>\n\n\t\t<h3 id=\"shared_channels_coachmark_title\" class=\"black charcoal_grey\">\n\t\t\t{{#t}}Imag\u00ednatelo: dos empresas distintas que utilizan Slack juntas.{{\/t}}\n\t\t<\/h3>\n\t\t<p id=\"shared_channels_coachmar_subtitle\" class=\"large_bottom_margin\">\n\t\t\t{{#t}}Con los canales compartidos puedes trabajar con otras empresas y equipos desde Slack.{{\/t}}\n\t\t<\/p>\n\t\t<div class=\"shared_channels_coachmark_buttons align_right\">\n\t\t\t<button id=\"shared_channels_coachmark_button_got_it\" class=\"btn btn_outline coachmark_skip_link\" type=\"button\">{{#t}}Cerrar{{\/t}}<\/button>\n\t\t\t<button id=\"shared_channels_coachmark_button_get_started\" class=\"btn btn_info coachmark_ok\" type=\"button\">{{#if show_create_button}}{{#t}}Crear un canal compartido{{\/t}}{{else}}{{#t}}Primeros pasos{{\/t}}{{\/if}}<\/button>\n\t\t<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['shared_channels_first_shared_channel_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div class=\"hidden\">\n\t<h2>{{#t}}Has compartido tu primer canal{{\/t}}<\/h2>\n\n\t<p>{{#t}}Puedes gestionar los ajustes de este canal, por ejemplo compartirlo y dejar de compartirlo, en <strong>Ajustes del canal \u2192 Opciones adicionales<\/strong>.{{\/t}}<\/p>\n<\/div>\n";
TS.raw_templates['shared_channels_retention_disclaimer'] = "{{i18n_ns 'shared'}}\n\n{{!-- A retention type of 2 or 3 means messages in channels are deleted after a given number of days --}}\n{{#if_gt (teamRetentionType) compare=1}}\n\t<div class=\"p-shared_channels_retention_disclaimer c-alert c-alert--inline c-alert--level_warning bottom_margin\">\n\t\t<ts-icon class=\"c-alert__icon c-deprecated-icon c-icon--warning\"><\/ts-icon>\n\t\t<div class=\"p-shared_channels_retention_disclaimer__message c-alert__message\">\n\t\t\t<strong>{{#t}}Los ajustes de retenci\u00f3n de tu espacio no se aplicar\u00e1n a los canales compartidos.{{\/t}}<\/strong>\n\t\t\t<br \/>\n\t\t\t{{#t team_duration=(teamRetentionDuration)}}Los mensajes de tu espacio de trabajo se eliminar\u00e1n despu\u00e9s de {team_duration, plural, =1 {# d\u00eda} other {# d\u00edas}}. En la versi\u00f3n beta, no se aplicar\u00e1 este ajuste a los canales compartidos.{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/articles\/115004152843\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a>\n\t\t<\/div>\n\t<\/div>\n{{\/if_gt}}\n";
TS.raw_templates['shared_channels_miscellaneous'] = "{{i18n_ns 'shared'}}\n\n<div class=\"hidden\">\n\t{{! This appears in the shared channel creation flow. }}\n\t<p>{{#t}}<strong>Nota:<\/strong> En la versi\u00f3n beta, los canales compartidos solo pueden ser abiertos.{{\/t}}<\/p>\n\n\t{{! It's possible we won't support disconnecting shared channels at launch. Just in case, let's put this string in the code to get it translated. }}\n\t<p>{{#t}}Esta operaci\u00f3n no se podr\u00e1 deshacer.{{\/t}} {{#t}}De momento no se puede dejar de compartir ni archivar un canal compartido.{{\/t}}<\/p>\n\n\t{{! Same as above, but not an alert. }}\n\t<p>{{#t}}<strong>Actualmente en beta.<\/strong> De momento hay funciones \u2014 como los ajustes personalizados de retenci\u00f3n o dejar de compartir canales \u2014 que no se incluyen en la versi\u00f3n beta.{{\/t}} <a href=\"https:\/\/get.slack.help\/hc\/articles\/115004152843\">{{#t}}M\u00e1s informaci\u00f3n{{\/t}}<\/a><\/p>\n\n\t{{! Archiving }}\n\t<p>{{#t channel_name=channel_name}}Dejar de compartir y archivar {channel_name}{{\/t}}<\/p>\n\t<p>{{#t team_names=team_names}}Al archivar este canal tambi\u00e9n dejas de compartirlo con {team_names}. Esto significa que:{{\/t}}<\/p>\n\t<p>{{#t note=\"explains consequence of archiving a shared channel: your team gets a copy of the channel that is archived\"}}Tu copia del canal se archivar\u00e1{{\/t}}<\/p>\n\t<button>{{#t note=\"action to archive a shared channel (also unshares it)\"}}Dejar de compartir y archivar{{\/t}}<\/button>\n\n\t{{! Additional options menu, viewed by a non-admin }}\n\t<p>{{#t}}Solo los administradores pueden compartir y dejar de compartir un canal.{{\/t}}<\/p>\n\t{{! Putting this in its own {t} so we can adjust its styling \/ callback as needed }}\n\t<a>{{#t}}Buscar un administrador{{\/t}}<\/a>\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<p class=\"enterprise_settings_shared_channels_default_channels\">\n\t<h2 class=\"ent_header_secondary\">{{#t note=\"section heading\"}}Canales predeterminados{{\/t}}<\/h2>\n\n\t<p class=\"permissions_title_info\">{{#t}}Los canales predeterminados son aquellos a los que se a\u00f1adir\u00e1 a todos los miembros de la organizaci\u00f3n.{{\/t}}<\/p>\n\n\t<p class=\"permissions_title_info hidden\" data-js=\"no_more_available_channels\">\n\t\t{{#t}}En este momento no hay canales disponibles para hacerlos predeterminados. Deber\u00e1s compartir un canal con toda tu organizaci\u00f3n para poder a\u00f1adir otro canal por defecto.{{\/t}}\n\t<\/p>\n\n\t<p class=\"permissions_title_info hidden\" data-js=\"cannot_add_more_channels\">\n\t\t{{#t}}Tu organizaci\u00f3n ha alcanzado el n\u00famero m\u00e1ximo disponible de canales predeterminados.{{\/t}}\n\t<\/p>\n\n\t<div class=\"display_flex align_items_center top_margin very_small_top_padding\">\n\t\t<h3 data-name=\"default_channels_header\" class=\"ent_header_tertiary flex_one\"><\/h3>\n\n\t\t<div class=\"left_margin\">\n\t\t\t<a data-qa=\"add_default_channel\" class=\"btn btn_small\">{{#t}}A\u00f1adir un canal{{\/t}}<\/a>\n\t\t<\/div>\n\t<\/div>\n\n\t<div data-name=\"default_channels\" class=\"top_margin\"><\/div>\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_rows'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_channel_row_header display_flex small_top_padding small_bottom_padding left_padding right_padding bottom_border\">\n\t<div class=\"flex_one small_right_margin\">{{#t}}Canal{{\/t}}<\/div>\n\t<div class=\"flex_one right_margin very_small_right_padding\">{{#t}}Pertenencia{{\/t}}<\/div>\n<\/div>\n\n{{#unless default_channels}}\n\t<div class=\"default_channel_row_no_channels large_padding align_center\">\n\t\t{{#t}}A\u00fan no hay ning\u00fan canal sugerido ni requerido.{{\/t}}\n\t<\/div>\n{{\/unless}}\n\n{{#each default_channels}}\n\t<div class=\"default_channel_row display_flex normal_padding {{#if @last}}{{else}}bottom_border{{\/if}}\" data-id=\"{{id}}\" data-popover-trigger=\"{{id}}\">\n\t\t<div class=\"default_channel_name flex_one small_right_margin bold\">\n\t\t\t<ts-icon class=\"ts_icon_channel ts_icon_inherit\"><\/ts-icon>{{name}} <ts-icon class=\"ts_icon_org_shared_channel ts_icon_inherit\"><\/ts-icon>\n\t\t<\/div>\n\t\t<div class=\"default_channel_mandatory flex_one\">\n\t\t\t{{#if is_mandatory}}\n\t\t\t\t<span class=\"tiny_negative_left_margin\">\n\t\t\t\t\t<ts-icon class=\"ts_icon_lock ts_icon_inherit\"><\/ts-icon> <strong>{{#t}}Obligatorio{{\/t}}<\/strong>\n\t\t\t\t<\/span>\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Optativo{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/div>\n\t\t<div class=\"default_channel_actions\">\n\t\t\t<span data-qa=\"default_channel_menu\" class=\"cursor_pointer\"><ts-icon class=\"ts_icon_ellipsis nudge_top_3\"><\/ts-icon><\/span>\n\t\t<\/div>\n\t<\/div>\n{{\/each}}\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_new_channel'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t{{#feature flag=\"feature_default_shared_channels\"}}\n\t\t<p>{{#t}}Todos los miembros de {org_name} se a\u00f1adir\u00e1n a este canal autom\u00e1ticamente. Los colaboradores invitados se tendr\u00e1n que a\u00f1adir manualmente.{{\/t}}<\/p>\n\n\t\t<h3 class=\"ent_header_tertiary bold margin_bottom_75 black\">{{#t}}Seleccionar un canal{{\/t}}<\/h3>\n\n\t\t<p data-js=\"no_more_available_channels\" class=\"hidden margin_bottom_100\">\n\t\t\t{{#t}}En este momento no hay canales disponibles para hacerlos predeterminados. Deber\u00e1s compartir un canal con toda tu organizaci\u00f3n para poder a\u00f1adir otro canal por defecto.{{\/t}}\n\t\t<\/p>\n\n\t\t<div id=\"global_channel_picker\"><\/div>\n\n\t\t<p class=\"c-alert c-alert--boxed c-alert--level_info margin_top_150\">\n\t\t\t<i class=\"c-alert__icon c-deprecated-icon c-icon--info-circle c-deprecated-icon--vertical-align-baseline\"><\/i>\n\t\t\t<span class=\"c-alert__message\">{{#t learn_more_link=\"https:\/\/get.slack.help\/hc\/en-us\/articles\/115001399587-Create-a-shared-channel\"}}Los canales predeterminados deben ser canales existentes que ya se comparten con toda tu organizaci\u00f3n. <a href=\"{learn_more_link}\">Obt\u00e9n m\u00e1s informaci\u00f3n sobre c\u00f3mo compartir canales<\/a>.{{\/t}}<\/span>\n\t\t<\/p>\n\t{{\/feature}}\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_new_channel_type_and_perms'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t{{> enterprise_settings_shared_channels_default_channels_modal_membership_options}}\n\n\t{{> enterprise_settings_shared_channels_default_channels_modal_permissions}}\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_add_all_members'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t{{#feature flag=\"feature_default_shared_channels\"}}\n\t\t<p class=\"border_bottom padding_bottom_150\">{{#t}}\u00bfHacer que {channel_name} sea un canal predeterminado para todos los miembros de {org_name}?{{\/t}}<\/p>\n\n\t\t<p class=\"display_flex border_bottom padding_top_50 padding_bottom_150 margin_left_75\"><i class=\"c-deprecated-icon c-icon--user sk_fill_blue\"><\/i> <span class=\"margin_left_100\">{{#t}}Se a\u00f1adir\u00e1n <strong>{member_total} miembros<\/strong> a este canal. A partir de ahora, se a\u00f1adir\u00e1n autom\u00e1ticamente.{{\/t}}<\/span><\/p>\n\n\t\t<p class=\"display_flex border_bottom padding_top_50 padding_bottom_150 margin_left_75\"><i class=\"c-deprecated-icon c-icon--clock-o sk_pin_orange\"><\/i> <span class=\"margin_left_100\">{{#t}}Puede tardar <strong>hasta {time_to_completion_in_minutes} minutos<\/strong> a\u00f1adir a todos los miembros al canal. Se publicar\u00e1 un mensaje en el canal cuando haya finalizado el proceso.{{\/t}}<\/span><\/p>\n\n\t\t{{#if is_mandatory}}\n\t\t\t<p class=\"display_flex border_bottom padding_top_50 padding_bottom_150 margin_left_75\"><i class=\"c-deprecated-icon c-icon--lock-o sk_warning_red\"><\/i> <span class=\"margin_left_100\">{{#t}}Ser\u00e1 <strong>obligatorio<\/strong> pertenecer al canal, por lo que los miembros no podr\u00e1n abandonarlo.{{\/t}}<\/span><\/p>\n\t\t{{\/if}}\n\n\t\t{{#if can_thread}}\n\t\t\t<p class=\"display_flex border_bottom padding_top_50 padding_bottom_150 margin_left_75\"><i class=\"c-deprecated-icon c-icon--comment-alt sk_seafoam_green\"><\/i> <span class=\"margin_left_100\">{{#t users=(listify selected_users strong=true)}}Solo {users} podr\u00e1n publicar en este canal. Cualquiera podr\u00e1 responder a un mensaje en un hilo.{{\/t}}<\/span><\/p>\n\t\t{{else}}\n\t\t\t<p class=\"display_flex border_bottom padding_top_50 padding_bottom_150 margin_left_75\"><i class=\"c-deprecated-icon c-icon--comment-alt sk_seafoam_green\"><\/i> <span class=\"margin_left_100\">{{#t users=(listify selected_users strong=true)}}Solo {users} podr\u00e1n publicar en este canal.{{\/t}}<\/span><\/p>\n\t\t{{\/if}}\n\t{{\/feature}}\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_edit_membership'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t<p>{{#t}}Puedes optar por cambiar entre la pertenencia optativo o requerida a este canal por defecto. Todas las personas que est\u00e9n en el canal seguir\u00e1n en \u00e9l.{{\/t}}<\/p>\n\n\t{{> enterprise_settings_shared_channels_default_channels_modal_membership_options}}\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_membership_options'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<h3 class=\"ent_header_tertiary large_top_margin bold margin_bottom_50 black\">{{#t}}Elegir tipo de pertenencia{{\/t}}<\/h3>\n<p class=\"margin_bottom_100\">{{#t}}Escoge si quieres que la pertenencia sea optativa o obligatoria para todos los miembros.{{\/t}}<\/p>\n\n<div class=\"display_flex justify_content_between\">\n\t<div class=\"flex_one margin_right_75 cursor_pointer normal_padding {{#if is_mandatory}}{{else}}active{{\/if}}\" data-qa=\"new_channel_radio\">\n\t\t<div class=\"no_bottom_margin display_flex\">\n\t\t\t<input id=\"optional\" class=\"nudge_bottom_2 margin_top_50\" type=\"radio\" name=\"membership_type\" value=\"default\" {{#if is_mandatory}}{{else}}checked{{\/if}} \/>\n\t\t\t<div class=\"margin_left_50 display_flex flex_direction_column\">\n\t\t\t\t<label for=\"optional\" class=\"no_bottom_margin\"><p class=\"no_bottom_margin\">{{#t}}Optativo{{\/t}}<\/p><\/label>\n\t\t\t\t<p class=\"no_bottom_margin\">{{#t}}Los miembros pueden abandonar el canal.{{\/t}}<\/p>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"flex_one cursor_pointer normal_padding {{#if is_mandatory}}active{{\/if}}\" data-qa=\"new_channel_radio\">\n\t\t<div class=\"no_bottom_margin display_flex\">\n\t\t\t<input id=\"mandatory\" class=\"nudge_bottom_2 margin_top_50\" type=\"radio\" name=\"membership_type\" value=\"mandatory\" {{#if is_mandatory}}checked{{\/if}} \/>\n\t\t\t<div class=\"margin_left_50 display_flex flex_direction_column\">\n\t\t\t\t<label for=\"mandatory\" class=\"no_bottom_margin\"><p class=\"no_bottom_margin\"><ts-icon class=\"ts_icon_lock ts_icon_inherit nudge_right_3 nudge_bottom_2\"><\/ts-icon>{{#t}}Obligatorio{{\/t}}<\/p><\/label>\n\t\t\t\t<p class=\"no_bottom_margin\">{{#t}}Los miembros <strong>no<\/strong> podr\u00e1n salirse.{{\/t}}<\/p>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_permissions'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n{{#feature flag=\"feature_default_shared_channels\"}}\n\n<h3 class=\"ent_header_tertiary margin_top_250 bold margin_bottom_50 black\">{{#t}}Permisos de publicaci\u00f3n{{\/t}}<\/h3>\n<p class=\"margin_bottom_50\">{{#t}}\u00bfQui\u00e9n puede publicar en este canal?{{\/t}}<\/p>\n\n<div>\n\t{{> enterprise_settings_shared_channels_default_channels_modal_new_channel_perms_radios}}\n<\/div>\n\n<div id=\"lfs_default_channel_posting_permissions_picker_wrapper\" class=\"hidden left_margin small_padding\">\n\t<input id=\"lfs_default_channel_posting_permissions_picker\" class=\"no_bottom_margin\" \/>\n<\/div>\n\n<div class=\"margin_top_75 nudge_right_1 position_relative\">\n\t<label class=\"c-label c-label--inline c-label--pointer\" for=\"default_channels_can_thread\">\n    <input type=\"checkbox\" class=\"c-input_checkbox\" id=\"default_channels_can_thread\" {{#if can_thread}}checked{{\/if}} \/>\n    <span class=\"c-label__text\">{{#t}}Permitir que cualquiera use los hilos{{\/t}}<\/span>\n\t<\/label>\n\t<p class=\"margin_left_100 padding_left_75\">{{#t}}Al seleccionar esta opci\u00f3n, cualquiera podr\u00e1 a\u00f1adir hilos de conversaci\u00f3n a los mensajes publicados en este canal, independientemente de los permisos de publicaci\u00f3n generales.{{\/t}}<\/p>\n<\/div>\n\n{{\/feature}}\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_make_default'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t<p>{{#t}}Al establecer como optativo la pertenencia a <strong>{channel_name}<\/strong>, los nuevos miembros de la organizaci\u00f3n ser\u00e1n a\u00f1adidos autom\u00e1ticamente al canal, pero podr\u00e1n abandonarlo en cualquier momento.{{\/t}}<\/p>\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_make_mandatory'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t<p>{{#t}}Una vez que se solicite la suscripci\u00f3n a <strong>{channel_name}<\/strong>, ning\u00fan miembro del canal podr\u00e1 salir. Adem\u00e1s, esto a\u00f1ade autom\u00e1ticamente a cualquier miembro de la organizaci\u00f3n que no est\u00e9 en \u00e9l.{{\/t}}<\/p>\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_remove_channel'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n<div class=\"default_shared_channels_modal_component clearfix large_top_margin margin_auto\">\n\t<p>{{#t}}Al eliminar <strong>{channel_name}<\/strong> de los canales sugeridos y requeridos, los nuevos miembros de la organizaci\u00f3n dejar\u00e1n de a\u00f1adirse autom\u00e1ticamente al canal.{{\/t}}<\/p>\n\n\t<p>{{#t}}Las personas que son parte del canal permanecer\u00e1n en \u00e9l, pero podr\u00e1n abandonarlo si lo desean.{{\/t}}<\/p>\n\n\t<p>{{#t}}\u00bfSeguro que quieres eliminar <strong>{channel_name}<\/strong> de la lista de canales sugeridos y obligatorios?{{\/t}}<\/p>\n<\/div>\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_channel_row'] = "{{~#if item.private~}}\n\t<ts-icon class=\"ts_icon_lock ts_icon_inherit\"><\/ts-icon>\n{{~else~}}\n\t<ts-icon class=\"ts_icon_channel ts_icon_inherit\"><\/ts-icon>\n{{~\/if~}}\n{{~item.name}} {{> shared_channel_icon}}\n";
TS.raw_templates['enterprise_settings_shared_channels_default_channels_modal_new_channel_perms_radios'] = "{{i18n_ns \"enterprise_dashboard\"}}\n\n{{#feature flag=\"feature_default_shared_channels\"}}\n\n<label class=\"radio modify_options\">\n\t<input name=\"default_channels_who_can_post\" type=\"radio\" value=\"owner\" {{#if_equal who_can_post_type compare=\"owner\"}}checked=\"checked\"{{\/if_equal}}>\n\t<span class=\"nudge_left_3 position_relative\">{{#t}}Propietarios y administradores de la org.{{\/t}}<\/span>\n<\/label>\n\n<label class=\"radio modify_options\">\n\t<input name=\"default_channels_who_can_post\" type=\"radio\" value=\"multi\" id=\"multi_manage_selector\" {{#if_equal who_can_post_type compare=\"multi\"}}checked=\"checked\"{{\/if_equal}}>\n\t<span class=\"nudge_left_3 position_relative\">{{#t}}Propietarios y administradores de la organizaci\u00f3n y algunos miembros{{\/t}}<\/span>\n<\/label>\n\n{{\/feature}}\n";
TS.raw_templates['keyboard_shortcuts_prompt'] = "{{i18n_ns \"keyboard_shortcuts\"}}\n{{#feature flag=\"feature_shortcuts_prompt\"}}\n\t<div class=\"p-shortcuts_prompt__body modal-body\" role=\"document\">\n\t\t<div class=\"p-shortcuts_prompt__shortcuts\">\n\t\t\t<p class=\"p-shortcuts_prompt__shortcuts_intro\">\n\t\t\t\t{{#t}}Con los atajos es muy f\u00e1cil moverse por Slack. Aqu\u00ed tienes algunos que te resultar\u00e1n \u00fatiles:{{\/t}}\n\t\t\t<\/p>\n\t\t\t<ul class=\"p-shortcuts_prompt__shortcuts_list\">\n\t\t\t\t<li class=\"p-shortcuts_prompt__shortcut\">\n\t\t\t\t\t<span class=\"c-keyboard_key p-shortcuts_prompt__arrow_key\"><ts-icon class=\"ts_icon_arrow_up_medium\"><\/ts-icon><\/span>\n\t\t\t\t\t<span class=\"c-keyboard_key p-shortcuts_prompt__arrow_key\"><ts-icon class=\"ts_icon_arrow_down_medium\"><\/ts-icon><\/span>\n\t\t\t\t\t<span class=\"shortcut_text\">{{#t}} Mover el enfoque entre los mensajes{{\/t}}<\/span>\n\t\t\t\t<\/li>\n\t\t\t\t<li class=\"p-shortcuts_prompt__shortcut\">\n\t\t\t\t\t<span class=\"c-keyboard_key\">{{#t}}Ctrl{{\/t}}<\/ts-icon><\/span>\n\t\t\t\t\t<span class=\"c-keyboard_key\">{{backtick_key}}<\/ts-icon><\/span>\n\t\t\t\t\t<span class=\"shortcut_text\">{{#t}} Mover el enfoque a la siguiente secci\u00f3n{{\/t}}<\/span>\n\t\t\t\t<\/li>\n\t\t\t\t<li class=\"p-shortcuts_prompt__shortcut\">\n\t\t\t\t\t<span class=\"c-keyboard_key\">{{#isMac}}{{#t}}Cmd{{\/t}}{{else}}{{#t}}Ctrl{{\/t}}{{\/isMac}}<\/ts-icon><\/span>\n\t\t\t\t\t<span class=\"c-keyboard_key\">{{#t}}K{{\/t}}<\/ts-icon><\/span>\n\t\t\t\t\t<span class=\"p-shortcuts_prompt__shortcut_text\">{{#t}}Quick Switcher{{\/t}}<\/span>\n\t\t\t\t<\/li>\n\t\t\t<\/ul>\n\n\t\t\t<p class=\"p-shortcuts_prompt__shortcuts_intro\">\n\t\t\t\t{{#t}}Y esto no es m\u00e1s que el principio. Para ver la lista completa de atajos del teclado, presiona <span class=\"c-keyboard_key\">{cmd_key}<\/span> + <span class=\"c-keyboard_key\">{slash_key}<\/span>.{{\/t}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n{{\/feature}}";
TS.raw_templates['email_prefs_updated'] = "{{i18n_ns \"email_prefs\"}}\n\n{{#feature flag=\"feature_email_prefs\"}}\n<div class=\"email_prefs__header\"><\/div>\n\t<div class=\"email_prefs__body align_center\">\n\t\t<div class=\"bottom_margin seafoam_green\"><ts-icon class=\"ts_icon_large ts_icon_check_circle_o_large\"><\/ts-icon><\/div>\n\t\t\n\n\t\t{{#if num_email_subs}}\n\t\t\t<h1>{{#t}}Se han actualizado tus preferencias{{\/t}}<\/h1>\n\t\t\t{{#if email_sub_text_array}}\n\t\t\t\t<div>{{#t note=\"the types of emails they're subscribed to\" list_of_email_subs=(listify email_sub_text_array)}}Has elegido recibir {list_of_email_subs}.{{\/t}}<\/div>\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t<h1>{{#t}}Te has dado de baja de todos los correos de Slack{{\/t}}<\/h1>\n\n\t\t\t<div>{{#t}}Ya no recibir\u00e1s correos electr\u00f3nicos de marketing de Slack, pero s\u00ed te llegar\u00e1 informaci\u00f3n importante (como las solicitudes para restablecer la contrase\u00f1a).{{\/t}}<\/div>\n\t\t{{\/if}}\n\n\t<\/div>\n<div class=\"email_prefs__footer\"><\/div>\n\n{{\/feature}}";
